	/**
	 * Modifica el valor de acto cabeza familiar.
	 *
	 * @param as_s asigna el valor a la propiedad acto cabeza familiar
	 */
	public void setActoCabezaFamiliar(String as_s)
	{
		is_actoCabezaFamiliar = as_s;
	}

	/**
	 * Retorna el valor de acto cabeza familiar.
	 *
	 * @return el valor de acto cabeza familiar
	 */
	public String getActoCabezaFamiliar()
	{
		if(!StringUtils.isValidString(is_actoCabezaFamiliar))
		{
			Constantes lc_c;
			lc_c = new Constantes();

			lc_c.setIdConstante(ConstanteCommon.ACTO_PATRIMONIO_FAMILIA);

			try
			{
				lc_c = irr_registroRemote.findConstante(lc_c);

				if(lc_c != null)
				{
					Map<String, String> lmss_mensajes;
					String[]            lsa_codigos;
					String              ls_descripcion;

					ls_descripcion = lc_c.getDescripcion();

					if(StringUtils.isValidString(ls_descripcion) && ls_descripcion.contains("-"))
					{
						lmss_mensajes     = new HashMap<String, String>();
						lsa_codigos       = ls_descripcion.split("-");

						if(lsa_codigos != null)
						{
							lmss_mensajes.put(EstadoCommon.S, lsa_codigos[0]);
							lmss_mensajes.put(EstadoCommon.N, lsa_codigos[1]);

							setMensajesMadreCabeza(lmss_mensajes);
						}
					}

					is_actoCabezaFamiliar = lc_c.getCaracter();
				}
			}
			catch(B2BException lb2be_e)
			{
				clh_LOGGER.error(lb2be_e);
				addMessage(lb2be_e);
				PrimeFaces.current().ajax().update(is_messageIdGrowl);
				PrimeFaces.current().ajax().update(is_idForm);
			}
		}

		return is_actoCabezaFamiliar;
	}

