	/**
	 * Carga los actos de la solicitud.
	 *
	 * @return modelo de columnas con los actos hallados
	 * @throws B2BException Señala que se ha producido una excepción
	 */
	public List<ColumnModel> getColumns()
	    throws B2BException
	{
		return getColumns(null);
	}

	/**
	 * Retorna el valor de columns.
	 *
	 * @param as_idCirculo correspondiente al valor del tipo de objeto String
	 * @return el valor de columns
	 * @throws B2BException Señala que se ha producido una excepción
	 */
	public List<ColumnModel> getColumns(String as_idCirculo)
	    throws B2BException
	{
		Solicitud         ls_solicitud;
		List<ColumnModel> llcm_columns;
		String            ls_idSolicitud;

		ls_solicitud       = getSolicitud();
		llcm_columns       = new ArrayList<ColumnModel>();
		ls_idSolicitud     = (ls_solicitud != null) ? ls_solicitud.getIdSolicitud() : null;

		if(StringUtils.isValidString(ls_idSolicitud))
		{
			Collection<TipoActo> lca_actosSolicitudAntigua;
			Collection<TipoActo> lca_actosSolicitud;
			Acto                 la_param;

			lca_actosSolicitudAntigua     = null;
			la_param                      = new Acto();

			if(!isHabilitarTurnoYnir())
			{
				SolicitudAsociada lsa_solicitudAsociada;

				lsa_solicitudAsociada = irr_registroRemote.findSolicitudAsociada(ls_solicitud);

				setSolicitudAsociada(lsa_solicitudAsociada);

				if(lsa_solicitudAsociada != null)
				{
					String ls_idSolicitud1;

					ls_idSolicitud1 = lsa_solicitudAsociada.getIdSolicitud1();

					if(StringUtils.isValidString(ls_idSolicitud1))
					{
						la_param.setIdSolicitud(ls_idSolicitud1);

						lca_actosSolicitudAntigua = findActosById(la_param, getUserId());
					}
				}
			}

			la_param.setIdSolicitud(ls_idSolicitud);

			if(StringUtils.isValidString(as_idCirculo))
			{
				la_param.setIdCirculo(as_idCirculo);
				lca_actosSolicitud = findActosById(la_param, getUserId(), true);
			}
			else
				lca_actosSolicitud = findActosById(la_param, getUserId());

			if(CollectionUtils.isValidCollection(lca_actosSolicitud))
			{
				Collection<TipoActo> lcta_actosDeinitivos;

				lcta_actosDeinitivos = null;

				if(CollectionUtils.isValidCollection(lca_actosSolicitudAntigua))
				{
					lcta_actosDeinitivos = new LinkedList<TipoActo>();

					for(TipoActo lta_actoNuevo : lca_actosSolicitud)
					{
						if(lta_actoNuevo != null)
						{
							String             ls_idCirculoAntiguo;
							String             ls_idTipoActoAntiguo;
							Iterator<TipoActo> lita_iterador;
							boolean            lb_encontro;

							ls_idCirculoAntiguo      = StringUtils.getStringNotNull(lta_actoNuevo.getIdCirculo());
							ls_idTipoActoAntiguo     = StringUtils.getStringNotNull(lta_actoNuevo.getIdTipoActo());
							lita_iterador            = lca_actosSolicitudAntigua.iterator();
							lb_encontro              = false;

							while(lita_iterador.hasNext() && !lb_encontro)
							{
								TipoActo lta_actoAntiguo;

								lta_actoAntiguo = lita_iterador.next();

								if(lta_actoAntiguo != null)
								{
									String ls_idCirculoNuevo;
									String ls_idTipoActoNuevo;

									ls_idCirculoNuevo      = StringUtils.getStringNotNull(
										    lta_actoAntiguo.getIdCirculo()
										);
									ls_idTipoActoNuevo     = StringUtils.getStringNotNull(
										    lta_actoAntiguo.getIdTipoActo()
										);

									if(
									    ls_idCirculoNuevo.equals(ls_idCirculoAntiguo)
										    && ls_idTipoActoNuevo.equals(ls_idTipoActoAntiguo)
									)
									{
										lcta_actosDeinitivos.add(lta_actoAntiguo);

										lb_encontro = true;
									}
								}
							}

							if(!lb_encontro)
								lcta_actosDeinitivos.add(lta_actoNuevo);
						}
					}
				}

				if(CollectionUtils.isValidCollection(lcta_actosDeinitivos))
					lca_actosSolicitud = lcta_actosDeinitivos;

				{
					Iterator<TipoActo> lia_actos;

					lia_actos = lca_actosSolicitud.iterator();

					while(lia_actos.hasNext())
					{
						TipoActo la_actos;

						la_actos = lia_actos.next();

						if(la_actos != null)
							llcm_columns.add(
							    new ColumnModel(
							        la_actos.getIdTipoActo(), new Boolean(false), la_actos.getNombre(),
							        conversionCientifica(NumericUtils.getDoubleWrapper(la_actos.getIdTipoCalculo())),
							        la_actos.getIdUsuarioCreacion(), la_actos.isValidarArea()
							    )
							);
					}
				}
			}
		}

		return llcm_columns;
	}

	/**
	 * Obtiene los datos de los actos segun la solicitud actual.
	 *
	 * @param addp_datosDelPredio objeto contenedor de la información del círculo
	 * @return Modelo de columnas con la información de los actos de la solicitud
	 * @throws B2BException Señala que se ha producido una excepción
	 */
	public List<ColumnModel> getColumnsActos(DatosDelPredio addp_datosDelPredio)
	    throws B2BException
	{
		List<ColumnModel> llcm_columns;

		llcm_columns = new ArrayList<ColumnModel>();

		if(addp_datosDelPredio != null)
		{
			Collection<TipoActo> lca_actosSolicitud;
			Collection<TipoActo> lca_actosSolicitudNuevaEntrada;
			String               ls_solicitud;
			String               ls_idCirculo;
			Solicitud            ls_solicitudObj;

			lca_actosSolicitud                 = new LinkedList<TipoActo>();
			lca_actosSolicitudNuevaEntrada     = new LinkedList<TipoActo>();
			ls_solicitudObj                    = getSolicitud();
			ls_solicitud                       = ls_solicitudObj.getIdSolicitud();
			ls_idCirculo                       = addp_datosDelPredio.getIdCirculo();

			if(StringUtils.isValidString(ls_solicitud) && StringUtils.isValidString(ls_idCirculo))
			{
				Acto la_param;

				la_param = new Acto();

				if(!isHabilitarTurnoYnir())
				{
					SolicitudAsociada lsa_solicitudAsociada;

					lsa_solicitudAsociada = irr_registroRemote.findSolicitudAsociada(ls_solicitudObj);
					setSolicitudAsociada(lsa_solicitudAsociada);

					if(lsa_solicitudAsociada != null)
					{
						String ls_idSolicitud;

						ls_idSolicitud = lsa_solicitudAsociada.getIdSolicitud1();

						if(StringUtils.isValidString(ls_idSolicitud))
						{
							la_param.setIdSolicitud(ls_idSolicitud);

							lca_actosSolicitudNuevaEntrada = findActosById(la_param, getUserId());
						}
					}
				}

				la_param.setIdSolicitud(ls_solicitud);

				lca_actosSolicitud = findActosById(la_param, getUserId());

				if(CollectionUtils.isValidCollection(lca_actosSolicitud))
				{
					if(CollectionUtils.isValidCollection(lca_actosSolicitudNuevaEntrada))
					{
						Collection<TipoActo> lca_actosDefinitivos;

						lca_actosDefinitivos = new LinkedList<TipoActo>();

						for(TipoActo lta_dataNueva : lca_actosSolicitud)
						{
							if(lta_dataNueva != null)
							{
								String             ls_codigoActo;
								String             ls_idCirculoActoNuevo;
								Iterator<TipoActo> lita_iterador;
								boolean            lb_encontro;

								ls_codigoActo             = StringUtils.getStringNotNull(lta_dataNueva.getIdTipoActo());
								ls_idCirculoActoNuevo     = StringUtils.getStringNotNull(lta_dataNueva.getIdCirculo());
								lita_iterador             = lca_actosSolicitudNuevaEntrada.iterator();
								lb_encontro               = false;

								while(lita_iterador.hasNext() && !lb_encontro)
								{
									TipoActo lta_dataAntigua;

									lta_dataAntigua = lita_iterador.next();

									if(lta_dataAntigua != null)
									{
										String ls_codigoActoAntiguo;
										String ls_idCirculoActoAntiguo;

										ls_codigoActoAntiguo        = StringUtils.getStringNotNull(
											    lta_dataAntigua.getIdTipoActo()
											);
										ls_idCirculoActoAntiguo     = StringUtils.getStringNotNull(
											    lta_dataAntigua.getIdCirculo()
											);

										if(
										    ls_codigoActoAntiguo.equals(ls_codigoActo)
											    && ls_idCirculoActoNuevo.equals(ls_idCirculoActoAntiguo)
										)
										{
											lta_dataAntigua.setDeshabilitar(true);

											lca_actosDefinitivos.add(lta_dataAntigua);

											lb_encontro = true;
										}
									}
								}

								if(!lb_encontro)
									lca_actosDefinitivos.add(lta_dataNueva);
							}
						}

						if(CollectionUtils.isValidCollection(lca_actosDefinitivos))
							lca_actosSolicitud = lca_actosDefinitivos;
					}

					Iterator<TipoActo> lia_actos;

					lia_actos = lca_actosSolicitud.iterator();

					while(lia_actos.hasNext())
					{
						TipoActo la_actos;

						la_actos = lia_actos.next();

						if(la_actos != null)
						{
							String ls_idCirculoActo;

							ls_idCirculoActo = la_actos.getIdCirculo();

							if(
							    StringUtils.isValidString(ls_idCirculoActo)
								    && ls_idCirculoActo.equalsIgnoreCase(ls_idCirculo)
							)
								llcm_columns.add(
								    new ColumnModel(
								        la_actos.getIdTipoActo(), new Boolean(false), la_actos.getNombre(),
								        conversionCientifica(
								            NumericUtils.getDoubleWrapper(la_actos.getIdTipoCalculo())
								        ), la_actos.getIdUsuarioCreacion(), la_actos.isValidarArea(), ls_idCirculoActo,
								        la_actos.isDeshabilitar()
								    )
								);
						}
					}
				}
			}
		}

		return llcm_columns;
	}

