	/**
	 * Valida la propiedad habilitar turno ynir.
	 *
	 * @return verdadero si se cumple la condicion, de lo contario retorna falso en habilitar turno ynir
	 */
	public boolean isHabilitarTurnoYnir()
	{
		return isHabilitarTurnoYnir(false);
	}

	/**
	 * Valida la propiedad habilitar turno ynir.
	 *
	 * @param ab_b correspondiente al valor del tipo de objeto boolean
	 * @return verdadero si se cumple la condicion, de lo contario retorna falso en habilitar turno ynir
	 */
	public boolean isHabilitarTurnoYnir(boolean ab_b)
	{
		boolean   lb_flag;
		Solicitud ls_solciitud;

		lb_flag          = true;
		ls_solciitud     = getSolicitud();

		if(ls_solciitud != null)
		{
			boolean lb_recepcionDeRecursos;
			String  ls_idProceso;
			String  ls_idTramiteSeleccion;

			ls_idProceso               = ls_solciitud.getIdProceso();
			lb_recepcionDeRecursos     = StringUtils.isValidString(ls_idProceso)
					&& (ls_idProceso.equalsIgnoreCase(ProcesoCommon.ID_PROCESO_47)
					|| ls_idProceso.equalsIgnoreCase(ProcesoCommon.ID_PROCESO_48));
			ls_idTramiteSeleccion      = lb_recepcionDeRecursos ? ls_idProceso : ls_solciitud.getIdSubproceso();

			if(ls_idTramiteSeleccion != null)
				lb_flag = !(StringUtils.isValidString(ls_idTramiteSeleccion)
						&& (ls_idTramiteSeleccion.equalsIgnoreCase("3") || ls_idTramiteSeleccion.equalsIgnoreCase("5")));

			if(ab_b)
			{
				if(lb_flag)
				{
					ls_solciitud.setIdTurnoAnt(null);
					ls_solciitud.setNirAsociado(null);
					setMostrarTurnoRecurrencia(false);
					setTurnoRecurrencia(null);
				}
			}
		}

		return lb_flag || ls_solciitud.isNuevaSolicitud();
	}

