	/**
	 * Método para actualizar los paneles de datos del Predio en Registro.
	 *
	 * @param as_idCirculo circulo para saber la posicion en que está el panel a actualizar
	 * @param ab_b de ab b
	 */
	public void actualizarPanelDatosDelPredio(String as_idCirculo, boolean ab_b)
	{
		Collection<DatosDelPredio> lcddp_datosPredio;
		int                        li_posicion;

		lcddp_datosPredio     = getDatosDelPredio();
		li_posicion           = 0;

		if(CollectionUtils.isValidCollection(lcddp_datosPredio))
		{
			Iterator<DatosDelPredio> liddp_iterador;
			boolean                  lb_encontro;

			liddp_iterador     = lcddp_datosPredio.iterator();
			lb_encontro        = false;

			while(liddp_iterador.hasNext() && !lb_encontro)
			{
				DatosDelPredio lddp_datosPredio;

				lddp_datosPredio = liddp_iterador.next();

				if(lddp_datosPredio != null)
				{
					String ls_idCirculo;

					ls_idCirculo = StringUtils.getStringNotNull(lddp_datosPredio.getIdCirculo());

					if(ls_idCirculo.equalsIgnoreCase(as_idCirculo))
						lb_encontro = true;
					else
						li_posicion++;
				}
			}

			if(ab_b)
			{
				actualizarComponente(
				    is_repeatDatosPredio + li_posicion + is_complementoRepeat + "idActosDatosDelPredio"
				);
				actualizarComponente(
				    is_repeatDatosPredio + li_posicion + is_complementoRepeat + "idPDatosDelPredioEnglobado"
				);
				actualizarComponente(is_repeatDatosPredio + li_posicion + is_complementoRepeat + "OpPreguntaSegracion");
				actualizarComponente(is_repeatDatosPredio + li_posicion + is_complementoRepeat + "panelDatosDelPredio");
			}
			else
			{
				actualizarComponente(is_repeatDatosPredio + li_posicion + is_complementoRepeat + "idPnlAdicional");
				actualizarComponente(
				    is_repeatDatosPredio + li_posicion + is_complementoRepeat + "idCBCancelarCrearPredio"
				);
				actualizarComponente(is_repeatDatosPredio + li_posicion + is_complementoRepeat + "idCBAgregarPredio");
				actualizarComponente(
				    is_repeatDatosPredio + li_posicion + is_complementoRepeat + "idPnPrediosAntiguoSistema"
				);

				StringBuilder lsb_script;
				lsb_script = new StringBuilder();

				lsb_script.append("mostrarElemento('");
				lsb_script.append(is_repeatDatosPredio);
				lsb_script.append(li_posicion);
				lsb_script.append(is_complementoRepeat);
				lsb_script.append("idCBGuardarDatosAntSistema')");

				PrimeFaces.current().executeScript(lsb_script.toString());
				PrimeFaces.current().executeScript("PF('wvTipoPredioAntSistema').focus()");
			}
		}
	}

