	/**
	 * Agregar actos individual.
	 *
	 * @param aae_ae correspondiente al valor del tipo de objeto ActionEvent
	 */
	public void agregarActosIndividual(ActionEvent aae_ae)
	{
		try
		{
			Solicitud ls_solicitud;

			ls_solicitud = getSolicitud();

			if(ls_solicitud != null)
			{
				Collection<PredioActoIU> lcpaui_tmp;
				boolean                  lb_validarArea;
				Collection<TipoActo>     lca_actosSolicitud;
				Acto                     la_param;
				int                      li_size;

				lb_validarArea     = false;
				lcpaui_tmp         = getActosAsociadosGeneral();
				la_param           = new Acto();

				la_param.setIdSolicitud(ls_solicitud.getIdSolicitud());

				lca_actosSolicitud = findActosById(la_param, getUserId());

				if(CollectionUtils.isValidCollection(lca_actosSolicitud))
				{
					for(TipoActo lota_ta : lca_actosSolicitud)
					{
						if(!lb_validarArea)
							lb_validarArea = lota_ta.isValidarArea();

						if(!isActosSegregacion())
							setActosSegregacion(lota_ta.isActoSegregacion());
					}
				}

				setValidarArea(lb_validarArea);

				if(!CollectionUtils.isValidCollection(lcpaui_tmp))
					lcpaui_tmp = new ArrayList<PredioActoIU>();
				else
				{
					for(PredioActoIU lpaui_actual : lcpaui_tmp)
					{
						if(lpaui_actual != null)
						{
							Long   ll_idMatricula;
							String ls_idCirculo;

							ll_idMatricula     = lpaui_actual.getIdMatricula();
							ls_idCirculo       = lpaui_actual.getIdCirculo();

							if(!StringUtils.isValidString(ls_idCirculo) || !NumericUtils.isValidLong(ll_idMatricula))
								throw new B2BException(ErrorKeys.ERROR_TABLA_MATRICULA_INGRESADA);
						}
					}
				}

				li_size = lcpaui_tmp.size();

				if(li_size < 10)
				{
					PredioActoIU lpaui_nuevo;

					lpaui_nuevo = new PredioActoIU(getColumns());

					lpaui_nuevo.setCertificadoAsociado(false);
					lpaui_nuevo.setCantidad(NumericUtils.getLongWrapper(0L));
					lpaui_nuevo.setHabilitarCert(false);
					lpaui_nuevo.setIngresoNuevo(true);
					lpaui_nuevo.setConsecutivo(li_size + 1);

					lcpaui_tmp.add(lpaui_nuevo);
				}
				else
					throw new B2BException(ErrorKeys.MAXIMO_MATRICULAS_ES_10_AGREGUE_DE_FORMA_MASIVA);

				setActosAsociadosGeneral(lcpaui_tmp);
			}
		}
		catch(B2BException lb2be_e)
		{
			clh_LOGGER.error(lb2be_e);
			addMessage(lb2be_e);
			PrimeFaces.current().ajax().update(is_messageIdGrowl);
		}
	}

