	/**
	 * Agregar actos masivos.
	 *
	 * @param addp_datosDelPredio correspondiente al valor del tipo de objeto DatosDelPredio
	 */
	public void agregarActosMasivos(DatosDelPredio addp_datosDelPredio)
	{
		if(addp_datosDelPredio != null)
		{
			StringBuilder lsb_Errors;

			lsb_Errors = new StringBuilder();

			try
			{
				Collection<PredioActoIU> lcpaui_tmp;
				String                   ls_rangoInicio;
				String                   ls_rangoFin;
				String                   ls_idCirculo;
				long                     ll_rangoMaximo;

				lcpaui_tmp         = getActosAsociadosGeneral();
				ls_idCirculo       = addp_datosDelPredio.getIdCirculo();
				ls_rangoInicio     = addp_datosDelPredio.getRangoInicio();
				ls_rangoFin        = addp_datosDelPredio.getRangoFin();

				if(!StringUtils.isValidString(ls_idCirculo))
					throw new B2BException(ErrorKeys.CIRCULO_REGISTRAL_SELECCIONADO_INVALIDO);

				if(StringUtils.isValidString(ls_rangoInicio) && StringUtils.isValidString(ls_rangoFin))
				{
					ls_rangoInicio     = ls_idCirculo + "-" + ls_rangoInicio;
					ls_rangoFin        = ls_idCirculo + "-" + ls_rangoFin;

					int    li_inicio;
					String ls_circuloRangoInicio;
					String ls_circuloRangoFin;
					String ls_tmpRangoInicio;
					String ls_tmpRangoFin;

					if(!CollectionUtils.isValidCollection(lcpaui_tmp))
						lcpaui_tmp = new ArrayList<PredioActoIU>();
					else
					{
						for(PredioActoIU lpaui_actual : lcpaui_tmp)
						{
							if(lpaui_actual != null)
							{
								String ls_matriculaActual;

								ls_matriculaActual = lpaui_actual.getMatricula();

								if(!StringUtils.isValidString(ls_matriculaActual))
									throw new B2BException("Hay un registro en la tabla sin Matrícula ingresada");

								if(ls_rangoInicio.equalsIgnoreCase(ls_matriculaActual))
									throw new B2BException("La Matrícula rango inicial ya esta ingresada en la tabla");

								if(ls_rangoFin.equalsIgnoreCase(ls_matriculaActual))
									throw new B2BException("La Matrícula rango final ya esta ingresada en la tabla");
							}
						}
					}

					if(!ls_rangoInicio.contains("-"))
					{
						Object[] aoa_messageArgs = new String[1];
						aoa_messageArgs[0] = ls_rangoInicio;
						throw new B2BException(ErrorKeys.MATRICULA_INMOBILIARIA_INVALIDA, aoa_messageArgs);
					}

					if(!ls_rangoFin.contains("-"))
					{
						Object[] aoa_messageArgs = new String[1];
						aoa_messageArgs[0] = ls_rangoFin;
						throw new B2BException(ErrorKeys.MATRICULA_INMOBILIARIA_INVALIDA, aoa_messageArgs);
					}

					li_inicio                 = ls_rangoInicio.lastIndexOf("-");
					ls_tmpRangoInicio         = ls_rangoInicio.substring(li_inicio + 1, ls_rangoInicio.length());
					ls_circuloRangoInicio     = ls_rangoInicio.substring(0, li_inicio);
					li_inicio                 = ls_rangoFin.lastIndexOf("-");
					ls_tmpRangoFin            = ls_rangoFin.substring(li_inicio + 1, ls_rangoFin.length());
					ls_circuloRangoFin        = ls_rangoFin.substring(0, li_inicio);

					if(
					    StringUtils.isValidString(ls_circuloRangoInicio)
						    && StringUtils.isValidString(ls_circuloRangoFin)
						    && NumericUtils.isValidLong(NumericUtils.getLongWrapper(ls_tmpRangoInicio), 1)
						    && NumericUtils.isValidLong(NumericUtils.getLongWrapper(ls_tmpRangoFin), 1)
					)
					{
						if(ls_circuloRangoInicio.equalsIgnoreCase(ls_circuloRangoFin))
						{
							long ll_desde;
							long ll_hasta;

							ll_desde     = NumericUtils.getLong(ls_tmpRangoInicio);
							ll_hasta     = NumericUtils.getLong(ls_tmpRangoFin);

							if(ll_desde > ll_hasta)
								throw new B2BException("El rango inicial no debe ser mayor al rango final");

							if(ll_desde < 1)
								throw new B2BException("El rango inicial debe ser mayor a cero (0)");

							if(ll_hasta < 1)
								throw new B2BException("El rango final debe ser mayor a cero (0)");

							ll_rangoMaximo = ll_hasta - ll_desde;

							if(ll_rangoMaximo > 1000)
								throw new B2BException(
								    "La cantidad máxima desde el rango inicial hasta el rango final debe ser menor a mil (1000) Matrículas"
								);

							{
								CirculoRegistral lcr_circulo;

								lcr_circulo = new CirculoRegistral();

								lcr_circulo.setIdCirculo(ls_circuloRangoInicio);

								lcr_circulo = irr_registroRemote.findCirculoRegistralById(lcr_circulo, getUserId());

								if(lcr_circulo != null)
								{
									long ll_contador;

									ll_contador = 0L;

									for(
									    long ll_numeroMatricula = ll_desde; ll_numeroMatricula <= ll_hasta;
										    ll_numeroMatricula++
									)
									{
										String       ls_matriculaConcatenada;
										String       ls_error;
										PredioActoIU lpaui_nuevo;

										ls_matriculaConcatenada     = ls_circuloRangoInicio + "-" + ll_numeroMatricula;
										ls_error                    = null;
										lpaui_nuevo                 = new PredioActoIU(getColumns());

										{
											PredioRegistro lpr_predio;

											lpr_predio = new PredioRegistro();

											lpr_predio.setIdCirculo(lcr_circulo.getIdCirculo());
											lpr_predio.setIdMatricula(NumericUtils.getLong(ll_numeroMatricula));
											lpr_predio.setValidMatricula(true);

											lpr_predio = irr_registroRemote.findPredioRegistroById(
												    lpr_predio, getUserId()
												);

											if(lpr_predio != null)
											{
												int  li_contarMatriculasIguales;
												Long ll_idMatricula;

												ll_idMatricula     = NumericUtils.getLongWrapper(
													    lpr_predio.getIdMatricula()
													);

												li_contarMatriculasIguales     = 0;
												ls_matriculaConcatenada        = lpr_predio.getIdCirculo() + "-"
													+ lpr_predio.getIdMatricula();
												lpaui_nuevo.setMatricula(ls_matriculaConcatenada);
												lpaui_nuevo.setIdMatricula(ll_idMatricula);
												lpaui_nuevo.setIdCirculo(ls_idCirculo);

												{
													DireccionPredio ld_direccion;

													ld_direccion = new DireccionPredio();

													ld_direccion.setIdCirculo(lpr_predio.getIdCirculo());
													ld_direccion.setIdMatricula(ll_idMatricula);

													ld_direccion = irr_registroRemote.findDireccionPredioById(
														    ld_direccion, getUserId()
														);

													if(ld_direccion != null)
														lpaui_nuevo.setDireccion(ld_direccion.getDireccion());
													else
														ls_error = ("La Matrícula Inmobiliaria "
															+ ls_matriculaConcatenada
															+ " No tiene Relacionada una dirección. ");
												}

												if(CollectionUtils.isValidCollection(lcpaui_tmp))
												{
													for(PredioActoIU lpaui_actual : lcpaui_tmp)
													{
														if(lpaui_actual != null)
														{
															String ls_matriculaCargada;

															ls_matriculaCargada = lpaui_actual.getMatricula();

															if(
															    ls_matriculaConcatenada.equalsIgnoreCase(
																        ls_matriculaCargada
																    )
															)
																li_contarMatriculasIguales++;
														}
													}
												}

												if((li_contarMatriculasIguales < 1))
													lcpaui_tmp.add(lpaui_nuevo);
												else
													ls_error = ("La Matrícula Inmobiliaria " + ls_matriculaConcatenada
														+ " Ya se encuentra insertada en a tabla. ");

												{
													String ls_estadoPredio;

													ls_estadoPredio = lpr_predio.getIdEstadoPredio();

													if(StringUtils.isValidString(ls_estadoPredio))
													{
														EstadoPredio lep_estado;

														lep_estado = new EstadoPredio();

														lep_estado.setIdEstadoPredio(ls_estadoPredio);

														lep_estado = irr_registroRemote.findEstadoPredioById(
															    lep_estado, getUserId()
															);

														if(lep_estado != null)
														{
															String ls_estado;

															ls_estado = lep_estado.getNombre();

															if(
															    StringUtils.isValidString(ls_estado)
																    && ls_estado.toUpperCase()
																                    .equalsIgnoreCase(
																        EstadoCommon.ESTADO_CERRADO
																    )
															)
																ls_error = ("La Matrícula Inmobiliaria "
																	+ ls_circuloRangoInicio + "-" + ll_numeroMatricula
																	+ " a incluir esta en estado 'CERRADO'. ");
														}
													}
												}

												{
													RegistroAnotacionProhibicion lrap_rap;

													lrap_rap = irr_registroRemote
															.findRegistroAnotacionProhibicionByCirMat(
															    getSolicitud(), ls_idCirculo, ll_numeroMatricula,
															    getUserId(), getLocalIpAddress(), getRemoteIpAddress()
															);

													if(lrap_rap != null)
													{
														if(lrap_rap.isAlerta())
														{
															String ls_errorKey;

															ls_errorKey = lrap_rap.getErrorKey();

															if(StringUtils.isValidString(ls_errorKey))
																ls_error = getMessages()
																		           .getString(
																		    ls_errorKey, lrap_rap.getMessageArgs()
																		);
														}
													}
												}

												{
													Collection<String> lcs_turnosBloqueo;

													lcs_turnosBloqueo = irr_registroRemote.findTurnosBloqueoPredio(
														    lpr_predio
														);

													if(CollectionUtils.isValidCollection(lcs_turnosBloqueo))
													{
														Iterator<String> lis_turnosBloqueo;
														String           ls_turnosBloqueo;

														lis_turnosBloqueo     = lcs_turnosBloqueo.iterator();
														ls_turnosBloqueo      = "";

														while(lis_turnosBloqueo.hasNext())
														{
															String ls_turnoTemp;
															String ls_espacio;

															ls_turnoTemp     = lis_turnosBloqueo.next();
															ls_espacio       = lis_turnosBloqueo.hasNext() ? ",\n" : "\n";

															if(StringUtils.isValidString(ls_turnoTemp))
																ls_turnosBloqueo = ls_turnosBloqueo + ls_espacio
																	+ ls_turnoTemp;
														}

														ls_error = ("El folio de matrícula " + ls_circuloRangoInicio
															+ "-" + ll_numeroMatricula
															+ " se encuentra bloqueado con los turnos: "
															+ ls_turnosBloqueo);
													}
												}
											}
											else
											{
												ls_error = ("La Matrícula Inmobiliaria " + ls_circuloRangoInicio + "-"
													+ ll_numeroMatricula + " No Encontrada o no Existe. ");
												ll_contador++;
											}
										}

										if(StringUtils.isValidString(ls_error))
											lsb_Errors.append(ls_error);
									}

									{
										long ll_rango;

										ll_rango = 0L;

										for(long cont = ll_desde; cont <= ll_hasta; cont++)
											ll_rango++;

										if((ll_rango == ll_contador))
										{
											lsb_Errors = new StringBuilder();

											lsb_Errors.append("Para el rango ingresado no existe predios existentes.");
										}
									}
								}
								else
									throw new B2BException(
									    "El Circulo Registral" + ls_circuloRangoInicio + " No Encontrado o no Existe."
									);
							}
						}
						else
							throw new B2BException("Los circulos registrales ingresados no coinciden");
					}
					else
						throw new B2BException(ErrorKeys.ERROR_RANGOS_INGRESADOS);
				}
				else
					throw new B2BException("Los rangos a ingresar debe estar diligenciados");

				setActosAsociadosGeneral(lcpaui_tmp);

				if(StringUtils.isValidString(lsb_Errors.toString()))
				{
					addMessage("I", lsb_Errors.toString());
					PrimeFaces.current().ajax().update(is_messageIdGrowl);
				}
			}
			catch(B2BException lb2be_e)
			{
				clh_LOGGER.error(lb2be_e);
				addMessage(lb2be_e);
				PrimeFaces.current().ajax().update(is_messageIdGrowl);
			}
		}
	}

	/**
	 * Agregar actos masivos circulos.
	 */
	public void agregarActosMasivosCirculos()
	{
		agregarActosMasivosCirculos(null, false);
	}

	/**
	 * Agregar actos masivos circulos.
	 *
	 * @param addp_datosDelPredio correspondiente al valor del tipo de objeto DatosDelPredio
	 */
	public void agregarActosMasivosCirculos(DatosDelPredio addp_datosDelPredio)
	{
		agregarActosMasivosCirculos(addp_datosDelPredio, true);
	}

	/**
	 * Agregar actos masivos circulos.
	 *
	 * @param addp_datosDelPredio correspondiente al valor del tipo de objeto DatosDelPredio
	 * @param ab_datosPredio correspondiente al valor del tipo de objeto boolean
	 */
	public void agregarActosMasivosCirculos(DatosDelPredio addp_datosDelPredio, boolean ab_datosPredio)
	{
		if((addp_datosDelPredio != null) || !ab_datosPredio)
		{
			StringBuilder lsb_Errors;

			lsb_Errors = new StringBuilder();

			try
			{
				Collection<PredioActoIU>   lcpaui_tmp;
				Collection<DatosDelPredio> lcddp_datosDelPredio;
				long                       ll_rangoMaximo;
				String                     ls_rangoInicio;
				String                     ls_rangoFin;
				String                     ls_idCirculo;
				boolean                    lb_procesoCertificados;

				lcddp_datosDelPredio     = getDatosDelPredio();
				lcpaui_tmp               = getActosAsociadosGeneral();

				if(ab_datosPredio)
				{
					ls_idCirculo       = addp_datosDelPredio.getIdCirculo();
					ls_rangoInicio     = addp_datosDelPredio.getRangoInicio();
					ls_rangoFin        = addp_datosDelPredio.getRangoFin();
				}
				else
				{
					ls_idCirculo       = getIdCirculoMasivo();
					ls_rangoInicio     = getRangoInicio();
					ls_rangoFin        = getRangoFin();
				}

				lb_procesoCertificados = isProcesoCertificados();

				if(!StringUtils.isValidString(ls_idCirculo))
					throw new B2BException(ErrorKeys.CIRCULO_REGISTRAL_SELECCIONADO_INVALIDO);

				if(CollectionUtils.isValidCollection(lcddp_datosDelPredio) && ab_datosPredio)
				{
					for(DatosDelPredio lddp_iterador : lcddp_datosDelPredio)
					{
						if(lddp_iterador != null)
						{
							String ls_idCirculoIterador;

							ls_idCirculoIterador = lddp_iterador.getIdCirculo();

							if(
							    StringUtils.isValidString(ls_idCirculoIterador)
								    && ls_idCirculoIterador.equalsIgnoreCase(ls_idCirculo)
							)
								lcpaui_tmp = lddp_iterador.getActosAsociadosGeneral();
						}
					}
				}

				if(StringUtils.isValidString(ls_rangoInicio) && StringUtils.isValidString(ls_rangoFin))
				{
					ls_rangoInicio     = ls_idCirculo + "-" + ls_rangoInicio;
					ls_rangoFin        = ls_idCirculo + "-" + ls_rangoFin;

					int    li_inicio;
					String ls_circuloRangoInicio;
					String ls_circuloRangoFin;
					String ls_tmpRangoInicio;
					String ls_tmpRangoFin;

					if(!CollectionUtils.isValidCollection(lcpaui_tmp))
						lcpaui_tmp = new ArrayList<PredioActoIU>();
					else
					{
						for(PredioActoIU lpaui_actual : lcpaui_tmp)
						{
							if(lpaui_actual != null)
							{
								String ls_matriculaActual;

								ls_matriculaActual = lpaui_actual.getMatricula();

								if(!StringUtils.isValidString(ls_matriculaActual))
									throw new B2BException("Hay un registro en la tabla sin Matrícula ingresada");

								if(ls_rangoInicio.equalsIgnoreCase(ls_matriculaActual))
									throw new B2BException("La Matrícula rango inicial ya esta ingresada en la tabla");

								if(ls_rangoFin.equalsIgnoreCase(ls_matriculaActual))
									throw new B2BException("La Matrícula rango final ya esta ingresada en la tabla");
							}
						}
					}

					if(!ls_rangoInicio.contains("-"))
					{
						Object[] aoa_messageArgs = new String[1];
						aoa_messageArgs[0] = ls_rangoInicio;
						throw new B2BException(ErrorKeys.MATRICULA_INMOBILIARIA_INVALIDA, aoa_messageArgs);
					}

					if(!ls_rangoFin.contains("-"))
					{
						Object[] aoa_messageArgs = new String[1];
						aoa_messageArgs[0] = ls_rangoFin;
						throw new B2BException(ErrorKeys.MATRICULA_INMOBILIARIA_INVALIDA, aoa_messageArgs);
					}

					li_inicio                 = ls_rangoInicio.lastIndexOf("-");
					ls_tmpRangoInicio         = ls_rangoInicio.substring(li_inicio + 1, ls_rangoInicio.length());
					ls_circuloRangoInicio     = ls_rangoInicio.substring(0, li_inicio);
					li_inicio                 = ls_rangoFin.lastIndexOf("-");
					ls_tmpRangoFin            = ls_rangoFin.substring(li_inicio + 1, ls_rangoFin.length());
					ls_circuloRangoFin        = ls_rangoFin.substring(0, li_inicio);

					if(
					    StringUtils.isValidString(ls_circuloRangoInicio)
						    && StringUtils.isValidString(ls_circuloRangoFin)
						    && NumericUtils.isValidLong(NumericUtils.getLongWrapper(ls_tmpRangoInicio), 1)
						    && NumericUtils.isValidLong(NumericUtils.getLongWrapper(ls_tmpRangoFin), 1)
					)
					{
						if(ls_circuloRangoInicio.equalsIgnoreCase(ls_circuloRangoFin))
						{
							long ll_desde;
							long ll_hasta;

							ll_desde     = NumericUtils.getLong(ls_tmpRangoInicio);
							ll_hasta     = NumericUtils.getLong(ls_tmpRangoFin);

							if(ll_desde > ll_hasta)
								throw new B2BException("El rango inicial no debe ser mayor al rango final");

							if(ll_desde < 1)
								throw new B2BException("El rango inicial debe ser mayor a cero (0)");

							if(ll_hasta < 1)
								throw new B2BException("El rango final debe ser mayor a cero (0)");

							ll_rangoMaximo = ll_hasta - ll_desde;

							if(ll_rangoMaximo > 1000)
								throw new B2BException(
								    "La cantidad máxima desde el rango inicial hasta el rango final debe ser menor a mil (1000) Matrículas"
								);

							{
								CirculoRegistral lcr_circulo;

								lcr_circulo = new CirculoRegistral();

								lcr_circulo.setIdCirculo(ls_circuloRangoInicio);

								lcr_circulo = irr_registroRemote.findCirculoRegistralById(lcr_circulo, getUserId());

								if(lcr_circulo != null)
								{
									long ll_contador;
									int  li_numMatr;

									ll_contador     = 0L;
									li_numMatr      = lcpaui_tmp.size() + 1;

									for(
									    long ll_numeroMatricula = ll_desde; ll_numeroMatricula <= ll_hasta;
										    ll_numeroMatricula++
									)
									{
										String       ls_matriculaConcatenada;
										PredioActoIU lpaui_nuevo;

										ls_matriculaConcatenada     = ls_circuloRangoInicio + "-" + ll_numeroMatricula;
										lpaui_nuevo                 = new PredioActoIU(getColumns());

										{
											PredioRegistro lpr_predio;

											lpr_predio = new PredioRegistro();

											lpr_predio.setIdCirculo(lcr_circulo.getIdCirculo());
											lpr_predio.setIdMatricula(ll_numeroMatricula);
											lpr_predio.setValidMatricula(true);

											lpr_predio = irr_registroRemote.findPredioRegistroById(
												    lpr_predio, getUserId()
												);

											if(lpr_predio != null)
											{
												int li_contarMatriculasIguales;
												li_contarMatriculasIguales     = 0;

												ls_matriculaConcatenada = lpr_predio.getIdCirculo() + "-"
													+ lpr_predio.getIdMatricula();

												lpaui_nuevo.setMatricula(ls_matriculaConcatenada);
												lpaui_nuevo.setIdCirculo(lpr_predio.getIdCirculo());
												lpaui_nuevo.setIdMatricula(
												    NumericUtils.getLongWrapper(lpr_predio.getIdMatricula())
												);
												lpaui_nuevo.setConsecutivo(li_numMatr);

												if(lb_procesoCertificados)
													lpaui_nuevo.setCantidad(NumericUtils.getLongWrapper(1L));

												{
													DireccionPredio ld_direccion;

													ld_direccion = new DireccionPredio();

													ld_direccion.setIdCirculo(lpr_predio.getIdCirculo());
													ld_direccion.setIdMatricula(
													    NumericUtils.getLongWrapper(lpr_predio.getIdMatricula())
													);

													ld_direccion = irr_registroRemote.findDireccionPredioById(
														    ld_direccion, getUserId()
														);

													if(ld_direccion != null)
														lpaui_nuevo.setDireccion(ld_direccion.getDireccion());
													else
														lsb_Errors.append(
														    "La Matrícula Inmobiliaria " + ls_matriculaConcatenada
														    + " No tiene Relacionada una dirección. "
														);
												}

												if(CollectionUtils.isValidCollection(lcpaui_tmp))
												{
													for(PredioActoIU lpaui_actual : lcpaui_tmp)
													{
														if(lpaui_actual != null)
														{
															String ls_matriculaCargada;

															ls_matriculaCargada = lpaui_actual.getMatricula();

															if(
															    ls_matriculaConcatenada.equalsIgnoreCase(
																        ls_matriculaCargada
																    )
															)
																li_contarMatriculasIguales++;
														}
													}
												}

												boolean lb_agregarMatricula;

												lb_agregarMatricula = true;

												if((li_contarMatriculasIguales < 1))
												{
													if(lb_agregarMatricula)
													{
														lcpaui_tmp.add(lpaui_nuevo);

														li_numMatr++;
													}
												}
												else
													lsb_Errors.append(
													    "La Matrícula Inmobiliaria " + ls_matriculaConcatenada
													    + " Ya se encuentra insertada en a tabla. "
													);

												if(lb_agregarMatricula)
												{
													{
														String ls_estadoPredio;

														ls_estadoPredio = lpr_predio.getIdEstadoPredio();

														if(StringUtils.isValidString(ls_estadoPredio))
														{
															EstadoPredio lep_estado;

															lep_estado = new EstadoPredio();

															lep_estado.setIdEstadoPredio(ls_estadoPredio);

															lep_estado = irr_registroRemote.findEstadoPredioById(
																    lep_estado, getUserId()
																);

															if(lep_estado != null)
															{
																String ls_estado;

																ls_estado = lep_estado.getNombre();

																if(
																    StringUtils.isValidString(ls_estado)
																	    && ls_estado.toUpperCase()
																	                    .equalsIgnoreCase(
																	        EstadoCommon.ESTADO_CERRADO
																	    )
																)
																	lsb_Errors.append(
																	    "La Matrícula Inmobiliaria "
																	    + ls_circuloRangoInicio + "-"
																	    + ll_numeroMatricula
																	    + " a incluir esta en estado 'CERRADO'. "
																	);
															}
														}
													}

													{
														RegistroAnotacionProhibicion lrap_rap;

														lrap_rap = irr_registroRemote
																.findRegistroAnotacionProhibicionByCirMat(
																    getSolicitud(), ls_idCirculo, ll_numeroMatricula,
																    getUserId(), getLocalIpAddress(),
																    getRemoteIpAddress()
																);

														if(lrap_rap != null)
														{
															if(lrap_rap.isAlerta())
															{
																String ls_errorKey;

																ls_errorKey = lrap_rap.getErrorKey();

																if(StringUtils.isValidString(ls_errorKey))
																	lsb_Errors.append(
																	    getMessages()
																		        .getString(
																		        ls_errorKey, lrap_rap.getMessageArgs()
																		    )
																	);
															}
														}
													}

													{
														Collection<String> lcs_turnosBloqueo;

														lcs_turnosBloqueo = irr_registroRemote.findTurnosBloqueoPredio(
															    lpr_predio
															);

														if(CollectionUtils.isValidCollection(lcs_turnosBloqueo))
														{
															Iterator<String> lis_turnosBloqueo;
															String           ls_turnosBloqueo;

															lis_turnosBloqueo     = lcs_turnosBloqueo.iterator();
															ls_turnosBloqueo      = "";

															while(lis_turnosBloqueo.hasNext())
															{
																String ls_turnoTemp;
																String ls_espacio;

																ls_turnoTemp     = lis_turnosBloqueo.next();
																ls_espacio       = lis_turnosBloqueo.hasNext() ? ",\n"
																	                                           : "\n";

																if(StringUtils.isValidString(ls_turnoTemp))
																	ls_turnosBloqueo = ls_turnosBloqueo + ls_espacio
																		+ ls_turnoTemp;
															}

															lsb_Errors.append(
															    "El folio de matrícula " + ls_circuloRangoInicio + "-"
															    + ll_numeroMatricula
															    + " se encuentra bloqueado con los turnos: "
															    + ls_turnosBloqueo
															    + IdentificadoresCommon.PUNTO_ESPACIO
															);
														}
													}

													if(
													    StringUtils.getStringNotNull(
														        lpr_predio.getPredioInconsistente()
														    ).equalsIgnoreCase(EstadoCommon.S)
													)
													{
														Object[] aoa_messageArgs;
														aoa_messageArgs        = new String[1];
														aoa_messageArgs[0]     = StringUtils.getString(
															    ll_numeroMatricula
															);

														lsb_Errors.append(
														    getMessages()
															        .getString(
															        MessagesKeys.PREDIO_INCONSISTENTE, aoa_messageArgs
															    )
														);

														lpaui_nuevo.setEsPredioInconsistente(true);
													}
												}
											}
											else
											{
												lsb_Errors.append(
												    "La Matrícula Inmobiliaria " + ls_circuloRangoInicio + "-"
												    + ll_numeroMatricula + " No Encontrada o no Existe. "
												);
												ll_contador++;
											}
										}
									}

									{
										long ll_rango;

										ll_rango = 0L;

										for(long cont = ll_desde; cont <= ll_hasta; cont++)
											ll_rango++;

										if((ll_rango == ll_contador))
										{
											lsb_Errors = new StringBuilder();

											lsb_Errors.append("Para el rango ingresado no existe predios existentes.");
										}
									}
								}
								else
									throw new B2BException(
									    "El Circulo Registral" + ls_circuloRangoInicio + " No Encontrado o no Existe."
									);
							}
						}
						else
							throw new B2BException("Los circulos registrales ingresados no coinciden");
					}
					else
						throw new B2BException(ErrorKeys.ERROR_RANGOS_INGRESADOS);
				}
				else
					throw new B2BException("Los rangos a ingresar debe estar diligenciados");

				if(CollectionUtils.isValidCollection(lcddp_datosDelPredio) && ab_datosPredio)
				{
					for(DatosDelPredio lddp_iterador : lcddp_datosDelPredio)
					{
						if(lddp_iterador != null)
						{
							String ls_idCirculoIterador;

							ls_idCirculoIterador = lddp_iterador.getIdCirculo();

							if(
							    StringUtils.isValidString(ls_idCirculoIterador)
								    && ls_idCirculoIterador.equalsIgnoreCase(ls_idCirculo)
							)
								lddp_iterador.setActosAsociadosGeneral(lcpaui_tmp);
						}
					}

					setDatosDelPredio(lcddp_datosDelPredio);
				}
				else
					setActosAsociadosGeneral(lcpaui_tmp);

				if(lb_procesoCertificados)
					addp_datosDelPredio.setActosAsociadosGeneral(lcpaui_tmp);

				cargarMensajePredioInconsistente();

				if(StringUtils.isValidString(lsb_Errors.toString()))
				{
					addMessage("I", lsb_Errors.toString());
					PrimeFaces.current().ajax().update(is_messageIdGrowl);
					PrimeFaces.current().ajax().update("fRegistro:idActosDatosDelPredio");
					PrimeFaces.current().ajax().update("fRegistro:idPnActosResumen");
				}
			}
			catch(B2BException lb2be_e)
			{
				clh_LOGGER.error(lb2be_e);
				addMessage(lb2be_e);
				PrimeFaces.current().ajax().update(is_messageIdGrowl);
				PrimeFaces.current().ajax().update("fRegistro:idActosDatosDelPredio");
				PrimeFaces.current().ajax().update("fRegistro:idPnActosResumen");
			}
		}
	}

	/**
	 * Agregar area.
	 */
	public void agregarArea()
	{
		try
		{
			AccAreaUI         laaui_dataArea;
			DetalleAreaPredio ladap_detalleArea;

			laaui_dataArea        = getAreaUI();
			ladap_detalleArea     = getDetalleAreaTerreno();

			if((laaui_dataArea != null) && (ladap_detalleArea != null))
			{
				boolean      lb_focus;
				BigInteger   lbi_count;
				String       ls_area;
				FacesContext lfc_context;

				lb_focus        = false;
				lbi_count       = laaui_dataArea.getIdDetalleAreaPredio();
				ls_area         = ladap_detalleArea.getAreaLectura();
				lfc_context     = FacesContext.getCurrentInstance();

				lb_focus = validateStyles(
					    ":predialForm:idITareaTerreno", lfc_context, StringUtils.getString(ls_area), lb_focus
					);

				if(StringUtils.isValidString(ls_area))
				{
					Double ld_area;
					String ls_medidaArea;

					ld_area           = NumericUtils.getDoubleWrapper(ls_area);
					ls_medidaArea     = ladap_detalleArea.getIdUnidadMedida();

					if(NumericUtils.isValidDouble(ld_area, NumericUtils.DEFAULT_DOUBLE_VALUE, false))
					{
						lb_focus = validateStyles(":predialForm:idITareaTerreno", lfc_context, ls_area, lb_focus);
						ladap_detalleArea.setArea(ld_area);
					}
					else
					{
						lb_focus = validateStyles(":predialForm:idITareaTerreno", lfc_context, "", lb_focus);
						throw new B2BException(ErrorKeys.ERROR_AREA_DEL_TERRENO);
					}

					lb_focus = validateStyles(
						    ":predialForm:idSOMunidadMedidaTerreno", lfc_context, ls_medidaArea, lb_focus
						);

					if(StringUtils.isValidString(ls_medidaArea))
					{
						Collection<DetalleAreaPredio> lcadap_areas;

						lcadap_areas = laaui_dataArea.getAreasTerreno();

						if(CollectionUtils.isValidCollection(lcadap_areas))
						{
							Iterator<DetalleAreaPredio> liadap_iterator;

							liadap_iterator = lcadap_areas.iterator();

							while(liadap_iterator.hasNext())
							{
								DetalleAreaPredio ladap_areaTerreno;

								ladap_areaTerreno = liadap_iterator.next();

								if(ladap_areaTerreno != null)
								{
									String ls_idDetalleAreaPredio;

									ls_idDetalleAreaPredio = ladap_areaTerreno.getIdDetalleAreaPredio();

									if(StringUtils.isValidString(ls_idDetalleAreaPredio))
									{
										BigInteger lbi_idDetalleAreaPredio;
										String     ls_medidaAreaIterador;

										ls_medidaAreaIterador       = ladap_areaTerreno.getIdUnidadMedida();
										lbi_idDetalleAreaPredio     = NumericUtils.getBigInteger(
											    ls_idDetalleAreaPredio
											);

										lbi_count = (lbi_idDetalleAreaPredio.compareTo(lbi_count) > 0)
											? lbi_idDetalleAreaPredio : lbi_count;

										if(StringUtils.isValidString(ls_medidaAreaIterador))
										{
											if(ls_medidaAreaIterador.equalsIgnoreCase(ls_medidaArea))
											{
												MedidaArea lma_medidaArea;
												Object[]   aoa_messageArgs;
												String     ls_medidaAreaNombre;

												lma_medidaArea = ipr_parameterRemote.findMedidaAreaById(
													    ls_medidaAreaIterador
													);

												if(lma_medidaArea == null)
													throw new B2BException(ErrorKeys.ERROR_UNIDAD_MEDIDA);

												ls_medidaAreaNombre     = lma_medidaArea.getDescripcion();
												aoa_messageArgs         = new String[1];
												aoa_messageArgs[0]      = ls_medidaAreaNombre;

												lb_focus = validateStyles(
													    ":predialForm:idSOMunidadMedidaTerreno", lfc_context, "",
													    lb_focus
													);
												throw new B2BException(
												    ErrorKeys.ERROR_UNIDAD_MEDIDA_DUPLICADO, aoa_messageArgs
												);
											}
										}
										else
											throw new B2BException(ErrorKeys.ERROR_UNIDAD_MEDIDA);
									}
								}
							}
						}

						lbi_count = lbi_count.add(BigInteger.ONE);

						ladap_detalleArea.setIdTipoArea(TipoAreaCommon.TERRENO);
						ladap_detalleArea.setIdDetalleAreaPredio(StringUtils.getString(lbi_count));
						lcadap_areas.add(ladap_detalleArea);
						laaui_dataArea.setIdDetalleAreaPredio(lbi_count);
						laaui_dataArea.setAreasTerreno(lcadap_areas);

						setDetalleAreaTerreno(null);
						setAreaUI(laaui_dataArea);
						actualizarAreaTerreno();
					}
					else
						throw new B2BException(ErrorKeys.ERROR_UNIDAD_MEDIDA);
				}
				else
					throw new B2BException(ErrorKeys.ERROR_AREA_DEL_TERRENO);
			}
		}
		catch(B2BException lb2be_e)
		{
			clh_LOGGER.error(lb2be_e);
			addMessage(lb2be_e);
			PrimeFaces.current().ajax().update(is_messageIdGrowl);
		}
	}

