	/**
	 * Método que consulta la bandeja de reproducción de constancia cuando se
	 * consulta por Documento.
	 *
	 * @throws B2BException Señala que se ha producido una excepción
	 */
	public void buscarRepConstanciaDocumento()
	    throws B2BException
	{
		Documento ld_docTemp;
		boolean   lb_focus;
		boolean   lb_indMessage;
		String    ls_message;

		ld_docTemp        = getBgnDocumento();
		lb_focus          = true;
		lb_indMessage     = false;
		ls_message        = MessagesKeys.CONSULTA_EXITOSA;

		if(ld_docTemp != null)
		{
			FacesContext lfc_context;
			lfc_context = FacesContext.getCurrentInstance();

			try
			{
				{
					String ls_idTipoDocumento;
					ls_idTipoDocumento     = ld_docTemp.getIdTipoDocumento();

					lb_focus = validateStyles(":fRegistro:idSOMEscritura", lfc_context, ls_idTipoDocumento, lb_focus);

					if(!StringUtils.isValidString(ls_idTipoDocumento))
						throw new B2BException(ErrorKeys.DEBE_SELECCIONAR_TIPO);
				}

				{
					String ls_numero;
					ls_numero     = ld_docTemp.getNumero();

					lb_focus = validateStyles(":fRegistro:idItDocuActo", lfc_context, ls_numero, lb_focus);

					if(!StringUtils.isValidString(ls_numero))
						throw new B2BException(ErrorKeys.DOCUMENTO_INVALIDO);
				}

				{
					Date ld_fecha;
					ld_fecha     = ld_docTemp.getFechaDocumento();

					lb_focus = validateStyles(":fRegistro:idCalFechaDoc", lfc_context, ld_fecha, lb_focus);

					if(ld_fecha == null)
					{
						Object[] aoa_messageArgs = new String[1];
						aoa_messageArgs[0] = " Documento ";
						throw new B2BException(ErrorKeys.ERROR_CAMPO_FECHA_OBLIGATORIO, aoa_messageArgs);
					}
				}

				Collection<DataReproduccionConstancia> lcdrc_tmp;
				Collection<AnotacionPredioDireccion>   lcap_colAnotPred;
				Collection<AnotacionPredioDireccion>   lcap_colFinal;
				DocumentoConstancia                    ld_documento;
				AnotacionPredioDireccion               lap_anotacionPredio;

				ld_documento            = new DocumentoConstancia();
				lap_anotacionPredio     = new AnotacionPredioDireccion();

				lap_anotacionPredio.setIdCirculo(getIdCirculo());

				lcdrc_tmp         = new ArrayList<DataReproduccionConstancia>();
				lcap_colFinal     = new ArrayList<AnotacionPredioDireccion>();

				ld_documento = new DocumentoConstancia();
				ld_documento.setIdTipoOficina(getIdTipoOficina());
				ld_documento.setIdOficinaOrigen(getIdOficinaOrigen());
				ld_documento.setNumero(ld_docTemp.getNumero());
				ld_documento.setIdTipoDocumento(ld_docTemp.getIdTipoDocumento());
				ld_documento.setFechaDocumento(ld_docTemp.getFechaDocumento());

				{
					DataReproduccionConstancia      lsrc_datarepCons;
					Collection<DocumentoConstancia> lcd_documentos;

					lsrc_datarepCons     = new DataReproduccionConstancia();

					lcd_documentos = irr_registroRemote.findDocumentosConstancia(ld_documento, getUserId());

					if(CollectionUtils.isValidCollection(lcd_documentos))
					{
						setSinConstanciaReproduccion(false);

						for(DocumentoConstancia ldc_iterador : lcd_documentos)
						{
							if(ldc_iterador != null)
							{
								lcap_colAnotPred = irr_registroRemote.findAnotacionPredioByRadicacion(
									    lap_anotacionPredio, getUserId(), ldc_iterador
									);

								AnotacionPredioDireccion lapd_temp;
								String                   ls_anotaciones;

								lapd_temp          = null;
								ls_anotaciones     = null;

								if(lcap_colAnotPred != null)
								{
									for(AnotacionPredioDireccion lap_iterador : lcap_colAnotPred)
									{
										if(lap_iterador != null)
										{
											DireccionPredio ldp_direccionPredio;
											String          ls_idAnotacion;

											ldp_direccionPredio     = new DireccionPredio();
											ls_idAnotacion          = StringUtils.getString(
												    lap_iterador.getIdAnotacion()
												);

											ldp_direccionPredio.setIdCirculo(lap_iterador.getIdCirculo());
											ldp_direccionPredio.setIdMatricula(
											    NumericUtils.getLongWrapper(lap_iterador.getIdMatricula())
											);

											ldp_direccionPredio = irr_registroRemote.findDireccionPredioById(
												    ldp_direccionPredio, getUserId()
												);

											if(ldp_direccionPredio != null)
												lap_iterador.setDireccionPredio(ldp_direccionPredio.getDireccion());

											lap_iterador.setSeleccionado(true);

											if(lapd_temp == null)
											{
												lapd_temp          = lap_iterador;
												ls_anotaciones     = StringUtils.getString(lapd_temp.getIdAnotacion());
											}
											else if(
											    lapd_temp.getIdCirculo().equalsIgnoreCase(lap_iterador.getIdCirculo())
											)
											{
												if(lapd_temp.getIdMatricula() == lap_iterador.getIdMatricula())
													ls_anotaciones = ls_anotaciones + "-" + ls_idAnotacion;
												else if(!(lapd_temp.getIdMatricula() == lap_iterador.getIdMatricula()))
												{
													lapd_temp.setAnotaciones(ls_anotaciones);
													lcap_colFinal.add(lapd_temp);
													ls_anotaciones     = ls_idAnotacion;
													lapd_temp          = lap_iterador;
												}
											}
											else if(
											    !lapd_temp.getIdCirculo().equalsIgnoreCase(lap_iterador.getIdCirculo())
											)
											{
												lapd_temp.setAnotaciones(ls_anotaciones);
												lcap_colFinal.add(lapd_temp);
												ls_anotaciones     = ls_idAnotacion;
												lapd_temp          = lap_iterador;
											}
											else if(lapd_temp.getIdDocumento().equals(lap_iterador.getIdDocumento()))
												ls_anotaciones = ls_anotaciones + "-" + ls_idAnotacion;
											else if(!lapd_temp.getIdDocumento().equals(lap_iterador.getIdDocumento()))
											{
												lapd_temp.setAnotaciones(ls_anotaciones);
												lcap_colFinal.add(lapd_temp);
												ls_anotaciones     = ls_idAnotacion;
												lapd_temp          = lap_iterador;
											}
										}
									}
								}

								if(lapd_temp != null)
								{
									lapd_temp.setAnotaciones(ls_anotaciones);
									lcap_colFinal.add(lapd_temp);
									ls_anotaciones     = null;
									lapd_temp          = null;
								}

								{
									Solicitud ls_solicitud;
									ls_solicitud = getSolicitud();

									if(ls_solicitud != null)
									{
										String ls_tipoConstanciaReproduccion;
										ls_tipoConstanciaReproduccion = ls_solicitud.getReproduccionTestamento();

										if(StringUtils.isValidString(ls_tipoConstanciaReproduccion))
										{
											if(ls_tipoConstanciaReproduccion.equals("S"))
											{
												Testamento lt_testamento;
												lt_testamento = irr_registroRemote.findTestamentoByDocumento(
													    ldc_iterador, getUserId(), getLocalIpAddress(),
													    getRemoteIpAddress()
													);

												if(lt_testamento != null)
												{
													ls_solicitud.setIdTestamento(lt_testamento.getIdTestamento());
													lapd_temp = new AnotacionPredioDireccion();
													lapd_temp.setTestamento(lt_testamento);
													lapd_temp.setSeleccionado(true);
													lapd_temp.setRadicacion(lt_testamento.getIdTurno());
													lapd_temp.setIdCirculo(lt_testamento.getIdCirculo());
													lcap_colFinal.add(lapd_temp);
													irr_registroRemote.updateSolicitud(ls_solicitud, getUserId());
												}
											}
										}
									}
								}

								lsrc_datarepCons.setDocumento(ldc_iterador);
								lsrc_datarepCons.setAnotacionPredioDireccion(lcap_colFinal);
							}
						}
					}
					else
					{
						setDataReproduccionConstancia(null);
						setSinConstanciaReproduccion(true);
						setDialogoConstanciaRepro(false);
						throw new B2BException(ErrorKeys.ERROR_NO_SE_ENCONTRARON_REGISTROS_CONTINUE);
					}

					if(!CollectionUtils.isValidCollection(lcap_colFinal))
						lb_indMessage = true;

					lcdrc_tmp.add(lsrc_datarepCons);

					setDataReproduccionConstancia(lcdrc_tmp);
					setRenderedGuardarInfoConstancia(true);
					setSinConstanciaReproduccionTurno(false);

					setIdTurno(null);

					if(lb_indMessage)
						ls_message = MessagesKeys.CONSULTA_EXITOSA_SIN_MATRICULAS;

					addMessage(ls_message);
					PrimeFaces.current().ajax().update(is_messageIdGrowl);
				}
			}
			catch(B2BException lb2be_e)
			{
				clh_LOGGER.error(lb2be_e);
				addMessage(lb2be_e);
				PrimeFaces.current().ajax().update(is_messageIdGrowl);
				setIdTurno(null);
			}

			{
				Ajax la_ajax;

				la_ajax = PrimeFaces.current().ajax();

				la_ajax.update("fRegistro:idItTurnRadicacion");
				la_ajax.update("fRegistro:idSOMCirculoRegistralAntSistemaConstanciaIdTurno");
				la_ajax.update("fRegistro:idSOMCirculoRegistralAntSistemaConstancia");
				la_ajax.update("fRegistro:idSOMEscritura");
				la_ajax.update("fRegistro:idItDocuActo");
				la_ajax.update("fRegistro:idSOMEscritura");
				la_ajax.update("fRegistro:idCalFechaDoc");
				la_ajax.update("fRegistro:idSOMTipoOficina");
				la_ajax.update("fRegistro:idSOMTipoEntidad");
				la_ajax.update("fRegistro:idEntidadExenta");
				la_ajax.update("fRegistro:idPaisDocumento");
				la_ajax.update("fRegistro:idSOMDepartamento");
				la_ajax.update("fRegistro:idSOMMunicipio");
				la_ajax.update("fRegistro:idSOMOficinaOrigen");
				la_ajax.update("fRegistro:idDtListadoDocumentos");
				la_ajax.update("fRegistro:cbTerminarConstanciaRep");
				la_ajax.update("fRegistro:cbGuardarConstanciaRep");
				la_ajax.update("fRegistro:opPanelTerminarProcesoConstanciaRep");
			}
		}
	}

	/**
	 * Método que consulta la bandeja de reproducción de constancia cuando se
	 * consulta por Turno.
	 */
	public void buscarRepConstanciaTurno()
	{
		try
		{
			boolean lb_focus;
			String  ls_idTurnoRepConstancia;
			String  ls_circuloIdTurno;
			ls_circuloIdTurno     = getCirculoIdTurno();

			lb_focus                    = true;
			ls_idTurnoRepConstancia     = getIdTurno();

			FacesContext lfc_context;
			lfc_context                 = FacesContext.getCurrentInstance();

			{
				lb_focus     = validateStyles(
					    ":fRegistro:idItTurnRadicacion", lfc_context, ls_idTurnoRepConstancia, lb_focus
					);

				ls_circuloIdTurno     = getCirculoIdTurno();
				lb_focus              = validateStyles(
					    ":fRegistro:idSOMCirculoRegistralAntSistemaConstanciaIdTurno", lfc_context, ls_circuloIdTurno,
					    lb_focus
					);
			}

			if(StringUtils.isValidString(ls_idTurnoRepConstancia))
			{
				if(StringUtils.isValidString(ls_circuloIdTurno))
				{
					Collection<DataReproduccionConstancia> lcdrc_cllDataReproduccionConstancia;
					AnotacionPredioDireccion               lap_anotacionPredio;

					lap_anotacionPredio = new AnotacionPredioDireccion();

					lap_anotacionPredio.setRadicacion(ls_idTurnoRepConstancia);
					lap_anotacionPredio.setIdCirculo(ls_circuloIdTurno);

					lcdrc_cllDataReproduccionConstancia = irr_registroRemote.findAnotacionPredioByRadicacion(
						    lap_anotacionPredio, getUserId()
						);

					if(CollectionUtils.isValidCollection(lcdrc_cllDataReproduccionConstancia))
					{
						for(DataReproduccionConstancia ldrpc_tmp : lcdrc_cllDataReproduccionConstancia)
						{
							if(ldrpc_tmp != null)
							{
								Collection<AnotacionPredioDireccion> lcapd_anotacionPredDirecc;

								lcapd_anotacionPredDirecc = ldrpc_tmp.getAnotacionPredioDireccion();

								if(CollectionUtils.isValidCollection(lcapd_anotacionPredDirecc))
								{
									for(AnotacionPredioDireccion lapd_object : lcapd_anotacionPredDirecc)
									{
										if(lapd_object != null)
										{
											cambiarBooleanoRepConstancia(lapd_object);

											Testamento lt_testamento;
											lt_testamento = lapd_object.getTestamento();

											if(lt_testamento != null)
											{
												Solicitud ls_solicitud;
												ls_solicitud = getSolicitud();
												ls_solicitud.setIdTestamento(lt_testamento.getIdTestamento());
												irr_registroRemote.updateSolicitud(ls_solicitud, getUserId());
											}
										}
									}
								}
							}
						}

						setDataReproduccionConstancia(lcdrc_cllDataReproduccionConstancia);
						setRenderedGuardarInfoConstancia(true);
					}
					else
					{
						setDataReproduccionConstancia(null);
						setSinConstanciaReproduccionTurno(true);
						setDialogoConstanciaRepro(false);

						throw new B2BException(ErrorKeys.DEBE_REVISAR_DATOS_TURNO);
					}

					setConsultaPorTurnoRepConstancia(true);
					addMessage(MessagesKeys.CONSULTA_EXITOSA);
					PrimeFaces.current().ajax().update(is_messageIdGrowl);
					setBgnDocumento(null);
					setIdCirculo(null);
				}
				else
				{
					setDataReproduccionConstancia(null);
					throw new B2BException(ErrorKeys.DEBE_SELECCIONAR_CIRCULO_REGISTRAL_CONSTANCIA);
				}
			}
			else
			{
				setDataReproduccionConstancia(null);
				throw new B2BException(ErrorKeys.DEBE_REVISAR_DATOS_TURNO);
			}

			{
				setSinConstanciaReproduccion(false);
			}
		}
		catch(B2BException lb2be_e)
		{
			if(
			    StringUtils.getStringNotNull(lb2be_e.getMessageKey())
				               .equalsIgnoreCase("errorSinReproduccionConstanciaTurno")
				    || StringUtils.getStringNotNull(lb2be_e.getMessageKey())
				                      .equalsIgnoreCase("errorCirculoRegistralNoCoincideConElTurno")
			)
			{
				boolean lb_bool;
				lb_bool = true;

				FacesContext lfc_context;
				lfc_context     = FacesContext.getCurrentInstance();

				lb_bool = validateStyles(
					    ":fRegistro:idSOMCirculoRegistralAntSistemaConstanciaIdTurno", lfc_context, "", lb_bool
					);
			}

			if(
			    !StringUtils.getStringNotNull(lb2be_e.getMessageKey())
				                .equalsIgnoreCase("errorCirculoRegistralNoCoincideConElTurno")
				    && !StringUtils.getStringNotNull(lb2be_e.getMessageKey())
				                       .equalsIgnoreCase("errorSinCirculoRegistralConstancia")
				    && !StringUtils.getStringNotNull(lb2be_e.getMessageKey())
				                       .equalsIgnoreCase("errorRevisarDatosDelTurno")
			)
				setSinConstanciaReproduccionTurno(true);

			setDialogoConstanciaRepro(false);
			setDataReproduccionConstancia(null);

			clh_LOGGER.error(lb2be_e);
			addMessage(lb2be_e);
			PrimeFaces.current().ajax().update(is_messageIdGrowl);
		}

		{
			Ajax la_ajax;

			la_ajax = PrimeFaces.current().ajax();
			la_ajax.update("fRegistro:idItTurnRadicacion");
			la_ajax.update("fRegistro:idDtListadoDocumentos");
		}
	}

	/**
	 * Método de consulta de los testamentos asignados a una persona.
	 *
	 * @throws B2BException Objeto de tipo B2BException, se produce cuando se encuentra algun error controlado.
	 */
	public void buscarTestamentos()
	    throws B2BException
	{
		try
		{
			Testamento             lt_testamento;
			Solicitud              ls_solicitud;
			Collection<Testamento> lct_testamentos;

			lt_testamento       = getTestamento();
			ls_solicitud        = getSolicitud();
			lct_testamentos     = null;

			if((lt_testamento != null) && (ls_solicitud != null))
				lct_testamentos = irr_registroRemote.consultarTestamentos(
					    lt_testamento, getUserId(), getLocalIpAddress(), getRemoteIpAddress()
					);

			setCTestamento(lct_testamentos);
			setVerPanelConsulta(true);

			PrimeFaces lpf_pf;

			lpf_pf = PrimeFaces.current();

			lpf_pf.ajax().update("fRegistro");

			if(lct_testamentos == null)
				throw new B2BException("Sin testamentos asociados al número");
		}
		catch(B2BException lb2be_e)
		{
			clh_LOGGER.error(lb2be_e);
			throw lb2be_e;
		}
	}

