	/**
	 * Método que se encarga de buscar los turnos de recepción dependiendo de la busqueda por turno o por documentos.
	 *
	 * @param ab_b Parámetro que determina si el método debe buscar por turno (false) o por documento (true)
	 * @param ls_form Parámetro que determina el formulario a actualizar
	 * @throws B2BException Señala que se ha producido una excepción
	 */
	public void busquedaTurnosRecepcion(boolean ab_b, String ls_form)
	    throws B2BException
	{
		Documento    ld_docTemp;
		boolean      lb_focus;
		FacesContext lfc_context;

		lb_focus        = true;
		lfc_context     = FacesContext.getCurrentInstance();
		setComentario(null);

		try
		{
			Solicitud lso_solicitud;

			lso_solicitud = getSolicitud();

			setBusquedaPorDocumentoRecepcionDoc(ab_b);

			if(lso_solicitud != null)
			{
				String ls_proceso;
				String ls_subproceso;

				ls_proceso        = lso_solicitud.getIdProceso();
				ls_subproceso     = lso_solicitud.getIdSubproceso();

				is_datoParaValidar     = ls_proceso;
				lb_focus               = validateStyles(
					    IdentificadoresCommon.DOS_PUNTOS + ls_form + ":idProcesoRecDocumentos", lfc_context,
					    is_datoParaValidar, lb_focus
					);

				if(StringUtils.isValidString(ls_proceso))
				{
					if(ab_b)
					{
						/*VALIDACION DATOS DOCUMENTO*/
						setTurnoRecepcion(null);
						ld_docTemp = getDocumentoRecepcion();

						if(ld_docTemp != null)
						{
							{
								String ls_idTipoDocumento;
								ls_idTipoDocumento     = ld_docTemp.getIdTipoDocumento();

								lb_focus = validateStyles(
									    IdentificadoresCommon.DOS_PUNTOS + ls_form + ":idTipoDocumentoRecepcion",
									    lfc_context, ls_idTipoDocumento, lb_focus
									);

								if(!StringUtils.isValidString(ls_idTipoDocumento))
									throw new B2BException(ErrorKeys.DEBE_SELECCIONAR_TIPO);
							}

							{
								String ls_numero;
								ls_numero     = ld_docTemp.getNumero();

								lb_focus = validateStyles(
									    IdentificadoresCommon.DOS_PUNTOS + ls_form + ":idNumeroDocumentoRecepcion",
									    lfc_context, ls_numero, lb_focus
									);

								if(!StringUtils.isValidString(ls_numero))
									throw new B2BException(ErrorKeys.DOCUMENTO_INVALIDO);
								else
								{
									if(ExpresionRegular.getExpresionRegular().contieneCaracteresEspeciales(ls_numero))
									{
										lb_focus = validateStyles(
											    ":fRegistro:idNumeroDocumentoRecepcion", lfc_context, "", lb_focus
											);
										throw new B2BException(ErrorKeys.ERROR_NUMERO_DOCUMENTO_INVALIDO);
									}
								}
							}

							{
								Date ld_fecha;
								ld_fecha     = ld_docTemp.getFechaDocumento();

								lb_focus = validateStyles(
									    IdentificadoresCommon.DOS_PUNTOS + ls_form + ":idFechaDocumentoRecepcion",
									    lfc_context, ld_fecha, lb_focus
									);

								if(ld_fecha == null)
								{
									Object[] aoa_messageArgs = new String[1];

									aoa_messageArgs[0] = " Documento ";

									throw new B2BException(ErrorKeys.ERROR_CAMPO_FECHA_OBLIGATORIO, aoa_messageArgs);
								}
							}

							ld_docTemp.setIdOficinaOrigen(getIdOficinaOrigen());
						}
					}
					else
					{
						/*VALIDACION NIR O TURNO*/
						String ls_consultaTurnoONir;
						ls_consultaTurnoONir = getConsultaTurnoONir();

						setDocumentoRecepcion(null);
						ld_docTemp = getTurnoRecepcion();

						if(ls_consultaTurnoONir != null)
						{
							if(ld_docTemp != null)
							{
								String ls_idTurnoNIR;
								ls_idTurnoNIR = ld_docTemp.getIdTurnoNir();

								if(
								    !ls_consultaTurnoONir.equalsIgnoreCase(IdentificadoresCommon.NIR)
									    || StringUtils.isValidString(ls_idTurnoNIR)
								)
								{
									if(ls_consultaTurnoONir.equalsIgnoreCase(IdentificadoresCommon.NIR))
									{
										String ls_nir;
										ls_nir     = ld_docTemp.getNirTurno();

										lb_focus     = validateStyles(
											    IdentificadoresCommon.DOS_PUNTOS + ls_form + ":idnirRecepcion",
											    lfc_context, ls_nir, lb_focus
											);
										lb_focus     = validateStyles(
											    IdentificadoresCommon.DOS_PUNTOS + ls_form
											    + ":idITurnoNirGrabacionMatricula", lfc_context, ls_idTurnoNIR, lb_focus
											);

										if(!StringUtils.isValidString(ls_nir))
											throw new B2BException(ErrorKeys.ERROR_NIR_NO_INGRESADO);

										if(!StringUtils.isValidString(ls_idTurnoNIR))
											throw new B2BException(ErrorKeys.DEBE_SELECCIONAR_TURNO_VALIDO);

										ld_docTemp.setIdTurno(ls_idTurnoNIR);
										ld_docTemp.setNir(ls_nir);
									}

									{
										boolean lb_proceso43;

										lb_proceso43 = ls_proceso.equalsIgnoreCase(ProcesoCommon.ID_PROCESO_43);

										{
											String ls_id;

											ls_id = IdentificadoresCommon.DOS_PUNTOS + ls_form
												+ ":idIRadicacionRecepcion";

											if(lb_proceso43)
											{
												String ls_nir;

												ls_nir = ld_docTemp.getNir();

												if(!StringUtils.isValidString(ls_nir))
												{
													String ls_idTurno;

													ls_idTurno = ld_docTemp.getIdTurno();

													if(!StringUtils.isValidString(ls_idTurno))
													{
														lb_focus     = validateStyles(
															    ":fRegistro:idnirRecepcion", lfc_context, ls_nir,
															    lb_focus
															);

														lb_focus = validateStyles(
															    ls_id, lfc_context, ls_idTurno, lb_focus
															);
														throw new B2BException(ErrorKeys.ERROR_NIR_TURNO_INVALIDOS);
													}
												}
												else
												{
													String ls_idTurno;

													ls_idTurno     = ld_docTemp.getIdTurno();

													lb_focus = validateStyles(ls_id, lfc_context, ls_idTurno, lb_focus);

													if(!StringUtils.isValidString(ls_idTurno))
														throw new B2BException(ErrorKeys.ERROR_TURNO_INVALIDO);
												}
											}
											else
											{
												String ls_idTurno;

												ls_idTurno     = ld_docTemp.getIdTurno();

												lb_focus = validateStyles(ls_id, lfc_context, ls_idTurno, lb_focus);

												if(!StringUtils.isValidString(ls_idTurno))
													throw new B2BException(ErrorKeys.ERROR_TURNO_INVALIDO);

												if(ls_proceso.equalsIgnoreCase(ProcesoCommon.ID_PROCESO_48))
												{
													lb_focus = validateStyles(
														    ":fRegistro:idTipoRecurso", lfc_context, ls_subproceso,
														    lb_focus
														);

													if(!StringUtils.isValidString(ls_subproceso))
														throw new B2BException(ErrorKeys.ERROR_TIPO_DE_RECURSO);
												}
											}
										}
									}
								}
								else
								{
									String ls_nir;
									String ls_consultaNirOTurno;

									ls_consultaNirOTurno     = getConsultaTurnoONir();
									ls_nir                   = ld_docTemp.getNir();

									if(StringUtils.isValidString(ls_consultaNirOTurno) && !isEsImpuestoDeRegistro())
									{
										if(ls_consultaNirOTurno.equalsIgnoreCase(IdentificadoresCommon.NIR))
											ls_nir = ld_docTemp.getNirTurno();
									}

									if(isEsImpuestoDeRegistro())
										lb_focus = validateStyles(
											    IdentificadoresCommon.DOS_PUNTOS + ls_form + ":idnirRecepcionImpuesto",
											    lfc_context, ls_nir, lb_focus
											);
									else
										lb_focus = validateStyles(
											    IdentificadoresCommon.DOS_PUNTOS + ls_form + "idnirRecepcion",
											    lfc_context, ls_nir, lb_focus
											);

									if(!StringUtils.isValidString(ls_nir))
										throw new B2BException(ErrorKeys.ERROR_NIR_NO_INGRESADO);

									if(!isEsImpuestoDeRegistro())
									{
										lb_focus = validateStyles(
											    IdentificadoresCommon.DOS_PUNTOS + ls_form
											    + "idITurnoNirGrabacionMatricula", lfc_context, ls_idTurnoNIR, lb_focus
											);

										if(!StringUtils.isValidString(ls_idTurnoNIR))
											throw new B2BException(ErrorKeys.DEBE_SELECCIONAR_TURNO_VALIDO);
									}
								}
							}
						}
						else
							throw new B2BException(ErrorKeys.DEBE_SELECCIONAR__CONSULTA__POR_NIR_O_TURNO);
					}
				}
				else
					throw new B2BException(ErrorKeys.DEBE_SELECCIONAR_TIPO_TRAMITE);

				if(ld_docTemp != null)
				{
					Collection<Turno> lct_ct;

					ld_docTemp.setAccion(ab_b);
					ld_docTemp.setIdProcesoRecepcion(ls_proceso);
					ld_docTemp.setIdSubProcesoRecepcion(ls_subproceso);

					lct_ct = irr_registroRemote.detalleTurnosRecepcion(
						    ld_docTemp, ab_b, getUserId(), getLocalIpAddress(), getRemoteIpAddress()
						);

					if(CollectionUtils.isValidCollection(lct_ct))
					{
						setInfoTurnos(lct_ct);

						String  ls_nir;
						boolean lb_fueraDeSuspension;
						boolean lb_turnoDesistimientoPermuta;
						boolean lb_turnoSinEtapaRecursos;

						ls_nir                           = null;
						lb_fueraDeSuspension             = false;
						lb_turnoDesistimientoPermuta     = false;
						lb_turnoSinEtapaRecursos         = false;

						for(Turno lt_tmp : lct_ct)
						{
							if(lt_tmp != null)
							{
								ls_nir = lt_tmp.getNir();

								if(ls_proceso.equalsIgnoreCase(ProcesoCommon.ID_PROCESO_40) && !ab_b)
								{
									long ls_idEtapa;
									ls_idEtapa = NumericUtils.getLong(lt_tmp.getIdEtapaActual());

									if(
									    (ls_idEtapa != EtapaCommon.ID_ETAPA_ENTREGA_SUSPENSION_DE_TERMINOS)
										    && (ls_idEtapa != EtapaCommon.ID_ETAPA_SUSPENSION_TRAMITE)
										    && (ls_idEtapa != EtapaCommon.ID_ETAPA_PENDIENTE_COMPLETITUD_DOCUMENTAL_CORRECIONES)
										    && (ls_idEtapa != EtapaCommon.ID_ETAPA_SUSPENSION_PRORROGA_PARA_APORTAR_DOCUMENTACION)
										    && (ls_idEtapa != EtapaCommon.PENDIENTE_APORTAR_PRUEBAS_ACTUACION_ADMINISTRATIVA)
										    && (ls_idEtapa != EtapaCommon.SUSPENSION_PRORROGA_PARA_APORTAR_DOCUMENTACION)
										    && (ls_idEtapa != EtapaCommon.ID_ETAPA_PENDIENTE_APORTAR_DOCUMENTACION_TRASLADOS)
										    && (ls_idEtapa != EtapaCommon.SUSPENSION_PRORROGA_PARA_APORTAR_DOCUMENTACION_RECURSOS_SI)
										    && (ls_idEtapa != EtapaCommon.SUSPENSION_PRORROGA_PARA_APORTAR_PRORROGA_SI)
										    && (ls_idEtapa != EtapaCommon.ID_ETAPA_ANALISTA_CERTIFICADOS_ESPECIALES)
										    && (ls_idEtapa != EtapaCommon.ID_ETAPA_APROBACION)
									)
										lb_fueraDeSuspension = true;
									else if(lt_tmp.isTurnoSuspensionConEtapaTER())
										lb_fueraDeSuspension = true;
								}

								if(
								    (ls_proceso.equalsIgnoreCase(ProcesoCommon.ID_PROCESO_47)
									    || ls_proceso.equalsIgnoreCase(ProcesoCommon.ID_PROCESO_48)) && !ab_b
								)
								{
									long ls_idEtapa;

									ls_idEtapa = NumericUtils.getLong(lt_tmp.getIdEtapaActual());

									if(
									    (ls_idEtapa != EtapaCommon.ID_ETAPA_EN_ESPERA_TERMINO_PARA_INTERPONER_RECURSOS)
										    && (ls_idEtapa == EtapaCommon.FINALIZACION_PROCESO_DEVUELTO_AL_PUBLICO_NOTA_DEVOLUTIVA)
									)
										lb_turnoSinEtapaRecursos = true;
								}

								if(ls_proceso.equalsIgnoreCase(ProcesoCommon.ID_PROCESO_39) && !ab_b)
								{
									if(lt_tmp.isTurnoTipoActoPermuta())
										lb_turnoDesistimientoPermuta = true;
								}
							}
						}

						getTurnoRecepcion().setNir(ls_nir);
						setNirImpuestoRegistro(ls_nir);

						if(ls_proceso.equalsIgnoreCase(ProcesoCommon.ID_PROCESO_45))
							addMessage(MessagesKeys.TURNOS_RECEPCION);

						if(lb_fueraDeSuspension)
							addMessage(MessagesKeys.TURNO_SELECCIONADO_SE_ENCUENTRA_ETAPA_FINAL);
						else if(lb_turnoDesistimientoPermuta)
							addMessage(MessagesKeys.EXISTEN_OTROS_TURNOS_TRAMITE_DESISTIMIENTO);
						else if(ls_proceso.equalsIgnoreCase(ProcesoCommon.ID_PROCESO_40))
							addMessage(MessagesKeys.EL_TURNO_SE_ENCUENTRA_EN_ETAPAS_VALIDAS_ENTREGA_DOC);
						else if(lb_turnoSinEtapaRecursos)
						{
							Object[] loa_object;

							loa_object     = new String[1];

							loa_object[0] = ld_docTemp.getIdTurno();

							addMessage(MessagesKeys.TURNO_SE_ENCUENTRA_EN_TERMINO_VENCIDO_RECURSO, loa_object);
						}
						else
							addMessage(MessagesKeys.CONSULTA_EXITOSA_4);

						PrimeFaces.current().ajax().update(is_messageIdGrowl);

						setConsultaRecepcionValida(true);

						PrimeFaces lpf_current;
						lpf_current = PrimeFaces.current();

						if(ab_b)
							lpf_current.executeScript("PF('panelConsulta').collapse();");
						else
							lpf_current.executeScript("PF('panelConsultaDocumento').collapse();");
					}
					else
					{
						setConsultaRecepcionValida(false);
						throw new B2BException(ErrorKeys.NO_SE_ENCONTRARON_REGISTROS);
					}
				}
			}
		}
		catch(B2BException lb2be_e)
		{
			clh_LOGGER.error(lb2be_e);
			setInfoTurnos(null);
			setNirImpuestoRegistro(null);
			addMessage(lb2be_e);
			PrimeFaces.current().ajax().update(is_idForm);
		}
	}

	/**
	 * Calcular fecha.
	 *
	 * @throws B2BException Señala que se ha producido una excepción
	 */
	public void calcularFecha()
	    throws B2BException
	{
		com.bachue.snr.prosnr01.model.registro.Acto ia_acto;
		Documento                                   ld_documento;

		ld_documento     = getBgnDocumento();
		ia_acto          = getActo();

		if(ia_acto != null)
		{
			if(
			    StringUtils.getStringNotNull(ia_acto.getEjecutora()).equalsIgnoreCase(EstadoCommon.S)
				    && !NumericUtils.isValidLong(ia_acto.getTiempo())
			)
				throw new B2BException(
				    "No existe tiempo de vencimiento para el Acto, no  se puede calcular la fecha de vencimiento"
				);

			if(NumericUtils.isValidLong(ia_acto.getTiempo()) && (ld_documento.getFechaEjecutoria() != null))
			{
				Calendar calendar = Calendar.getInstance();
				calendar.setTime(ld_documento.getFechaEjecutoria());
				calendar.add(Calendar.DAY_OF_YEAR, ia_acto.getTiempo().intValue());
				ia_acto.setFechaVencimiento(calendar.getTime());
			}
		}
	}

