	/**
	 * Actualiza los campos del panel de datos del acto según el código que se haya
	 * seleccionado.
	 *
	 * @param ab_cambiarEspecificacion correspondiente al valor del tipo de objeto boolean
	 * @param ab_mayorValor Argumento de tipo <code>boolean</code> que determina si la funcionalidad es invocada desde mayor valor.
	 * @param ab_limpiarPreguntaPagoImpuesto Argumento de tipo <code>boolean</code> que determina si se debe limpiar variable PreguntaPagoImpuestoRegistroGobernaciones.
	 */
	public void cambiarEspecifica(
	    boolean ab_cambiarEspecificacion, boolean ab_mayorValor, boolean ab_limpiarPreguntaPagoImpuesto
	)
	{
		com.bachue.snr.prosnr01.model.registro.Acto la_tmp;
		boolean                                     lb_validCantidadMatriculas;
		boolean                                     lb_validMatriculasIncrl;

		la_tmp                         = getActo();
		lb_validCantidadMatriculas     = false;
		lb_validMatriculasIncrl        = false;

		if(ab_limpiarPreguntaPagoImpuesto)
			setPreguntaPagoImpuestoRegistroGobernaciones(null);

		setDeshabilitarCantidadMatriculas(false);
		setMostrarCantidadActos(false);
		setEsActoImpuestoRegistro(false);
		setReciboPagoExtemporaneo(false);
		setReciboPagoRegistro(false);
		setPreguntaLey1943(false);
		setCuotaparteDonacion(false);
		setPrestacionesPeriodicas(false);

		try
		{
			if(la_tmp != null)
			{
				String ls_codigoAct;

				if(ab_cambiarEspecificacion)
					ls_codigoAct = StringUtils.getString(la_tmp.getCodigo());
				else
					ls_codigoAct = StringUtils.getString(la_tmp.getEspecificacion());

				if(StringUtils.isValidString(ls_codigoAct))
				{
					if(ls_codigoAct.equalsIgnoreCase("-1"))
						setActo(null);
					else
					{
						Map<String, TipoActo> lhmsta_tiposActo;

						lhmsta_tiposActo = getAllTiposActo();

						if(CollectionUtils.isValidCollection(lhmsta_tiposActo))
						{
							if(lhmsta_tiposActo.containsKey(ls_codigoAct))
							{
								TipoActo lo_ta;

								lo_ta = lhmsta_tiposActo.get(ls_codigoAct);

								if(lo_ta != null)
								{
									boolean            lb_naturaleza;
									NaturalezaJuridica lnj_naturalezaJuridica;
									String             ls_grupoNaturalezaJuridica;

									lb_naturaleza                  = false;
									lnj_naturalezaJuridica         = irr_referenceRemote.findNaturalezaJuridicaById(
										    ls_codigoAct
										);
									ls_grupoNaturalezaJuridica     = null;

									if(lnj_naturalezaJuridica != null)
									{
										ls_grupoNaturalezaJuridica     = lnj_naturalezaJuridica.getIdGrupoNatJur();
										lb_naturaleza                  = StringUtils.isValidString(
											    ls_grupoNaturalezaJuridica
											);
									}

									setCuotaparteDonacion(lo_ta.isCuotaparteDonacion());
									setRenderCuotaParteDonacionAreas(
									    BooleanUtils.getBooleanValue(lo_ta.getCuotaparteDonacionString())
									);

									{
										boolean lb_periodicidadCuantia;

										lb_periodicidadCuantia = BooleanUtils.getBooleanValue(
											    lo_ta.getPrestacionesPeriodicasString()
											);

										setPrestacionesPeriodicas(lb_periodicidadCuantia);

										if(lb_periodicidadCuantia)
										{
											Constantes lc_constante;

											lc_constante = irr_referenceRemote.findConstantesById(
												    ConstanteCommon.PERIODICIDAD_CUANTIA
												);

											if(lc_constante != null)
												la_tmp.setDatosPeriodicidadCuantia(
												    ListadoCodigosConstantes.generarCodigosCollection(
												        lc_constante.getCaracter()
												    )
												);
										}
									}

									{
										Documento ld_documento;

										ld_documento = getBgnDocumento();

										if(ld_documento != null)
										{
											String ls_idDocumento;

											ls_idDocumento = ld_documento.getIdTipoDocumento();

											if(
											    StringUtils.isValidString(ls_idDocumento)
												    && ls_idDocumento.equalsIgnoreCase(
												        TipoDocumentoPublicoCommon.ESCRITURA
												    )
											)
											{
												String ls_actoSinCuantia;

												ls_actoSinCuantia = lo_ta.getActoSinCuantia();

												if(
												    StringUtils.isValidString(ls_actoSinCuantia)
													    && ls_actoSinCuantia.equalsIgnoreCase(EstadoCommon.N)
													    && StringUtils.isValidString(ls_grupoNaturalezaJuridica)
												)
												{
													Constantes lc_constante;

													lc_constante = irr_referenceRemote.findConstantesById(
														    ConstanteCommon.GRUPO_NATURALEZA_JURIDICA_LEY1943
														);

													if(lc_constante != null)
													{
														String ls_caracter;

														ls_caracter = lc_constante.getCaracter();

														if(
														    StringUtils.isValidString(ls_caracter)
															    && ls_caracter.contains(ls_grupoNaturalezaJuridica)
														)
														{
															la_tmp.setPregunta1943(lc_constante.getTexto());
															setPreguntaLey1943(true);
														}
													}
												}
											}
										}
									}

									if(!ab_cambiarEspecificacion)
										la_tmp.setCodigo(lo_ta.getIdTipoActo());

									la_tmp.setEspecificacion(lo_ta.getIdTipoActo());

									String ls_actoCuantia;
									ls_actoCuantia = StringUtils.getStringNotNull(lo_ta.getActoSinCuantia());

									if(ls_actoCuantia.equalsIgnoreCase(EstadoCommon.N))
										ls_actoCuantia = IdentificadoresCommon.CON_CUANTIA;
									else
										ls_actoCuantia = IdentificadoresCommon.SIN_CUANTIA;

									la_tmp.setActoConCuantia(ls_actoCuantia);
									la_tmp.setTipoTarifa(lo_ta.getIdTipoCalculo());
									la_tmp.setRequiereTipoAdquisicion(lo_ta.getRequiereTipoAdquisicion());
									la_tmp.setAvaluo(lo_ta.getAvaluo());

									if(ls_codigoAct.equalsIgnoreCase("0331") || ls_codigoAct.equalsIgnoreCase("0347"))
									{
										PrimeFaces.current().executeScript("PF('actosSegregacion').show();");
										PrimeFaces.current().ajax().update("idDActosSegregacion");
									}

									if(
									    ls_codigoAct.equalsIgnoreCase("99") || ls_codigoAct.equalsIgnoreCase("64")
										    || ls_codigoAct.equalsIgnoreCase("12")
										    || ls_codigoAct.equalsIgnoreCase("19")
									)
										la_tmp.setCantidadActos(new Integer(1));

									setActo0315(ls_codigoAct.equalsIgnoreCase(getActoCabezaFamiliar()));

									if(ls_codigoAct.equalsIgnoreCase("0126"))
									{
										setAreaUI(null);
										setProcesoVentaParcial(true);
										setDeshabilitarCantidadMatriculas(true);
										la_tmp.setCantidadMatriculas(new Integer(1));
									}
									else
										setProcesoVentaParcial(false);

									if(
									    StringUtils.getStringNotNull(lo_ta.getImpuestoRegistro())
										               .equalsIgnoreCase(EstadoCommon.S)
									)
									{
										Solicitud los_tmp;

										los_tmp = irr_registroRemote.recibosImpuesto(
											    getSolicitud(), getUserId(), getLocalIpAddress(), getRemoteIpAddress()
											);

										if(los_tmp != null)
										{
											boolean lb_tmp;
											lb_tmp = los_tmp.isReciboImpuestos();

											if(lb_tmp)
											{
												setReciboPagoExtemporaneo(lb_tmp);
												la_tmp.setImpuestoRegistroExtShow(lb_tmp);
											}

											setReciboPagoRegistro(true);
											la_tmp.setImpuestoRegistroShow(true);
											setEsActoImpuestoRegistro(true);
										}
									}

									if(
									    StringUtils.getStringNotNull(la_tmp.getEjecutora())
										               .equalsIgnoreCase(EstadoCommon.S)
									)
										la_tmp.setActivaFechaEjecutoria(false);
									else
										la_tmp.setActivaFechaEjecutoria(true);

									if(
									    StringUtils.getStringNotNull(lo_ta.getActoSinCuantia())
										               .equalsIgnoreCase(EstadoCommon.S)
									)
										setMostrarCantidadActos(false);
									else
										setMostrarCantidadActos(true);

									{
										Constantes lc_constante;

										lc_constante = irr_referenceRemote.findConstantesById(
											    ConstanteCommon.GRUPO_NATURALEZA_JURIDICA_CANCELACION
											);

										if(lc_constante != null)
										{
											String ls_caracter;

											ls_caracter = lc_constante.getCaracter();

											if(
											    StringUtils.isValidString(ls_caracter) && lb_naturaleza
												    && ls_grupoNaturalezaJuridica.equalsIgnoreCase(ls_caracter)
											)
												setMostrarCantidadActos(false);
										}
									}

									if(
									    StringUtils.getStringNotNull(lo_ta.getRequiereCuantia())
										               .equalsIgnoreCase(EstadoCommon.S)
									)
										setHabilitarCuantiaActo(false);
									else
										setHabilitarCuantiaActo(true);

									if(
									    StringUtils.getStringNotNull(la_tmp.getAvaluo()).equalsIgnoreCase(
										        EstadoCommon.S
										    )
									)
										setHabilitarAvaluo(true);
									else
										setHabilitarAvaluo(false);

									{
										boolean lb_requiereTipoAdquisicion;

										lb_requiereTipoAdquisicion = StringUtils.getStringNotNull(
											    la_tmp.getRequiereTipoAdquisicion()
											).equalsIgnoreCase(EstadoCommon.S);

										setMostrarTipoAdquisicion(!lb_requiereTipoAdquisicion);

										if(!ab_mayorValor)
											la_tmp.setTipoAdquisicion(
											    lb_requiereTipoAdquisicion ? null : TipoAdquisicionCommon.NORMAL
											);
									}

									la_tmp.setAvaluo(lo_ta.getAvaluo());

									if(
									    StringUtils.getStringNotNull(lo_ta.getAperturaMatricula())
										               .equalsIgnoreCase(EstadoCommon.S)
									)
										lb_validCantidadMatriculas = true;

									if(
									    StringUtils.getStringNotNull(lo_ta.getInscripcionAdicional())
										               .equalsIgnoreCase(EstadoCommon.S)
									)
									{
										lb_validMatriculasIncrl = true;

										setValidacion700(
										    irr_registroRemote.perteneceActoCancelacion(
										        lo_ta.getIdTipoActo(), getUserId(), getLocalIpAddress(),
										        getRemoteIpAddress()
										    )
										);

										if(isValidacion700())
											la_tmp.setCantidadActos(NumericUtils.getInteger(1));
									}

									setActoNaturaleza400(
									    irr_registroRemote.perteneceActoMedidaCautelar(
									        lo_ta.getIdTipoActo(), getUserId(), getLocalIpAddress(),
									        getRemoteIpAddress()
									    )
									);

									Constantes lc_constanteDivMat;
									lc_constanteDivMat = irr_referenceRemote.findConstantesById(
										    ConstanteCommon.ACTOS_DIVISION_MATERIAL
										);

									if(lc_constanteDivMat != null)
									{
										String              ls_idDivisionMaterial;
										Map<String, String> lmss_caracter;

										ls_idDivisionMaterial     = lc_constanteDivMat.getCaracter();
										lmss_caracter             = ListadoCodigosConstantes.generarCodigos(
											    ls_idDivisionMaterial
											);

										if(lmss_caracter == null)
											throw new B2BException(ErrorKeys.ERROR_INTERNO_SISTEMA);

										if(lmss_caracter.containsKey(ls_codigoAct))
										{
											la_tmp.setCantidadActos(NumericUtils.getInteger(1));

											setDivisionMaterial(true);
										}
									}

									{
										Constantes              lc_constante;
										HashMap<String, String> lhmss_codigos;

										lc_constante      = new Constantes();
										lhmss_codigos     = new HashMap<String, String>();

										lc_constante.setIdConstante(ConstanteCommon.CODIGOS_ACTOS_ENGLOBES);

										lc_constante = ipr_parameterRemote.findConstantById(lc_constante);

										if(lc_constante != null)
										{
											String ls_caracter;

											ls_caracter = lc_constante.getCaracter();

											if(StringUtils.isValidString(ls_caracter))
											{
												String[] lsa_codigos;

												lsa_codigos = ls_caracter.split(",");

												if(CollectionUtils.isValidCollection(lsa_codigos))
												{
													for(String ls_iterador : lsa_codigos)
													{
														if(StringUtils.isValidString(ls_iterador))
															lhmss_codigos.put(ls_iterador, ls_iterador);
													}
												}
											}
										}

										lc_constante = new Constantes();

										lc_constante.setIdConstante(ConstanteCommon.CODIGOS_ACTOS_DESENGLOBES);

										lc_constante = ipr_parameterRemote.findConstantById(lc_constante);

										if(lc_constante != null)
										{
											String ls_caracter;

											ls_caracter = lc_constante.getCaracter();

											if(StringUtils.isValidString(ls_caracter))
											{
												String[] lsa_codigos;

												lsa_codigos = ls_caracter.split(",");

												if(CollectionUtils.isValidCollection(lsa_codigos))
												{
													for(String ls_iterador : lsa_codigos)
													{
														if(StringUtils.isValidString(ls_iterador))
															lhmss_codigos.put(ls_iterador, ls_iterador);
													}
												}
											}
										}

										lc_constante = new Constantes();

										lc_constante.setIdConstante(ConstanteCommon.CODIGOS_ACTOS_VENTA_PARCIAL);

										lc_constante = ipr_parameterRemote.findConstantById(lc_constante);

										if(lc_constante != null)
										{
											String ls_caracter;

											ls_caracter = lc_constante.getCaracter();

											if(StringUtils.isValidString(ls_caracter))
											{
												String[] lsa_codigos;

												lsa_codigos = ls_caracter.split(",");

												if(CollectionUtils.isValidCollection(lsa_codigos))
												{
													for(String ls_iterador : lsa_codigos)
													{
														if(StringUtils.isValidString(ls_iterador))
															lhmss_codigos.put(ls_iterador, ls_iterador);
													}
												}
											}
										}

										if(lhmss_codigos.containsKey(ls_codigoAct))
										{
											la_tmp.setCantidadMatriculas(NumericUtils.getInteger(1));
											la_tmp.setCantidadMatriculasInclr(NumericUtils.getInteger(1));
											la_tmp.setCantidadActos(NumericUtils.getInteger(1));
											setMostrarCantidadActos(true);
											setDeshabilitarCantidadMatriculas(true);
										}
									}

									la_tmp.setValidCantidadMatriculas(lb_validCantidadMatriculas);
									la_tmp.setValidMatriculasIncrl(lb_validMatriculasIncrl);

									setActo(la_tmp);
								}

								com.bachue.snr.prosnr01.model.registro.Acto la_acto;

								la_acto = getActo();

								if((la_acto != null) && !isEsCambioTipoCuantia())
								{
									String ls_codigoActo;

									ls_codigoActo = StringUtils.getStringNotNull(la_acto.getCodigo());

									if(StringUtils.isValidString(ls_codigoActo))
									{
										TipoActo lta_tipoActo;

										lta_tipoActo = new TipoActo();

										lta_tipoActo.setIdTipoActo(ls_codigoActo);

										lta_tipoActo = irr_registroRemote.findTipoActoById(lta_tipoActo);

										if(lta_tipoActo != null)
										{
											String ls_cambioTipoCuantia;

											ls_cambioTipoCuantia = StringUtils.getStringNotNull(
												    lta_tipoActo.getCambioTipoCuantia()
												);

											if(ls_cambioTipoCuantia.equalsIgnoreCase(EstadoCommon.S))
											{
												String ls_actoSinCuantia;

												ls_actoSinCuantia = StringUtils.getStringNotNull(
													    lta_tipoActo.getActoSinCuantia()
													);

												{
													String ls_script;

													ls_script = null;

													if(ls_actoSinCuantia.equalsIgnoreCase(EstadoCommon.S))
														ls_script = "PF('dlgInclCuantia').show();";
													else if(ls_actoSinCuantia.equalsIgnoreCase(EstadoCommon.N))
														ls_script = "PF('dlgNoInclCuantia').show();";

													if(StringUtils.isValidString(ls_script))
														PrimeFaces.current().executeScript(ls_script);
												}
											}
										}
									}
								}

								{
									boolean lb_habilitarEjecutoria;

									lb_habilitarEjecutoria = irr_registroRemote.consultaEnTabla(ls_codigoAct);

									setHabilitarFechaAudiencia(lb_habilitarEjecutoria);
									setFechaEjecutoriaVisible(lb_habilitarEjecutoria);

									if(lb_habilitarEjecutoria)
									{
										setEsActoConEjecutoria(true);
										setHabilitarFechaAudiencia(true);
									}
								}
							}
						}
					}
				}
			}

			PrimeFaces.current().ajax().update(is_idForm);
		}
		catch(B2BException lb2be_e)
		{
			clh_LOGGER.error("cambiarEspecifica", lb2be_e);
			addMessage(lb2be_e);
			PrimeFaces.current().ajax().update(is_messageIdGrowl);
		}
	}

	/**
	 * Cambiar especificacion.
	 *
	 * @param ab_cambiarEspecificacion correspondiente al valor del tipo de objeto boolean
	 */
	public void cambiarEspecificacion(boolean ab_cambiarEspecificacion)
	{
		boolean      lb_focus;
		FacesContext lfc_context;
		lb_focus        = true;
		lfc_context     = FacesContext.getCurrentInstance();

		lb_focus     = validateStyles(
			    ":fRegistro:idItCuantiaActo", lfc_context, IdentificadoresCommon.DATO_VALIDO, lb_focus
			);
		lb_focus     = validateStyles(
			    ":fRegistro:idItValorAvaluo", lfc_context, IdentificadoresCommon.DATO_VALIDO, lb_focus
			);
		lb_focus     = validateStyles(
			    ":fRegistro:idItCantidadActos", lfc_context, IdentificadoresCommon.DATO_VALIDO, lb_focus
			);

		setEsCambioTipoCuantia(false);

		cambiarEspecifica(ab_cambiarEspecificacion);
	}

	/**
	 * Cambia los flags de control de la pantalla para los detalles del predio segun el libro seleccionado.
	 *
	 * @param addp_datosPredio Objeto contenedor de la selección del libro
	 */
	public void cambiarLibro(DatosDelPredio addp_datosPredio)
	{
		try
		{
			if(addp_datosPredio == null)
				throw new B2BException(ErrorKeys.ERROR_INTERNO_SISTEMA);

			DetalleAntSistema ldas_datosAntSis;

			ldas_datosAntSis = addp_datosPredio.getDetalleAntSistema();

			if(ldas_datosAntSis != null)
			{
				String ls_idLibro;

				ls_idLibro = StringUtils.getString(ldas_datosAntSis.getIdLibroAntSistema());

				if(StringUtils.isValidString(ls_idLibro))
				{
					if(ls_idLibro.equals(LibroAntSistemaCommon.LIBRO_PRIMERO))
					{
						addp_datosPredio.setLibroPrimero(true);
						addp_datosPredio.setLibroSegundo(false);
						addp_datosPredio.setLibroMatriculas(false);
					}
					else if(ls_idLibro.equals(LibroAntSistemaCommon.LIBRO_SEGUNDO))
					{
						addp_datosPredio.setLibroPrimero(false);
						addp_datosPredio.setLibroSegundo(true);
						addp_datosPredio.setLibroMatriculas(false);
					}
					else if(ls_idLibro.equals(LibroAntSistemaCommon.LIBRO_DE_MATRICULAS))
					{
						addp_datosPredio.setLibroPrimero(false);
						addp_datosPredio.setLibroSegundo(false);
						addp_datosPredio.setLibroMatriculas(true);
					}
					else
					{
						addp_datosPredio.setLibroPrimero(false);
						addp_datosPredio.setLibroSegundo(false);
						addp_datosPredio.setLibroMatriculas(false);
					}
				}
				else
				{
					addp_datosPredio.setLibroPrimero(false);
					addp_datosPredio.setLibroSegundo(false);
					addp_datosPredio.setLibroMatriculas(false);
				}
			}

			{
				Collection<DatosDelPredio> lcddp_datosPredio;

				lcddp_datosPredio = getDatosDelPredio();

				if(lcddp_datosPredio != null)
				{
					String                   ls_idCirArg;
					int                      li_posicion;
					Iterator<DatosDelPredio> liddp_iterador;
					boolean                  lb_encontro;

					ls_idCirArg        = StringUtils.getStringNotNull(addp_datosPredio.getIdCirculo());
					li_posicion        = 0;
					liddp_iterador     = lcddp_datosPredio.iterator();
					lb_encontro        = false;

					while(liddp_iterador.hasNext() && !lb_encontro)
					{
						DatosDelPredio lddp_data;

						lddp_data = liddp_iterador.next();

						if(lddp_data != null)
						{
							String ls_idCirculo;

							ls_idCirculo = StringUtils.getStringNotNull(lddp_data.getIdCirculo());

							if(ls_idCirculo.equalsIgnoreCase(ls_idCirArg))
								lb_encontro = true;
							else
								li_posicion++;
						}
					}

					Ajax la_ajax;

					la_ajax = PrimeFaces.current().ajax();

					la_ajax.update(is_repeatDatosPredio + li_posicion + is_complementoRepeat + "idSOMAno");
					la_ajax.update(is_repeatDatosPredio + li_posicion + is_complementoRepeat + "idSOMPartida");
					la_ajax.update(is_repeatDatosPredio + li_posicion + is_complementoRepeat + "idOLCirDetAntSis");
					la_ajax.update(
					    is_repeatDatosPredio + li_posicion + is_complementoRepeat
					    + "idSOMCirculoRegistralAntSistemaLibroSegundo"
					);
					la_ajax.update(
					    is_repeatDatosPredio + li_posicion + is_complementoRepeat + "idOLTipoPredioDetAntSis"
					);
					la_ajax.update(
					    is_repeatDatosPredio + li_posicion + is_complementoRepeat
					    + "idSOMTipoPredioAntSistemaLibroSegundo"
					);
					la_ajax.update(
					    is_repeatDatosPredio + li_posicion + is_complementoRepeat + "idOLMatriculaDetAntSis"
					);
					la_ajax.update(
					    is_repeatDatosPredio + li_posicion + is_complementoRepeat + "datosPredioIdMatricula"
					);
				}
			}
		}
		catch(B2BException lb2be_e)
		{
			clh_LOGGER.error("cambiarLibro", lb2be_e);
			addMessage(lb2be_e);
		}
	}

