	/**
	 * Carga en pantalla la información del predio que será modificado.
	 *
	 * @param addp_datosPredio Objeto contenedor de la información general del círculo del predio
	 * @param adas_datosAntSis objeto contenedor de la información del predio
	 */
	public void cargarDatosPredio(DatosDelPredio addp_datosPredio, DatosAntSistema adas_datosAntSis)
	{
		Ajax la_ajax;

		la_ajax = PrimeFaces.current().ajax();

		try
		{
			if((addp_datosPredio == null) || (adas_datosAntSis == null))
				throw new B2BException(ErrorKeys.ERROR_INTERNO_SISTEMA);

			Collection<DatosDelPredio> lcddp_datosPredio;
			int                        li_posicion;

			lcddp_datosPredio     = getDatosDelPredio();
			li_posicion           = 0;

			if(CollectionUtils.isValidCollection(lcddp_datosPredio))
			{
				String                   ls_idCirArg;
				boolean                  lb_encontro;
				Iterator<DatosDelPredio> lddp_iterador;

				ls_idCirArg       = StringUtils.getStringNotNull(addp_datosPredio.getIdCirculo());
				lb_encontro       = false;
				lddp_iterador     = lcddp_datosPredio.iterator();

				while(lddp_iterador.hasNext() && !lb_encontro)
				{
					DatosDelPredio lddp_data;

					lddp_data = lddp_iterador.next();

					if(lddp_data != null)
					{
						String ls_idCirculo;

						ls_idCirculo = StringUtils.getStringNotNull(lddp_data.getIdCirculo());

						if(ls_idCirculo.equals(ls_idCirArg))
							lb_encontro = true;
						else
							li_posicion++;
					}
				}
			}

			addp_datosPredio.setDatosAntiguoSistema(adas_datosAntSis);
			addp_datosPredio.setModificarDatosAntSis(true);

			if(!isProcesoCertificados())
			{
				la_ajax.update(is_repeatDatosPredio + li_posicion + is_complementoRepeat + "idPnPrediosAntiguoSistema");
				la_ajax.update(is_repeatDatosPredio + li_posicion + is_complementoRepeat + "idCBAgregarPredio");
				la_ajax.update(is_repeatDatosPredio + li_posicion + is_complementoRepeat + "idPnPrediosAntiguoSistema");
			}

			addMessage(MessagesKeys.MODIFICAR_DATOS_PREDIO_ANT_SISTEMA);
			la_ajax.update(is_messageIdGrowl);
		}
		catch(B2BException lb2be_e)
		{
			clh_LOGGER.error("cargarDatosPredio", lb2be_e);
			addMessage(lb2be_e);
		}

		la_ajax.update(is_messageIdGrowl);
	}

