	/**
	 * Carga la información de un detalle que va a ser editado.
	 *
	 * @param addp_datosPredio Objeto contenedor de los datos del predio correspondientes al círculo registral
	 * al que pertenece el detalle del predio a modificar
	 * @param adas_detalleAntSis Objeto contenedor de la información del detalle de antiguo sistema que se va a modificar
	 */
	public void cargarDetallesPredio(DatosDelPredio addp_datosPredio, DetalleAntSistema adas_detalleAntSis)
	{
		if((addp_datosPredio != null) && (adas_detalleAntSis != null))
		{
			Ajax la_ajax;

			la_ajax = PrimeFaces.current().ajax();

			try
			{
				String ls_idDetalleAntSistema;
				String ls_idDatosAntPadre;

				ls_idDetalleAntSistema     = StringUtils.getStringNotNull(adas_detalleAntSis.getIdDetalleAntSistema());
				ls_idDatosAntPadre         = StringUtils.getStringNotNull(adas_detalleAntSis.getIdDatosAntSistema());

				Collection<DetalleAntSistema> ldas_detalles;

				ldas_detalles              = addp_datosPredio.getDetallesAntSisAgregados();

				if((ldas_detalles == null))
					throw new B2BException(ErrorKeys.ERROR_INTERNO_SISTEMA);

				for(DetalleAntSistema ldas_temp : ldas_detalles)
				{
					if(ldas_temp != null)
					{
						String ls_idDetalleTemp;
						String ls_idDatosTemp;

						ls_idDetalleTemp     = StringUtils.getStringNotNull(ldas_temp.getIdDetalleAntSistema());
						ls_idDatosTemp       = StringUtils.getStringNotNull(ldas_temp.getIdDatosAntSistema());

						if(ls_idDetalleTemp.equals(ls_idDetalleAntSistema) && ls_idDatosTemp.equals(ls_idDatosAntPadre))
						{
							{
								Documento ld_documento;

								ld_documento = ldas_temp.getDocumento();

								if(ld_documento != null)
								{
									addp_datosPredio.setBgnDocumento(ld_documento);
									addp_datosPredio.setLibroSegundo(true);
								}
								else
									addp_datosPredio.setLibroSegundo(false);
							}

							{
								String ls_idLibro;

								ls_idLibro = StringUtils.getString(ldas_temp.getIdLibroAntSistema());

								if(
								    StringUtils.isValidString(ls_idLibro)
									    && ls_idLibro.equalsIgnoreCase(LibroAntSistemaCommon.LIBRO_DE_MATRICULAS)
								)
									addp_datosPredio.setLibroMatriculas(true);
								else
									addp_datosPredio.setLibroMatriculas(false);
							}

							addp_datosPredio.setDetalleAntSistema(ldas_temp);
							addp_datosPredio.setModificarDetallesAntSis(true);

							break;
						}
					}
				}

				{
					Collection<DatosDelPredio> lcddp_datosPredio;

					lcddp_datosPredio = getDatosDelPredio();

					if(CollectionUtils.isValidCollection(lcddp_datosPredio))
					{
						String ls_idCirArg;
						int    li_posicion;

						ls_idCirArg     = StringUtils.getStringNotNull(addp_datosPredio.getIdCirculo());
						li_posicion     = 0;

						Iterator<DatosDelPredio> liddp_iterador;
						boolean                  lb_found;

						liddp_iterador  = lcddp_datosPredio.iterator();
						lb_found        = false;

						while(liddp_iterador.hasNext() && !lb_found)
						{
							DatosDelPredio lddp_data;

							lddp_data = liddp_iterador.next();

							if(lddp_data != null)
							{
								String ls_idCirTemp;
								ls_idCirTemp = StringUtils.getStringNotNull(lddp_data.getIdCirculo());

								if(ls_idCirArg.equals(ls_idCirTemp))
									lb_found = true;
								else
									li_posicion++;
							}
						}

						la_ajax.update(is_repeatDatosPredio + li_posicion + is_complementoRepeat + "idPnlAdicional");
						la_ajax.update(
						    is_repeatDatosPredio + li_posicion + is_complementoRepeat + "idOPPanelDocumento"
						);
						la_ajax.update(is_repeatDatosPredio + li_posicion + is_complementoRepeat + "idCBAgregarPredio");
						la_ajax.update(
						    is_repeatDatosPredio + li_posicion + is_complementoRepeat + "idPnPrediosAntiguoSistema"
						);
					}
				}

				addMessage(MessagesKeys.MODIFICAR_DETALLES_PREDIO_ANT_SISTEMA);
			}
			catch(B2BException lb2be_e)
			{
				clh_LOGGER.error("cargarDetallesPredio", lb2be_e);
				addMessage(lb2be_e);
			}

			la_ajax.update(is_messageIdGrowl);
		}
	}

	/**
	 * Cargar direccion correspondencia.
	 *
	 * @throws B2BException Objeto de tipo B2BException, se produce cuando se encuentra algun error controlado.
	 */
	public void cargarDireccionCorrespondencia()
	    throws B2BException
	{
		BeanDireccion lbd_beanDireccion;
		String        ls_idDirCorrSeleccion;

		lbd_beanDireccion         = getBeanDireccion();
		ls_idDirCorrSeleccion     = getIdDirCorrSeleccion();

		if(StringUtils.isValidString(ls_idDirCorrSeleccion))
		{
			String[] lsa_tmp;
			lsa_tmp = ls_idDirCorrSeleccion.split("-");

			if(CollectionUtils.isValidCollection(lsa_tmp) && (lsa_tmp.length > 1))
			{
				String ls_idPersonaSeleccionada;
				String ls_idDirCorrSeleccionada;

				ls_idPersonaSeleccionada     = lsa_tmp[0];
				ls_idDirCorrSeleccionada     = lsa_tmp[1];

				if(
				    StringUtils.isValidString(ls_idPersonaSeleccionada)
					    && StringUtils.isValidString(ls_idDirCorrSeleccionada)
				)
				{
					Registro lr_datosCalculados;
					lr_datosCalculados = getRegistroDatosConsultados();

					if(lr_datosCalculados != null)
					{
						Collection<PersonaDireccion> lcp_direcciones;
						lcp_direcciones = lr_datosCalculados.getListadoDireccionCorrespondencia();

						if(CollectionUtils.isValidCollection(lcp_direcciones))
						{
							for(PersonaDireccion lpd_iterador : lcp_direcciones)
							{
								if(lpd_iterador != null)
								{
									String ls_idPersona;
									String ls_idDireccion;

									ls_idPersona       = lpd_iterador.getIdPersona();
									ls_idDireccion     = lpd_iterador.getIdDireccion();

									if(
									    StringUtils.isValidString(ls_idPersona)
										    && StringUtils.isValidString(ls_idDireccion)
									)
									{
										if(
										    ls_idPersonaSeleccionada.equalsIgnoreCase(ls_idPersona)
											    && ls_idDirCorrSeleccionada.equalsIgnoreCase(ls_idDireccion)
										)
										{
											lpd_iterador.setTipoDireccion(EstadoCommon.C);
											lbd_beanDireccion.setDireccionCorrespondencia(lpd_iterador);

											lbd_beanDireccion.setDeshabilitarCorrespondencia(true);
											setDeshabilitarCorrespondencia(true);
										}
									}
								}
							}
						}
					}
				}
			}
		}
		else
		{
			lbd_beanDireccion.setDireccionCorrespondencia(null);
			lbd_beanDireccion.setDeshabilitarCorrespondencia(false);
			setDeshabilitarCorrespondencia(false);
		}
	}

	/**
	 * Cargar direccion correspondencia inter.
	 *
	 * @throws B2BException Objeto de tipo B2BException, se produce cuando se encuentra algun error controlado.
	 */
	public void cargarDireccionCorrespondenciaInter()
	    throws B2BException
	{
		BeanDireccion lbd_beanDireccion;
		String        ls_idDirCorrSeleccion;

		lbd_beanDireccion         = getBeanDireccion();
		ls_idDirCorrSeleccion     = getIdDirCorrSeleccionInter();

		if(StringUtils.isValidString(ls_idDirCorrSeleccion))
		{
			String[] lsa_tmp;
			lsa_tmp = ls_idDirCorrSeleccion.split("-");

			if(CollectionUtils.isValidCollection(lsa_tmp) && (lsa_tmp.length > 1))
			{
				String ls_idPersonaSeleccionada;
				String ls_idDirCorrSeleccionada;

				ls_idPersonaSeleccionada     = lsa_tmp[0];
				ls_idDirCorrSeleccionada     = lsa_tmp[1];

				if(
				    StringUtils.isValidString(ls_idPersonaSeleccionada)
					    && StringUtils.isValidString(ls_idDirCorrSeleccionada)
				)
				{
					Registro lr_datosCalculados;
					lr_datosCalculados = getRegistroDatosConsultadosInter();

					if(lr_datosCalculados != null)
					{
						Collection<PersonaDireccion> lcp_direcciones;
						lcp_direcciones = lr_datosCalculados.getListadoDireccionCorrespondencia();

						if(CollectionUtils.isValidCollection(lcp_direcciones))
						{
							for(PersonaDireccion lpd_iterador : lcp_direcciones)
							{
								if(lpd_iterador != null)
								{
									String ls_idPersona;
									String ls_idDireccion;

									ls_idPersona       = lpd_iterador.getIdPersona();
									ls_idDireccion     = lpd_iterador.getIdDireccion();

									if(
									    StringUtils.isValidString(ls_idPersona)
										    && StringUtils.isValidString(ls_idDireccion)
									)
									{
										if(
										    ls_idPersonaSeleccionada.equalsIgnoreCase(ls_idPersona)
											    && ls_idDirCorrSeleccionada.equalsIgnoreCase(ls_idDireccion)
										)
										{
											lpd_iterador.setTipoDireccion(EstadoCommon.C);
											lbd_beanDireccion.setDireccionCorrespondencia(lpd_iterador);
											lbd_beanDireccion.setDeshabilitarCorrespondencia(true);
											setDeshabilitarCorrespondenciaInter(true);
										}
									}
								}
							}
						}
					}
				}
			}
		}
		else
		{
			lbd_beanDireccion.setDireccionCorrespondencia(null);
			lbd_beanDireccion.setDeshabilitarCorrespondencia(false);
			setDeshabilitarCorrespondenciaInter(false);
		}
	}

	/**
	 * Retorna el valor del objeto de Collection.
	 *
	 * @param as_matricula correspondiente al valor del tipo de objeto String
	 * @param as_nupre correspondiente al valor del tipo de objeto String
	 * @param addp_datosDelPredio correspondiente al valor del tipo de objeto DatosDelPredio
	 * @param apui_predioActoUI de apui predio acto UI
	 * @return devuelve el valor de Collection
	 * @throws B2BException Señala que se ha producido una excepción
	 */
	public Collection<String> cargarDireccionPredio(
	    String as_matricula, String as_nupre, DatosDelPredio addp_datosDelPredio, PredioActoIU apui_predioActoUI
	)
	    throws B2BException
	{
		Collection<String> lcs_return;

		lcs_return = new ArrayList<String>();

		try
		{
			boolean              lb_matricula;
			boolean              lb_nupre;
			Map<String, Boolean> llhm_matriculasCorrecciones;
			String               ls_matriculaInmobiliaria;
			String               ls_message;
			String               ls_nupre;
			PredioRegistro       lpr_predio;

			lb_matricula                    = false;
			lb_nupre                        = false;
			llhm_matriculasCorrecciones     = getMatriculasValidarCorrecciones();
			ls_matriculaInmobiliaria        = as_matricula;
			ls_message                      = "";
			ls_nupre                        = as_nupre;
			lpr_predio                      = new PredioRegistro();

			lb_matricula     = StringUtils.isValidString(ls_matriculaInmobiliaria);
			lb_nupre         = StringUtils.isValidString(ls_nupre);
			setEsMasivoYPredioInconsistente(false);

			if(lb_matricula || lb_nupre)
			{
				if(lb_matricula)
				{
					if(ls_matriculaInmobiliaria.length() > 3)
					{
						int                      li_contarMatriculasIguales;
						Collection<PredioActoIU> lcpaui_tmp;
						Long                     ll_idLibro;

						if(addp_datosDelPredio != null)
						{
							lcpaui_tmp     = addp_datosDelPredio.getActosAsociadosGeneral();
							ll_idLibro     = addp_datosDelPredio.getDetalleAntSistema().getIdLibroAntSistema();
						}
						else
						{
							lcpaui_tmp     = getActosAsociadosGeneral();
							ll_idLibro     = null;
						}

						li_contarMatriculasIguales = 0;

						if(CollectionUtils.isValidCollection(lcpaui_tmp) && !NumericUtils.isValidLong(ll_idLibro, 1))
						{
							Boolean                  lb_booleanTrue;
							HashMap<String, Boolean> lhm_matriculas;

							lb_booleanTrue     = Boolean.TRUE;
							lhm_matriculas     = new HashMap<String, Boolean>();

							for(PredioActoIU lpaiu_iterador : lcpaui_tmp)
							{
								if(lpaiu_iterador != null)
								{
									Long   ll_idMatricula;
									String ls_idCirculo;

									ll_idMatricula     = lpaiu_iterador.getIdMatricula();
									ls_idCirculo       = lpaiu_iterador.getIdCirculo();

									if(
									    StringUtils.isValidString(ls_idCirculo)
										    && NumericUtils.isValidLong(ll_idMatricula)
									)
									{
										String ls_matricula;

										ls_matricula = ls_idCirculo + "-" + ll_idMatricula;

										if(!lhm_matriculas.containsKey(ls_matricula))
											lhm_matriculas.put(ls_matricula, lb_booleanTrue);
										else
										{
											lpaiu_iterador.setIdMatricula(null);
											throw new B2BException(ErrorKeys.MATRICULA_INGRESADA);
										}

										{
											PredioRegistro lpr_predioR;

											lpr_predioR = new PredioRegistro();

											lpr_predioR.setIdCirculo(ls_idCirculo);
											lpr_predioR.setIdMatricula(ll_idMatricula.longValue());
											lpr_predioR.setValidMatricula(lb_matricula);
											lpr_predioR.setValidNupre(lb_nupre);

											if(lb_nupre)
												lpr_predioR.setNupre(as_nupre);

											lpr_predioR = irr_registroRemote.findPredioRegistroById(
												    lpr_predioR, getUserId()
												);

											if(lpr_predioR != null)
											{
												String ls_estadoPredio;

												ls_estadoPredio = lpr_predioR.getIdEstadoPredio();

												if(StringUtils.isValidString(ls_estadoPredio))
												{
													EstadoPredio lep_estado;

													lep_estado = new EstadoPredio();

													lep_estado.setIdEstadoPredio(ls_estadoPredio);

													lep_estado = irr_registroRemote.findEstadoPredioById(
														    lep_estado, getUserId()
														);

													if(lep_estado != null)
													{
														String ls_estado;

														ls_estado = lep_estado.getNombre();

														if(StringUtils.isValidString(ls_estado))
														{
															if(
															    ls_estado.toUpperCase()
																             .equalsIgnoreCase(EstadoCommon.TRASLADADO)
															)
															{
																lpaiu_iterador.setIdMatricula(null);
																throw new B2BException(
																    "La matrícula inmobiliaria "
																    + ls_matriculaInmobiliaria
																    + " a incluir esta en estado 'TRASLADADO', No se puede radicar la solicitud."
																);
															}
														}
													}
												}
											}
										}
									}
								}
							}

							for(PredioActoIU lpaui_actual : lcpaui_tmp)
							{
								if(lpaui_actual != null)
								{
									Long   ll_idMatricula;
									String ls_idCirculo;
									String ls_matriculaCargada;

									ll_idMatricula     = lpaui_actual.getIdMatricula();
									ls_idCirculo       = lpaui_actual.getIdCirculo();

									if(
									    (!StringUtils.isValidString(ls_idCirculo)
										    || !NumericUtils.isValidLong(ll_idMatricula))
									)
										throw new B2BException(ErrorKeys.ERROR_TABLA_MATRICULA_INGRESADA);

									ls_matriculaCargada = ls_idCirculo + "-" + ll_idMatricula;

									lpaui_actual.setMatricula(ls_matriculaCargada);

									if(ls_matriculaInmobiliaria.equalsIgnoreCase(ls_matriculaCargada))
									{
										Map<String, Boolean> imsb_actos;

										imsb_actos = lpaui_actual.getActos();

										for(Map.Entry<String, Boolean> lm_iterador : imsb_actos.entrySet())
											imsb_actos.replace(lm_iterador.getKey(), new Boolean(false));

										li_contarMatriculasIguales++;
									}
								}
							}

							Collection<GravamenPendiente> lcgp_gravamenes;
							Collection<GravamenPendiente> lcgp_gravamenesFinal;

							lcgp_gravamenes          = getGravamenes();
							lcgp_gravamenesFinal     = new ArrayList<GravamenPendiente>();

							if(CollectionUtils.isValidCollection(lcgp_gravamenes))
							{
								for(GravamenPendiente lgp_iterador : lcgp_gravamenes)
								{
									if(lgp_iterador != null)
									{
										String ls_matricula;

										ls_matricula = lgp_iterador.getIdCirculoPredio() + "-"
											+ lgp_iterador.getIdMatriculaPredio();

										if(lhm_matriculas.containsKey(ls_matricula))
											lcgp_gravamenesFinal.add(lgp_iterador);
									}
								}

								setGravamenes(lcgp_gravamenesFinal);
							}
						}

						if(!ls_matriculaInmobiliaria.contains("-"))
						{
							Object[] aoa_messageArgs = new String[1];
							aoa_messageArgs[0] = ls_matriculaInmobiliaria;
							throw new B2BException(ErrorKeys.MATRICULA_INMOBILIARIA_INVALIDA, aoa_messageArgs);
						}

						if(li_contarMatriculasIguales <= 1)
						{
							int    li_inicio;
							String ls_circuloRegistral;
							String ls_matricula;

							ls_matriculaInmobiliaria     = ls_matriculaInmobiliaria.toUpperCase();

							li_inicio               = ls_matriculaInmobiliaria.lastIndexOf("-");
							ls_circuloRegistral     = ls_matriculaInmobiliaria.substring(0, li_inicio);
							ls_matricula            = ls_matriculaInmobiliaria.substring(
								    li_inicio + 1, ls_matriculaInmobiliaria.length()
								);

							if(
							    StringUtils.isValidString(ls_matricula)
								    && StringUtils.isValidString(ls_circuloRegistral)
							)
							{
								long             ll_matricula;
								CirculoRegistral lcr_circulo;

								lcr_circulo = new CirculoRegistral();
								lcr_circulo.setIdCirculo(ls_circuloRegistral);

								lcr_circulo = irr_registroRemote.findCirculoRegistralById(lcr_circulo, getUserId());

								if(lcr_circulo != null)
								{
									ll_matricula = NumericUtils.getLong(ls_matricula);

									if(NumericUtils.isValidLong(NumericUtils.getLongWrapper(ll_matricula), 1))
									{
										lpr_predio.setIdCirculo(lcr_circulo.getIdCirculo());
										lpr_predio.setIdMatricula(ll_matricula);
									}
									else
									{
										Object[] aoa_messageArgs = new String[1];
										aoa_messageArgs[0] = ls_matriculaInmobiliaria;
										throw new B2BException(
										    ErrorKeys.MATRICULA_INMOBILIARIA_INVALIDA, aoa_messageArgs
										);
									}
								}
								else
									throw new B2BException(ErrorKeys.CIRCULO_REGISTRAL_INVALIDO);
							}
							else
							{
								Object[] aoa_messageArgs = new String[1];
								aoa_messageArgs[0] = ls_matriculaInmobiliaria;
								throw new B2BException(ErrorKeys.MATRICULA_INMOBILIARIA_INVALIDA, aoa_messageArgs);
							}
						}
						else
							throw new B2BException("la Matrícula ingresada ya esta registrada en la tabla");
					}
					else
					{
						Object[] aoa_messageArgs = new String[1];
						aoa_messageArgs[0] = ls_matriculaInmobiliaria;
						throw new B2BException(ErrorKeys.MATRICULA_INMOBILIARIA_INVALIDA, aoa_messageArgs);
					}
				}

				if(lb_nupre)
					lpr_predio.setNupre(as_nupre);

				if(lpr_predio != null)
				{
					PredioRegistro lpr_predioR;

					lpr_predioR = null;

					lpr_predio.setValidNupre(lb_nupre);
					lpr_predio.setValidMatricula(lb_matricula);

					lpr_predioR = irr_registroRemote.findPredioRegistroById(lpr_predio, getUserId());

					if(lpr_predioR != null)
					{
						DireccionPredio ldp_direccionPredio;
						long            ll_idMatriculaPredio;
						String          ls_idCirculoPredio;
						String          ls_address;
						boolean         lb_validAddress;

						ldp_direccionPredio      = new DireccionPredio();
						ll_idMatriculaPredio     = lpr_predioR.getIdMatricula();
						ls_idCirculoPredio       = lpr_predioR.getIdCirculo();
						ls_address               = null;

						ldp_direccionPredio.setIdCirculo(ls_idCirculoPredio);
						ldp_direccionPredio.setIdMatricula(NumericUtils.getLongWrapper(ll_idMatriculaPredio));

						ls_matriculaInmobiliaria     = ls_idCirculoPredio + "-" + ll_idMatriculaPredio;

						ldp_direccionPredio = irr_registroRemote.findDireccionPredioById(
							    ldp_direccionPredio, getUserId()
							);

						if(ldp_direccionPredio != null)
							ls_address = ldp_direccionPredio.getDireccion();
						else
						{
							if(isActosSegregacion())
							{
								setFilePredialRendered(true);
								addp_datosDelPredio.setFilePredialRendered(true);
							}
						}

						Collection<PredioActoIU> lcpaui_cargado;

						if(addp_datosDelPredio != null)
							lcpaui_cargado = addp_datosDelPredio.getActosAsociadosGeneral();
						else
							lcpaui_cargado = getActosAsociadosGeneral();

						lb_validAddress = StringUtils.isValidString(ls_address);

						if(CollectionUtils.isValidCollection(lcpaui_cargado))
						{
							for(PredioActoIU lpaui_actual : lcpaui_cargado)
							{
								if(lpaui_actual != null)
								{
									String ls_matriculaCargada;
									String ls_nupreCargado;

									if(lb_nupre)
									{
										ls_nupreCargado = lpaui_actual.getNupre();

										if(ls_nupre.equalsIgnoreCase(ls_nupreCargado))
										{
											if(lb_validAddress)
												lpaui_actual.setDireccion(ls_address);

											lpaui_actual.setMatricula(ls_matriculaInmobiliaria);
											lpaui_actual.setIdCirculo(ls_idCirculoPredio);
											lpaui_actual.setIdMatricula(
											    NumericUtils.getLongWrapper(ll_idMatriculaPredio)
											);

											if(isActosSegregacion())
											{
												setFilePredialRendered(true);
												addp_datosDelPredio.setFilePredialRendered(true);
											}
										}
									}

									if(lb_matricula)
									{
										String ls_idCirculo;
										Long   ll_idMatricula;

										ls_idCirculo       = lpaui_actual.getIdCirculo();
										ll_idMatricula     = lpaui_actual.getIdMatricula();

										if(
										    !StringUtils.isValidString(ls_idCirculo)
											    || !NumericUtils.isValidLong(ll_idMatricula)
										)
											throw new B2BException(ErrorKeys.ERROR_TABLA_MATRICULA_INGRESADA);

										ls_matriculaCargada = ls_idCirculo + "-" + ll_idMatricula;

										lpaui_actual.setMatricula(ls_matriculaCargada);
										lpaui_actual.setNupre(lpr_predioR.getNupre());
										lpaui_actual.setNumeroPredial(lpr_predioR.getNumeroPredial());

										if(ls_matriculaInmobiliaria.equalsIgnoreCase(ls_matriculaCargada))
										{
											if(lb_validAddress)
												lpaui_actual.setDireccion(ls_address);

											if(isActosSegregacion())
											{
												setFilePredialRendered(true);
												addp_datosDelPredio.setFilePredialRendered(true);
											}

											lpaui_actual.setCorreccion(true);

											if(!llhm_matriculasCorrecciones.containsKey(as_matricula))
												llhm_matriculasCorrecciones.put(as_matricula, new Boolean(false));
										}
									}

									lpaui_actual.setMatriculaCargada(true);
								}
							}
						}

						if(addp_datosDelPredio != null)
							addp_datosDelPredio.setActosAsociadosGeneral(lcpaui_cargado);
						else
							setActosAsociadosGeneral(lcpaui_cargado);

						{
							String ls_estadoPredio;

							ls_estadoPredio = lpr_predioR.getIdEstadoPredio();

							if(StringUtils.isValidString(ls_estadoPredio))
							{
								EstadoPredio lep_estado;

								lep_estado = new EstadoPredio();

								lep_estado.setIdEstadoPredio(ls_estadoPredio);

								lep_estado = irr_registroRemote.findEstadoPredioById(lep_estado, getUserId());

								if(lep_estado != null)
								{
									String ls_estado;

									ls_estado = lep_estado.getNombre();

									if(StringUtils.isValidString(ls_estado))
									{
										String ls_error;

										ls_error = null;

										if(ls_estado.toUpperCase().equalsIgnoreCase(EstadoCommon.ESTADO_CERRADO))
											ls_error = ("La matrícula inmobiliaria " + ls_matriculaInmobiliaria
												+ " a incluir esta en estado 'CERRADO'. ");
										else if(ls_estado.toUpperCase().equalsIgnoreCase(EstadoCommon.ANULADO))
											ls_error = ("La matrícula inmobiliaria " + ls_matriculaInmobiliaria
												+ " a incluir esta en estado 'ANULADO'. ");
										else if(ls_estado.toUpperCase().equalsIgnoreCase(EstadoCommon.TRASLADADO))
											throw new B2BException(
											    "La matrícula inmobiliaria " + ls_matriculaInmobiliaria
											    + " a incluir esta en estado 'TRASLADADO', No se puede radicar la solicitud."
											);

										if(StringUtils.isValidString(ls_error))
											lcs_return.add(ls_error);
									}
								}
							}
						}

						{
							int                                      li_inicio;
							Collection<RegistroAnotacionProhibicion> lcrap_registrosAnotacionProhib;
							String                                   ls_circuloRegistral;
							String                                   ls_matricula;

							ls_matriculaInmobiliaria     = ls_matriculaInmobiliaria.toUpperCase();

							li_inicio                          = ls_matriculaInmobiliaria.lastIndexOf("-");
							ls_circuloRegistral                = ls_matriculaInmobiliaria.substring(0, li_inicio);
							ls_matricula                       = ls_matriculaInmobiliaria.substring(
								    li_inicio + 1, ls_matriculaInmobiliaria.length()
								);
							lcrap_registrosAnotacionProhib     = irr_registroRemote
									.findAllRegistroAnotacionProhibicionByCirMat(
									    getSolicitud(), ls_circuloRegistral, NumericUtils.getLong(ls_matricula),
									    getUserId(), getLocalIpAddress(), getRemoteIpAddress()
									);

							if(CollectionUtils.isValidCollection(lcrap_registrosAnotacionProhib))
							{
								for(RegistroAnotacionProhibicion lrap_data : lcrap_registrosAnotacionProhib)
								{
									if((lrap_data != null) && lrap_data.isAlerta())
									{
										String ls_errorKey;
										String ls_error;

										ls_errorKey     = lrap_data.getErrorKey();
										ls_error        = null;

										if(StringUtils.isValidString(ls_errorKey))
											ls_error = getMessages().getString(ls_errorKey, lrap_data.getMessageArgs());

										if(StringUtils.isValidString(ls_error))
											lcs_return.add(ls_error);
									}
								}
							}
						}

						{
							String ls_turnoBloqueo;

							ls_turnoBloqueo = lpr_predioR.getTurnoBloqueo();

							if(StringUtils.isValidString(ls_turnoBloqueo))
							{
								Collection<String> lcs_turnosBloqueo;

								lcs_turnosBloqueo = irr_registroRemote.findTurnosBloqueoPredio(lpr_predioR);

								if(CollectionUtils.isValidCollection(lcs_turnosBloqueo))
								{
									Iterator<String> lis_turnosBloqueo;
									String           ls_turnosBloqueo;
									String           ls_error;

									lis_turnosBloqueo     = lcs_turnosBloqueo.iterator();
									ls_turnosBloqueo      = "";
									ls_error              = null;

									while(lis_turnosBloqueo.hasNext())
									{
										String ls_turnoTemp;
										String ls_espacio;

										ls_turnoTemp     = lis_turnosBloqueo.next();
										ls_espacio       = lis_turnosBloqueo.hasNext() ? ",\n" : "\n";

										if(StringUtils.isValidString(ls_turnoTemp))
											ls_turnosBloqueo = ls_turnosBloqueo + ls_espacio + ls_turnoTemp;
									}

									ls_error = ("El folio de matrícula " + ls_matriculaInmobiliaria
										+ " se encuentra bloqueado con los turnos: " + ls_turnosBloqueo);

									if(StringUtils.isValidString(ls_error))
										lcs_return.add(ls_error);
								}
							}
						}

						if(lpr_predioR.getPredioInconsistente().equalsIgnoreCase(EstadoCommon.S))
						{
							if(isCertificadosMasivos())
							{
								Object[] loa_args;
								String   ls_error;

								loa_args     = new String[1];

								loa_args[0]     = ls_matriculaInmobiliaria;

								ls_error = getMessages()
										           .getString(
										    MessagesKeys.PREDIO_INCONSISTENTE_NO_SE_ATIENDE_SOLICITUD, loa_args
										);

								if(StringUtils.isValidString(ls_error))
									lcs_return.add(ls_error);

								setEsMasivoYPredioInconsistente(true);
							}
							else
							{
								lcs_return.add(
								    "El predio con matrícula inmobiliaria " + ls_matriculaInmobiliaria
								    + " es un predio inconsistente."
								);

								if(apui_predioActoUI != null)
									apui_predioActoUI.setEsPredioInconsistente(true);
							}
						}
					}
					else
					{
						Collection<PredioActoIU> lcpaui_cargado;

						lcpaui_cargado = addp_datosDelPredio.getActosAsociadosGeneral();

						if(CollectionUtils.isValidCollection(lcpaui_cargado))
						{
							for(PredioActoIU lpaui_actual : lcpaui_cargado)
							{
								if(lpaui_actual != null)
								{
									String ls_idCirculo;
									Long   ll_idMatricula;
									String ls_matriculaCargada;
									String ls_nupreCargada;

									ls_idCirculo       = lpaui_actual.getIdCirculo();
									ll_idMatricula     = lpaui_actual.getIdMatricula();

									if(
									    !StringUtils.isValidString(ls_idCirculo)
										    || !NumericUtils.isValidLong(ll_idMatricula)
									)
										throw new B2BException(ErrorKeys.ERROR_TABLA_MATRICULA_INGRESADA);

									ls_matriculaCargada     = ls_idCirculo + "-" + ll_idMatricula;
									// ls_matriculaCargada = lpaui_actual.getMatricula();
									ls_nupreCargada         = lpaui_actual.getNupre();

									lpaui_actual.setMatricula(ls_matriculaCargada);

									if(
									    (lb_matricula
										    && StringUtils.getStringNotNull(ls_matriculaInmobiliaria)
										                      .equalsIgnoreCase(ls_matriculaCargada))
										    || (lb_nupre
										    && StringUtils.getStringNotNull(ls_nupre).equalsIgnoreCase(ls_nupreCargada))
									)
									{
										lpaui_actual.setDireccion(null);
										lpaui_actual.setCantidad(NumericUtils.getLongWrapper(0L));
										lpaui_actual.setCertificadoAsociado(false);

										{
											List<ColumnModel> lcm_lcm;

											lcm_lcm = getColumns();

											if(CollectionUtils.isValidCollection(lcm_lcm))
											{
												Map<String, Boolean> lmsb_actos;

												lmsb_actos = new HashMap<String, Boolean>(lpaui_actual.getActos());

												for(ColumnModel lcm_tmp : lcm_lcm)
												{
													if(lcm_tmp != null)
													{
														boolean lb_actoAsociado;
														String  ls_idActo;

														lb_actoAsociado     = false;
														ls_idActo           = lcm_tmp.getIdActo();

														if(StringUtils.isValidString(ls_idActo))
															lb_actoAsociado = BooleanUtils.getBooleanValue(
																    lmsb_actos.get(ls_idActo)
																);

														if(lb_actoAsociado)
															lmsb_actos.replace(ls_idActo, new Boolean(false));
													}
												}

												lpaui_actual.setActos(lmsb_actos);
												lpaui_actual.setCorreccion(true);
												lpaui_actual.setMatriculaCargada(false);

												if(!llhm_matriculasCorrecciones.containsKey(as_matricula))
													llhm_matriculasCorrecciones.put(as_matricula, new Boolean(false));
											}
										}
									}
								}
							}
						}

						addp_datosDelPredio.setActosAsociadosGeneral(lcpaui_cargado);

						if(lb_nupre && lb_matricula)
							ls_message = "Matrícula :" + as_matricula + " " + "Con Nupre :" + as_nupre;
						else if(lb_nupre)
							ls_message = "Nupre :" + as_nupre;
						else if(lb_matricula)
							ls_message = "Matrícula :" + as_matricula;

						throw new B2BException("No se encontraron registros del predio para " + " " + ls_message);
					}

					{
						String                     ls_idCirculo;
						Collection<DatosDelPredio> lcddp_datosPredio;

						lcddp_datosPredio = getDatosDelPredio();

						if(addp_datosDelPredio != null)
							ls_idCirculo = StringUtils.getStringNotNull(addp_datosDelPredio.getIdCirculo());
						else
						{
							int li_inicio;

							li_inicio        = as_matricula.lastIndexOf("-");
							ls_idCirculo     = as_matricula.substring(0, li_inicio);
						}

						if(lcddp_datosPredio != null)
						{
							for(DatosDelPredio lddp_data : lcddp_datosPredio)
							{
								if(lddp_data != null)
								{
									String ls_idCirTemp;
									ls_idCirTemp = StringUtils.getStringNotNull(lddp_data.getIdCirculo());

									if(ls_idCirculo.equals(ls_idCirTemp))
									{
										lddp_data = addp_datosDelPredio;

										break;
									}
								}
							}
						}
					}
				}
			}
		}
		catch(B2BException lb2be_e)
		{
			clh_LOGGER.error(lb2be_e);
			lcs_return.add(lb2be_e.getMessage());
		}

		return lcs_return;
	}

