	/**
	 * Carga la dirección de una matrícula ingresada.
	 *
	 * @param al_idMatricula número de matrícula ingresado
	 * @param as_idCirculo id del círculo al cual pertenece la matrícula
	 * @param as_nupre número del nupre
	 * @param addp_datosDelPredio objeto contenedor de los datos del círculo
	 * @param ap_predioActoUI predio acto actual
	 */
	public void cargarDireccionPredioActo(
	    Long al_idMatricula, String as_idCirculo, String as_nupre, DatosDelPredio addp_datosDelPredio,
	    PredioActoIU ap_predioActoUI
	)
	    throws B2BException
	{
		try
		{
			Collection<String> lcs_errores;
			String             ls_matriculaInmobiliaria;
			boolean            lb_validacionErrores;
			String             ls_idProceso;

			ls_matriculaInmobiliaria     = null;
			lb_validacionErrores         = false;
			ls_idProceso                 = getIdProceso();

			if(NumericUtils.isValidLong(al_idMatricula) && StringUtils.isValidString(as_idCirculo))
			{
				PredioRegistro lpr_predioRegistro;

				lpr_predioRegistro = irr_referenceRemote.findPredioRegistroByMatriculaCirculo(
					    as_idCirculo, al_idMatricula, getUserId(), getLocalIpAddress(), getRemoteIpAddress()
					);

				setTrasladoMatriculaValido(lpr_predioRegistro == null);

				if(
				    (lpr_predioRegistro == null) && StringUtils.isValidString(ls_idProceso)
					    && ls_idProceso.equalsIgnoreCase(ProcesoCommon.ID_PROCESO_38)
				)
					throw new B2BException(ErrorKeys.MATRICULA_TRASLADO_INVALIDO);
				else
					ls_matriculaInmobiliaria = as_idCirculo + "-" + al_idMatricula;
			}
			else
				ls_matriculaInmobiliaria = null;

			if(StringUtils.isValidString(ls_matriculaInmobiliaria))
				setMatriculaParaBorrarActo(ls_matriculaInmobiliaria);

			lcs_errores              = cargarDireccionPredio(
				    ls_matriculaInmobiliaria, as_nupre, addp_datosDelPredio, ap_predioActoUI
				);
			lb_validacionErrores     = CollectionUtils.isValidCollection(lcs_errores);

			if(lb_validacionErrores)
			{
				for(String ls_error : lcs_errores)
				{
					if(StringUtils.isValidString(ls_error))
					{
						if(ls_error.contains("ya está registrada para esta solicitud"))
							addMessage("W", ls_error);
						else if(ls_error.contains("TRASLADADO"))
							addMessage("W", ls_error);
						else
							addMessage("I", ls_error);

						PrimeFaces.current().ajax().update(is_messageIdGrowl);
					}
				}
			}

			if(isProcesoCorrecciones())
				PrimeFaces.current().ajax().update("fRegistro:idDtActoAsociadoGeneral");
			else if(!isProcesoCertificados())
			{
				renderizarTablesProhibicionesGravamenes();
				addMessage(MessagesKeys.ASOCIAR_ACTO_MATRICULA);
				PrimeFaces.current().ajax().update("fRegistro:idActosDatosDelPredio");
			}

			cargarMensajePredioInconsistente();

//			validarTramiteSuspension(as_idCirculo, StringUtils.getString(al_idMatricula));
			Collection<String> lcc_alertas;
			lcc_alertas     = new LinkedList<String>();

			lcc_alertas = isr_suspensionRemote.validarTramiteSuspension2(
				    as_idCirculo, StringUtils.getString(al_idMatricula), isActo0463(), getUserId(), getLocalIpAddress(),
				    getRemoteIpAddress(), lcc_alertas
				);

			if(CollectionUtils.isValidCollection(lcc_alertas))
			{
				for(String is_iterador : lcc_alertas)
					addMessage("I", is_iterador);
			}

			PrimeFaces.current().ajax().update(is_messageIdGrowl);
		}
		catch(B2BException lb2be_e)
		{
			clh_LOGGER.error(lb2be_e);
			addMessage(lb2be_e);
			PrimeFaces.current().ajax().update(is_messageIdGrowl);

			if(isProcesoCorrecciones())
				PrimeFaces.current().ajax().update("fRegistro:idDtActoAsociadoGeneral");
			else
				PrimeFaces.current().ajax().update("fRegistro:idActosDatosDelPredio");
		}
	}

	/**
	 * Cargar direccion residencia.
	 *
	 * @throws B2BException Objeto de tipo B2BException, se produce cuando se encuentra algun error controlado.
	 */
	public void cargarDireccionResidencia()
	    throws B2BException
	{
		BeanDireccion lbd_beanDireccion;
		String        ls_idDirResSeleccion;

		lbd_beanDireccion        = getBeanDireccion();
		ls_idDirResSeleccion     = getIdDirResSeleccion();

		if(StringUtils.isValidString(ls_idDirResSeleccion))
		{
			String[] lsa_tmp;
			lsa_tmp = ls_idDirResSeleccion.split("-");

			if(CollectionUtils.isValidCollection(lsa_tmp) && (lsa_tmp.length > 1))
			{
				String ls_idPersonaSeleccionada;
				String ls_idDirResSeleccionada;

				ls_idPersonaSeleccionada     = lsa_tmp[0];
				ls_idDirResSeleccionada      = lsa_tmp[1];

				if(
				    StringUtils.isValidString(ls_idPersonaSeleccionada)
					    && StringUtils.isValidString(ls_idDirResSeleccionada)
				)
				{
					Registro lr_datosCalculados;
					lr_datosCalculados = getRegistroDatosConsultados();

					if(lr_datosCalculados != null)
					{
						Collection<PersonaDireccion> lcp_direcciones;
						lcp_direcciones = lr_datosCalculados.getListadoDireccionResidencia();

						if(CollectionUtils.isValidCollection(lcp_direcciones))
						{
							for(PersonaDireccion lpd_iterador : lcp_direcciones)
							{
								if(lpd_iterador != null)
								{
									String ls_idPersona;
									String ls_idDireccion;

									ls_idPersona       = lpd_iterador.getIdPersona();
									ls_idDireccion     = lpd_iterador.getIdDireccion();

									if(
									    StringUtils.isValidString(ls_idPersona)
										    && StringUtils.isValidString(ls_idDireccion)
									)
									{
										if(
										    ls_idPersonaSeleccionada.equalsIgnoreCase(ls_idPersona)
											    && ls_idDirResSeleccionada.equalsIgnoreCase(ls_idDireccion)
										)
										{
											lpd_iterador.setTipoDireccion(EstadoCommon.R);
											lbd_beanDireccion.setDireccionResidencia(lpd_iterador);
											lbd_beanDireccion.setDeshabilitarResidencia(true);
											setDeshabilitarResidencia(true);
										}
									}
								}
							}
						}
					}
				}
			}
		}
		else
		{
			lbd_beanDireccion.setDireccionResidencia(null);
			lbd_beanDireccion.setDeshabilitarResidencia(false);
			setDeshabilitarResidencia(false);
		}
	}

