	/**
	 * Metodo que se encarga de cargar en pantalla los datos de un turno seleccionado.
	 *
	 * @param at_turno Objeto contenedor de la información de la persona que se va a cargar
	 * en pantalla
	 * @throws B2BException Señala que se ha producido una excepción
	 */
	public void cargarTurnoRecepcion(Turno at_turno)
	    throws B2BException
	{
		if(at_turno != null)
		{
			String            ls_idTurnoSeleccionado;
			Collection<Turno> lcp_turnos;

			ls_idTurnoSeleccionado     = at_turno.getIdTurno();
			lcp_turnos                 = getInfoTurnos();

			if(CollectionUtils.isValidCollection(lcp_turnos))
			{
				for(Turno lp_iterador : lcp_turnos)
				{
					if(lp_iterador != null)
					{
						if(StringUtils.isValidString(ls_idTurnoSeleccionado))
						{
							setIdTurno(ls_idTurnoSeleccionado);

							String ls_idTurno;
							ls_idTurno = lp_iterador.getIdTurno();

							if(
							    StringUtils.isValidString(ls_idTurno)
								    && !ls_idTurnoSeleccionado.equalsIgnoreCase(ls_idTurno)
							)
								lp_iterador.setTurnoSeleccionado(false);
							else
							{
								Solicitud lso_solicitud;

								lso_solicitud = getSolicitud();

								if(lso_solicitud != null)
								{
									String ls_idProceso;

									ls_idProceso = lso_solicitud.getIdProceso();

									if(
									    StringUtils.isValidString(ls_idProceso)
										    && ls_idProceso.equalsIgnoreCase(ProcesoCommon.ID_PROCESO_39)
									)
									{
										Turno lt_turno;

										lt_turno = new Turno();
										lt_turno.setIdTurno(ls_idTurnoSeleccionado);

										lt_turno = iasr_antiguoSistemaRemote.findIdCirculoOrigen(lt_turno);

										if(lt_turno != null)
										{
											long     ll_idEtapaActual;
											Object[] loa_messageArgs = new String[1];

											ll_idEtapaActual = NumericUtils.getLong(lt_turno.getIdEtapaActual());

											if(
											    ((ll_idEtapaActual >= EtapaCommon.ID_ETAPA_ENTREGA_ORIP_INSCRIPCION)
												    && (ll_idEtapaActual < EtapaCommon.ID_ETAPA_EN_ESPERA_TERMINO_PARA_INTERPONER_RECURSOS))
												    || (ll_idEtapaActual >= EtapaCommon.ID_ETAPA_PROCESO_DE_REGISTRO_FINALIZADO)
											)
											{
												Etapa le_etapa;

												le_etapa = new Etapa();

												le_etapa.setIdEtapa(ll_idEtapaActual);
												le_etapa = ipr_parameterRemote.findEtapaById(
													    le_etapa, getUserId(), getLocalIpAddress(), getRemoteIpAddress()
													);

												if(le_etapa != null)
													loa_messageArgs[0] = le_etapa.getNombre();

												addMessage(
												    EstadoCommon.I,
												    getMessages()
													        .getString(
													        MessagesKeys.TURNO_ENTREGA_DESISTIMIENTO, loa_messageArgs
													    )
												);
											}
										}
									}
								}
							}
						}
						else
							lp_iterador.setTurnoSeleccionado(false);
					}
				}
			}
		}
	}

	/**
	 * Comprobar areas.
	 */
	public void comprobarAreas()
	{
		LinkedHashMap<String, Boolean> llhms_map;

		llhms_map = getMatriculasValidarArea();

		if(!llhms_map.isEmpty())
		{
			if(llhms_map.containsValue(new Boolean(false)))
				setAreasValidadas(false);
			else
				setAreasValidadas(true);
		}
		else
			setAreasValidadas(false);
	}

	/**
	 * Metodo encargado de llenar el objeto acto para mostrar detalladamente un acto.
	 * @param as_idActo Argumento de tipo String que contiene el id_acto con el que se consultará detalladamente.
	 */
	public void consultaDetalleActo(String as_idActo)
	{
		try
		{
			setAddActo(false);
			setModifyActo(true);
			setEsCambioTipoCuantia(false);
			setRequiereCuantiaActo(false);
			setNoRequiereCuantiaActo(false);
			setCanceloRespuestaNoRequiereCuantia(false);
			setPreguntaLey1943(false);
			setCuotaparteDonacion(false);
			setPrestacionesPeriodicas(false);
			setTiempoCanonValidado(false);

			if(StringUtils.isValidString(as_idActo))
			{
				com.bachue.snr.prosnr01.model.registro.Acto la_actoTemp;

				la_actoTemp = irr_registroRemote.findDetalleActo(
					    as_idActo, null, getUserId(), getLocalIpAddress(), getRemoteIpAddress()
					);

				if(la_actoTemp != null)
				{
					String ls_impuestoRegistro;

					ls_impuestoRegistro = la_actoTemp.getImpuestoRegistro();

					setPreguntaPagoImpuestoRegistroGobernaciones(
					    StringUtils.isValidString(ls_impuestoRegistro) ? EstadoCommon.S : EstadoCommon.N
					);

					validarPreguntaImpuesto();

					setActo(la_actoTemp);
				}
			}

			cambiarEspecifica(true, true, false);

			addMessage(MessagesKeys.MODIFICAR_ACTO);
		}
		catch(B2BException lb2be_e)
		{
			clh_LOGGER.error("consultaDetalleActo", lb2be_e);

			addMessage(lb2be_e);
		}
		finally
		{
			actualizarComponente(is_messageIdGrowl);
		}
	}

	/**
	 * Consulta detalle predio.
	 *
	 * @param aopaiu_iu correspondiente al valor del tipo de objeto PredioActoIU
	 */
	public void consultaDetallePredio(PredioActoIU aopaiu_iu)
	{
		try
		{
			setAreaUI(null);

			String ls_matriculaCompleta;
			int    li_inicio;
			String ls_idCirculo;
			String ls_matricula;

			if(aopaiu_iu != null)
			{
				ls_matriculaCompleta = aopaiu_iu.getMatricula();
				setPredioModificarArea(aopaiu_iu);

				if(StringUtils.isValidString(ls_matriculaCompleta))
				{
					AccAreaPredio laap_areaPredioArg;

					laap_areaPredioArg     = new AccAreaPredio();
					li_inicio              = ls_matriculaCompleta.lastIndexOf("-");
					ls_idCirculo           = ls_matriculaCompleta.substring(0, li_inicio);
					ls_matricula           = ls_matriculaCompleta.substring(
						    li_inicio + 1, ls_matriculaCompleta.length()
						);

					if(aopaiu_iu.isValidarArea())
					{
						AccAreaPredio laap_areaPredio;
						AccAreaUI     laaui_data;
						Long          ll_idMatricula;

						ll_idMatricula = NumericUtils.getLongWrapper(ls_matricula);

						laap_areaPredioArg.setIdCirculo(ls_idCirculo);
						laap_areaPredioArg.setIdMatricula(ll_idMatricula);

						laaui_data = irr_registroRemote.consultaAreaPredio(laap_areaPredioArg, getUserId(), true);

						if((laaui_data != null) && (laaui_data.getAreaPredio() != null) && (laaui_data.isConsulta()))
						{
							com.bachue.snr.prosnr01.model.registro.Acto la_actoPantalla;
							laap_areaPredio = laaui_data.getAreaPredio();

							laap_areaPredio.setModificacion(false);
							laap_areaPredio.setIdCirculo(ls_idCirculo);
							laap_areaPredio.setIdMatricula(ll_idMatricula);
							la_actoPantalla = getActo();

							if(la_actoPantalla != null)
							{
								Double                       ld_areaTotalInmuebleActoPantalla;
								Double                       ld_areaTotalInmuebleActoRegistrado;
								ArrayList<DetalleAreaPredio> laldap_detallesPredio;

								ld_areaTotalInmuebleActoRegistrado = null;

								if(CollectionUtils.isValidCollection(laaui_data.getAreasTerreno()))
									laldap_detallesPredio = new ArrayList<DetalleAreaPredio>(
										    laaui_data.getAreasTerreno()
										);
								else
									laldap_detallesPredio = null;

								if(CollectionUtils.isValidCollection(laldap_detallesPredio))
								{
									for(DetalleAreaPredio adap_detalleAreapredio : laldap_detallesPredio)
									{
										if(adap_detalleAreapredio != null)
										{
											Double ld_areaPredioTmp;
											ld_areaPredioTmp = adap_detalleAreapredio.getArea();

											if(ld_areaPredioTmp != null)
											{
												if(ld_areaTotalInmuebleActoRegistrado != null)
												{
													if(
													    ld_areaPredioTmp.doubleValue() > ld_areaTotalInmuebleActoRegistrado
														    .doubleValue()
													)
														ld_areaTotalInmuebleActoRegistrado = ld_areaPredioTmp;
												}
												else
													ld_areaTotalInmuebleActoRegistrado = ld_areaPredioTmp;
											}
										}
									}
								}

								ld_areaTotalInmuebleActoPantalla = la_actoPantalla.getAreaTotalInmueble();

								if(
								    NumericUtils.isValidDouble(ld_areaTotalInmuebleActoPantalla)
									    && NumericUtils.isValidDouble(ld_areaTotalInmuebleActoRegistrado)
								)
								{
									if(!ld_areaTotalInmuebleActoPantalla.equals(ld_areaTotalInmuebleActoRegistrado))
										throw new B2BException(
										    "Verifique área del terreno asociado al acto, no coincide con el área actual del predio."
										);
								}
							}
						}
						else
						{
							laap_areaPredioArg.setIdCirculo(ls_idCirculo);
							laap_areaPredioArg.setIdMatricula(ll_idMatricula);

							laaui_data = irr_registroRemote.consultaAreaPredio(laap_areaPredioArg, getUserId(), false);

							if(
							    (laaui_data != null)
								    && ((laaui_data.getAreaPredio() != null) && laaui_data.isConsulta())
							)
								laap_areaPredio = laaui_data.getAreaPredio();
							else
							{
								laaui_data          = new AccAreaUI();
								laap_areaPredio     = new AccAreaPredio();

								laaui_data.setIdDetalleAreaPredio(BigInteger.ZERO);
							}

							laap_areaPredio.setIdCirculo(ls_idCirculo);
							laap_areaPredio.setIdMatricula(ll_idMatricula);
							laaui_data.setAreaPredio(laap_areaPredio);
							laap_areaPredio.setModificacion(true);
						}

						if(laaui_data != null)
						{
							laaui_data.setIdCirculo(ls_idCirculo);
							laaui_data.setIdMatricula(ll_idMatricula);

							AccAreaPredio     laap_area;
							DetalleAreaPredio ldap_privada;
							DetalleAreaPredio ldap_construida;

							laap_area           = laaui_data.getAreaPredio();
							ldap_privada        = laaui_data.getDetalleAreaPrivada();
							ldap_construida     = laaui_data.getDetalleAreaConstruida();

							if(ldap_privada != null)
							{
								Double ld_area;

								ld_area = ldap_privada.getArea();

								if(NumericUtils.isValidDouble(ld_area))
									ldap_privada.setAreaLectura(StringUtils.getString(ld_area));
							}

							if(ldap_construida != null)
							{
								Double ld_area;

								ld_area = ldap_construida.getArea();

								if(NumericUtils.isValidDouble(ld_area))
									ldap_construida.setAreaLectura(StringUtils.getString(ld_area));
							}

							if(laap_area != null)
							{
								Double ld_coeficiente;

								ld_coeficiente = laap_area.getCoeficiente();

								if(NumericUtils.isValidDouble(ld_coeficiente))
									laap_area.setCoeficienteLectura(StringUtils.getString(ld_coeficiente));
							}
						}

						{
							LinderoRegistroCalificacion llrc_lindero;

							llrc_lindero = new LinderoRegistroCalificacion();

							llrc_lindero.setIdCirculo(ls_idCirculo);
							llrc_lindero.setIdMatricula(ll_idMatricula);

							laaui_data.setLinderos(irr_calificacionRemote.findLindero(llrc_lindero, false));
						}

						setDataInfoSegrec(laap_areaPredio);
						setDetalleAreaTerreno(null);
						setAreaUI(laaui_data);
						actualizarAreaTerreno();

						{
							PrimeFaces lp_faces;

							lp_faces = PrimeFaces.current();

							lp_faces.ajax().update("idDataPredial");
							lp_faces.executeScript("PF('idDataPredial').show();");
						}
					}
				}
			}
		}
		catch(B2BException lb2be_e)
		{
			clh_LOGGER.error(lb2be_e);
			addMessage(lb2be_e);
			setPredioModificarArea(null);
		}
	}

	/**
	 * Consulta matricula correccion.
	 *
	 * @param aopaiu_iu correspondiente al valor del tipo de objeto PredioActoIU
	 */
	public void consultaMatriculaCorreccion(PredioActoIU aopaiu_iu)
	{
		try
		{
			Collection<CausalCorreccion> lcc_causales;
			String                       ls_matriculaCompleta;
			String                       ls_idSolicitud;
			Solicitud                    ls_solicitud;
			SolicitudCorreccion          lsc_solicitudCorreccion;

			ls_matriculaCompleta        = null;
			ls_solicitud                = getSolicitud();
			ls_idSolicitud              = null;
			lsc_solicitudCorreccion     = new SolicitudCorreccion();

			if(ls_solicitud != null)
				ls_idSolicitud = ls_solicitud.getIdSolicitud();

			if(aopaiu_iu != null)
			{
				ls_matriculaCompleta = aopaiu_iu.getMatricula();
				setPredioActoCorreccion(aopaiu_iu);

				if(StringUtils.isValidString(ls_matriculaCompleta))
				{
					String[] lsa_matricula;

					lsa_matricula = ls_matriculaCompleta.split("-");

					if(lsa_matricula.length > 1)
					{
						BigInteger     lbi_idMatricula;
						PredioRegistro lpr_predioR;
						String         ls_idCirculo;

						lbi_idMatricula     = NumericUtils.getBigInteger(lsa_matricula[1]);
						lpr_predioR         = new PredioRegistro();
						ls_idCirculo        = lsa_matricula[0];

						lpr_predioR.setValidMatricula(true);
						lpr_predioR.setIdCirculo(ls_idCirculo);
						lpr_predioR.setIdMatricula(NumericUtils.getLong(lsa_matricula[1]));

						lpr_predioR = irr_registroRemote.findPredioRegistroById(lpr_predioR, getUserId());

						if(lpr_predioR == null)
							throw new B2BException(ErrorKeys.ERROR_MATRICULA_INVALIDA);

						if(StringUtils.isValidString(ls_idCirculo))
							lsc_solicitudCorreccion.setIdCirculo(ls_idCirculo);

						if(NumericUtils.isValidBigInteger(lbi_idMatricula))
							lsc_solicitudCorreccion.setIdMatricula(lbi_idMatricula);
					}
					else
						throw new B2BException(ErrorKeys.ERROR_MATRICULA_INVALIDA);
				}
				else
					throw new B2BException(ErrorKeys.ERROR_MATRICULA_INVALIDA);
			}

			if(StringUtils.isValidString(ls_idSolicitud))
				lsc_solicitudCorreccion.setIdSolicitud(ls_idSolicitud);

			lsc_solicitudCorreccion.setFindOnlySolicitud(false);

			lcc_causales = irr_registroRemote.findAllCausales(lsc_solicitudCorreccion);

			if(CollectionUtils.isValidCollection(lcc_causales))
				setCausales(lcc_causales);

			PrimeFaces.current().executeScript("PF('dlgCorrecciones').show();");
			PrimeFaces.current().ajax().update("dlgCorrecciones");
		}
		catch(B2BException lb2be_e)
		{
			setPredioActoCorreccion(null);
			PrimeFaces.current().executeScript("PF('dlgCorrecciones').hide();");

			clh_LOGGER.error(lb2be_e);
			addMessage(lb2be_e);
			PrimeFaces.current().ajax().update(is_messageIdGrowl);
		}
	}

