	/**
	 * Consultar persona documento.
	 *
	 * @param ab_mostrarAlertas Argumento de tipo <code>boolean</code> que determina si se deben mostrar las alertas de datos no encontrados y limpiar datos.
	 * @param ab_soloMostrarAlertas Argumento de tipo <code>boolean</code> que determina si se deben mostrar las alertas de datos no encontrados.
	 * @param as_tipoRecepcion Argumento de tipo <code>String</code> que determina si se debe cargar los medios a notificar y comunicar de copias.
	 * @param as_idForm correspondiente al valor del tipo de objeto String
	 * @throws B2BException Señala que se ha producido una excepción
	 */
	public void consultarPersonaDocumento(
	    boolean ab_mostrarAlertas, boolean ab_soloMostrarAlertas, String as_tipoRecepcion, String as_idForm
	)
	    throws B2BException
	{
		boolean lb_focus;
		ib_rendered = false;
		setPersona(null);

		lb_focus = true;

		try
		{
			BeanDireccion lbd_beanDireccion;
			Persona       lp_parametros;
			Registro      lr_registro;
			FacesContext  lfc_context;

			lbd_beanDireccion     = getBeanDireccion();
			lfc_context           = FacesContext.getCurrentInstance();
			lp_parametros         = new Persona();
			lr_registro           = new Registro();

			if(ab_mostrarAlertas)
				limpiarInteresados();

			lp_parametros.setNumeroDocumento(getDocumentoInteresado());
			lp_parametros.setTipoDocIdentidad(getTipoDocInteresado());

			String ls_idTipoDocumento;
			ls_idTipoDocumento     = lp_parametros.getTipoDocIdentidad();

			lb_focus = validateStyles(as_idForm + ":idSOMTipoDocIdentidad", lfc_context, ls_idTipoDocumento, lb_focus);

			String ls_documentoIdentidad;
			ls_documentoIdentidad     = lp_parametros.getNumeroDocumento();

			lb_focus = validateStyles(as_idForm + ":idItDocumentoID", lfc_context, ls_documentoIdentidad, lb_focus);

			if(isEsCreacionMatriculasOficio())
			{
				Solicitud ls_solicitud;
				ls_solicitud = getSolicitud();

				if(ls_solicitud != null)
				{
					String ls_usuarioOrip;
					ls_usuarioOrip = ls_solicitud.getUsuarioOrip();

					if(ls_usuarioOrip == null)
						throw new B2BException(ErrorKeys.SELECCIONAR_SOLICITUD_POR_CIUDADANO_ORIP);
				}
			}

			if(!StringUtils.isValidString(ls_idTipoDocumento))
				throw new B2BException(ErrorKeys.TIPO_DOCUMENTO_INVALIDO);

			if(StringUtils.isValidString(ls_documentoIdentidad))
			{
				if(
				    !ExpresionRegular.getExpresionRegular()
					                     .esDocumentoIdentidad(StringUtils.getString(ls_documentoIdentidad))
				)
					throw new B2BException(ErrorKeys.DEBE_DIGITAR_DOC_SIN_CARACTERES);
			}
			else
				throw new B2BException(ErrorKeys.DOCUMENTO_INVALIDO);

			lr_registro.setPersona(lp_parametros);
			setHabilitadoPorConsulta(true);
			lbd_beanDireccion.setHabilitadoPorConsulta(true);
			setPersonaConsultada(true);
			setExenta(false);

			cargarDataPersona(
			    irr_registroRemote.findPersonByDocument(lr_registro, getUserId()), ab_mostrarAlertas,
			    ab_soloMostrarAlertas, as_tipoRecepcion
			);
		}
		catch(B2BException lb2be_e)
		{
			clh_LOGGER.error(lb2be_e);
			addMessage(lb2be_e);
		}
	}

	/**
	 * Consultar persona documento inter.
	 */
	public void consultarPersonaDocumentoInter()
	{
		setRenderedInterviniente(false);
		setMostrarDatosConsultaInter(false);

		limpiarMedioNoInter();
		limpiarMedioCoInter();

		{
			SolicitudInterviniente lsi_inter;

			lsi_inter = getSolicitudInter();

			if(lsi_inter != null)
			{
				lsi_inter.setIdAutorizacionNotificacion(IdentificadoresCommon.DATO_INVALIDO);
				lsi_inter.setIdAutorizacionComunicacion(IdentificadoresCommon.DATO_INVALIDO);
			}
		}

		try
		{
			boolean      lb_focus;
			boolean      lb_consultaEntidad;
			FacesContext lfc_context;
			Persona      lp_parametros;
			Registro     lr_resultado;
			String       ls_idTipoDocumento;
			String       ls_documentoIdentidad;
			String       ls_idTipoEntidad;

			lb_focus               = true;
			lfc_context            = FacesContext.getCurrentInstance();
			lp_parametros          = new Persona();
			lr_resultado           = null;
			ls_idTipoEntidad       = getIdTipoEntidadInterviniente();
			lb_consultaEntidad     = StringUtils.isValidString(ls_idTipoEntidad);

			limpiarIntervinientesConsulta();

			if(lb_consultaEntidad)
			{
				AccEntidadExterna laee_param;
				String            ls_idEntidad;

				ls_idEntidad     = getIdEntidadExternaInterviniente();
				laee_param       = new AccEntidadExterna();
				lb_focus         = validateStyles(
					    "fRegistro:idSOMNombreEntidadExterna", lfc_context, ls_idEntidad, lb_focus
					);

				if(!StringUtils.isValidString(ls_idEntidad))
					throw new B2BException(ErrorKeys.NOMBRE_ENTIDAD_EXTERNA_INVALIDO);

				laee_param.setIdEntidadExterna(ls_idEntidad);

				setPersonaConsultadaInter(true);
				setMostrarDatosBasicosInterviniente(false);

				lr_resultado = irr_registroRemote.findEntidadExterna(
					    laee_param, getUserId(), getLocalIpAddress(), getRemoteIpAddress()
					);

				getBeanReference().setEntidadExterna(null);

				if(lr_resultado != null)
				{
					Persona lp_persona;

					lp_persona = lr_resultado.getPersona();

					if(lp_persona != null)
					{
						setTipoDocInterviniente(lp_persona.getIdDocumentoTipo());
						setDocumentoInterviniente(lp_persona.getNumeroDocumento());
					}
				}
			}
			else
			{
				lp_parametros.setNumeroDocumento(getDocumentoInterviniente());
				lp_parametros.setTipoDocIdentidad(getTipoDocInterviniente());

				ls_idTipoDocumento     = getTipoDocInterviniente();
				lb_focus               = validateStyles(
					    "fRegistro:idSOMTipoDocIdentidadInter", lfc_context, ls_idTipoDocumento, lb_focus
					);

				ls_documentoIdentidad     = getDocumentoInterviniente();
				lb_focus                  = validateStyles(
					    "fRegistro:idItDocumentoIDInter", lfc_context, ls_documentoIdentidad, lb_focus
					);

				if(!StringUtils.isValidString(ls_idTipoDocumento))
					throw new B2BException(ErrorKeys.TIPO_DOCUMENTO_INVALIDO);

				if(StringUtils.isValidString(ls_documentoIdentidad))
				{
					if(
					    !ExpresionRegular.getExpresionRegular()
						                     .esDocumentoIdentidad(StringUtils.getString(ls_documentoIdentidad))
					)
						throw new B2BException(ErrorKeys.DEBE_DIGITAR_DOC_SIN_CARACTERES);
				}
				else
					throw new B2BException(ErrorKeys.DOCUMENTO_INVALIDO);

				setPersonaConsultadaInter(true);

				{
					Registro lr_registro;

					lr_registro = new Registro();

					lr_registro.setPersona(lp_parametros);

					lr_resultado = irr_registroRemote.findPersonByDocument(lr_registro, getUserId());
				}
			}

			setMostrarDatosBasicosInterviniente(false);

			if(lr_resultado != null)
				llenarDatosIntervinientes(lr_resultado, true);
		}
		catch(B2BException lb2be_e)
		{
			clh_LOGGER.error(lb2be_e);
			addMessage(lb2be_e);
		}
		finally
		{
			actualizarComponente(is_messageIdGrowl);
		}
	}

