	/**
	 * Retorna el valor del objeto de String.
	 *
	 * @return devuelve el valor de String
	 *
	 */
	public String contar()
	{
		String ls_descripcion;
		char[] arrayChar;
		int    contador;
		String result;

		ls_descripcion     = getSolicitud().getDescripcion();
		contador           = 0;

		if(StringUtils.isValidString(ls_descripcion))
		{
			arrayChar     = ls_descripcion.toCharArray();
			contador      = arrayChar.length;
		}

		result = Integer.toString(contador) + "/4000";

		return result;
	}

