	/**
	 * Delete matricula.
	 *
	 * @param ams_ms correspondiente al valor del tipo de objeto MatriculaSegregacionUi
	 * @param adp_adp correspondiente al valor del tipo de objeto DatosDelPredio
	 */
	public void deleteMatricula(MatriculaSegregacionUi ams_ms, DatosDelPredio adp_adp)
	{
		try
		{
			if((ams_ms != null) && (adp_adp != null))
			{
				Collection<MatriculaSegregacionUi> lcmsui_msui;
				lcmsui_msui = adp_adp.getDataInfoPredial();

				if(CollectionUtils.isValidCollection(lcmsui_msui))
				{
					lcmsui_msui.remove(ams_ms);

					Collection<DatosDelPredio> lcdp_dp;
					lcdp_dp = getDatosDelPredio();

					if(CollectionUtils.isValidCollection(lcdp_dp))
					{
						String ls_idCirculo;
						int    li_posicion;

						ls_idCirculo     = adp_adp.getIdCirculo();
						li_posicion      = 0;

						if(StringUtils.isValidString(ls_idCirculo))
						{
							for(DatosDelPredio ldp_tmp : lcdp_dp)
							{
								if(ldp_tmp != null)
								{
									if(ls_idCirculo.equalsIgnoreCase(ldp_tmp.getIdCirculo()))
									{
										PrimeFaces.current().ajax()
											          .update(
											    is_repeatDatosPredio + li_posicion + is_complementoRepeat
											    + "idMatriculasAperturarManual"
											);

										break;
									}

									li_posicion++;
								}
							}
						}
					}

					adp_adp.setDataInfoPredial(lcmsui_msui);

					throw new B2BException("Registro Eliminado.");
				}
			}
		}
		catch(B2BException lb2be_e)
		{
			clh_LOGGER.error(lb2be_e);
			addMessage(lb2be_e);
			PrimeFaces.current().ajax().update(is_messageIdGrowl);
		}
	}

