	/**
	 * Elimina un predio previamente seleccionado.
	 */
	public void eliminarDatosAntSistema()
	{
		Ajax la_ajax;

		la_ajax = PrimeFaces.current().ajax();

		try
		{
			DatosDelPredio lddp_datosPredio;
			lddp_datosPredio = getDatosTemporalesEliminar();

			if((lddp_datosPredio == null))
				throw new B2BException(ErrorKeys.ERROR_INTERNO_SISTEMA);

			DatosAntSistema ldas_datos;

			ldas_datos = lddp_datosPredio.getDatosAntiguoSistema();

			if(ldas_datos == null)
				throw new B2BException(ErrorKeys.ERROR_INTERNO_SISTEMA);

			Collection<DatosAntSistema> lcdas_datosAnt;
			boolean                     lb_procesoCertificados;

			lcdas_datosAnt             = irr_registroRemote.eliminarDatosAntSistema(
				    ldas_datos, getUserId(), getLocalIpAddress(), getRemoteIpAddress()
				);
			lb_procesoCertificados     = isProcesoCertificados();

			{
				Collection<DatosDelPredio> lcddp_datosPredio;
				lcddp_datosPredio = getDatosDelPredio();

				if(CollectionUtils.isValidCollection(lcddp_datosPredio))
				{
					String                   ls_idCirculo;
					Iterator<DatosDelPredio> liddp_iterador;
					boolean                  lb_encontro;
					int                      li_posicion;

					ls_idCirculo       = StringUtils.getStringNotNull(lddp_datosPredio.getIdCirculo());
					liddp_iterador     = lcddp_datosPredio.iterator();
					lb_encontro        = false;
					li_posicion        = 0;

					while(liddp_iterador.hasNext() && !lb_encontro)
					{
						DatosDelPredio lddp_data;

						lddp_data = liddp_iterador.next();

						if(lddp_data != null)
						{
							String ls_idCirTemp;
							ls_idCirTemp = StringUtils.getStringNotNull(lddp_data.getIdCirculo());

							if(ls_idCirTemp.equals(ls_idCirculo))
							{
								lb_encontro = true;

								procesoEliminarDatosPredio(
								    lddp_data, lcdas_datosAnt, ldas_datos, lb_procesoCertificados
								);
							}
							else
								li_posicion++;
						}
					}

					setDatosTemporalesEliminar(null);

					la_ajax.update(
					    is_repeatDatosPredio + li_posicion + is_complementoRepeat + "idPnPrediosAntiguoSistema"
					);
					la_ajax.update(is_repeatDatosPredio + li_posicion + is_complementoRepeat + "idPRelacionActoPredio");
					la_ajax.update(is_repeatDatosPredio + li_posicion + is_complementoRepeat + "idPnlAdicional");
					la_ajax.update(
					    is_repeatDatosPredio + li_posicion + is_complementoRepeat + "idOPTablaDetalleAntsis"
					);
				}
			}

			if(lb_procesoCertificados)
				procesoEliminarDatosPredio(lddp_datosPredio, lcdas_datosAnt, ldas_datos, lb_procesoCertificados);

			addMessage(MessagesKeys.REGISTRO_ELIMINADO);
		}
		catch(B2BException lb2be_e)
		{
			clh_LOGGER.error("eliminarDatosAntSistema", lb2be_e);
			la_ajax.update(is_messageIdGrowl);
			addMessage(lb2be_e);
		}
	}

	/**
	 * Elimina de la base de datos un detalle del predio seleccionado en pantalla.
	 *
	 * @param addp_datosPredio Objeto contenedor de todos los detalles asociados al predio padre del detalle
	 * a eliminar
	 * @param adas_detalle Detalle de antiguo sistema que se va a eliminar de la base de datos
	 */
	public void eliminarDetalleAntSistema(DatosDelPredio addp_datosPredio, DetalleAntSistema adas_detalle)
	{
		Ajax la_ajax;

		la_ajax = PrimeFaces.current().ajax();

		try
		{
			if((addp_datosPredio == null) || (adas_detalle == null))
				throw new B2BException(ErrorKeys.ERROR_INTERNO_SISTEMA);
			else if(addp_datosPredio.isModificarDetallesAntSis())
				throw new B2BException(ErrorKeys.ERROR_SIN_GUARDAR_DETALLE_ANT_SIS_DELETE);

			irr_registroRemote.eliminarDetalleAntSistema(
			    adas_detalle, getUserId(), getLocalIpAddress(), getRemoteIpAddress()
			);

			Collection<DetalleAntSistema> lcdas_detalles;

			lcdas_detalles = addp_datosPredio.getDetallesAntSisAgregados();

			if(lcdas_detalles == null)
				throw new B2BException(ErrorKeys.ERROR_INTERNO_SISTEMA);

			lcdas_detalles.remove(adas_detalle);

			if(lcdas_detalles.isEmpty())
				addp_datosPredio.setDetallesAntSistemaGuardados(false);

			{
				Collection<DatosDelPredio> lcddp_datosPredio;

				lcddp_datosPredio = getDatosDelPredio();

				if(lcddp_datosPredio != null)
				{
					int                      li_posicion;
					String                   ls_idCirArg;
					Iterator<DatosDelPredio> liddp_iterador;
					boolean                  lb_encontro;

					li_posicion        = 0;
					ls_idCirArg        = StringUtils.getStringNotNull(addp_datosPredio.getIdCirculo());
					liddp_iterador     = lcddp_datosPredio.iterator();
					lb_encontro        = false;

					while(liddp_iterador.hasNext() && !lb_encontro)
					{
						DatosDelPredio lddp_datosPredio;

						lddp_datosPredio = liddp_iterador.next();

						if(lddp_datosPredio != null)
						{
							String ls_idCirculo;

							ls_idCirculo = StringUtils.getStringNotNull(lddp_datosPredio.getIdCirculo());

							if(ls_idCirculo.equalsIgnoreCase(ls_idCirArg))
								lb_encontro = true;
							else
								li_posicion++;
						}
					}

					la_ajax.update(is_repeatDatosPredio + li_posicion + is_complementoRepeat + "idSOMAno");
					la_ajax.update(is_repeatDatosPredio + li_posicion + is_complementoRepeat + "idSOMPartida");
					la_ajax.update(is_repeatDatosPredio + li_posicion + is_complementoRepeat + "idOLCirDetAntSis");
					la_ajax.update(
					    is_repeatDatosPredio + li_posicion + is_complementoRepeat
					    + "idSOMCirculoRegistralAntSistemaLibroSegundo"
					);
					la_ajax.update(
					    is_repeatDatosPredio + li_posicion + is_complementoRepeat + "idOLTipoPredioDetAntSis"
					);
					la_ajax.update(
					    is_repeatDatosPredio + li_posicion + is_complementoRepeat
					    + "idSOMTipoPredioAntSistemaLibroSegundo"
					);
					la_ajax.update(
					    is_repeatDatosPredio + li_posicion + is_complementoRepeat + "idOLMatriculaDetAntSis"
					);
					la_ajax.update(
					    is_repeatDatosPredio + li_posicion + is_complementoRepeat + "datosPredioIdMatricula"
					);
					la_ajax.update(
					    is_repeatDatosPredio + li_posicion + is_complementoRepeat + "idDTDetallesAntGuardados"
					);
				}
			}

			addMessage(MessagesKeys.DETALLE_ELIMINADO_SATISFACTORIAMENTE);
		}
		catch(B2BException lb2be_e)
		{
			clh_LOGGER.error("eliminarDetalleAntSistema", lb2be_e);
			addMessage(lb2be_e);
		}

		la_ajax.update(is_messageIdGrowl);
	}

