	/**
	 * Es cancelacion valida.
	 *
	 * @throws B2BException Señala que se ha producido una excepción
	 */
	public void esCancelacionValida()
	    throws B2BException
	{
		Collection<DatosDelPredio>    lcddp_datosPredio;
		Collection<ProhibicionVPM>    lcpv_prohibiciones;
		Collection<GravamenPendiente> lcgp_gravamenes;

		lcddp_datosPredio      = getDatosDelPredio();
		lcpv_prohibiciones     = getProhibicionesVPM();
		lcgp_gravamenes        = getGravamenes();

		if(CollectionUtils.isValidCollection(lcddp_datosPredio))
		{
			for(DatosDelPredio lddp_temp : lcddp_datosPredio)
			{
				if(lddp_temp != null)
				{
					Collection<PredioActoIU> lcpau_prediosActo;
					lcpau_prediosActo = lddp_temp.getActosAsociadosGeneral();

					if(CollectionUtils.isValidCollection(lcpau_prediosActo))
					{
						for(PredioActoIU lpau_temp : lcpau_prediosActo)
						{
							String  ls_circulo;
							String  ls_matricula;
							boolean lb_isTipoActo700;

							ls_circulo           = lpau_temp.getIdCirculo();
							ls_matricula         = StringUtils.getString(lpau_temp.getIdMatricula());
							lb_isTipoActo700     = lpau_temp.isTipoActo700();

							if(lpau_temp != null)
							{
								if(CollectionUtils.isValidCollection(lcgp_gravamenes))
								{
									Iterator<GravamenPendiente> ligp_iterator;

									ligp_iterator = lcgp_gravamenes.iterator();

									while(ligp_iterator.hasNext() && !lpau_temp.isEsTipoActo700Valido())
									{
										GravamenPendiente lgp_gravamenTemp;

										lgp_gravamenTemp = ligp_iterator.next();

										if(lgp_gravamenTemp != null)
										{
											if(
											    ls_circulo.equalsIgnoreCase(lgp_gravamenTemp.getIdCirculoPredio())
												    && ls_matricula.equalsIgnoreCase(
												        lgp_gravamenTemp.getIdMatriculaPredio()
												    ) && lb_isTipoActo700
											)
												lpau_temp.setEsTipoActo700Valido(true);
											else
												lpau_temp.setEsTipoActo700Valido(false);
										}
									}
								}

								if(!lpau_temp.isEsTipoActo700Valido())
								{
									if(CollectionUtils.isValidCollection(lcpv_prohibiciones))
									{
										Iterator<ProhibicionVPM> lipv_iterator;

										lipv_iterator = lcpv_prohibiciones.iterator();

										while(lipv_iterator.hasNext() && !lpau_temp.isEsTipoActo700Valido())
										{
											ProhibicionVPM lpv_prohibicionTemp;

											lpv_prohibicionTemp = lipv_iterator.next();

											if(lpv_prohibicionTemp != null)
											{
												if(
												    ls_circulo.equalsIgnoreCase(
													        lpv_prohibicionTemp.getIdCirculoPredio()
													    )
													    && ls_matricula.equalsIgnoreCase(
													        lpv_prohibicionTemp.getIdMatriculaPredio()
													    ) && lb_isTipoActo700
												)
													lpau_temp.setEsTipoActo700Valido(true);
												else
													lpau_temp.setEsTipoActo700Valido(false);
											}
										}
									}
								}
							}
						}

						for(PredioActoIU lpau_temp : lcpau_prediosActo)
						{
							String ls_matricula;

							ls_matricula = StringUtils.getString(lpau_temp.getIdMatricula());

							if(lpau_temp.isEsTipoActo700Valido())
							{
								Iterator<ProhibicionVPM> lipv_iterator;
								boolean                  lb_selecciono;
								lipv_iterator     = lcpv_prohibiciones.iterator();
								lb_selecciono     = false;

								while(lipv_iterator.hasNext() && !lb_selecciono)
								{
									ProhibicionVPM lpv_prohibicionTemp;

									lpv_prohibicionTemp = lipv_iterator.next();

									if(lpv_prohibicionTemp != null)
									{
										if(
										    lpv_prohibicionTemp.isSeleccionado()
											    && StringUtils.getString(ls_matricula)
											                      .equalsIgnoreCase(
											        lpv_prohibicionTemp.getIdMatriculaPredio()
											    )
										)
											lb_selecciono = true;
									}
								}

								if(!lb_selecciono)
								{
									Iterator<GravamenPendiente> ligp_iterator;

									ligp_iterator = lcgp_gravamenes.iterator();

									while(ligp_iterator.hasNext() && !lb_selecciono)
									{
										GravamenPendiente lgp_gravamenTemp;

										lgp_gravamenTemp = ligp_iterator.next();

										if(lgp_gravamenTemp != null)
										{
											if(
											    lgp_gravamenTemp.isSeleccionado()
												    && StringUtils.getString(ls_matricula)
												                      .equalsIgnoreCase(
												        lgp_gravamenTemp.getIdMatriculaPredio()
												    )
											)
												lb_selecciono = true;
										}
									}
								}

								if(!lb_selecciono)
								{
									Object[] loa_args;

									loa_args     = new String[1];

									loa_args[0] = ls_matricula;
									throw new B2BException(ErrorKeys.ERROR_SIN_ANOTACION_SELECCIONADA, loa_args);
								}
							}
							else if(lpau_temp.isTipoActo700())
							{
								Object[] loa_args;

								loa_args     = new String[1];

								loa_args[0] = ls_matricula;
								throw new B2BException(
								    ErrorKeys.ERROR_MATRICULA_ACTO_DE_CANCELACION_INVALIDA, loa_args
								);
							}
						}
					}
				}
			}
		}
	}

