	/**
	 * Consulta el departamento y municipio que se encuentren relacionados a un círculo registral específico.
	 *
	 * @param addp_data Objeto contenedor del id círculo a verificar
	 */
	public void filtrarPorCirculo(DatosDelPredio addp_data)
	{
		if(addp_data != null)
		{
			try
			{
				if(isEsCreacionMatriculasOficio())
					cargarDatosDelPredioCreacionMatriculasOficio(addp_data);

				boolean         lb_procesoCertificados;
				DatosAntSistema ldas_datosAntSis;
				String          ls_idCirculo;
				ZonaRegistral   lcr_zonaRegistral;

				lb_procesoCertificados     = isProcesoCertificados();
				ldas_datosAntSis           = addp_data.getDatosAntiguoSistema();

				if(ldas_datosAntSis == null)
					throw new B2BException(ErrorKeys.ERROR_INTERNO_SISTEMA);

				ls_idCirculo          = lb_procesoCertificados ? ldas_datosAntSis.getIdCirculo()
					                                           : addp_data.getIdCirculo();
				lcr_zonaRegistral     = new ZonaRegistral();

				lcr_zonaRegistral.setIdCirculo(ls_idCirculo);

				lcr_zonaRegistral = irr_registroRemote.findZonaRegistralById(lcr_zonaRegistral, getUserId());

				if(lcr_zonaRegistral != null)
				{
					Collection<Departamento> lcd_temp;

					lcd_temp = findDepartamentosAntSistema(addp_data);

					if(CollectionUtils.isValidCollection(lcd_temp))
					{
						for(Departamento ld_dept : lcd_temp)
						{
							if(ld_dept != null)
							{
								if(ld_dept.getIdDepartamento().equals(lcr_zonaRegistral.getIdDepartamento()))
								{
									ldas_datosAntSis.setIdDepartamento(ld_dept.getIdDepartamento());

									break;
								}
							}
						}
					}

					if(!lb_procesoCertificados && !isEsCreacionMatriculasOficio())
					{
						Collection<Municipio> lcm_mun;

						lcm_mun = findMunicipioAntSistema(addp_data);

						if(CollectionUtils.isValidCollection(lcm_mun))
						{
							for(Municipio lm_municipio : lcm_mun)
							{
								if(lm_municipio != null)
								{
									if(lm_municipio.getIdMunicipio().equals(lcr_zonaRegistral.getIdMunicipio()))
									{
										ldas_datosAntSis.setIdMunicipio(lm_municipio.getIdMunicipio());

										break;
									}
								}
							}
						}
					}
				}
			}
			catch(B2BException lb2be_e)
			{
				clh_LOGGER.error("filtrarPorCirculo", lb2be_e);
				addMessage(lb2be_e);
			}
		}
	}

