	/**
	 * Filtrar por dep Y mun.
	 *
	 * @param addp_data correspondiente al valor del tipo de objeto DatosDelPredio
	 */
	public void filtrarPorDepYMun(DatosDelPredio addp_data)
	{
		if(addp_data != null)
		{
			DatosAntSistema            ldas_datosAntSis;
			String                     ld_dept;
			Collection<DatosDelPredio> lcddp_datosPredio;

			ldas_datosAntSis      = addp_data.getDatosAntiguoSistema();
			ld_dept               = ldas_datosAntSis.getIdDepartamento();
			lcddp_datosPredio     = getDatosDelPredio();

			if((ld_dept != null) && (lcddp_datosPredio != null))
			{
				String                    lm_mun;
				Collection<ZonaRegistral> lcidt_datos;

				lcidt_datos     = findAllZonaRegistrales();
				lm_mun          = ldas_datosAntSis.getIdMunicipio();

				lcddp_datosPredio.remove(addp_data);

				if(lcidt_datos != null)
				{
					for(ZonaRegistral l_zonaRegistral : lcidt_datos)
					{
						if(
						    l_zonaRegistral.getIdDepartamento().equals(ld_dept)
							    && l_zonaRegistral.getIdMunicipio().equals(lm_mun)
						)
						{
							ldas_datosAntSis.setIdCirculo(l_zonaRegistral.getIdCirculo());

							addp_data.setDatosAntiguoSistema(ldas_datosAntSis);

							lcddp_datosPredio.add(addp_data);

							break;
						}
					}
				}
			}
		}
	}

