	/**
	 * Retorna el valor del objeto de Collection.
	 *
	 * @return devuelve el valor de Collection
	 *
	 */
	public Collection<com.bachue.snr.prosnr01.model.sdb.pgn.TipoDocumental> findAllTiposDocumentales()
	{
		Collection<com.bachue.snr.prosnr01.model.sdb.pgn.TipoDocumental> lctd_documentoTipos;
		String                                                           ls_constante;
		lctd_documentoTipos     = new LinkedList<com.bachue.snr.prosnr01.model.sdb.pgn.TipoDocumental>();
		ls_constante            = null;

		if(isEsProrrogaEntregaDocumentacion())
			ls_constante = ConstanteCommon.TIPO_DOC_REQ_PRORROGA;

		else if(
		    isEsProcesoDesistimiento() || isEsProrrogaMayorValor() || isEsSuspensionArticulo()
			    || isEsRecepcionRecursos() || isEsSegundaInstancia()
		)
		{
			Solicitud ls_solicitud;
			ls_solicitud = getSolicitud();

			if(ls_solicitud != null)
			{
				String ls_idCalidadSolicitante;

				ls_idCalidadSolicitante = ls_solicitud.getIdCalidadSolicitante();

				if(StringUtils.isValidString(ls_idCalidadSolicitante))
				{
					if(ls_idCalidadSolicitante.equalsIgnoreCase("1"))
					{
						if(isEsSuspensionArticulo())
							ls_constante = ConstanteCommon.TIPOS_DOC_ART19_APODERADO;
						else
							ls_constante = ConstanteCommon.TIPO_DOC_APOD_REQ_DESISTIMIENTO;
					}
					else
					{
						if(isEsSuspensionArticulo())
							ls_constante = ConstanteCommon.TIPOS_DOC_ART19_INTERESADO;
						else
							ls_constante = ConstanteCommon.TIPO_DOC_REQ_DESISTIMIENTO;
					}
				}
				else
					ls_constante = ConstanteCommon.TIPO_DOC_REQ_DESISTIMIENTO;
			}
		}

		try
		{
			lctd_documentoTipos = irr_referenceRemote.findAllTiposDocumentales(
				    getUserId(), getLocalIpAddress(), getRemoteIpAddress(), ls_constante
				);
		}
		catch(B2BException lb2be_e)
		{
			addMessage(lb2be_e);
		}

		return lctd_documentoTipos;
	}

