	/**
	 * Método para buscar todos los tipo de documento publico activo.
	 *
	 * @return Coleccion de TipoDocumentoPublico
	 *
	 */
	public Collection<TipoDocumentoPublico> findTipoDocumentoPublicoActivo()
	{
		Collection<TipoDocumentoPublico> lcidt_datos;

		String                           ls_idProceso;
		Solicitud                        ls_solicitud;

		lcidt_datos      = null;
		ls_idProceso     = getIdProceso();
		ls_solicitud     = getSolicitud();

		try
		{
			if((ls_idProceso != null) && (ls_solicitud != null))
			{
				String ls_idProcesoSolicitud;

				ls_idProcesoSolicitud = ls_solicitud.getIdProceso();

				if(ls_idProceso.equalsIgnoreCase(ProcesoCommon.ID_PROCESO_37))
					lcidt_datos = irr_registroRemote.findTipoDocumentoPublicoByConstante();
				else if(ls_idProceso.equalsIgnoreCase(ProcesoCommon.ID_PROCESO_38))
					lcidt_datos = irr_registroRemote.findTipoDocumentoPublicoTraslado();
				else if(
				    (ls_idProcesoSolicitud != null)
					    && (ls_idProcesoSolicitud.equalsIgnoreCase(ProcesoCommon.ID_PROCESO_42)
					    || ls_idProcesoSolicitud.equalsIgnoreCase(ProcesoCommon.ID_PROCESO_39)
					    || isEsRecepcionRecursos() || isEsSegundaInstancia() || isEsSuspensionArticulo())
				)
				{
					lcidt_datos = irr_registroRemote.findTipoDocumentoPublicoByConstante();

					if(isEsSuspensionArticulo())
					{
						Documento ld_documento;
						ld_documento = getBgnDocumento();

						if((ld_documento != null) && !StringUtils.isValidString(ld_documento.getIdTipoDocumento()))
						{
							ld_documento.setIdTipoDocumento(TipoDocumentoPublicoCommon.OFICIO);
							tipoDocumentoValidar(null);
						}
					}
				}
				else if(
				    (ls_idProcesoSolicitud != null)
					    && ls_idProcesoSolicitud.equalsIgnoreCase(ProcesoCommon.ID_PROCESO_6)
					    && ls_solicitud.getIdSubproceso().equalsIgnoreCase(SubProcesoCommon.TESTAMENTO)
				)
				{
					lcidt_datos = irr_referenceRemote.findTipoDocumentoPublico(EstadoCommon.S);

					if(CollectionUtils.isValidCollection(lcidt_datos))
					{
						Collection<TipoDocumentoPublico> lcidt_datosTestamentos;
						lcidt_datosTestamentos = new LinkedList<TipoDocumentoPublico>();

						for(TipoDocumentoPublico itdp_tipoDocumento : lcidt_datos)
						{
							if(itdp_tipoDocumento != null)
							{
								String ls_idTipoDocumento;
								ls_idTipoDocumento = itdp_tipoDocumento.getIdTipoDocumento();

								if(StringUtils.isValidString(ls_idTipoDocumento) && !ls_idTipoDocumento.equals("38"))
									lcidt_datosTestamentos.add(itdp_tipoDocumento);
							}
						}

						lcidt_datos = lcidt_datosTestamentos;
					}

					Documento ld_documento;
					ld_documento = getBgnDocumento();

					if((ld_documento != null) && !StringUtils.isValidString(ld_documento.getIdTipoDocumento()))
						ld_documento.setIdTipoDocumento(TipoDocumentoPublicoCommon.ESCRITURA);

					tipoOficina(null);
				}
				else
				{
					lcidt_datos = irr_referenceRemote.findTipoDocumentoPublico(EstadoCommon.S);

					if(isEsCreacionMatriculasOficio())
					{
						if(isEsCreacionMatriculasOficio())
						{
							String ls_usuarioOrip;
							ls_usuarioOrip = ls_solicitud.getUsuarioOrip();

							if(ls_usuarioOrip.equalsIgnoreCase(IdentificadoresCommon.S))
								tipoDocumentoValidar(null);
						}
					}
				}
			}
			else
				lcidt_datos = irr_referenceRemote.findTipoDocumentoPublico(EstadoCommon.S);
		}
		catch(B2BException lb2be_e)
		{
			addMessage(lb2be_e);

			lcidt_datos = null;
		}

		return lcidt_datos;
	}

	/**
	 * Método para habilitar en el dropdown la secuencia y encontrar el consecutivo de la secuencia del documento.
	 *
	 * @return devuelve el valor de Collection
	 *
	 */
	public Collection<InteresadoDocumentoTipo> findTipoDocumentoSecuencia()
	{
		Collection<InteresadoDocumentoTipo> lcidt_datos;

		try
		{
			if(isHabilitarSecuencia())
			{
				String ls_tipoDocInter;
				ls_tipoDocInter = getTipoDocInterviniente();

				if(ls_tipoDocInter != null)
				{
					if(ls_tipoDocInter.equalsIgnoreCase(EstadoCommon.SE))
					{
						lcidt_datos = irr_referenceRemote.findTipoDocumento();

						Constantes lc_constante;
						lc_constante = new Constantes();
						lc_constante.setIdConstante(ConstanteCommon.CONSECUTIVO_TIPO_DOCUMENTO_SECUENCIA);
						lc_constante = irr_registroRemote.findConstante(lc_constante);

						if(lc_constante != null)
						{
							BigInteger lbi_temp;

							lbi_temp = lc_constante.getEntero().add(NumericUtils.getBigInteger(1));

							if(NumericUtils.isValidBigInteger(lbi_temp))
								setDocumentoInterviniente(StringUtils.getString(lbi_temp));

							setRenderedHabilitaSecuencia(true);
							getPersonaInter().setIdDocumentoTipo(ls_tipoDocInter);
							getPersonaInter().setNumeroDocumento(StringUtils.getString(lbi_temp));
						}
					}
					else
					{
						lcidt_datos = irr_referenceRemote.findTipoDocumento();
						setRenderedHabilitaSecuencia(false);
					}
				}
				else
				{
					lcidt_datos = irr_referenceRemote.findTipoDocumento();
					setDocumentoInterviniente(null);
					setRenderedHabilitaSecuencia(false);
				}
			}
			else
			{
				lcidt_datos = irr_referenceRemote.findTipoDocumentoActivo();
				setDocumentoInterviniente(null);
				setRenderedHabilitaSecuencia(false);
			}
		}
		catch(B2BException lb2be_e)
		{
			clh_LOGGER.error(lb2be_e);
			addMessage(lb2be_e);

			lcidt_datos = null;
		}

		return lcidt_datos;
	}

	/**
	 * Find tipo entidad documento.
	 *
	 * @param addp_datosPredio correspondiente al valor del tipo de objeto DatosDelPredio
	 */
	public void findTipoEntidadDocumento(DatosDelPredio addp_datosPredio)
	{
		boolean   lb_antSis;
		String    ls_idTipoOficina;
		Documento ld_documento;

		lb_antSis            = false;
		ls_idTipoOficina     = null;
		ld_documento         = null;

		if(addp_datosPredio != null)
		{
			ld_documento = addp_datosPredio.getBgnDocumento();

			if(ld_documento != null)
				lb_antSis = true;
		}

		ls_idTipoOficina = lb_antSis ? ld_documento.getIdTipoOficina() : getIdTipoOficina();

		try
		{
			if(StringUtils.isValidString(ls_idTipoOficina))
			{
				TipoOficina lto_to;

				lto_to = new TipoOficina();

				lto_to.setIdTipoOficina(ls_idTipoOficina);

				lto_to = irr_referenceRemote.findTipoOficinaById(lto_to);

				if(lto_to != null)
				{
					TipoEntidad lte_te;

					lte_te = new TipoEntidad();

					lte_te.setIdTipoEntidad(lto_to.getIdTipoEntidad());

					lte_te = irr_referenceRemote.findTipoEntidadById(lte_te);

					if(lb_antSis)
					{
						DatosDelPredio[] lddpa_datosPredio;

						//int              li_posicion;
						String                     ls_idCirArg;
						Collection<DatosDelPredio> lcddp_datosPredio;

						lcddp_datosPredio = getDatosDelPredio();

						if(lcddp_datosPredio == null)
							throw new B2BException(ErrorKeys.ERROR_INTERNO_SISTEMA);

						lddpa_datosPredio     = lcddp_datosPredio.toArray(new DatosDelPredio[lcddp_datosPredio.size()]);
						//li_posicion           = 0;
						ls_idCirArg           = StringUtils.getStringNotNull(addp_datosPredio.getIdCirculo());

						for(int li_i = 0; li_i < lddpa_datosPredio.length; li_i++)
						{
							if(lddpa_datosPredio[li_i] != null)
							{
								String ls_idCirculo;

								ls_idCirculo = StringUtils.getStringNotNull(lddpa_datosPredio[li_i].getIdCirculo());

								if(ls_idCirculo.equalsIgnoreCase(ls_idCirArg))
								{
									lddpa_datosPredio[li_i].setIdTipoEntidad(lte_te.getIdTipoEntidad());
									lddpa_datosPredio[li_i].setIdDepartamento(null);
									lddpa_datosPredio[li_i].setIdMunicipio(null);

									//li_posicion = li_i;
									break;
								}
							}
						}

						lcddp_datosPredio = new ArrayList<DatosDelPredio>(Arrays.asList(lddpa_datosPredio));

						setDatosDelPredio(lcddp_datosPredio);
						setIdTipoEntidad(lte_te.getIdTipoEntidad());
					}
					else
						setIdTipoEntidad(lte_te.getIdTipoEntidad());
				}
			}
			else
				setIdTipoEntidad(null);
		}
		catch(B2BException lb2be_e)
		{
			clh_LOGGER.error("findTipoEntidadDocumento", lb2be_e);
			addMessage(lb2be_e);
		}
	}

	/**
	 * Busca los tipos de oficina que correspondan al tipo de documento seleccionado.
	 *
	 * @param addp_datosPredio Objeto contenedor de la información del documento
	 * @return Colección de tipos de oficina resultante de la busqueda
	 *
	 */
	public Collection<TipoOficina> findTipoOficina(DatosDelPredio addp_datosPredio)
	{
		Collection<TipoOficina> lcto_datos;

		lcto_datos = new ArrayList<TipoOficina>();

		try
		{
			if(isEsGrabacionMatriculas())
			{
				Documento ld_d;
				ld_d = getBgnDocumento();

				if(ld_d != null)
				{
					String ls_tipoDoc;
					ls_tipoDoc = ld_d.getIdTipoDocumento();

					if(ls_tipoDoc != null)
					{
						TipoOficina lto_tipoOfi;

						lto_tipoOfi = new TipoOficina();

						if(ls_tipoDoc.equalsIgnoreCase(TipoDocumentoPublicoCommon.OFICIO))
						{
							lto_tipoOfi.setIdTipoOficina(TipoOficinaCommon.OFICINA_REGISTRO);

							lto_tipoOfi = irr_referenceRemote.findTipoOficinaById(lto_tipoOfi);

							if(lto_tipoOfi != null)
							{
								lcto_datos.add(lto_tipoOfi);
								setIdTipoOficina(lto_tipoOfi.getIdTipoOficina());
							}
						}
						else if(ls_tipoDoc.equalsIgnoreCase(TipoDocumentoPublicoCommon.CARTA))
						{
							lto_tipoOfi.setIdTipoOficina(TipoOficinaCommon.PARTICULAR);

							lto_tipoOfi = irr_referenceRemote.findTipoOficinaById(lto_tipoOfi);

							if(lto_tipoOfi != null)
							{
								lcto_datos.add(lto_tipoOfi);
								setIdTipoOficina(lto_tipoOfi.getIdTipoOficina());
							}
						}

						setTipoOficinaDocumento(lcto_datos);
					}
					else
					{
						setTipoOficinaDocumento(null);
						setIdTipoOficina(null);
					}
				}
			}
			else
			{
				Documento ld_d;
				Documento ld_docAntSis;
				boolean   lb_antSis;

				ld_docAntSis     = null;
				lb_antSis        = false;

				if(addp_datosPredio != null)
				{
					ld_docAntSis = addp_datosPredio.getBgnDocumento();

					if(ld_docAntSis != null)
						lb_antSis = true;
				}

				ld_d     = lb_antSis ? ld_docAntSis : getBgnDocumento();

				lcto_datos = irr_referenceRemote.findTipoOficina(ld_d);

				if(CollectionUtils.isValidCollection(lcto_datos))
				{
					if(lcto_datos.size() == 1)
					{
						for(TipoOficina lto_tmp : lcto_datos)
						{
							if(lto_tmp != null)
								if(lb_antSis)
									addp_datosPredio.getBgnDocumento().setIdTipoOficina(lto_tmp.getIdTipoOficina());
								else
									setIdTipoOficina(lto_tmp.getIdTipoOficina());
						}
					}
					else if(lcto_datos.size() >= 2)
					{
						Iterator<TipoOficina> lito_oficinas;

						lito_oficinas = lcto_datos.iterator();

						if(lito_oficinas.hasNext())
						{
							TipoOficina lto_oficina;

							lto_oficina = lito_oficinas.next();

							if(lto_oficina != null)
							{
								String ls_idTipoOficina;

								ls_idTipoOficina = lto_oficina.getIdTipoOficina();

								if(StringUtils.isValidString(ls_idTipoOficina))
								{
									if(lb_antSis)
										addp_datosPredio.getBgnDocumento().setIdTipoOficina(ls_idTipoOficina);
									else
										setIdTipoOficina(ls_idTipoOficina);
								}
							}
						}
					}

					if(lb_antSis)
						addp_datosPredio.setTipoOficinaDocumento(lcto_datos);
					else
						setTipoOficinaDocumento(lcto_datos);
				}
				else
				{
					TipoOficina ltf_seleccione;

					ltf_seleccione     = new TipoOficina();
					lcto_datos         = new ArrayList<TipoOficina>();

					ltf_seleccione.setNombre(ConstanteCommon.SELECCIONE);
					lcto_datos.add(ltf_seleccione);
					setTipoOficinaDocumento(lcto_datos);
				}
			}
		}
		catch(B2BException lb2be_e)
		{
			clh_LOGGER.error("findTipoOficina", lb2be_e);
			addMessage(lb2be_e);
			lcto_datos = null;
		}

		return lcto_datos;
	}

