	/**
	 * Retorna el valor del objeto de Collection.
	 *
	 * @param as_solicitud correspondiente al valor del tipo de objeto Solicitud
	 * @param as_idCirculo correspondiente al valor del tipo de objeto String
	 * @return devuelve el valor de Collection
	 * @throws B2BException Señala que se ha producido una excepción
	 *
	 */
	public Collection<com.bachue.snr.prosnr01.model.registro.Acto> generarDatosActos(
	    Solicitud as_solicitud, String as_idCirculo
	)
	    throws B2BException
	{
		Collection<com.bachue.snr.prosnr01.model.registro.Acto> lca_actos;
		int                                                     li_contadorReloteo;
		int                                                     li_contadorLoteo;
		int                                                     li_contadorDivisionMaterial;
		boolean                                                 lb_sumatoriaArea;
		li_contadorReloteo              = 0;
		li_contadorLoteo                = 0;
		li_contadorDivisionMaterial     = 0;
		lb_sumatoriaArea                = false;

		if(StringUtils.isValidString(as_idCirculo))
			lca_actos = irr_registroRemote.findActosBySolicitudIdCirculo(
				    as_solicitud.getIdSolicitud(), as_idCirculo, getUserId(), getLocalIpAddress(), getRemoteIpAddress()
				);
		else
			lca_actos = irr_registroRemote.findActosBySolicitud(as_solicitud.getIdSolicitud());

		setActosConSegregacion(false);

		if(CollectionUtils.isValidCollection(lca_actos))
		{
			Map<String, TipoActo> lhm_actos;

			lhm_actos = getAllTiposActo();

			for(com.bachue.snr.prosnr01.model.registro.Acto la_acto : lca_actos)
			{
				if(la_acto != null)
				{
					boolean  lb_actoSegregacion;
					String   ls_actoSinCuantia;
					String   ls_codigoActo;
					TipoActo lta_tipoActo;

					ls_actoSinCuantia     = la_acto.getActoConCuantia();
					ls_codigoActo         = la_acto.getCodigo();

					if(CollectionUtils.isValidCollection(lhm_actos))
						lta_tipoActo = lhm_actos.get(ls_codigoActo);
					else
						lta_tipoActo = null;

					if(lta_tipoActo != null)
					{
						lb_actoSegregacion = StringUtils.getStringNotNull(lta_tipoActo.getGeneraSegregacion())
								                            .equalsIgnoreCase(EstadoCommon.S);

						if(
						    StringUtils.isValidString(lta_tipoActo.getHabilitarSecuencia())
							    && lta_tipoActo.getHabilitarSecuencia().equalsIgnoreCase(EstadoCommon.S)
						)
							setHabilitarSecuencia(true);
						else
							setHabilitarSecuencia(false);
					}
					else
						lb_actoSegregacion = false;

					if(!lb_sumatoriaArea)
						lb_sumatoriaArea = StringUtils.getStringNotNull(la_acto.getSumatoriaArea())
								                          .equalsIgnoreCase(EstadoCommon.S);

					{
						if(lb_actoSegregacion)
						{
							if(ls_codigoActo.equalsIgnoreCase("0331") || ls_codigoActo.equalsIgnoreCase("0347"))
								setActosConSegregacion(isRespuestaSegregarActo());
							else
								setActosConSegregacion(lb_actoSegregacion);
						}
					}

					if(StringUtils.isValidString(ls_codigoActo))
					{
						la_acto.setMatriculaLiquidacion(StringUtils.isValidString(la_acto.getIdActoPrincipal()));

						{
							boolean lb_actoBaldio;

							lb_actoBaldio = irr_registroRemote.validarTipoActoBaldio(ls_codigoActo);

							if(lb_actoBaldio)
								setEsTipoActoBaldio(true);
						}

						{
							Constantes lc_constanteEnglobes;

							lc_constanteEnglobes = new Constantes();

							lc_constanteEnglobes.setIdConstante(ConstanteCommon.CODIGOS_ACTOS_ENGLOBES);

							lc_constanteEnglobes = ipr_parameterRemote.findConstantById(lc_constanteEnglobes);

							if(lc_constanteEnglobes != null)
							{
								String ls_caracter;

								ls_caracter = lc_constanteEnglobes.getCaracter();

								if(StringUtils.isValidString(ls_caracter))
								{
									String[] lsa_codigos;

									lsa_codigos = ls_caracter.split(",");

									if(CollectionUtils.isValidCollection(lsa_codigos))
									{
										Map<String, String> lhmss_codigos;

										lhmss_codigos = new HashMap<String, String>();

										for(String ls_iterador : lsa_codigos)
										{
											if(StringUtils.isValidString(ls_iterador))
												lhmss_codigos.put(ls_iterador, ls_iterador);
										}

										if(lhmss_codigos.containsKey(ls_codigoActo))
											setProcesoEnglobes(true);
									}
								}
							}
						}

						{
							Constantes lc_constanteEnglobes;

							lc_constanteEnglobes = new Constantes();

							lc_constanteEnglobes.setIdConstante(ConstanteCommon.CODIGOS_ACTOS_DESENGLOBES);

							lc_constanteEnglobes = ipr_parameterRemote.findConstantById(lc_constanteEnglobes);

							if(lc_constanteEnglobes != null)
							{
								String ls_caracter;

								ls_caracter = lc_constanteEnglobes.getCaracter();

								if(StringUtils.isValidString(ls_caracter))
								{
									String[] lsa_codigos;

									lsa_codigos = ls_caracter.split(",");

									if(CollectionUtils.isValidCollection(lsa_codigos))
									{
										Map<String, String> lhmss_codigos;

										lhmss_codigos = new HashMap<String, String>();

										for(String ls_iterador : lsa_codigos)
										{
											if(StringUtils.isValidString(ls_iterador))
												lhmss_codigos.put(ls_iterador, ls_iterador);
										}

										if(lhmss_codigos.containsKey(ls_codigoActo))
										{
											setAreaUI(null);
											setProcesoDesenglobes(true);
										}
									}
								}
							}
						}

						{
							Constantes lc_constanteVentaParcial;

							lc_constanteVentaParcial = new Constantes();

							lc_constanteVentaParcial.setIdConstante(ConstanteCommon.CODIGOS_ACTOS_VENTA_PARCIAL);

							lc_constanteVentaParcial = ipr_parameterRemote.findConstantById(lc_constanteVentaParcial);

							if(lc_constanteVentaParcial != null)
							{
								String ls_caracter;

								ls_caracter = lc_constanteVentaParcial.getCaracter();

								if(StringUtils.isValidString(ls_caracter))
								{
									String[] lsa_codigos;

									lsa_codigos = ls_caracter.split(",");

									if(CollectionUtils.isValidCollection(lsa_codigos))
									{
										Map<String, String> lhmss_codigos;

										lhmss_codigos = new HashMap<String, String>();

										for(String ls_iterador : lsa_codigos)
										{
											if(StringUtils.isValidString(ls_iterador))
												lhmss_codigos.put(ls_iterador, ls_iterador);
										}

										if(lhmss_codigos.containsKey(ls_codigoActo))
										{
											setAreaUI(null);
											setProcesoVentaParcial(true);
										}
									}
								}
							}
						}

						{
							if(getCodigosReLoteo().containsKey(ls_codigoActo))
							{
								setAreaUI(null);
								li_contadorReloteo++;
							}

							if(getCodigosLoteo().containsKey(ls_codigoActo))
								li_contadorLoteo++;

							if(getCodigosDivisionMaterial().containsKey(ls_codigoActo))
								li_contadorDivisionMaterial++;
						}
					}

					if(StringUtils.isValidString(ls_actoSinCuantia))
					{
						la_acto.setActoConCuantia(
						    (ls_actoSinCuantia.equalsIgnoreCase(EstadoCommon.S)
							    || ls_actoSinCuantia.equalsIgnoreCase(EstadoCommon.X))
						    ? IdentificadoresCommon.SIN_CUANTIA : IdentificadoresCommon.CON_CUANTIA
						);
						la_acto.setEspecificacion((lta_tipoActo != null) ? lta_tipoActo.getNombre() : null);
					}
				}

				if(li_contadorReloteo > 0)
					setProcesoReloteo(true);
				else
					setProcesoReloteo(false);

				if(li_contadorLoteo > 0)
					setProcesoLoteo(true);
				else
					setProcesoLoteo(false);

				if(li_contadorDivisionMaterial > 0)
					setDivisionMaterial(true);
				else
					setDivisionMaterial(false);
			}

			setSumatoriaTotalArea(lb_sumatoriaArea);
		}

		return lca_actos;
	}

	/**
	 * Generar recibo liquidacion.
	 *
	 * @param ab_b correspondiente al valor del tipo de objeto boolean
	 * @throws Exception Señala que se ha producido una excepción
	 */
	public void generarReciboLiquidacion(boolean ab_b)
	    throws Exception
	{
		try
		{
			Registro    lr_registro;
			Solicitud   ls_solicitud;
			String      ls_user;
			byte[]      lba_pdf;
			InputStream lis_stream;

			lr_registro      = new Registro();
			ls_solicitud     = getSolicitud();
			ls_user          = getUserId();
			lr_registro.setSolicitud(ls_solicitud);
			lr_registro.setIdUsuarioCreacion(ls_user);

			lr_registro = irr_registroRemote.generarReciboLiquidacion(
				    lr_registro, ab_b, ls_user, getLocalIpAddress(), getRemoteIpAddress()
				);

			if(lr_registro != null)
			{
				lba_pdf = lr_registro.getPdf();

				if(lba_pdf == null)
					throw new B2BException(ErrorKeys.NO_GENERO_PDF);

				{
					lis_stream = new ByteArrayInputStream(lba_pdf);

					setReciboLiquidacion(
					    new DefaultStreamedContent(
					        lis_stream, TipoContenidoCommon.PDF,
					        ConstanteCommon.NOMBRE_ARCHIVO_RECIBO_LIQUIDACION + ExtensionCommon.PDF_PUNTO
					    )
					);
				}
			}
		}
		catch(B2BException lb2be_e)
		{
			clh_LOGGER.error(lb2be_e);
			addMessage(lb2be_e);
		}
	}

	/**
	 * Guarda en la base de datos los datos suministrados por pantalla de un predio de antiguo sistema.
	 *
	 * @param addp_datosPredio Objeto contenedor de los predios agregados para un círculo específico
	 * @param ab_guardar Indica si la información suministrada se va a insertar o a actualizar, true para insertar,
	 * false para actualizar
	 */
	public void guardarDatosAntSistema(DatosDelPredio addp_datosPredio, boolean ab_guardar)
	{
		if(addp_datosPredio != null)
		{
			Collection<DatosDelPredio> lcddp_datosPredio;
			DatosAntSistema            ldas_datosAntSis;

			lcddp_datosPredio     = getDatosDelPredio();
			ldas_datosAntSis      = addp_datosPredio.getDatosAntiguoSistema();

			try
			{
				PrimeFaces lpf_primefaces;

				lpf_primefaces = PrimeFaces.current();

				if(ldas_datosAntSis != null)
				{
					boolean lb_procesoCertificados;

					lb_procesoCertificados = isProcesoCertificados();

					ldas_datosAntSis.setAdquisicionPredio(addp_datosPredio.getAntiguoSistema1932());
					ldas_datosAntSis.setIdSolicitud(getSolicitud().getIdSolicitud());

					if(!lb_procesoCertificados)
						validarCamposDatosAntSistema(addp_datosPredio, lcddp_datosPredio, lpf_primefaces);

					ldas_datosAntSis = irr_registroRemote.guardarDatosAntSistema(
						    ldas_datosAntSis, getUserId(), getLocalIpAddress(), getRemoteIpAddress(), ab_guardar
						);

					if(ldas_datosAntSis == null)
						throw new B2BException(ErrorKeys.ERROR_INTERNO_SISTEMA);

					int li_posicion;

					li_posicion = 0;

					if(CollectionUtils.isValidCollection(lcddp_datosPredio))
					{
						{
							String                   ls_idCirArg;
							Iterator<DatosDelPredio> liddp_iterador;
							boolean                  lb_encontro;

							ls_idCirArg        = StringUtils.getStringNotNull(addp_datosPredio.getIdCirculo());
							liddp_iterador     = lcddp_datosPredio.iterator();
							lb_encontro        = false;

							while(liddp_iterador.hasNext() && !lb_encontro)
							{
								DatosDelPredio lddp_datosPredio;

								lddp_datosPredio = liddp_iterador.next();

								if(lddp_datosPredio != null)
								{
									String ls_idCirculo;

									ls_idCirculo = StringUtils.getStringNotNull(lddp_datosPredio.getIdCirculo());

									if(ls_idCirculo.equalsIgnoreCase(ls_idCirArg))
										lb_encontro = true;
									else
										li_posicion++;
								}
							}
						}

						{
							Collection<ColumnModel> lccm_infoActos;
							lccm_infoActos = addp_datosPredio.getColumns();

							if(CollectionUtils.isValidCollection(lccm_infoActos))
							{
								Map<String, Boolean> lmsb_actos;
								lmsb_actos = new HashMap<String, Boolean>();

								for(ColumnModel lcm_tmp : lccm_infoActos)
								{
									if(lcm_tmp != null)
									{
										String ls_idActo;

										ls_idActo = lcm_tmp.getIdActo();

										if(StringUtils.isValidString(ls_idActo))
											lmsb_actos.put(ls_idActo, new Boolean(false));
									}
								}

								ldas_datosAntSis.setActos(lmsb_actos);
							}
						}
					}

					addp_datosPredio.setDatosAntiguoSistema(ldas_datosAntSis);
					addp_datosPredio.setDatosAntSistemaGuardados(true);
					addp_datosPredio.setCreacionPredio(false);

					{
						Collection<DatosAntSistema> lcdas_datos;
						lcdas_datos = addp_datosPredio.getDatosAntSisAgregados();

						if(lcdas_datos != null)
						{
							if(ab_guardar)
								lcdas_datos.add(ldas_datosAntSis);
							else
							{
								String                    ls_idDatos;
								Iterator<DatosAntSistema> lidas_iterador;
								boolean                   lb_encontro;

								ls_idDatos         = StringUtils.getStringNotNull(
									    ldas_datosAntSis.getIdDatosAntSistema()
									);
								lidas_iterador     = lcdas_datos.iterator();
								lb_encontro        = false;

								while(lidas_iterador.hasNext() && !lb_encontro)
								{
									DatosAntSistema ldas_dataTemp;

									ldas_dataTemp = lidas_iterador.next();

									if(ldas_dataTemp != null)
									{
										String ls_idDatosTemp;
										ls_idDatosTemp = StringUtils.getStringNotNull(
											    ldas_dataTemp.getIdDatosAntSistema()
											);

										if(ls_idDatosTemp.equals(ls_idDatos))
										{
											ldas_dataTemp.setAdquisicionPredio(ldas_datosAntSis.getAdquisicionPredio());
											ldas_dataTemp.setIdTipoPredio(ldas_datosAntSis.getIdTipoPredio());
											ldas_dataTemp.setIdMunicipio(ldas_datosAntSis.getIdMunicipio());
											ldas_dataTemp.setNombrePredio(ldas_datosAntSis.getNombrePredio());
											ldas_dataTemp.setIdUsuarioModificacion(
											    ldas_datosAntSis.getIdUsuarioModificacion()
											);
											ldas_dataTemp.setIpModificacion(ldas_datosAntSis.getIpModificacion());
											ldas_dataTemp.setCantidadCertificados(
											    ldas_datosAntSis.getCantidadCertificados()
											);

											lb_encontro = true;
										}
									}

									addp_datosPredio.setModificarDatosAntSis(false);

									Collection<DetalleAntSistema> lcdas_detalles;

									lcdas_detalles = addp_datosPredio.getDetallesAntSisAgregados();

									if(CollectionUtils.isValidCollection(lcdas_detalles))
									{
										String ls_consecutivo;
										ls_consecutivo = StringUtils.getStringNotNull(
											    ldas_datosAntSis.getConsecutivoPredioAntSistema()
											);

										for(DetalleAntSistema ldas_detalle : lcdas_detalles)
										{
											if(ldas_detalle != null)
											{
												String ls_idConsecutivoTemp;
												ls_idConsecutivoTemp = StringUtils.getStringNotNull(
													    ldas_detalle.getConsecutivoPredioAntSistema()
													);

												if(ls_idConsecutivoTemp.equals(ls_consecutivo))
													ldas_detalle.setIdMunicipioTomo(ldas_datosAntSis.getIdMunicipio());

												if(
												    StringUtils.isValidString(ls_idConsecutivoTemp)
													    && ls_idConsecutivoTemp.equalsIgnoreCase(
													        ldas_datosAntSis.getConsecutivoPredioAntSistema()
													    )
												)
												{
													String ls_nombrePredio;
													ls_nombrePredio = ldas_datosAntSis.getNombrePredio();

													if(StringUtils.isValidString(ls_nombrePredio))
														ldas_detalle.setNombrePredio(
														    "Predio #" + ls_consecutivo + " " + ls_nombrePredio
														);
												}
											}
										}
									}
								}
							}
						}
					}

					addp_datosPredio.getDetalleAntSistema()
						                .setIdMunicipioTomo(addp_datosPredio.getDatosAntiguoSistema().getIdMunicipio());

					if(!lb_procesoCertificados)
					{
						{
							StringBuilder lsb_script;
							lsb_script = new StringBuilder();

							lsb_script.append("ocultarElemento('");
							lsb_script.append(is_repeatDatosPredio);
							lsb_script.append(li_posicion);
							lsb_script.append(is_complementoRepeat);
							lsb_script.append("idCBCancelarCrearPredio')");

							lpf_primefaces.executeScript(lsb_script.toString());
						}

						lpf_primefaces.ajax()
							              .update(
							    is_repeatDatosPredio + li_posicion + is_complementoRepeat + "idPnlAdicional"
							);
						lpf_primefaces.ajax()
							              .update(
							    is_repeatDatosPredio + li_posicion + is_complementoRepeat + "idPnPrediosAntiguoSistema"
							);
						lpf_primefaces.ajax()
							              .update(
							    is_repeatDatosPredio + li_posicion + is_complementoRepeat + "idOPBotonAgregarPredio"
							);
						lpf_primefaces.ajax()
							              .update(
							    is_repeatDatosPredio + li_posicion + is_complementoRepeat + "idCBAgregarPredio"
							);
						lpf_primefaces.ajax()
							              .update(
							    is_repeatDatosPredio + li_posicion + is_complementoRepeat + "idPRelacionActoPredio"
							);
						lpf_primefaces.ajax()
							              .update(
							    is_repeatDatosPredio + li_posicion + is_complementoRepeat + "idCBCancelarCrearPredio"
							);
						lpf_primefaces.ajax()
							              .update(
							    is_repeatDatosPredio + li_posicion + is_complementoRepeat + "idPnlAdicional"
							);
						lpf_primefaces.ajax()
							              .update(
							    is_repeatDatosPredio + li_posicion + is_complementoRepeat + "idOPPanelDocumento"
							);
						lpf_primefaces.ajax()
							              .update(
							    is_repeatDatosPredio + li_posicion + is_complementoRepeat + "idCBAgregarPredio"
							);
						lpf_primefaces.ajax()
							              .update(
							    is_repeatDatosPredio + li_posicion + is_complementoRepeat + "idPnPrediosAntiguoSistema"
							);

						lpf_primefaces.ajax()
							              .update(
							    is_repeatDatosPredio + li_posicion + is_complementoRepeat + "idDTDetallesAntGuardados"
							);
					}

					if(ab_guardar)
						addMessage(
						    isProcesoCertificados() ? MessagesKeys.DATOS_ANT_SISTEMA_GUARDADOS_CERTIFICADOS
						                            : MessagesKeys.DATOS_ANT_SISTEMA_GUARDADOS
						);
					else
						addMessage(MessagesKeys.DATOS_ANT_SISTEMA_MODIFICADOS);
				}

				String ls_validar;
				ls_validar     = null;
				ls_validar     = addp_datosPredio.getAntiguoSistema1932();

				if(StringUtils.isValidString(ls_validar))
				{
					if(ls_validar.equalsIgnoreCase(EstadoCommon.S))
						PrimeFaces.current().executeScript("PF('widgetDatosLibro').expand();");
				}
			}
			catch(B2BException lb2be_e)
			{
				clh_LOGGER.error("guardarDatosAntSistema", lb2be_e);
				addMessage(lb2be_e);
			}

			PrimeFaces.current().ajax().update(is_messageIdGrowl);
		}
	}

	/**
	 * Guarda en la base de datos la información suministrada por pantalla para un libro de antiguo sistema.
	 *
	 * @param addp_datosPredio Objeto contenedor de los predios agregados para un círculo específico
	 * @param ab_guardar Indica si la información suministrada se va a insertar o a actualizar, true para insertar,
	 * false para actualizar
	 */
	public void guardarDetalleAntSistema(DatosDelPredio addp_datosPredio, boolean ab_guardar)
	{
		if(addp_datosPredio != null)
		{
			DetalleAntSistema ldas_detallesAntSis;

			ldas_detallesAntSis = addp_datosPredio.getDetalleAntSistema();

			if(ldas_detallesAntSis != null)
			{
				try
				{
					DatosAntSistema            ldas_datosAntSis;
					Long                       ll_idLibro;
					String                     ls_idLibroStr;
					Ajax                       la_ajax;
					boolean                    lb_procesoCertificados;
					Collection<DatosDelPredio> lcddp_datosPredio;

					ldas_datosAntSis           = addp_datosPredio.getDatosAntiguoSistema();
					ll_idLibro                 = ldas_detallesAntSis.getIdLibroAntSistema();
					la_ajax                    = PrimeFaces.current().ajax();
					lb_procesoCertificados     = isProcesoCertificados();
					lcddp_datosPredio          = getDatosDelPredio();

					if(ldas_datosAntSis == null)
						throw new B2BException(ErrorKeys.ERROR_INTERNO_SISTEMA);

					if(!lb_procesoCertificados)
						validarCamposDetallesAntSistema(addp_datosPredio, lcddp_datosPredio, la_ajax);
					else
						ldas_detallesAntSis.setIdDatosAntSistema(ldas_datosAntSis.getIdDatosAntSistema());

					if(!NumericUtils.isValidLong(ll_idLibro, 1))
						throw new B2BException(ErrorKeys.DEBE_SELECCIONAR_LIBRO);

					{
						Collection<DatosAntSistema> lcdas_datosCirSelected;

						lcdas_datosCirSelected = addp_datosPredio.getDatosAntSisAgregados();

						if(CollectionUtils.isValidCollection(lcdas_datosCirSelected))
						{
							Iterator<DatosAntSistema> lidas_iterador;
							String                    ls_idDatosPadreSeleccionado;
							boolean                   lb_found;

							lidas_iterador                  = lcdas_datosCirSelected.iterator();
							ls_idDatosPadreSeleccionado     = StringUtils.getStringNotNull(
								    ldas_detallesAntSis.getIdDatosAntSistema()
								);
							lb_found                        = false;

							while(lidas_iterador.hasNext() && !lb_found)
							{
								DatosAntSistema ldas_temp;

								ldas_temp = lidas_iterador.next();

								if(ldas_temp != null)
								{
									String ls_idDatosTemp;

									ls_idDatosTemp = StringUtils.getStringNotNull(ldas_temp.getIdDatosAntSistema());

									if(ls_idDatosTemp.equalsIgnoreCase(ls_idDatosPadreSeleccionado))
									{
										ldas_detallesAntSis.setConsecutivoPredioAntSistema(
										    ldas_temp.getConsecutivoPredioAntSistema()
										);

										lb_found = true;
									}
								}
							}
						}
					}

					ls_idLibroStr = StringUtils.getString(ll_idLibro);

					if(ls_idLibroStr.equals(LibroAntSistemaCommon.LIBRO_SEGUNDO))
					{
						ldas_detallesAntSis.setDocumento(addp_datosPredio.getBgnDocumento());

						if(!lb_procesoCertificados)
							validarCamposDocumentoAntSistema(addp_datosPredio, lcddp_datosPredio);
					}

					ldas_detallesAntSis = irr_registroRemote.guardarDetallesAntSistema(
						    ldas_detallesAntSis, getUserId(), getLocalIpAddress(), getRemoteIpAddress(), ab_guardar
						);

					if(ldas_detallesAntSis != null)
					{
						DetalleAntSistema  ldas_detalleAntSistema;
						DetalleAntSistema  ldas_nuevoDetalleAntSistema;
						Collection<String> lcs_matriculasRelacionadas;
						StringBuilder      lsb_nombrePredioDetalle;

						ldas_detalleAntSistema          = addp_datosPredio.getDetalleAntSistema();
						ldas_nuevoDetalleAntSistema     = new DetalleAntSistema();
						lcs_matriculasRelacionadas      = irr_registroRemote.consultarMatriculasParaDetalle(
							    ldas_detallesAntSis, getUserId(), getLocalIpAddress(), getRemoteIpAddress()
							);
						lsb_nombrePredioDetalle         = new StringBuilder();

						lsb_nombrePredioDetalle.append(
						    IdentificadoresCommon.PREDIO_MIN + " " + IdentificadoresCommon.SIMBOLO_NUMERAL
						    + ldas_datosAntSis.getConsecutivoPredioAntSistema() + " "
						    + ldas_datosAntSis.getNombrePredio()
						);

						ldas_detallesAntSis.setNombrePredio(lsb_nombrePredioDetalle.toString());

						if(CollectionUtils.isValidCollection(lcs_matriculasRelacionadas))
						{
							StringBuilder    lsb_matriculas;
							Iterator<String> lis_iterador;
							String           ls_cadenaFinal;

							lsb_matriculas     = new StringBuilder();
							lis_iterador       = lcs_matriculasRelacionadas.iterator();
							ls_cadenaFinal     = null;

							while(lis_iterador.hasNext())
							{
								String ls_temp;

								ls_temp = lis_iterador.next();

								if(StringUtils.isValidString(ls_temp))
								{
									lsb_matriculas.append(ls_temp);

									if(lis_iterador.hasNext())
										lsb_matriculas.append(", ");
								}
							}

							ls_cadenaFinal = lsb_matriculas.toString();

							if(StringUtils.isValidString(ls_cadenaFinal))
							{
								Object[] aoa_messageArgs;

								aoa_messageArgs     = new String[1];

								aoa_messageArgs[0] = ls_cadenaFinal;

								addMessage(MessagesKeys.INFORMACION_DETALLE_ANT_SISTEMA, aoa_messageArgs);

								la_ajax.update(is_messageIdGrowl);
							}
						}

						if(ldas_detalleAntSistema != null)
						{
							ldas_nuevoDetalleAntSistema.setIdMunicipioTomo(ldas_detalleAntSistema.getIdMunicipioTomo());
							ldas_nuevoDetalleAntSistema.setIdCirculo(ldas_detalleAntSistema.getIdCirculo());
							ldas_nuevoDetalleAntSistema.setTipoPredio(ldas_detalleAntSistema.getTipoPredio());
						}

						addp_datosPredio.setDetalleAntSistema(ldas_nuevoDetalleAntSistema);
						addp_datosPredio.setBgnDocumento(null);
						addp_datosPredio.setLibroSegundo(false);
						addp_datosPredio.setLibroMatriculas(false);
						addp_datosPredio.setLibroPrimero(false);
						addp_datosPredio.setIdDepartamento(null);
						addp_datosPredio.setIdMunicipio(null);

						if(ab_guardar)
							addp_datosPredio.getDetallesAntSisAgregados().add(ldas_detallesAntSis);
						else
						{
							Collection<DetalleAntSistema> lcdas_detalles;
							lcdas_detalles = addp_datosPredio.getDetallesAntSisAgregados();

							String ls_idDetalle;
							String ls_idDatosPadre;

							ls_idDetalle        = StringUtils.getStringNotNull(
								    ldas_detallesAntSis.getIdDetalleAntSistema()
								);
							ls_idDatosPadre     = StringUtils.getStringNotNull(
								    ldas_detallesAntSis.getIdDatosAntSistema()
								);

							if(CollectionUtils.isValidCollection(lcdas_detalles))
							{
								Iterator<DetalleAntSistema> lidas_iterador;
								boolean                     lb_found;

								lidas_iterador     = lcdas_detalles.iterator();
								lb_found           = false;

								while(lidas_iterador.hasNext() && !lb_found)
								{
									DetalleAntSistema ldas_temp;

									ldas_temp = lidas_iterador.next();

									if(ldas_temp != null)
									{
										String ls_idDetalleTemp;
										String ls_idDatosTemp;

										ls_idDetalleTemp     = StringUtils.getStringNotNull(
											    ldas_temp.getIdDetalleAntSistema()
											);
										ls_idDatosTemp       = StringUtils.getStringNotNull(
											    ldas_temp.getIdDatosAntSistema()
											);

										if(
										    ls_idDetalleTemp.equals(ls_idDetalle)
											    && ls_idDatosTemp.equals(ls_idDatosPadre)
										)
										{
											ldas_temp.setIdLibroAntSistema(ldas_detallesAntSis.getIdLibroAntSistema());
											ldas_temp.setTomo(ldas_detallesAntSis.getTomo());
											ldas_temp.setFolio(ldas_detallesAntSis.getFolio());
											ldas_temp.setPartida(ldas_detallesAntSis.getPartida());
											ldas_temp.setAnio(ldas_detallesAntSis.getAnio());
											ldas_temp.setNumeroPartida(ldas_detallesAntSis.getNumeroPartida());
											ldas_temp.setIdMunicipioTomo(ldas_detallesAntSis.getIdMunicipioTomo());
											ldas_temp.setIdDocumentoTradicion(
											    ldas_detallesAntSis.getIdDocumentoTradicion()
											);
											ldas_temp.setIdMatricula(ldas_detallesAntSis.getIdMatricula());
											ldas_temp.setVersionDocumentoTradicion(
											    ldas_detallesAntSis.getVersionDocumentoTradicion()
											);
											ldas_temp.setIdUsuarioModificacion(
											    ldas_detallesAntSis.getIdUsuarioModificacion()
											);
											ldas_temp.setIpModificacion(ldas_detallesAntSis.getIpModificacion());

											lb_found = true;
										}
									}
								}
							}
						}

						addp_datosPredio.setDetallesAntSistemaGuardados(true);

						if(!ab_guardar)
							addp_datosPredio.setModificarDetallesAntSis(false);

						if(CollectionUtils.isValidCollection(lcddp_datosPredio))
						{
							int                      li_posicion;
							Iterator<DatosDelPredio> liddp_iterador;
							boolean                  lb_found;
							String                   ls_idCirArg;

							li_posicion        = 0;
							liddp_iterador     = lcddp_datosPredio.iterator();
							lb_found           = false;
							ls_idCirArg        = StringUtils.getStringNotNull(addp_datosPredio.getIdCirculo());

							while(liddp_iterador.hasNext() && !lb_found)
							{
								DatosDelPredio lddp_data;

								lddp_data = liddp_iterador.next();

								if(lddp_data != null)
								{
									String ls_idCirTemp;
									ls_idCirTemp = StringUtils.getStringNotNull(lddp_data.getIdCirculo());

									if(ls_idCirArg.equals(ls_idCirTemp))
										lb_found = true;
									else
										li_posicion++;
								}
							}

							la_ajax.update(is_repeatDatosPredio + li_posicion + is_complementoRepeat + "idSOMAno");
							la_ajax.update(is_repeatDatosPredio + li_posicion + is_complementoRepeat + "idSOMPartida");
							la_ajax.update(
							    is_repeatDatosPredio + li_posicion + is_complementoRepeat + "idOLCirDetAntSis"
							);
							la_ajax.update(
							    is_repeatDatosPredio + li_posicion + is_complementoRepeat
							    + "idSOMCirculoRegistralAntSistemaLibroSegundo"
							);
							la_ajax.update(
							    is_repeatDatosPredio + li_posicion + is_complementoRepeat + "idOLTipoPredioDetAntSis"
							);
							la_ajax.update(
							    is_repeatDatosPredio + li_posicion + is_complementoRepeat
							    + "idSOMTipoPredioAntSistemaLibroSegundo"
							);
							la_ajax.update(
							    is_repeatDatosPredio + li_posicion + is_complementoRepeat + "idOLMatriculaDetAntSis"
							);
							la_ajax.update(
							    is_repeatDatosPredio + li_posicion + is_complementoRepeat + "datosPredioIdMatricula"
							);
							la_ajax.update(
							    is_repeatDatosPredio + li_posicion + is_complementoRepeat + "idDTDetallesAntGuardados"
							);
							la_ajax.update(
							    is_repeatDatosPredio + li_posicion + is_complementoRepeat + "idCBAgregarPredio"
							);
							la_ajax.update(
							    is_repeatDatosPredio + li_posicion + is_complementoRepeat + "idOPPanelDocumento"
							);
						}
					}

					if(ab_guardar)
						addMessage(MessagesKeys.DETALLES_ANT_SISTEMA_GUARDADOS);
					else
						addMessage(MessagesKeys.DETALLES_ANT_SISTEMA_MODIFICADOS);

					la_ajax.update(is_messageIdGrowl);

					ldas_detallesAntSis.setError(false);
				}
				catch(B2BException lb2be_e)
				{
					ldas_detallesAntSis.setError(true);
					clh_LOGGER.error("guardarDetalleAntSistema", lb2be_e);
					addMessage(lb2be_e);
				}
			}
		}
	}

