	/**
	 * Insertar solicitud reproduccion.
	 *
	 * @param aod_datosDocumento correspondiente al valor del tipo de objeto Documento
	 * @throws B2BException Señala que se ha producido una excepción
	 */
	public void insertarSolicitudReproduccion(Documento aod_datosDocumento)
	    throws B2BException
	{
		try
		{
			Collection<DataReproduccionConstancia> lcdrc_dataRepCons;
			DataReproduccionConstancia             ldrc_parametros;
			Solicitud                              ls_solicitud;

			lcdrc_dataRepCons     = getDataReproduccionConstancia();
			ldrc_parametros       = new DataReproduccionConstancia();
			ls_solicitud          = getSolicitud();

			if(ls_solicitud != null)
			{
				String ls_reproduccionTestamento;

				ls_reproduccionTestamento = ls_solicitud.getReproduccionTestamento();

				if(!StringUtils.isValidString(ls_reproduccionTestamento))
					throw new B2BException(ErrorKeys.ERROR_TIPO_REPRODUCCION_CONSTANCIA_SELECCIONE);
			}

			ldrc_parametros.setDataReproduccionConstancia(lcdrc_dataRepCons);
			ldrc_parametros.setSolicitud(ls_solicitud);
			ldrc_parametros.setSinConstanciaReproduccion(isSinConstanciaReproduccion());
			ldrc_parametros.setSinConstanciaReproduccionTurno(isSinConstanciaReproduccionTurno());
			setDetalleReproduccionConstancia(false);

			if(CollectionUtils.isValidCollection(lcdrc_dataRepCons))
			{
				boolean lb_seleccionado;
				lb_seleccionado = false;

				for(DataReproduccionConstancia lorc_tmp : lcdrc_dataRepCons)
					if(lorc_tmp != null)
					{
						Collection<AnotacionPredioDireccion> lcapd_tmp;
						lcapd_tmp = lorc_tmp.getAnotacionPredioDireccion();

						if(CollectionUtils.isValidCollection(lcapd_tmp))
						{
							for(AnotacionPredioDireccion lapd_tmp : lcapd_tmp)
							{
								lapd_tmp.setSeleccionadoRepConstancia(true);
								lapd_tmp.setSeleccionado(lapd_tmp.isSeleccionadoRepConstancia());

								if(lapd_tmp.isSeleccionado())
								{
									if(
									    NumericUtils.isValidInteger(lapd_tmp.getCantidadCopiasReproducir())
										    && (NumericUtils.getInt(lapd_tmp.getCantidadCopiasReproducir()) > 0)
									)
									{
										lb_seleccionado = true;
										setDetalleReproduccionConstancia(true);
									}
									else
										throw new B2BException(ErrorKeys.DEBE_DIGITAR_CANTIDAD_COPIAS_REPRODUCIR);
								}
							}
						}
					}

				if(!lb_seleccionado)
					throw new B2BException(ErrorKeys.DEBE_SELECCIONAR_MINIMO_UNO_PARA_REP_CONSTANCIA);
			}

			if(isSinConstanciaReproduccionTurno())
			{
				String ls_idCirculo;
				ls_idCirculo = getCirculoIdTurno();

				if(!StringUtils.isValidString(ls_idCirculo))
					throw new B2BException(ErrorKeys.DEBE_SELECCIONAR_CIRCULO_REGISTRAL_CONSTANCIA);
				else
					aod_datosDocumento.setIdCirculo(ls_idCirculo);
			}

			ldrc_parametros.setDatosDocumento(aod_datosDocumento);
			ldrc_parametros.setDetalleReproduccionConstancia(isDetalleReproduccionConstancia());

			ldrc_parametros = irr_registroRemote.salvarReproduccionConstancia(
				    ldrc_parametros, getUserId(), getLocalIpAddress(), getRemoteIpAddress()
				);

			if(CollectionUtils.isValidCollection(lcdrc_dataRepCons))
			{
				for(DataReproduccionConstancia ldrc_iterador : lcdrc_dataRepCons)
				{
					if(ldrc_iterador != null)
					{
						Collection<AnotacionPredioDireccion> lcapd_anotacionPredioDireccion;
						lcapd_anotacionPredioDireccion = ldrc_iterador.getAnotacionPredioDireccion();

						if(CollectionUtils.isValidCollection(lcapd_anotacionPredioDireccion))
						{
							for(AnotacionPredioDireccion lapd_iterador : lcapd_anotacionPredioDireccion)
							{
								if(lapd_iterador != null)
									lapd_iterador.setBloquearSeleccionado(true);
							}
						}
					}
				}
			}

			if(ldrc_parametros != null)
				setLiquidacionReprodruccionConstancia(ldrc_parametros.getLiquidacion());

			setRenderedTerminarRepConstancia(true);
			setRenderedGuardarInfoConstancia(false);
		}
		catch(B2BException lb2be_e)
		{
			clh_LOGGER.error(lb2be_e);
			setDialogoConstanciaRepro(false);
			throw new B2BException(lb2be_e.getMessage());
		}
	}

