	/**
	 * Metodo encargado de listar intervinientes ingresados.
	 *
	 * @param ar_registro Objeto Registro con el nuevo interviniente a agregar
	 * @throws B2BException Señala que se ha producido una excepción
	 */
	public void listarSolInter(Registro ar_registro)
	    throws B2BException
	{
		Collection<SolicitudInterviniente> lcsi_datos;
		boolean                            lb_accion;
		String                             ls_solicitud;
		String                             ls_solicitudActual;
		long                               ll_etapaActual;
		SolicitudInterviniente             lsi_parametros;

		lcsi_datos             = null;
		lb_accion              = false;
		ls_solicitud           = getSolicitud().getIdSolicitud();
		ls_solicitudActual     = getSolicitud().getIdSolicitud();
		lsi_parametros         = new SolicitudInterviniente();
		ll_etapaActual         = 0L;

		if(NumericUtils.isValidLong(getSolicitud().getIdEtapaActual()))
			ll_etapaActual = getSolicitud().getIdEtapaActual().longValue();

		if(!isHabilitarTurnoYnir())
		{
			SolicitudAsociada                  lsa_solicitudAsociada;
			Collection<SolicitudInterviniente> lcsi_datosTemp;

			lsi_parametros.setIdSolicitud(ls_solicitudActual);

			lsa_solicitudAsociada     = irr_registroRemote.findSolicitudAsociada(getSolicitud());
			lcsi_datosTemp            = irr_registroRemote.findSolicitudIntervinienteBySolicitud(
				    lsi_parametros, getUserId()
				);

			setSolicitudAsociada(lsa_solicitudAsociada);

			if(lsa_solicitudAsociada != null)
			{
				String ls_idSolicitud;

				ls_idSolicitud = lsa_solicitudAsociada.getIdSolicitud1();

				if(StringUtils.isValidString(ls_idSolicitud))
					ls_solicitud = ls_idSolicitud;
			}

			if(!CollectionUtils.isValidCollection(lcsi_datosTemp))
				lb_accion = true;
		}

		lsi_parametros.setIdSolicitud(ls_solicitud);

		lcsi_datos = irr_registroRemote.findSolicitudIntervinienteBySolicitud(lsi_parametros, getUserId());

		if(lb_accion)
		{
			if(CollectionUtils.isValidCollection(lcsi_datos))
			{
				for(SolicitudInterviniente lcsi_interviniente : lcsi_datos)
				{
					lcsi_interviniente.setIdSolicitud(ls_solicitudActual);
					lcsi_interviniente.setIdUsuarioCreacion(getUserId());
					irr_registroRemote.insertarIntervinienteCopia(lcsi_interviniente);
				}
			}
		}

		if(ar_registro != null)
		{
			SolicitudInterviniente lsi_intervinienteIngresado;

			lsi_intervinienteIngresado = ar_registro.getSolicitudInterviniente();

			if(lsi_intervinienteIngresado != null)
			{
				Collection<SolicitudInterviniente> lcsi_intervinientesActuales;

				lcsi_intervinientesActuales = getTablaSolicitudInterviniente();

				if(CollectionUtils.isValidCollection(lcsi_intervinientesActuales))
				{
					Persona lp_personaAExtraer;

					lp_personaAExtraer = ar_registro.getPersona();

					if(lp_personaAExtraer != null)
					{
						Collection<SolicitudInterviniente> lcsi_intervinientesValidados;

						lsi_intervinienteIngresado.setPersona(lp_personaAExtraer);
						lcsi_intervinientesValidados = irr_registroRemote.enlistarPorMapaIntervinientes(
							    lcsi_intervinientesActuales, lsi_intervinienteIngresado, ll_etapaActual, getUserId(),
							    getLocalIpAddress(), getRemoteIpAddress()
							);

						if(CollectionUtils.isValidCollection(lcsi_intervinientesValidados))
							setTablaSolicitudInterviniente(lcsi_intervinientesValidados);
					}
				}
				else
					setTablaSolicitudInterviniente(lcsi_datos);
			}
		}
		else
		{
			SolicitudInterviniente lsi_solicitudInterviniente;

			lsi_solicitudInterviniente = new SolicitudInterviniente();

			lsi_solicitudInterviniente.setIdSolicitud(ls_solicitudActual);

			setTablaSolicitudInterviniente(
			    irr_registroRemote.findSolicitudIntervinienteBySolicitud(lsi_solicitudInterviniente, getUserId())
			);
		}
	}

