	/**
	 * Listar turnos dado el nir.
	 *
	 * @param as_idForm de as id form
	 */
	public void listarTurnosDadoElNir(String as_idForm)
	{
		try
		{
			Turno             lt_turno;
			Collection<Turno> lct_turnos;
			FacesContext      lfc_context;
			Solicitud         lso_solicitud;

			lfc_context       = FacesContext.getCurrentInstance();
			lso_solicitud     = getSolicitud();

			if(lso_solicitud != null)
			{
				Documento ld_docTemp;
				ld_docTemp = getTurnoRecepcion();

				if(ld_docTemp != null)
				{
					String ls_nir;
					String ls_proceso;
					lt_turno     = new Turno();

					ls_nir         = ld_docTemp.getNirTurno();
					ls_proceso     = lso_solicitud.getIdProceso();
					lct_turnos     = new ArrayList<Turno>();

					validateStyles(
					    IdentificadoresCommon.DOS_PUNTOS + as_idForm + ":idnirRecepcionTurno", lfc_context, ls_nir,
					    false
					);

					if(!StringUtils.isValidString(ls_nir))
						throw new B2BException(ErrorKeys.ERROR_NIR_NO_INGRESADO);

					lt_turno.setNir(ls_nir);
					lt_turno.setIdProceso(ls_proceso);

					lct_turnos = irr_registroRemote.findTurnoByNir(lt_turno);

					if(lct_turnos != null)
					{
						setInfoTurnosNir(lct_turnos);

						addMessage(MessagesKeys.CONSULTA_EXITOSA_5);
						PrimeFaces.current().ajax().update(is_messageIdGrowl);
					}
					else
						throw new B2BException(ErrorKeys.ERROR_NIR_ES_INVALIDO);
				}
			}

			PrimeFaces.current().ajax().update(is_idForm);
		}
		catch(B2BException lb2be_e)
		{
			setInfoTurnosNir(null);
			clh_LOGGER.error(lb2be_e);
			addMessage(lb2be_e);
			PrimeFaces.current().ajax().update(is_idForm);
		}
	}

