	/**
	 * Toma los valores en pantalla de un acto, en la pestaña de datos del acto, los
	 * valida dependiendo del acto seleccionado, y si son correctos los actualiza.
	 * @param as_form Argumento de tipo String que contiene el id del formulario de
	 * donde proviene la petición.
	 */
	public void modificarActo(String as_form, boolean ab_actoVIS)
	{
		try
		{
			validarCamposActo(as_form);

			Collection<com.bachue.snr.prosnr01.model.registro.Acto> lca_tmp;
			com.bachue.snr.prosnr01.model.registro.Acto             la_acto;

			lca_tmp     = new ArrayList<com.bachue.snr.prosnr01.model.registro.Acto>();
			la_acto     = getActo();

			if(la_acto != null)
			{
				Collection<com.bachue.snr.prosnr01.model.registro.Acto> lc_datosActo;
				String                                                  ls_tipoActo;
				String                                                  ls_tipoAdquisicion;
				String                                                  ls_descripcion;
				String                                                  ls_msj;

				ls_descripcion     = getObservacionesDatosActo();
				ls_msj             = getMessages().getString(MessagesKeys.OBSERVACIONES_REPRODUCCION_CONSTANCIA);

				lc_datosActo           = getDatosActo();
				ls_tipoActo            = la_acto.getCodigo();
				ls_tipoAdquisicion     = la_acto.getTipoAdquisicion();

				if(la_acto.isImpuestoRegistroShow())
				{
					if(
					    !StringUtils.isValidString(la_acto.getImpuestoRegistro())
						    || (la_acto.isImpuestoRegistroExtShow()
						    && !StringUtils.isValidString(la_acto.getImpuestoRegistroExtemporaneo()))
					)
					{
						if(!StringUtils.isValidString(ls_descripcion))
							ls_descripcion = ls_msj;
					}
					else
						ls_descripcion = null;

					setObservacionesDatosActo(StringUtils.getStringNotNull(ls_descripcion));
				}

				if(StringUtils.getStringNotNull(ls_tipoActo).equalsIgnoreCase(getActoCabezaFamiliar()))
				{
					if(!StringUtils.isValidString(getCabezaDeFamilia()))
						throw new B2BException(ErrorKeys.ERROR_SIN_PREGUNTA_CABEZA_MADRE);

					if(getCabezaDeFamilia().equalsIgnoreCase(EstadoCommon.SI))
					{
						if(
						    irr_registroRemote.validacionActo0315(
							        getSolicitud(), getUserId(), getLocalIpAddress(), getRemoteIpAddress()
							    )
						)
						{
							la_acto.setMadreCabeza(EstadoCommon.SI);
							setObservacionesActo0315(getMensajesMadreCabeza().get(EstadoCommon.SI));
						}

						else
						{
							setObservacionesActo0315(null);
							throw new B2BException(ErrorKeys.ERROR_ACTO_CABEZA_FAMILIA);
						}
					}
					else
					{
						la_acto.setMadreCabeza(EstadoCommon.NO);
						setObservacionesActo0315(getMensajesMadreCabeza().get(EstadoCommon.NO));
					}
				}

				irr_registroRemote.findDetalleActo(
				    null, la_acto, getUserId(), getLocalIpAddress(), getRemoteIpAddress()
				);

				if(CollectionUtils.isValidCollection(lc_datosActo))
				{
					String               ls_idActoDb;
					Collection<TipoActo> lcta_allActosTipoActo;

					ls_idActoDb               = la_acto.getIdActoDb();
					lcta_allActosTipoActo     = getAllActos();

					for(com.bachue.snr.prosnr01.model.registro.Acto loa_oa : lc_datosActo)
					{
						if(loa_oa != null)
						{
							String ls_idActoDbIterador;

							ls_idActoDbIterador = loa_oa.getIdActoDb();

							if(StringUtils.isValidString(ls_idActoDb) && StringUtils.isValidString(ls_idActoDbIterador))
							{
								if(!ls_idActoDb.equalsIgnoreCase(ls_idActoDbIterador))
									lca_tmp.add(loa_oa);
							}
						}
					}

					if(
					    CollectionUtils.isValidCollection(lcta_allActosTipoActo)
						    && StringUtils.isValidString(ls_tipoActo)
					)
					{
						Map<String, TipoActo> lhmsta_tiposActo;

						lhmsta_tiposActo = getAllTiposActo();

						if(CollectionUtils.isValidCollection(lhmsta_tiposActo))
						{
							if(lhmsta_tiposActo.containsKey(ls_tipoActo))
							{
								TipoActo lo_ta;

								lo_ta = lhmsta_tiposActo.get(ls_tipoActo);

								if(lo_ta != null)
									la_acto.setEspecificacion(lo_ta.getNombre());
							}
						}
					}

					{
						String ls_actoConCuantia;
						ls_actoConCuantia = la_acto.getActoConCuantia();

						if(StringUtils.isValidString(ls_actoConCuantia))
							la_acto.setActoConCuantia(ls_actoConCuantia);
					}

					com.bachue.snr.prosnr01.model.registro.Acto la_tmp;

					la_tmp = getActo();

					{
						Acto la_actoUdate;

						la_actoUdate = new Acto();

						la_actoUdate.setIdCirculo(la_acto.getIdCirculo());
						la_actoUdate.setIdActoPrincipal(ls_idActoDb);

						irr_registroRemote.updateCirculoActosHijos(la_actoUdate, getUserId(), getRemoteIpAddress());
					}

					lca_tmp.add(la_acto);
					setDatosActo(lca_tmp);

					boolean                                                 lb_codigo0125;
					boolean                                                 lb_validacion0125;
					Collection<com.bachue.snr.prosnr01.model.registro.Acto> lca_ActosHijos;
					String                                                  ls_idCirculoActo;
					String                                                  ls_nombreTipoAdquisicion;

					lb_codigo0125                = false;
					lb_validacion0125            = false;
					lca_ActosHijos               = irr_registroRemote.findActosHijosById(la_acto, getUserId());
					ls_idCirculoActo             = la_acto.getIdCirculo();
					ls_nombreTipoAdquisicion     = la_acto.getTipoAdquisicion();

					if(
					    StringUtils.isValidString(ls_tipoActo) && ls_tipoActo.equalsIgnoreCase("0125")
						    && StringUtils.isValidString(ls_nombreTipoAdquisicion)
					)
					{
						Constantes lc_tipoAdquisicion;

						lc_tipoAdquisicion = irr_calificacionRemote.findConstanteById(
							    ConstanteCommon.REGIMEN_ESPECIAL, getUserId(), getLocalIpAddress(), getRemoteIpAddress()
							);

						if(lc_tipoAdquisicion != null)
						{
							String ls_caracter;

							ls_caracter = lc_tipoAdquisicion.getCaracter();

							if(StringUtils.isValidString(ls_caracter))
							{
								String[] las_tiposAdquisicion;

								las_tiposAdquisicion     = ls_caracter.split(",");
								lb_codigo0125            = true;

								if(CollectionUtils.isValidCollection(las_tiposAdquisicion))
								{
									for(String ls_tipo : las_tiposAdquisicion)
									{
										if(
										    StringUtils.isValidString(ls_tipo)
											    && ls_nombreTipoAdquisicion.equals(ls_tipo)
										)
											lb_validacion0125 = true;
									}
								}
							}
						}
					}

					boolean lb_vis;

					lb_vis = false;

					if(ls_tipoActo.equalsIgnoreCase("0125") && StringUtils.isValidString(ls_tipoAdquisicion))
					{
						lb_vis = validarConstante(ConstanteCommon.TIPO_ADQUISICIONI_VIS, ls_tipoAdquisicion);

						if(validarConstante(ConstanteCommon.TIPO_ADQUISICION_VIVIENDA_MILITAR, ls_tipoAdquisicion))
						{
							addMessage(MessagesKeys.ACTO_VPM);
							PrimeFaces.current().ajax().update(is_messageIdGrowl);
						}
					}

					if(lb_vis && !ab_actoVIS && !isRespuestaNoEmbargo())
					{
						if(lb_vis)
						{
							setActosVis(
							    irr_referenceRemote.findAllTiposActoVisActivos(
							        getUserId(), getLocalIpAddress(), getRemoteIpAddress()
							    )
							);

							PrimeFaces.current().executeScript("PF('dlgModifyVIS').show();");
							PrimeFaces.current().ajax().update("dlgModifyVIS");
						}
					}
					else
					{
						lb_vis = false;

						if(CollectionUtils.isValidCollection(lca_ActosHijos))
						{
							for(com.bachue.snr.prosnr01.model.registro.Acto la_ActoTmp : lca_ActosHijos)
							{
								if(!CollectionUtils.isValidCollection(getDetailsActo()))
								{
									Solicitud ls_s;
									ls_s = new Solicitud();

									ls_s.setIdSolicitud(la_acto.getIdSolicitud());
									ls_s.setDocumento(true);

									ls_s = irr_registroRemote.findSolicitudById(ls_s, getUserId());
									setDetailsActo(ls_s.getActosDetails());
								}

								for(TipoActo lta_tmp : getDetailsActo())
								{
									if(
									    (la_ActoTmp != null) && (lta_tmp != null)
										    && lta_tmp.getIdTipoActo().equalsIgnoreCase(la_ActoTmp.getCodigo())
									)
									{
										boolean lb_update;

										lb_update = (!lb_codigo0125) || (lb_codigo0125 && lb_validacion0125);

										if(lb_update)
										{
											com.bachue.snr.prosnr01.model.registro.Acto la_ActoHijo;
											la_ActoHijo = new com.bachue.snr.prosnr01.model.registro.Acto();

											la_ActoHijo.setSecuence(la_ActoTmp.getIdActoDb());
											la_ActoHijo.setIdSolicitud(la_ActoTmp.getIdSolicitud());
											la_ActoHijo.setCodigo(lta_tmp.getIdTipoActo());
											la_ActoHijo.setTipoTarifa(lta_tmp.getIdTipoCalculo());
											la_ActoHijo.setEspecificacion(lta_tmp.getIdTipoActo());
											la_ActoHijo.setCantidadActos(la_tmp.getCantidadMatriculas());
											la_ActoHijo.setMadreCabeza(la_tmp.getMadreCabeza());
											la_ActoHijo.setActivoPrecalificacion(la_ActoTmp.getActivoPrecalificacion());
											la_ActoHijo.setTipoTarifa(lta_tmp.getIdTipoCalculo());
											la_ActoHijo.setActivaFechaEjecutoria(true);
											la_ActoHijo.setEspecificacion(lta_tmp.getNombre());
											la_ActoHijo.setIdCirculo(ls_idCirculoActo);
											la_ActoHijo.setIdActoPrincipal(la_acto.getIdActoDb());
											la_ActoHijo.setTipoAdquisicion(ls_nombreTipoAdquisicion);
											la_ActoHijo.setActoConCuantia(IdentificadoresCommon.SIN_CUANTIA);

											irr_registroRemote.updateActoHijo(
											    la_ActoHijo, getUserId(), getLocalIpAddress(), getRemoteIpAddress()
											);
										}
										else
										{
											if(CollectionUtils.isValidCollection(lca_ActosHijos))
											{
												la_acto.setIdCirculo(la_ActoTmp.getIdCirculo());
												irr_registroRemote.deleteActosHijos(la_acto);
												la_acto.setIdCirculo(ls_idCirculoActo);
											}
										}
									}
								}
							}
						}
						else
						{
							if(lb_validacion0125 && lb_vis)
							{
								Collection<TipoActo> lcta_detailsActo;

								lcta_detailsActo = getDetailsActo();

								if(CollectionUtils.isValidCollection(lcta_detailsActo))
								{
									com.bachue.snr.prosnr01.model.registro.Acto la_actoHijo0125;

									la_actoHijo0125 = new com.bachue.snr.prosnr01.model.registro.Acto();

									for(TipoActo lota_ta : lcta_detailsActo)
									{
										String ls_idTipoActo;

										ls_idTipoActo = lota_ta.getIdTipoActo();

										if(StringUtils.isValidString(ls_idTipoActo))
										{
											if(
											    ls_idTipoActo.equalsIgnoreCase("0362")
												    || ls_idTipoActo.equalsIgnoreCase("0369")
												    || ls_idTipoActo.equalsIgnoreCase("0315")
											)
											{
												la_actoHijo0125.setCodigo(lota_ta.getIdTipoActo());
												la_actoHijo0125.setTipoTarifa(lota_ta.getIdTipoCalculo());
												la_actoHijo0125.setEspecificacion(lota_ta.getIdTipoActo());
												la_actoHijo0125.setCantidadActos(la_tmp.getCantidadMatriculas());
												la_actoHijo0125.setTipoTarifa(lota_ta.getIdTipoCalculo());
												la_actoHijo0125.setActivaFechaEjecutoria(true);
												la_actoHijo0125.setEspecificacion(lota_ta.getNombre());
												la_actoHijo0125.setIdCirculo(ls_idCirculoActo);
												la_actoHijo0125.setIdActoPrincipal(la_tmp.getIdActoDb());
												la_actoHijo0125.setTipoAdquisicion(ls_nombreTipoAdquisicion);
												la_actoHijo0125.setActoConCuantia(IdentificadoresCommon.SIN_CUANTIA);
												la_actoHijo0125.setMadreCabeza(la_tmp.getMadreCabeza());

												setActo(la_actoHijo0125);

												saveInfoAll();
											}
										}
									}
								}
							}
							else
							{
								Collection<TipoActo> lcta_actosVisSelected;

								lcta_actosVisSelected = getActosVis();

								if(CollectionUtils.isValidCollection(lcta_actosVisSelected))
								{
									com.bachue.snr.prosnr01.model.registro.Acto la_actoHijo0125;

									la_actoHijo0125 = new com.bachue.snr.prosnr01.model.registro.Acto();

									for(TipoActo ata_tmp : lcta_actosVisSelected)
									{
										if(ata_tmp != null)
										{
											if(ata_tmp.isActoSelected())
											{
												la_actoHijo0125.setCodigo(ata_tmp.getIdTipoActo());
												la_actoHijo0125.setTipoTarifa(ata_tmp.getIdTipoCalculo());
												la_actoHijo0125.setEspecificacion(ata_tmp.getIdTipoActo());
												la_actoHijo0125.setCantidadActos(la_tmp.getCantidadMatriculas());
												la_actoHijo0125.setTipoTarifa(ata_tmp.getIdTipoCalculo());
												la_actoHijo0125.setActivaFechaEjecutoria(true);
												la_actoHijo0125.setEspecificacion(ata_tmp.getNombre());
												la_actoHijo0125.setIdCirculo(ls_idCirculoActo);
												la_actoHijo0125.setIdActoPrincipal(la_tmp.getIdActoDb());
												la_actoHijo0125.setTipoAdquisicion(ls_nombreTipoAdquisicion);
												la_actoHijo0125.setActoConCuantia(ata_tmp.getActoSinCuantia());
												la_actoHijo0125.setMadreCabeza(la_tmp.getMadreCabeza());

												if(ata_tmp.getActoSinCuantia().equalsIgnoreCase("N"))
													la_actoHijo0125.setCuantiaActo(ata_tmp.getCuantiaActo());
												else
													la_actoHijo0125.setCuantiaActo(null);

												{
													Integer li_cantidadActosTmp;

													li_cantidadActosTmp = ata_tmp.getCantidadActos();

													if(NumericUtils.isValidInteger(li_cantidadActosTmp))
														la_actoHijo0125.setCantidadActos(li_cantidadActosTmp);
													else
														la_actoHijo0125.setCantidadActos(null);
												}

												setActo(la_actoHijo0125);

												saveInfoAll();
											}
										}
									}
								}
							}
						}

						PrimeFaces.current().executeScript("PF('dlgModifyVIS').hide();");
						PrimeFaces.current().ajax().update("dlgModifyVIS");
					}

					if(!lb_vis)
					{
						setActo(null);
						setModifyActo(false);
						setAddActo(true);
						setEsActoImpuestoRegistro(false);
						setPreguntaPagoImpuestoRegistroGobernaciones(null);
						setPreguntaLey1943(false);
						setDatosActo(generarDatosActos(getSolicitud()));

						if(isActoNaturaleza400())
							setActoNaturaleza400(false);

						if(isDivisionMaterial())
							setDivisionMaterial(false);
					}
				}

				setFechaEjecutoriaVisible(false);
				addMessage(MessagesKeys.ACTO_MODIFICADO);
			}
		}
		catch(B2BException lb2be_e)
		{
			clh_LOGGER.error(lb2be_e);
			addMessage(lb2be_e);
		}
		finally
		{
			PrimeFaces.current().ajax().update(is_messageIdGrowl);
		}
	}

	/**
	 * Modificar area.
	 *
	 * @param aadap_detalle correspondiente al valor del tipo de objeto DetalleAreaPredio
	 */
	public void modificarArea(DetalleAreaPredio aadap_detalle)
	{
		if(aadap_detalle != null)
		{
			DetalleAreaPredio ladap_nuevo;

			ladap_nuevo = new DetalleAreaPredio();

			ladap_nuevo.setIdTipoArea(aadap_detalle.getIdTipoArea());
			ladap_nuevo.setAreaLectura(StringUtils.getString(aadap_detalle.getArea()));
			ladap_nuevo.setIdUnidadMedida(aadap_detalle.getIdUnidadMedida());
			ladap_nuevo.setIdDetalleAreaPredio(aadap_detalle.getIdDetalleAreaPredio());

			setDetalleAreaTerreno(ladap_nuevo);
			setBloquearAgregarAreaTerreno(true);
		}
	}

	/**
	 * Modificar area terreno.
	 */
	public void modificarAreaTerreno()
	{
		try
		{
			AccAreaUI         laaui_dataArea;
			DetalleAreaPredio ladap_detalle;

			laaui_dataArea     = getAreaUI();
			ladap_detalle      = getDetalleAreaTerreno();

			if((laaui_dataArea != null) && (ladap_detalle != null))
			{
				String ls_idDetalleAreaPredio;

				ls_idDetalleAreaPredio = ladap_detalle.getIdDetalleAreaPredio();

				if(StringUtils.isValidString(ls_idDetalleAreaPredio))
				{
					boolean      lb_focus;
					FacesContext lfc_context;
					String       ls_area;

					lb_focus        = false;
					lfc_context     = FacesContext.getCurrentInstance();
					ls_area         = ladap_detalle.getAreaLectura();
					lb_focus        = validateStyles(":predialForm:idITareaTerreno", lfc_context, ls_area, lb_focus);

					if(StringUtils.isValidString(ls_area))
					{
						Double ld_area;
						String ls_medidaArea;

						ld_area           = NumericUtils.getDoubleWrapper(ls_area);
						ls_medidaArea     = ladap_detalle.getIdUnidadMedida();

						if(NumericUtils.isValidDouble(ld_area, NumericUtils.DEFAULT_DOUBLE_VALUE, false))
						{
							lb_focus = validateStyles(":predialForm:idITareaTerreno", lfc_context, ls_area, lb_focus);
							ladap_detalle.setArea(ld_area);
						}
						else
						{
							lb_focus = validateStyles(":predialForm:idITareaTerreno", lfc_context, "", lb_focus);
							throw new B2BException(ErrorKeys.ERROR_AREA_DEL_TERRENO);
						}

						lb_focus = validateStyles(
							    ":predialForm:idSOMunidadMedidaTerreno", lfc_context, ls_medidaArea, lb_focus
							);

						if(StringUtils.isValidString(ls_medidaArea))
						{
							Collection<DetalleAreaPredio> lcadap_areas;

							lcadap_areas = laaui_dataArea.getAreasTerreno();

							if(CollectionUtils.isValidCollection(lcadap_areas))
							{
								DetalleAreaPredio           ladap_areaEditar;
								HashMap<String, String>     lhmss_unidadesDeMedida;
								Iterator<DetalleAreaPredio> liadap_iterator;

								ladap_areaEditar           = null;
								lhmss_unidadesDeMedida     = new HashMap<String, String>();
								liadap_iterator            = lcadap_areas.iterator();

								while(liadap_iterator.hasNext())
								{
									DetalleAreaPredio ladap_areaTerreno;

									ladap_areaTerreno = liadap_iterator.next();

									if(ladap_areaTerreno != null)
									{
										String ls_idDetalleAreaPredioIterador;

										ls_idDetalleAreaPredioIterador = ladap_areaTerreno.getIdDetalleAreaPredio();

										if(StringUtils.isValidString(ls_idDetalleAreaPredioIterador))
										{
											String ls_medidaAreaIterador;

											ls_medidaAreaIterador = ladap_areaTerreno.getIdUnidadMedida();

											if(StringUtils.isValidString(ls_medidaAreaIterador))
											{
												if(
												    !ls_idDetalleAreaPredioIterador.equalsIgnoreCase(
													        ls_idDetalleAreaPredio
													    )
												)
													lhmss_unidadesDeMedida.put(
													    ls_idDetalleAreaPredioIterador, ls_medidaAreaIterador
													);
												else
													ladap_areaEditar = ladap_areaTerreno;
											}
											else
												throw new B2BException(ErrorKeys.ERROR_UNIDAD_MEDIDA);
										}
									}
								}

								if(ladap_areaEditar != null)
								{
									if(lhmss_unidadesDeMedida.containsValue(ls_medidaArea))
									{
										MedidaArea lma_medidaArea;
										Object[]   aoa_messageArgs;
										String     ls_medidaAreaNombre;

										lma_medidaArea = ipr_parameterRemote.findMedidaAreaById(ls_medidaArea);

										if(lma_medidaArea != null)
										{
											ls_medidaAreaNombre     = lma_medidaArea.getDescripcion();
											aoa_messageArgs         = new String[1];
											aoa_messageArgs[0]      = ls_medidaAreaNombre;

											lb_focus = validateStyles(
												    ":predialForm:idSOMunidadMedidaTerreno", lfc_context, "", lb_focus
												);
											throw new B2BException(
											    ErrorKeys.ERROR_UNIDAD_MEDIDA_DUPLICADO, aoa_messageArgs
											);
										}
									}
									else
									{
										ladap_areaEditar.setIdUnidadMedida(ls_medidaArea);
										ladap_areaEditar.setArea(ld_area);
									}
								}
							}

							laaui_dataArea.setAreasTerreno(lcadap_areas);
							setAreaUI(laaui_dataArea);
							setDetalleAreaTerreno(null);
							setBloquearAgregarAreaTerreno(false);
							actualizarAreaTerreno();

							addMessage(MessagesKeys.MODIFICACION_EXITOSA);
						}
						else
							throw new B2BException(ErrorKeys.ERROR_UNIDAD_MEDIDA);
					}
					else
						throw new B2BException(ErrorKeys.ERROR_AREA_DEL_TERRENO);
				}
			}
		}
		catch(B2BException lb2be_e)
		{
			clh_LOGGER.error(lb2be_e);
			addMessage(lb2be_e);
			PrimeFaces.current().ajax().update(is_messageIdGrowl);
		}
	}

	/**
	 * Modificar matricula.
	 *
	 * @param ams_ms correspondiente al valor del tipo de objeto MatriculaSegregacionUi
	 * @param adp_dp correspondiente al valor del tipo de objeto DatosDelPredio
	 */
	public void modificarMatricula(MatriculaSegregacionUi ams_ms, DatosDelPredio adp_dp)
	{
		if(ams_ms != null)
		{
			setInfoSegregacionManual(ams_ms);
			setModificarAreaSegregacion(true);
		}

		Collection<DatosDelPredio> lcdp_dp;
		lcdp_dp = getDatosDelPredio();

		if(CollectionUtils.isValidCollection(lcdp_dp))
		{
			String ls_idCirculo;
			int    li_posicion;

			ls_idCirculo     = adp_dp.getIdCirculo();
			li_posicion      = 0;

			if(StringUtils.isValidString(ls_idCirculo))
			{
				for(DatosDelPredio ldp_tmp : lcdp_dp)
				{
					if(ldp_tmp != null)
					{
						if(ls_idCirculo.equalsIgnoreCase(ldp_tmp.getIdCirculo()))
						{
							PrimeFaces.current().ajax()
								          .update(
								    is_repeatDatosPredio + li_posicion + is_complementoRepeat
								    + "idInsercionManualPredial"
								);
							PrimeFaces.current().ajax()
								          .update(
								    is_repeatDatosPredio + li_posicion + is_complementoRepeat
								    + "idMatriculasAperturarManual"
								);

							break;
						}

						li_posicion++;
					}
				}
			}
		}
	}

	/**
	 * Modificar matricula segregacion.
	 *
	 * @param addp_datosPredio correspondiente al valor del tipo de objeto DatosDelPredio
	 * @throws B2BException Señala que se ha producido una excepción
	 */
	public void modificarMatriculaSegregacion(DatosDelPredio addp_datosPredio)
	    throws B2BException
	{
		try
		{
			if(addp_datosPredio == null)
				throw new B2BException(ErrorKeys.ERROR_INTERNO_SISTEMA);

			Collection<DatosDelPredio> lcddp_datosPredio;
			int                        li_posicion;
			String                     ls_idCirculo;

			lcddp_datosPredio     = getDatosDelPredio();
			li_posicion           = 0;
			ls_idCirculo          = StringUtils.getStringNotNull(addp_datosPredio.getIdCirculo());

			for(DatosDelPredio lddp_data : lcddp_datosPredio)
			{
				if(lddp_data != null)
				{
					String ls_idCirTemp;
					ls_idCirTemp = StringUtils.getStringNotNull(lddp_data.getIdCirculo());

					if(ls_idCirculo.equals(ls_idCirTemp))
						break;

					li_posicion++;
				}
			}

			Collection<MatriculaSegregacionUi> lcmsui_tmp;
			MatriculaSegregacionUi             lmsui_msui;

			lcmsui_tmp     = addp_datosPredio.getDataInfoPredial();
			lmsui_msui     = getInfoSegregacionManual();

			if((lmsui_msui != null) && CollectionUtils.isValidCollection(lcmsui_tmp))
			{
				Long ll_idCantidad;

				ll_idCantidad = lmsui_msui.getCantidad();

				for(MatriculaSegregacionUi lmsui_tmp : lcmsui_tmp)
				{
					if(lmsui_tmp != null)
					{
						Long ll_cantidadIterada;
						long ll_idCantidadL;
						long ll_cantidadIteradaL;

						ll_cantidadIterada      = lmsui_tmp.getCantidad();
						ll_idCantidadL          = NumericUtils.getLong(ll_idCantidad);
						ll_cantidadIteradaL     = NumericUtils.getLong(ll_cantidadIterada);

						if(ll_idCantidadL == ll_cantidadIteradaL)
						{
							FacesContext lfc_context;
							boolean      lb_focus;

							lfc_context     = FacesContext.getCurrentInstance();
							lb_focus        = true;

							if(!NumericUtils.isValidLong(lmsui_msui.getUnidad()))
								throw new B2BException(ErrorKeys.ERROR_UNIDAD_MEDIDA);

							if(!StringUtils.isValidString(lmsui_msui.getNombrePredio()))
								throw new B2BException(ErrorKeys.ERROR_SIN_NOMBRE_PREDIO);

							{
								String ls_areaTerrenoStr;
								String ls_idCampoAreaTerreno;

								ls_idCampoAreaTerreno     = "idITareaTerrenoCompletaSegregacion";
								ls_areaTerrenoStr         = lmsui_msui.getAreaTerrenoStr();

								if(StringUtils.isValidString(ls_areaTerrenoStr))
								{
									Double ld_area;
									ld_area = NumericUtils.getDoubleWrapper(ls_areaTerrenoStr);

									if(NumericUtils.isValidDouble(ld_area, NumericUtils.DEFAULT_DOUBLE_VALUE, false))
									{
										lb_focus = validateStylesRepeatTab(
											    is_repeatDatosPredio, ls_idCampoAreaTerreno, lfc_context,
											    is_idTabViewDatosPredio, ls_areaTerrenoStr, lb_focus
											);
										lmsui_msui.setAreaTerreno(ld_area);
										lmsui_msui.setAreaTerrenoStr(ls_areaTerrenoStr);
									}
									else
									{
										lb_focus = validateStylesRepeatTab(
											    is_repeatDatosPredio, ls_idCampoAreaTerreno, lfc_context,
											    is_idTabViewDatosPredio, IdentificadoresCommon.DATO_INVALIDO, lb_focus
											);

										PrimeFaces.current().ajax()
											          .update(
											    is_repeatDatosPredio + li_posicion + is_complementoRepeat
											    + ls_idCampoAreaTerreno
											);

										throw new B2BException(ErrorKeys.ERROR_AREA_DEL_TERRENO);
									}
								}
								else
									throw new B2BException(ErrorKeys.ERROR_AREA_DEL_TERRENO);
							}

							if(isBloquearDatosArea())
							{
								lmsui_msui.setAreaConstruida(
								    NumericUtils.getDoubleWrapper(NumericUtils.DEFAULT_DOUBLE_VALUE)
								);
								lmsui_msui.setAreaConstruidaStr("0.0");

								lmsui_msui.setAreaPrivada(
								    NumericUtils.getDoubleWrapper(NumericUtils.DEFAULT_DOUBLE_VALUE)
								);

								lmsui_msui.setAreaPrivadaStr("0.0");

								lmsui_msui.setCoeficiente(
								    NumericUtils.getDoubleWrapper(NumericUtils.DEFAULT_DOUBLE_VALUE)
								);
							}
							else
							{
								{
									String ls_areaPrivada;
									String ls_idAreaPrivada;

									ls_areaPrivada       = lmsui_msui.getAreaPrivadaStr();
									ls_idAreaPrivada     = "idITareaPrivadaSegregacionManual";

									if(StringUtils.isValidString(ls_areaPrivada))
									{
										Double ld_areaPrivada;

										ld_areaPrivada = NumericUtils.getDoubleWrapper(ls_areaPrivada);

										if(
										    NumericUtils.isValidDouble(
											        ld_areaPrivada, NumericUtils.DEFAULT_DOUBLE_VALUE, false
											    )
										)
										{
											lmsui_msui.setAreaPrivada(ld_areaPrivada);
											lmsui_msui.setAreaPrivadaStr(ls_areaPrivada);
										}
										else
										{
											lb_focus = validateStylesRepeatTab(
												    is_repeatDatosPredio, ls_idAreaPrivada, lfc_context,
												    is_idTabViewDatosPredio, IdentificadoresCommon.DATO_INVALIDO,
												    lb_focus
												);

											PrimeFaces.current().ajax()
												          .update(
												    is_repeatDatosPredio + li_posicion + is_complementoRepeat
												    + ls_idAreaPrivada
												);

											throw new B2BException(ErrorKeys.ERROR_AREA_PRIVADA_CONSTRUIDA);
										}
									}
								}

								{
									String ls_coeficienteStr;
									String ls_idCampoCoeficiente;

									ls_idCampoCoeficiente     = "idITcoeficienteSegregacionManual";
									ls_coeficienteStr         = lmsui_msui.getCoeficienteStr();

									if(StringUtils.isValidString(ls_coeficienteStr))
									{
										Double ld_coeficiente;
										ld_coeficiente = NumericUtils.getDoubleWrapper(ls_coeficienteStr);

										if(NumericUtils.isValidDouble(ld_coeficiente, 1L))
										{
											double ld_coeficientePrimitivo;
											ld_coeficientePrimitivo = NumericUtils.getDouble(ld_coeficiente);

											if((ld_coeficientePrimitivo <= 0) || (ld_coeficientePrimitivo > 100))
												throw new B2BException(ErrorKeys.ERROR_COEFICIENTE);

											lb_focus = validateStylesRepeatTab(
												    is_repeatDatosPredio, ls_idCampoCoeficiente, lfc_context,
												    is_idTabViewDatosPredio, ls_coeficienteStr, lb_focus
												);

											lmsui_msui.setCoeficiente(ld_coeficiente);
										}
										else
										{
											lb_focus = validateStylesRepeatTab(
												    is_repeatDatosPredio, ls_idCampoCoeficiente, lfc_context,
												    is_idTabViewDatosPredio, IdentificadoresCommon.DATO_INVALIDO,
												    lb_focus
												);

											PrimeFaces.current().ajax()
												          .update(
												    is_repeatDatosPredio + li_posicion + is_complementoRepeat
												    + ls_idCampoCoeficiente
												);

											throw new B2BException(ErrorKeys.ERROR_COEFICIENTE);
										}
									}
								}

								{
									String ls_areaConstruida;
									String ls_idConstruida;

									ls_areaConstruida     = lmsui_msui.getAreaConstruidaStr();
									ls_idConstruida       = "idITareaConstruidaSegregacionManual";

									if(StringUtils.isValidString(ls_areaConstruida))
									{
										Double ld_areaConstruida;
										ld_areaConstruida = NumericUtils.getDoubleWrapper(ls_areaConstruida);

										if(
										    NumericUtils.isValidDouble(
											        ld_areaConstruida, NumericUtils.DEFAULT_DOUBLE_VALUE, false
											    )
										)
										{
											lmsui_msui.setAreaConstruida(ld_areaConstruida);
											lmsui_msui.setAreaConstruidaStr(ls_areaConstruida);
										}
										else
										{
											lb_focus = validateStylesRepeatTab(
												    is_repeatDatosPredio, ls_idConstruida, lfc_context,
												    is_idTabViewDatosPredio, IdentificadoresCommon.DATO_INVALIDO,
												    lb_focus
												);

											PrimeFaces.current().ajax()
												          .update(
												    is_repeatDatosPredio + li_posicion + is_complementoRepeat
												    + ls_idConstruida
												);

											throw new B2BException(ErrorKeys.ERROR_AREA_CONSTRUIDA);
										}
									}
								}
							}

							lmsui_tmp = lmsui_msui;

							break;
						}
					}
				}

				setInfoSegregacionManual(null);
				setModificarAreaSegregacion(false);
			}
		}
		catch(B2BException lb2be_e)
		{
			clh_LOGGER.error("modificarMatriculaSegregacion", lb2be_e);
			addMessage(lb2be_e);
		}
		finally
		{
			PrimeFaces.current().ajax().update(is_messageIdGrowl);
		}
	}

	/**
	 * Mostrar con sin matricula.
	 *
	 * @return verdadero, si se cumple la condicion, de lo contario retorna falso
	 */
	public boolean mostrarConSinMatricula()
	{
		boolean   lb_return;
		Solicitud ls_solicitud;

		ls_solicitud     = getSolicitud();
		lb_return        = true;

		if(ls_solicitud != null)
		{
			String ls_idSubProceso;

			ls_idSubProceso = ls_solicitud.getIdSubproceso();

			if(StringUtils.isValidString(ls_idSubProceso))
			{
				if(
				    ls_idSubProceso.equalsIgnoreCase("1") || ls_idSubProceso.equalsIgnoreCase("7")
					    || ls_idSubProceso.equalsIgnoreCase("3")
				)
				{
					lb_return = false;

					setSolicitudConTramite("true");
				}
			}
		}

		return lb_return;
	}

