	/**
	 * Método que determina el flujo del proceso dependiendo de cúal se desee realizar.
	 *
	 * @param apaiu_acto Objeto de tipo PredioActoIU usado para el proceso de áreas.
	 * @param adp_datosPredio Objeto de tipo DatosDelPredio usado para el proceso de matriculas segregación.
	 * @param acm_columna Objeto de tipo ColumnModel usado para extraer información necesaria para los procesos a realizar.
	 * @throws B2BException Señala que se ha producido una excepción
	 */
	public void mostrarDescripcionArea(
	    PredioActoIU apaiu_acto, DatosDelPredio adp_datosPredio, ColumnModel acm_columna
	)
	    throws B2BException
	{
		PrimeFaces lp_faces;

		lp_faces = PrimeFaces.current();

		try
		{
			if((apaiu_acto != null) && (acm_columna != null))
			{
				Map<String, Boolean>       lm_actos;
				Map<String, Boolean>       lm_actosTemp;
				Collection<DatosDelPredio> lcddp_datosDelPredio;
				boolean                    lb_validarArea;
				Long                       ll_idMatriculaPrincipal;
				String                     ls_idCirculoPrincipal;
				String                     ls_idActoColumn;
				int                        li_contador;

				lm_actos                    = apaiu_acto.getActos();
				lm_actosTemp                = new HashMap<String, Boolean>();
				lcddp_datosDelPredio        = getDatosDelPredio();
				lb_validarArea              = false;
				ll_idMatriculaPrincipal     = apaiu_acto.getIdMatricula();
				ls_idCirculoPrincipal       = apaiu_acto.getIdCirculo();
				ls_idActoColumn             = acm_columna.getIdActo();
				li_contador                 = 0;

				apaiu_acto.setHabilitarDetalleArea(!acm_columna.isDeshabilitar());

				boolean lb_validacionCertificadoObligatorio;
				boolean lb_habilitarCertificados;
				boolean lb_seleccionado;

				lb_validacionCertificadoObligatorio     = false;
				lb_habilitarCertificados                = false;
				lb_seleccionado                         = false;

				if(CollectionUtils.isValidCollection(lm_actos))
				{
					for(Map.Entry<String, Boolean> lmesb_data : lm_actos.entrySet())
					{
						String  ls_idActo;
						boolean lb_validacion;

						lb_validacion       = false;
						ls_idActo           = lmesb_data.getKey();
						lb_seleccionado     = BooleanUtils.getBooleanValue(lmesb_data.getValue());

						if(StringUtils.isValidString(ls_idActo))
							lb_validacion = irr_registroRemote.validarCertificadoObligatorio(
								    ls_idActo, getUserId(), getLocalIpAddress(), getRemoteIpAddress()
								);
						else

							break;

						if(lb_seleccionado)
							lb_validacionCertificadoObligatorio = lb_validacion;

						lm_actosTemp.put(ls_idActo, lmesb_data.getValue());
					}

					lb_habilitarCertificados = lm_actos.containsValue(Boolean.TRUE);
				}

				apaiu_acto.setHabilitarCertificados(lb_habilitarCertificados);

				if(lb_habilitarCertificados)
				{
					if(lb_validacionCertificadoObligatorio)
						apaiu_acto.setCertificadoAsociado(lb_validacionCertificadoObligatorio);
				}
				else
					apaiu_acto.setCertificadoAsociado(lb_validacionCertificadoObligatorio);

				if(lb_validacionCertificadoObligatorio)
				{
					apaiu_acto.setHabilitarCert(true);
					apaiu_acto.setCantidad(NumericUtils.getLongWrapper(1));
				}
				else
				{
					apaiu_acto.setHabilitarCert(false);

					if(apaiu_acto.isIngresoNuevo() || isHabilitarTurnoYnir())
						apaiu_acto.setCantidad(NumericUtils.getLongWrapper(0));
				}

				Collection<ColumnModel> lccm_columns;

				lccm_columns = new ArrayList<ColumnModel>();

				if(CollectionUtils.isValidCollection(lcddp_datosDelPredio))
				{
					for(DatosDelPredio lddp_iterador : lcddp_datosDelPredio)
					{
						if(lddp_iterador != null)
						{
							Collection<ColumnModel> lccm_columnsIterador;

							lccm_columnsIterador = lddp_iterador.getColumns();

							if(CollectionUtils.isValidCollection(lccm_columnsIterador))
							{
								for(ColumnModel lcm_column : lccm_columnsIterador)
								{
									if(lcm_column != null)
										lccm_columns.add(lcm_column);
								}
							}

							Collection<PredioActoIU> lcpaiu_prediosActo;

							lcpaiu_prediosActo = lddp_iterador.getActosAsociadosGeneral();

							if(CollectionUtils.isValidCollection(lcpaiu_prediosActo))
							{
								for(PredioActoIU lpaiu_iterador : lcpaiu_prediosActo)
								{
									if(lpaiu_iterador != null)
									{
										Map<String, Boolean> lmsb_temp;

										lmsb_temp = lpaiu_iterador.getActos();

										for(Map.Entry<String, Boolean> iterador : lmsb_temp.entrySet())
										{
											Boolean lb_value;
											String  ls_key;

											lb_value     = iterador.getValue();
											ls_key       = iterador.getKey();

											if(BooleanUtils.getBooleanValue(lb_value))
											{
												if(lm_actosTemp.containsKey(ls_key))
													lm_actosTemp.replace(ls_key, lb_value);
											}
										}
									}
								}
							}
						}
					}
				}

				if(adp_datosPredio != null)
				{
					Collection<PredioActoIU>      lcpai_cpai;
					Collection<GravamenPendiente> lcgp_gravamenes;
					Collection<ProhibicionVPM>    lcpv_prohibiciones;

					lcpai_cpai             = adp_datosPredio.getActosAsociadosGeneral();
					lcgp_gravamenes        = new ArrayList<GravamenPendiente>();
					lcpv_prohibiciones     = new ArrayList<ProhibicionVPM>();

					if(CollectionUtils.isValidCollection(lcpai_cpai))
					{
						Collection<PredioActoIU> lcpai_matriculasTipoActos700;
						lcpai_matriculasTipoActos700 = new ArrayList<PredioActoIU>();

						for(PredioActoIU lpai_temp : lcpai_cpai)
						{
							boolean lb_isTipo700;
							lb_isTipo700 = false;

							if(lpai_temp != null)
							{
								Map<String, Boolean> lmesb_actosPorMatricula;
								lmesb_actosPorMatricula = lpai_temp.getActos();

								if(CollectionUtils.isValidCollection(lmesb_actosPorMatricula))
								{
									for(Map.Entry<String, Boolean> lmesb_data : lmesb_actosPorMatricula.entrySet())
									{
										if(lmesb_data != null)
										{
											String ls_idActoMatricula;
											ls_idActoMatricula = lmesb_data.getKey();

											if(StringUtils.isValidString(ls_idActoMatricula))
											{
												Acto la_acto;
												la_acto = new Acto();

												la_acto.setIdActo(ls_idActoMatricula);
												la_acto = irr_registroRemote.findActoBy(la_acto);

												if(la_acto != null)
												{
													lb_isTipo700 = irr_registroRemote.perteneceActoCancelacion(
														    la_acto.getIdTipoActo(), getUserId(), getLocalIpAddress(),
														    getRemoteIpAddress()
														);

													if(lb_isTipo700)
													{
														boolean lb_actoSeleccionado;
														lb_actoSeleccionado = BooleanUtils.getBooleanValue(
															    lmesb_data.getValue()
															);

														if(lb_actoSeleccionado)
														{
															lcpai_matriculasTipoActos700.add(lpai_temp);
															lpai_temp.setTipoActo700(true);
															li_contador++;
														}
														else
															lpai_temp.setTipoActo700(false);
													}
												}
											}
										}
									}
								}
							}
						}

						if(CollectionUtils.isValidCollection(lcpai_matriculasTipoActos700))
						{
							for(PredioActoIU lpau_temp : lcpai_matriculasTipoActos700)
							{
								if(lpau_temp != null)
								{
									String ls_idCirculoMatricula;
									String ls_idMatricula;

									ls_idCirculoMatricula     = lpau_temp.getIdCirculo();
									ls_idMatricula            = StringUtils.getString(lpau_temp.getIdMatricula());

									Collection<GravamenPendiente> lcgp_temp;
									lcgp_temp                 = irr_registroRemote.findGravamenPendiente(
										    ls_idCirculoMatricula, ls_idMatricula, getUserId(), getLocalIpAddress(),
										    getRemoteIpAddress()
										);

									if(CollectionUtils.isValidCollection(lcgp_temp))
									{
										for(GravamenPendiente lgp_temp : lcgp_temp)
										{
											if(lgp_temp != null)
												lcgp_gravamenes.add(lgp_temp);
										}
									}

									Collection<ProhibicionVPM> lcpv_temp;
									ProhibicionVPM             lpv_temp;
									lpv_temp = new ProhibicionVPM();

									lpv_temp.setIdMatriculaPredio(ls_idMatricula);
									lpv_temp.setIdCirculoPredio(ls_idCirculoMatricula);
									lcpv_temp = irr_registroRemote.findProhibicionesVPM(
										    lpv_temp, getUserId(), getLocalIpAddress(), getRemoteIpAddress()
										);

									if(CollectionUtils.isValidCollection(lcpv_temp))
									{
										for(ProhibicionVPM lpv_iterador : lcpv_temp)
										{
											if(lpv_iterador != null)
												lcpv_prohibiciones.add(lpv_iterador);
										}
									}
								}
							}
						}
					}

					setGravamenes(lcgp_gravamenes);
					setProhibicionesVPM(lcpv_prohibiciones);

					if(!CollectionUtils.isValidCollection(lcgp_gravamenes))
						setSiActosSeleccionadosConGravamen(false);
					else
						setSiActosSeleccionadosConGravamen(true);

					if(!CollectionUtils.isValidCollection(lcpv_prohibiciones))
						setRenderedProhibiciones(false);
				}

				for(ColumnModel ac_column : lccm_columns)
				{
					String ls_idActo;

					ls_idActo = ac_column.getIdActo();

					if(StringUtils.isValidString(ls_idActo))
					{
						boolean lb_validar;

						lb_validar = BooleanUtils.getBooleanValue(lm_actosTemp.get(ls_idActo));

						if(lb_validar && ac_column.isValidarArea())
							lb_validarArea = lb_validar;
					}
				}

				boolean lb_procesoEnglobes;
				boolean lb_procesoReloteo;

				lb_procesoEnglobes     = isProcesoEnglobes();
				lb_procesoReloteo      = isProcesoReloteo();

				if((lb_procesoEnglobes || lb_procesoReloteo) && (adp_datosPredio != null))
				{
					Constantes lc_constante;
					String     ls_idConstante;
					String     ls_tipoActo;

					lc_constante       = new Constantes();
					ls_idConstante     = null;
					ls_tipoActo        = acm_columna.getHeader();

					if(lb_procesoEnglobes)
						ls_idConstante = ConstanteCommon.CODIGOS_ACTOS_ENGLOBES;
					else if(lb_procesoReloteo)
						ls_idConstante = ConstanteCommon.CODIGOS_ACTOS_RELOTEO;

					lc_constante.setIdConstante(ls_idConstante);

					lc_constante = ipr_parameterRemote.findConstantById(lc_constante);

					if(lc_constante != null)
					{
						String ls_caracter;

						ls_caracter = lc_constante.getCaracter();

						if(StringUtils.isValidString(ls_caracter))
						{
							String[] lsa_codigos;

							lsa_codigos = ls_caracter.split(",");

							if(CollectionUtils.isValidCollection(lsa_codigos))
							{
								HashMap<String, String> lhmss_codigos;

								lhmss_codigos = new HashMap<String, String>();

								for(String ls_iterador : lsa_codigos)
								{
									if(StringUtils.isValidString(ls_iterador))
										lhmss_codigos.put(ls_idConstante, ls_iterador);
								}

								if(lhmss_codigos.containsValue(ls_tipoActo))
								{
									Collection<PredioActoIU> lcpaiu_prediosActo;

									lcpaiu_prediosActo = adp_datosPredio.getActosAsociadosGeneral();

									if(CollectionUtils.isValidCollection(lcpaiu_prediosActo))
									{
										int li_count;

										li_count = 0;

										for(PredioActoIU lpaiu_iterador : lcpaiu_prediosActo)
										{
											if(lpaiu_iterador != null)
											{
												Map<String, Boolean> lmsb_temp;

												lmsb_temp = lpaiu_iterador.getActos();

												for(Map.Entry<String, Boolean> iterador : lmsb_temp.entrySet())
												{
													Boolean lb_value;
													String  ls_key;

													lb_value     = iterador.getValue();
													ls_key       = iterador.getKey();

													if(
													    ls_key.equalsIgnoreCase(ls_idActoColumn)
														    && BooleanUtils.getBooleanValue(lb_value)
													)
														li_count++;
												}
											}
										}

										if(li_count > 1)
										{
											adp_datosPredio.setValidarProceso(true);

											if(lb_procesoEnglobes)
												addMessage(MessagesKeys.REQUIERE_CERTIFICADO_ENGLOBES);
											else if(lb_procesoReloteo)
												addMessage(MessagesKeys.REQUIERE_CERTIFICADO_RELOTEO);
										}
										else
										{
											adp_datosPredio.setMatriculaSegregacion(null);
											adp_datosPredio.setValidarProceso(false);
										}
									}

									if(lb_procesoReloteo)
									{
										Constantes lc_constanteLoteo;

										lc_constanteLoteo = new Constantes();

										lc_constanteLoteo.setIdConstante(ConstanteCommon.CODIGOS_ACTOS_LOTEO);

										lc_constanteLoteo = ipr_parameterRemote.findConstantById(lc_constanteLoteo);

										if(lc_constanteLoteo != null)
										{
											String ls_codigoLoteo;

											ls_codigoLoteo = lc_constanteLoteo.getCaracter();

											if(StringUtils.isValidString(ls_codigoLoteo))
											{
												AnotacionPredio lap_anotacionPredio;

												lap_anotacionPredio = new AnotacionPredio();

												lap_anotacionPredio.setIdCirculo(ls_idCirculoPrincipal);
												lap_anotacionPredio.setIdMatricula(ll_idMatriculaPrincipal);
												lap_anotacionPredio.setIdNaturalezaJuridica(ls_codigoLoteo);

												if(!irr_registroRemote.validarAnotacionLoteo(lap_anotacionPredio))
												{
													Object[] aoa_messageArgs;

													aoa_messageArgs        = new String[2];
													aoa_messageArgs[0]     = ls_idCirculoPrincipal;
													aoa_messageArgs[1]     = StringUtils.getString(
														    ll_idMatriculaPrincipal
														);

													setMsgErrorReloteo(
													    getMessages()
														        .getString(
														        MessagesKeys.ANOTACION_LOTEO, aoa_messageArgs
														    )
													);

													addMessage(EstadoCommon.E, getMsgErrorReloteo());
												}
												else
													setMsgErrorReloteo(null);
											}
										}
									}
									else
										setMsgErrorReloteo(null);
								}
							}
						}
					}
				}

				boolean lb_procesoVentaParcial;
				boolean lb_procesoDesenglobes;

				lb_procesoVentaParcial     = isProcesoVentaParcial();
				lb_procesoDesenglobes      = isProcesoDesenglobes();

				if(lb_procesoVentaParcial || lb_procesoDesenglobes)
				{
					Constantes lc_constante;
					String     ls_tipoActo;
					String     ls_actoValidar;

					lc_constante       = new Constantes();
					ls_tipoActo        = acm_columna.getHeader();
					ls_actoValidar     = null;

					if(lb_procesoVentaParcial)
						ls_actoValidar = ConstanteCommon.CODIGOS_ACTOS_VENTA_PARCIAL;
					else if(lb_procesoDesenglobes)
						ls_actoValidar = ConstanteCommon.CODIGOS_ACTOS_DESENGLOBES;

					lc_constante.setIdConstante(ls_actoValidar);

					lc_constante = ipr_parameterRemote.findConstantById(lc_constante);

					if(lc_constante != null)
					{
						String ls_caracter;

						ls_caracter = lc_constante.getCaracter();

						if(StringUtils.isValidString(ls_caracter))
						{
							String[] lsa_codigos;

							lsa_codigos = ls_caracter.split(",");

							if(CollectionUtils.isValidCollection(lsa_codigos))
							{
								HashMap<String, String> lhmss_codigos;

								lhmss_codigos = new HashMap<String, String>();

								for(String ls_iterador : lsa_codigos)
								{
									if(StringUtils.isValidString(ls_iterador))
										lhmss_codigos.put(ls_iterador, ls_iterador);
								}

								if(lhmss_codigos.containsKey(ls_tipoActo))
								{
									Collection<PredioActoIU> lcpaiu_prediosActo;

									lcpaiu_prediosActo = adp_datosPredio.getActosAsociadosGeneral();

									if(CollectionUtils.isValidCollection(lcpaiu_prediosActo))
									{
										int li_count;

										li_count = 0;

										for(PredioActoIU lpaiu_iterador : lcpaiu_prediosActo)
										{
											if(lpaiu_iterador != null)
											{
												Map<String, Boolean> lmsb_temp;

												lmsb_temp = lpaiu_iterador.getActos();

												for(Map.Entry<String, Boolean> iterador : lmsb_temp.entrySet())
												{
													Boolean lb_value;
													String  ls_key;

													lb_value     = iterador.getValue();
													ls_key       = iterador.getKey();

													if(
													    ls_key.equalsIgnoreCase(ls_idActoColumn)
														    && BooleanUtils.getBooleanValue(lb_value)
													)
														li_count++;
												}
											}
										}

										if(li_count == 1)
										{
											adp_datosPredio.setValidarProceso(true);

											if(lb_procesoVentaParcial)
												addMessage(MessagesKeys.REQUIERE_CERTIFICADO_VENTA_PARCIAL);
											else if(lb_procesoDesenglobes)
												addMessage(MessagesKeys.REQUIERE_CERTIFICADO_DESENGLOBES);
										}
										else
										{
											adp_datosPredio.setMatriculaSegregacion(null);
											adp_datosPredio.setValidarProceso(false);
										}
									}
								}
							}
						}
					}
				}

				if(StringUtils.isValidString(ls_idActoColumn))
				{
					if(
					    irr_registroRemote.mensajeEmbargoVigente(
						        ls_idActoColumn, ls_idCirculoPrincipal, ll_idMatriculaPrincipal, true, getUserId(),
						        getLocalIpAddress(), getRemoteIpAddress()
						    )
					)
					{
						Object[] loa_arg;

						loa_arg        = new String[1];
						loa_arg[0]     = ls_idCirculoPrincipal + "-" + ll_idMatriculaPrincipal;

						addMessage(MessagesKeys.EMBARGO_VIGENTE_MATRICULA, loa_arg);
					}

					{
						setMensajeAdjudicacionEmbargoVigente(
						    irr_registroRemote.mensajeEmbargoVigente(
						        ls_idActoColumn, ls_idCirculoPrincipal, ll_idMatriculaPrincipal, false, getUserId(),
						        getLocalIpAddress(), getRemoteIpAddress()
						    )
						);

						if(isMensajeAdjudicacionEmbargoVigente())
						{
							Object[] loa_arg;

							loa_arg        = new String[1];
							loa_arg[0]     = ls_idCirculoPrincipal + "-" + ll_idMatriculaPrincipal;

							addMessage(MessagesKeys.MEDIDA_CAUTELAR_VIGENTE, loa_arg);
							setObservacionesEmbargoVigente(
							    getMessages().getString(MessagesKeys.MEDIDA_CAUTELAR_VIGENTE, loa_arg)
							);
						}
					}
				}

				String ls_idCirculo;
				ls_idCirculo = adp_datosPredio.getIdCirculo();

				if(StringUtils.isValidString(ls_idCirculo))
					actualizarPanelDatosDelPredio(ls_idCirculo, true);

				apaiu_acto.setValidarArea(lb_validarArea);

				if(apaiu_acto.isIngresoNuevo() || isHabilitarTurnoYnir())
					addMessage(MessagesKeys.CANTIDAD_CERTIFICADOS_ANTIGUO_SISTEMA);

				validarArea(apaiu_acto);

				setHayActosCancelacion(li_contador > 0);
			}
		}
		catch(B2BException lb2be_e)
		{
			clh_LOGGER.error(lb2be_e);
			addMessage(lb2be_e);
		}
		finally
		{
			lp_faces.ajax().update(is_messageIdGrowl);
			lp_faces.ajax().update("fRegistro:idDtActoAsociadoGeneral");
			lp_faces.ajax().update("fRegistro:idPDatosDelPredioEnglobado");
			lp_faces.ajax().update("fRegistro:idActosDatosDelPredio");
			lp_faces.ajax().update("fRegistro:OpPreguntaSegracion");
			lp_faces.ajax().update("fRegistro:idexcelPredial");
			lp_faces.ajax().update("fRegistro:idPGravamenesPendientes");
			lp_faces.ajax().update("fRegistro:idPProhibicionesVPM");
		}
	}

