	/**
	 * Retorna el valor del objeto de Collection.
	 *
	 * @return devuelve el valor de Collection
	 * @throws B2BException Señala que se ha producido una excepción
	 *
	 */
	public Collection<TipoDocumental> obtenerTiposDocActo()
	    throws B2BException
	{
		Collection<TipoDocumental> lctd_ctd;

		lctd_ctd = new ArrayList<TipoDocumental>();

		try
		{
			String ll_idActo;
			String ls_codigo;

			ls_codigo     = getCodigo();
			ll_idActo     = getIdActo();

			if(
			    NumericUtils.isValidLong(NumericUtils.getLongWrapper(ll_idActo))
				    && NumericUtils.isValidLong(NumericUtils.getLongWrapper(ls_codigo))
			)
			{
				Solicitud ls_solicitud;

				ls_solicitud     = getSolicitud();
				lctd_ctd         = irr_registroRemote.findAllDocumentales(
					    StringUtils.getString(ll_idActo), StringUtils.getString(ls_codigo), true,
					    (ls_solicitud != null) ? ls_solicitud.getIdSolicitud() : null
					);

				if(CollectionUtils.isValidCollection(lctd_ctd))
				{
					Iterator<TipoDocumental> litd_itarator;

					litd_itarator = lctd_ctd.iterator();

					while(litd_itarator.hasNext())
					{
						TipoDocumental ltd_actual;

						ltd_actual = litd_itarator.next();

						if(ltd_actual != null)
							ltd_actual.setTiposDoc(lctd_ctd);
					}
				}
			}
		}
		catch(B2BException lb2be_e)
		{
			clh_LOGGER.error(lb2be_e);
		}

		return lctd_ctd;
	}

	/**
	 * Oficina origen.
	 *
	 * @param addp_datosPredio correspondiente al valor del tipo de objeto DatosDelPredio
	 * @throws B2BException Señala que se ha producido una excepción
	 */
	public void oficinaOrigen(DatosDelPredio addp_datosPredio)
	    throws B2BException
	{
		try
		{
			Collection<OficinaOrigen> lc_oficina;
			lc_oficina = getOficinaOrigen(addp_datosPredio);

			if(lc_oficina == null)
				throw new B2BException(ErrorKeys.NO_OFICINA_ORIGEN);
		}
		catch(B2BException lb2be_e)
		{
			clh_LOGGER.error(lb2be_e);
			addMessage(lb2be_e);
			PrimeFaces.current().ajax().update(is_messageIdGrowl);
		}
	}

