	/**
	 * On row toggle.
	 *
	 * @param event correspondiente al valor del tipo de objeto ToggleEvent
	 * @throws B2BException Señala que se ha producido una excepción
	 */
	public void onRowToggle(ToggleEvent event)
	    throws B2BException
	{
		com.bachue.snr.prosnr01.model.registro.Acto lo_acto;

		lo_acto = ((com.bachue.snr.prosnr01.model.registro.Acto)event.getData());

		if(event.getVisibility().toString().equalsIgnoreCase("VISIBLE"))
		{
			if(lo_acto != null)
			{
				Collection<TipoDocumental> lctd_documentales;

				setCodigo(lo_acto.getCodigo());
				setIdActo(lo_acto.getIdActoDb());

				lctd_documentales = obtenerTiposDocActo();

				if(CollectionUtils.isValidCollection(lctd_documentales))
				{
					for(TipoDocumental ltd_tipoDocumental : lctd_documentales)
					{
						if(ltd_tipoDocumental != null)
						{
							ltd_tipoDocumental.setEditar(true);

							if(lo_acto.getCodigo().equals("64"))
								ltd_tipoDocumental.setSeleccionado(true);
						}
					}
				}

				lo_acto.setActosui(lctd_documentales);
			}
		}
		else
			setCodigo(null);
	}

