	/**
	 * Metodo encargado de crear acto de división material.
	 *
	 * @param as_form Argumento de tipo String que contiene el id del formulario desde
	 * donde se realiza la petición.
	 * @throws B2BException Señala que se ha producido una excepción
	 */
	public void preguntaDivisionMaterial(String as_form)
	    throws B2BException
	{
		try
		{
			com.bachue.snr.prosnr01.model.registro.Acto la_actoDivision;
			com.bachue.snr.prosnr01.model.registro.Acto la_actoDivisionSecundario;

			la_actoDivisionSecundario     = new com.bachue.snr.prosnr01.model.registro.Acto();
			la_actoDivision               = getActoDivisionMaterial();

			if(la_actoDivision == null)
				throw new B2BException(ErrorKeys.ERROR_INTERNO_SISTEMA);

			String     ls_idConstante;
			Constantes lc_constante;

			ls_idConstante     = ConstanteCommon.ACTOS_DIVISION_MATERIAL;
			lc_constante       = irr_referenceRemote.findConstantesById(ls_idConstante);

			if(lc_constante == null)
			{
				Object[] loa_messageArgs;

				loa_messageArgs        = new String[1];
				loa_messageArgs[0]     = ls_idConstante;

				throw new B2BException(ErrorKeys.ERROR_SIN_CONSTANTE, loa_messageArgs);
			}

			String   ls_caracter;
			String[] lsa_codigosDivision;

			ls_caracter             = StringUtils.getStringNotNull(lc_constante.getCaracter());
			lsa_codigosDivision     = ls_caracter.split(",");

			la_actoDivisionSecundario.setCodigo(lsa_codigosDivision[1]);

			setActo(la_actoDivisionSecundario);

			cambiarEspecifica(true);

			la_actoDivisionSecundario.setIdCirculo(la_actoDivision.getIdCirculo());
			la_actoDivisionSecundario.setCantidadActos(la_actoDivision.getCantidadActos());
			la_actoDivisionSecundario.setCantidadMatriculas(la_actoDivision.getCantidadMatriculas());
			la_actoDivisionSecundario.setCantidadMatriculasInclr(la_actoDivision.getCantidadMatriculasInclr());

			setActo(la_actoDivisionSecundario);

			agregarActos(false, as_form);
		}
		catch(B2BException lb2be_e)
		{
			clh_LOGGER.error("preguntaDivisionMaterial", lb2be_e);
			addMessage(lb2be_e);
			PrimeFaces.current().ajax().update(is_messageIdGrowl);
			throw lb2be_e;
		}
	}

