	/**
	 * Procesa el cargue de un archivo de excel para las matrículas.
	 *
	 * @param afue_event Objeto contenedor del archivo cargado
	 */
	public void processFile(FileUploadEvent afue_event)
	{
		DatosDelPredio lddp_datosPredio;
		boolean        lb_validDatosPredio;
		boolean        lb_traslado;

		lddp_datosPredio        = (DatosDelPredio)afue_event.getComponent().getAttributes().get("nAttrDatoPredio");
		lb_validDatosPredio     = lddp_datosPredio != null;
		lb_traslado             = isProcesoTraslado();

		try
		{
			boolean lb_datosPredio;
			String  ls_datosPredio;

			ls_datosPredio     = (String)afue_event.getComponent().getAttributes().get("datosPredio");
			lb_datosPredio     = BooleanUtils.getBooleanValue(ls_datosPredio);

			if((lb_validDatosPredio) || !lb_datosPredio || lb_traslado)
			{
				String       ls_mensaje  = null;
				UploadedFile luf_file;
				int          li_posicion;

				luf_file                 = afue_event.getFile();
				li_posicion              = 0;

				if(luf_file != null)
				{
					if(luf_file.getSize() <= 500000)
					{
						byte[] lba_excelFile;

						lba_excelFile = luf_file.getContents();

						if((lba_excelFile != null) && (luf_file.getFileName() != null))
						{
							setContadorMatriculasErroneas(0);

							lba_excelFile = FileLoad(lba_excelFile, luf_file.getFileName(), getUserId());
						}

						if(lba_excelFile != null)
						{
							String ls_nombreArchivo;

							ls_nombreArchivo = luf_file.getFileName();

							if(StringUtils.isValidString(ls_nombreArchivo))
							{
								if(isProcesoCertificados())
								{
									Object[] loa_args;

									loa_args = new String[1];

									if(!lb_datosPredio)
										setFile(lba_excelFile);
									else
										lddp_datosPredio.setFile(lba_excelFile);

									lddp_datosPredio.setActosAsociadosGeneral(getActosAsociadosGeneral());

									loa_args[0] = StringUtils.getString(getContadorMatriculasErroneas());

									addMessage(MessagesKeys.NUMERO_MATRICULAS_ERRONEAS, loa_args);
								}
								else if(lb_datosPredio)
								{
									Collection<DatosDelPredio> lcddp_coleccionPredio;

									lcddp_coleccionPredio = getDatosDelPredio();

									if(lcddp_coleccionPredio != null)
									{
										String ls_idCirculo;

										ls_idCirculo = StringUtils.getStringNotNull(lddp_datosPredio.getIdCirculo());

										for(DatosDelPredio lddp_data : lcddp_coleccionPredio)
										{
											if(lddp_data != null)
											{
												String ls_idCirTemp;

												ls_idCirTemp = StringUtils.getStringNotNull(lddp_data.getIdCirculo());

												if(ls_idCirculo.equals(ls_idCirTemp))
												{
													lddp_data.setFile(lba_excelFile);

													break;
												}

												li_posicion++;
											}
										}
									}
								}
								else
									setFile(lba_excelFile);
							}
						}
					}
					else
						throw new B2BException("El Archivo de Cargue de Excel no puede exceder los 500 Kb.");
				}
				else
					ls_mensaje = "No se encontro un Archivo de Cargue Masivo para procesar.";

				if(!StringUtils.isValidString(ls_mensaje))
					ls_mensaje = "Procesamiento de Archivo Cargue Masivo terminado. Por favor verifique si hay errores en el archivo de salida";

				addMessage("I", ls_mensaje);
				cargarMensajePredioInconsistente();

				if(lb_datosPredio)
				{
					PrimeFaces.current().ajax()
						          .update(
						    is_repeatDatosPredio + li_posicion + is_complementoRepeat + "idClnkRespuesta"
						);
					PrimeFaces.current().ajax()
						          .update(is_repeatDatosPredio + li_posicion + is_complementoRepeat + "idOlLinkExcel");
					PrimeFaces.current().ajax()
						          .update(
						    is_repeatDatosPredio + li_posicion + is_complementoRepeat + "panelDatosDelPredio"
						);

					if(lb_traslado)
						PrimeFaces.current().ajax().update("fRegistro:idClnkRespuestaTraslados");
				}
			}
			else
				throw new B2BException(ErrorKeys.ERROR_INTERNO_SISTEMA);
		}
		catch(B2BException lb2be_e)
		{
			setFile(null);

			clh_LOGGER.error("processFile", lb2be_e);
			addMessage(lb2be_e);
			PrimeFaces.current().ajax().update(is_messageIdGrowl);
		}
		catch(Exception lb2be_e)
		{
			setFile(null);

			clh_LOGGER.error("processFile", lb2be_e);
			addMessage("E", lb2be_e.getMessage());
			PrimeFaces.current().ajax().update(is_messageIdGrowl);
		}
	}

	/**
	 * Retorna el valor del objeto de String.
	 *
	 * @param afue_event correspondiente al valor del tipo de objeto FileUploadEvent
	 * @return devuelve el valor de String
	 *
	 */
	public String processFilePredial(FileUploadEvent afue_event)
	{
		try
		{
			DatosDelPredio lddp_datosPredio;
			Ajax           la_ajax;

			lddp_datosPredio     = (DatosDelPredio)afue_event.getComponent().getAttributes().get("nAttrPredial");
			la_ajax              = PrimeFaces.current().ajax();

			if(lddp_datosPredio != null)
			{
				String       ls_mensaje   = null;
				UploadedFile luf_file;
				String       ls_solicitud;
				int          li_posicion;

				luf_file                  = afue_event.getFile();
				ls_solicitud              = getSolicitud().getIdSolicitud();
				li_posicion               = 0;

				if(luf_file != null)
				{
					if(luf_file.getSize() <= 500000)
					{
						lddp_datosPredio.setDataInfoPredial(null);
						lddp_datosPredio.setFilePredial(null);

						byte[] lba_excelFile;

						lba_excelFile = luf_file.getContents();

						if((lba_excelFile != null) && (luf_file.getFileName() != null))
							lba_excelFile = FileLoadPredial(
								    lba_excelFile, luf_file.getFileName(), getUserId(), ls_solicitud, lddp_datosPredio
								);

						if(lba_excelFile != null)
						{
							Collection<DatosDelPredio> lcddp_datosPredio;

							lcddp_datosPredio = getDatosDelPredio();

							if(lcddp_datosPredio == null)
								throw new B2BException(ErrorKeys.ERROR_INTERNO_SISTEMA);

							String ls_idCirculo;
							ls_idCirculo = StringUtils.getStringNotNull(lddp_datosPredio.getIdCirculo());

							Iterator<DatosDelPredio> li_i;
							boolean                  lb_b;

							li_i     = lcddp_datosPredio.iterator();
							lb_b     = false;

							while(li_i.hasNext() && !lb_b)
							{
								DatosDelPredio lddp_data;

								lddp_data = li_i.next();

								if(lddp_data != null)
								{
									String ls_idCirTemp;
									ls_idCirTemp = StringUtils.getStringNotNull(lddp_data.getIdCirculo());

									if(ls_idCirculo.equals(ls_idCirTemp))
									{
										InputStream lis_stream = new ByteArrayInputStream(lba_excelFile);
										lddp_data.setFilePredial(
										    new DefaultStreamedContent(
										        lis_stream, luf_file.getContentType(), "ARCHIVO_DE_SALIDA.xlsx"
										    )
										);

										lb_b = true;
									}

									if(!lb_b)
										li_posicion++;
								}
							}
						}
					}
					else
						throw new B2BException("El Archivo de Cargue de Excel no puede exceder los 500 Kb.");
				}
				else
					ls_mensaje = "No se encontro un Archivo de Cargue  para procesar.";

				if(!StringUtils.isValidString(ls_mensaje))
					ls_mensaje = "Procesamiento de Archivo Cargue  terminado. Por favor verifique si hay errores en el archivo de salida";

				addMessage("I", ls_mensaje);

				la_ajax.update(is_repeatDatosPredio + li_posicion + is_complementoRepeat + "idDtActoAsociadoGeneral");
				la_ajax.update(is_repeatDatosPredio + li_posicion + is_complementoRepeat + "idDataTablePredioAsociado");
				la_ajax.update(is_repeatDatosPredio + li_posicion + is_complementoRepeat + "idClnkRespuesta");
				la_ajax.update(is_repeatDatosPredio + li_posicion + is_complementoRepeat + "idexcelPredial");
				la_ajax.update(is_repeatDatosPredio + li_posicion + is_complementoRepeat + "idMatriculasAperturar");
				la_ajax.update(is_repeatDatosPredio + li_posicion + is_complementoRepeat + "idOPLogoExcel");
			}
			else
				throw new B2BException(ErrorKeys.ERROR_INTERNO_SISTEMA);
		}
		catch(B2BException lb2be_e)
		{
			clh_LOGGER.error("processFilePredial", lb2be_e);
			addMessage(lb2be_e);
			PrimeFaces.current().ajax().update(is_messageIdGrowl);
		}
		catch(Exception lb2be_e)
		{
			clh_LOGGER.error("processFilePredial", lb2be_e);
			addMessage("E", lb2be_e.getMessage());
			PrimeFaces.current().ajax().update(is_messageIdGrowl);
		}

		return null;
	}

