	/**
	 * Reset ant sis.
	 *
	 * @param addp_datosPredio correspondiente al valor del tipo de objeto DatosDelPredio
	 */
	public void resetAntSis(DatosDelPredio addp_datosPredio)
	{
		try
		{
			if((addp_datosPredio == null))
				throw new B2BException(ErrorKeys.ERROR_INTERNO_SISTEMA);

			Collection<DatosDelPredio> lcddp_datosPredio;
			int                        li_posicion;
			boolean                    lb_procesoCertificados;
			DatosAntSistema            ldas_datos;

			lcddp_datosPredio          = getDatosDelPredio();
			li_posicion                = 0;
			lb_procesoCertificados     = isProcesoCertificados();
			ldas_datos                 = null;

			if(CollectionUtils.isValidCollection(lcddp_datosPredio))
			{
				String                   ls_idCirculo;
				Iterator<DatosDelPredio> liddp_iterador;
				boolean                  lb_encontro;

				ls_idCirculo       = StringUtils.getStringNotNull(addp_datosPredio.getIdCirculo());
				liddp_iterador     = lcddp_datosPredio.iterator();
				lb_encontro        = false;

				while(liddp_iterador.hasNext() && !lb_encontro)
				{
					DatosDelPredio lddp_data;

					lddp_data = liddp_iterador.next();

					if(lddp_data != null)
					{
						String ls_idCirTemp;

						ls_idCirTemp = StringUtils.getStringNotNull(lddp_data.getIdCirculo());

						if(ls_idCirTemp.equals(ls_idCirculo))
						{
							ldas_datos     = lddp_data.getDatosAntiguoSistema();

							lb_encontro = true;
						}
						else
							li_posicion++;
					}
				}
			}
			else if(lb_procesoCertificados)
				ldas_datos = addp_datosPredio.getDatosAntiguoSistema();

			if(ldas_datos == null)
				throw new B2BException(ErrorKeys.ERROR_INTERNO_SISTEMA);

			ldas_datos.setNombrePredio(null);
			ldas_datos.setIdTipoPredio(null);
			ldas_datos.setIdMunicipio(null);
			ldas_datos.setCantidadCertificados(null);

			if(lb_procesoCertificados)
			{
				ldas_datos.setIdCirculo(null);
				ldas_datos.setIdDepartamento(null);
			}
			else
			{
				Ajax la_ajax;
				la_ajax = PrimeFaces.current().ajax();

				la_ajax.update(is_repeatDatosPredio + li_posicion + is_complementoRepeat + "idPnPrediosAntiguoSistema");
				la_ajax.update(
				    is_repeatDatosPredio + li_posicion + is_complementoRepeat + "idCBModificarDatosAntSistema"
				);
				la_ajax.update(
				    is_repeatDatosPredio + li_posicion + is_complementoRepeat + "idCBEliminarDatosAntSistema"
				);
				la_ajax.update(
				    is_repeatDatosPredio + li_posicion + is_complementoRepeat + "idCBGuardarDatosAntSistema"
				);
			}
		}
		catch(B2BException lb2be_e)
		{
			clh_LOGGER.error("resetAntSis", lb2be_e);
			addMessage(lb2be_e);
		}

		PrimeFaces.current().ajax().update(is_messageIdGrowl);
	}

