	// guardaar total
	public ActoNuevaEntrada saveInfoAll()
	    throws B2BException
	{
		ActoNuevaEntrada lane_actoNuevaEntrada;

		lane_actoNuevaEntrada = new ActoNuevaEntrada();

		lane_actoNuevaEntrada.setSaveInfoAll(true);

		try
		{
			com.bachue.snr.prosnr01.model.registro.Acto loa_oa;

			loa_oa = getActo();

			if(loa_oa != null)
			{
				String ls_idSolicitud;

				ls_idSolicitud = getSolicitud().getIdSolicitud();

				lane_actoNuevaEntrada.setActo(loa_oa);

				if(StringUtils.isValidString(ls_idSolicitud))
				{
					Constantes loc_tmp;

					loc_tmp = irr_referenceRemote.findConstantesById(ConstanteCommon.ACTOS_CON_VENCIMIENTO);

					if(loc_tmp != null)
					{
						String ls_caracter;
						ls_caracter = loc_tmp.getCaracter();

						if(StringUtils.isValidString(ls_caracter))
						{
							String[] lsa_codigos;

							lsa_codigos = ls_caracter.split(",");

							if(lsa_codigos != null)
							{
								boolean   lb_b;
								Date      ld_fechaVencimiento;
								Solicitud ls_solicitud;
								String    ls_codigoActo;

								lb_b                    = false;
								ld_fechaVencimiento     = null;
								ls_solicitud            = new Solicitud();
								ls_codigoActo           = loa_oa.getCodigo();

								ls_solicitud.setIdSolicitud(ls_idSolicitud);
								ls_solicitud.setDocumento(true);

								ls_solicitud = irr_registroRemote.findSolicitudById(ls_solicitud, getUserId());

								if(ls_solicitud != null)
								{
									ld_fechaVencimiento = ls_solicitud.getFechaDocumento();

									if(!CollectionUtils.isValidCollection(getDetailsActo()))
										setDetailsActo(ls_solicitud.getActosDetails());
								}

								for(String ls_tmp : lsa_codigos)
								{
									if(StringUtils.isValidString(ls_tmp))
									{
										if(!lb_b && ls_tmp.equalsIgnoreCase(ls_codigoActo))
											lb_b = true;
									}
								}

								if(lb_b)
								{
									Calendar lc_calendar;
									Date     ld_d;

									lc_calendar     = Calendar.getInstance();
									ld_d            = lc_calendar.getTime();

									lc_calendar.setTime(new Date());
									lc_calendar.add(Calendar.DAY_OF_YEAR, -90);

									if((ld_fechaVencimiento != null) && ld_fechaVencimiento.before(ld_d))
									{
										addMessage(MessagesKeys.DOCUMENTO_HIPOTECA_O_PATRIMONIO_FAMILIA);
										PrimeFaces.current().ajax().update(is_messageIdGrowl);
									}
								}
							}
						}
					}

					loa_oa.setIdSolicitud(ls_idSolicitud);
					loa_oa.setRequiereCuantiaActo(isRequiereCuantiaActo());
					loa_oa.setNoRequiereCuantiaActo(isNoRequiereCuantiaActo());
					loa_oa.setEsCambioTipoCuantia(isEsCambioTipoCuantia());

					if(isEsActoConEjecutoria())
						loa_oa.setFechaEjecutoria(getFechaEjecutoria());

					if(isCuotaparteDonacion())
						validarDatosCuotaparteDonacion(false);

					com.bachue.snr.prosnr01.model.registro.Acto la_temp;

					la_temp = irr_registroRemote.saveInfoAll(
						    loa_oa, getUserId(), getLocalIpAddress(), getRemoteIpAddress()
						);

					if(la_temp != null)
					{
						String ls_actoIdDb;

						ls_actoIdDb = la_temp.getIdActoDb();

						if(StringUtils.isValidString(ls_actoIdDb))
						{
							loa_oa.setIdActoDb(ls_actoIdDb);
							loa_oa.setIdActoDerivado(la_temp.getIdActoDerivado());
							setIdActoBd(ls_actoIdDb);
							lane_actoNuevaEntrada.setActo(loa_oa);
						}
					}
				}
			}
		}
		catch(B2BException lb2be_e)
		{
			clh_LOGGER.error(lb2be_e);
			lane_actoNuevaEntrada.setSaveInfoAll(false);
			throw new B2BException(lb2be_e.getMessage());
		}

		return lane_actoNuevaEntrada;
	}

