	/**
	 * Metodo encargado de insertar los tipos documentales asociados a un acto.
	 *
	 * @param aa_acto Argumento de tipo Acto que contiene los datos necesarios para insertar los
	 * tipos documentales.
	 * @param as_form Argumento de tipo String que contiene el id del formulario
	 * que realiza la petición.
	 * @param ab_procesoCorrecciones Argumento de tipo <code>boolean</code> que determina si es un proceso de correcciones.
	 * @return Variable de tipo boolean que indica si se presentó un error (true) de lo contrario (false).
	 * @throws B2BException Señala que se ha producido una excepción
	 */
	public boolean saveInfoTiposDoc(
	    com.bachue.snr.prosnr01.model.registro.Acto aa_acto, String as_form, boolean ab_procesoCorrecciones
	)
	    throws B2BException
	{
		boolean lb_b;

		try
		{
			if(aa_acto == null)
				aa_acto = getTempActo();

			Collection<TipoDocumental> lctd_tiposDocumentales;
			boolean                    lb_validActo;
			String                     ls_idSolicitud;
			String                     ls_codigo;
			String                     ls_idActo;
			boolean                    lb_focus;
			FacesContext               lfc_context;

			lb_validActo               = aa_acto != null;
			ls_idSolicitud             = getSolicitud().getIdSolicitud();
			ls_codigo                  = lb_validActo ? aa_acto.getCodigo() : null;
			ls_idActo                  = lb_validActo ? aa_acto.getIdActoDb() : null;
			lctd_tiposDocumentales     = lb_validActo ? aa_acto.getActosui() : null;
			lb_b                       = false;
			lb_focus                   = true;
			lfc_context                = FacesContext.getCurrentInstance();

			if(CollectionUtils.isValidCollection(lctd_tiposDocumentales))
			{
				for(TipoDocumental lotd_td : lctd_tiposDocumentales)
				{
					if(lotd_td != null)
					{
						String  ls_observaciones;
						String  ls_medioRecepcion;
						boolean lb_seleccionado;

						lb_seleccionado       = lotd_td.isSeleccionado();
						ls_observaciones      = lotd_td.getObservaciones();
						ls_medioRecepcion     = lotd_td.getMedioRecepcion();

						if(lotd_td.isMostrarBoletaFiscal())
						{
							if(lb_seleccionado)
								lb_focus = validateStyles(
									    as_form + ":idDtActo:idDtTiposDocumentales:observaTipo", lfc_context, "valido",
									    lb_focus
									);
							else
							{
								lb_focus = validateStyles(
									    as_form + ":idDtActo:idDtTiposDocumentales:observaTipo", lfc_context,
									    ls_observaciones, lb_focus
									);

								if(!StringUtils.isValidString(ls_observaciones))
									throw new B2BException(ErrorKeys.ERROR_SIN_OBSERVACIONES_DOCUMENTO_FALTANTE);
							}
						}

						lb_focus = validateStyles(
							    as_form + ":idDtActo:idDtTiposDocumentales:idSOMedioRecepcion", lfc_context,
							    ls_medioRecepcion, lb_focus
							);
					}
				}
			}

			irr_registroRemote.guardarTiposDocumentales(
			    ls_idSolicitud, lctd_tiposDocumentales, ls_idActo, getUserId(), ls_codigo, ab_procesoCorrecciones
			);

			obtenerTiposDocActo();
			addMessage("I", "Registro Insertado");
			PrimeFaces.current().ajax().update(as_form + ":idDtActo");
			PrimeFaces.current().ajax().update(is_messageIdGrowl);
		}
		catch(B2BException lb2be_e)
		{
			lb_b = true;
			clh_LOGGER.error(lb2be_e);
			addMessage(lb2be_e);
			PrimeFaces.current().ajax().update(is_messageIdGrowl);
		}
		finally
		{
			PrimeFaces.current().ajax().update("fRegistro:idDtActo:idDtTiposDocumentales");
		}

		return lb_b;
	}

