	/**
	 * Terminar proceso constancia.
	 *
	 * @param event correspondiente al valor del tipo de objeto ActionEvent
	 * @throws Exception Señala que se ha producido una excepción
	 */
	public void terminarProcesoConstancia()
	{
		try
		{
			if(isPreliquidacion())
			{
				boolean   ls_isConstanciaRep;
				boolean   lb_validacionCorr;
				Registro  lr_registro;
				String    ls_indCondicion;
				Solicitud ls_solicitud;

				ls_isConstanciaRep     = true;
				lr_registro            = new Registro();
				ls_indCondicion        = IdentificadoresCommon.LIQUIDAR;
				ls_solicitud           = getSolicitud();
				lb_validacionCorr      = irr_registroRemote.validarNotificarCorrespondencia(
					    ls_solicitud, getUserId(), getLocalIpAddress(), getRemoteIpAddress()
					);

				lr_registro.setSolicitud(getSolicitud());

				procLiquidacion(ls_indCondicion);

				lr_registro.setIndCondicion(ls_indCondicion);

				lr_registro = irr_registroRemote.terminarProceso(
					    lr_registro, null, getUserId(), lb_validacionCorr, ls_isConstanciaRep, getLocalIpAddress(),
					    getRemoteIpAddress()
					);

				if(lr_registro != null)
				{
					byte[] lba_pdf;
					byte[] lba_pdfliquidacion;

					lba_pdf                = lr_registro.getPdf();
					lba_pdfliquidacion     = lr_registro.getPdfLiquidacion();

					if(lba_pdf == null)
						throw new B2BException(ErrorKeys.NO_GENERO_PDF);

					if(lba_pdfliquidacion == null)
						throw new B2BException(ErrorKeys.NO_GENERO_PDF_LIQUIDACION);
					else
						setPdfLiquidacion(lba_pdfliquidacion);

					{
						InputStream lis_stream;

						lis_stream = new ByteArrayInputStream(lba_pdf);

						setArchivoPdf(
						    new DefaultStreamedContent(
						        lis_stream, TipoContenidoCommon.PDF,
						        ConstanteCommon.NOMBRE_ARCHIVO_GENERADO + ExtensionCommon.PDF_PUNTO
						    )
						);
					}

					setProcesoTerminado(true);
					setDeshabilitarBotonInterviniente(true);

					{
						Ajax       la_ajax;
						PrimeFaces primeFaces;
						String     ls_nir;

						primeFaces     = PrimeFaces.current();
						la_ajax        = primeFaces.ajax();
						ls_nir         = lr_registro.getNirProceso();

						setNirGenerado(ls_nir);

						if(la_ajax != null)
						{
							clh_LOGGER.error("terminarProcesoConstancia", "se inicia actualizaciones ajax");
							la_ajax.update("fRegistro:opPanelTerminarProcesoConstanciaRep");
							la_ajax.update("fRegistro:opBotones");
							la_ajax.update(is_messageIdGrowl);

							setMensajeTerminarProceso("Ha finalizado su solicitud bajo el NIR: " + ls_nir);
							primeFaces.executeScript("PF('idDialogNir').show();");
							la_ajax.update("fDialog2:otMensaje");
							clh_LOGGER.error("terminarProcesoConstancia", "se finaliza actualizaciones ajax");
						}

						{
							clh_LOGGER.error("terminarProcesoConstancia", "se inicia actualizaciones wizard");

							Wizard lw_wizard;

							lw_wizard = (Wizard)FacesContext.getCurrentInstance().getViewRoot()
									                            .findComponent("fRegistro:myWizard");

							lw_wizard.setStep("liquidacion_id");
							PrimeFaces.current().ajax().update("fRegistro");
							clh_LOGGER.error("terminarProcesoConstancia", "se finaliza actualizaciones wizard");
						}
					}
				}
			}
			else
				throw new B2BException(ErrorKeys.SIN_PRELIQUIDACION);
		}
		catch(B2BException lb2be_e)
		{
			clh_LOGGER.error(lb2be_e);
			addMessage(lb2be_e);
			PrimeFaces.current().ajax().update(is_messageIdGrowl);
		}

		clh_LOGGER.error("terminarProcesoConstancia", "Sale del método");
		PrimeFaces.current().executeScript("PF('statusDialog').hide();PF('idDialogNir').show();");
	}

	/**
	 * Terminar proceso grabacion matriculas.
	 *
	 * @param event correspondiente al valor del tipo de objeto ActionEvent
	 * @throws Exception Señala que se ha producido una excepción
	 */
	public void terminarProcesoGrabacionMatriculas(ActionEvent event)
	    throws Exception
	{
		String    ls_idProceso;
		String    ls_idSubproceso;
		Solicitud ls_solicitud;

		ls_idProceso        = getIdProceso();
		ls_idSubproceso     = getIdSubproceso();
		ls_solicitud        = getSolicitud();

		if(ls_solicitud != null)
		{
			ls_idProceso = ls_solicitud.getIdProceso();

			ls_solicitud.setIdSubproceso(ls_idSubproceso);

			if(!StringUtils.isValidString(ls_idProceso))
				ls_idProceso = ProcesoCommon.ID_PROCESO_37;
		}

		try
		{
			salvarPredioRegistroGrabacionMatriculas();

			boolean  lb_validacionCorr;
			Registro lr_registro;

			lb_validacionCorr     = irr_registroRemote.validarNotificarCorrespondencia(
				    ls_solicitud, getUserId(), getLocalIpAddress(), getRemoteIpAddress()
				);
			lr_registro           = new Registro();

			if(!StringUtils.isValidString(ls_idSubproceso))
				ls_idSubproceso = ProcesoCommon.ID_SUBPROCESO_1;

			lr_registro.setSolicitud(ls_solicitud);

			// lr_registro.setIndCondicion(IdentificadoresCommon.LIQUIDAR);
			lr_registro = irr_registroRemote.terminarProcesoGrabacionMatriculas(
				    lr_registro, lb_validacionCorr, getUserId(), getLocalIpAddress(), getRemoteIpAddress()
				);

			if(lr_registro != null)
			{
				byte[] lba_pdf;
				String ls_error;

				lba_pdf      = lr_registro.getPdf();
				ls_error     = lr_registro.getObservacionesProceso();

				if(lba_pdf == null)
					throw new B2BException(ErrorKeys.NO_GENERO_PDF);

				{
					InputStream lis_stream;
					lis_stream = new ByteArrayInputStream(lba_pdf);

					setArchivoPdf(
					    new DefaultStreamedContent(
					        lis_stream, TipoContenidoCommon.PDF,
					        ConstanteCommon.NOMBRE_ARCHIVO_GENERADO + ExtensionCommon.PDF_PUNTO
					    )
					);
				}

				if(StringUtils.isValidString(ls_error))
					addMessage("I", ls_error);

				setOcultarSiguiente(false);
				setProcesoTerminado(true);

				{
					Ajax       la_ajax;
					PrimeFaces lp_primeFaces;

					lp_primeFaces     = PrimeFaces.current();
					la_ajax           = lp_primeFaces.ajax();

					if(la_ajax != null)
					{
						String ls_nir;

						ls_nir = lr_registro.getNirProceso();

						la_ajax.update("fRegistro:opPanelTerminarProceso");
						la_ajax.update("fRegistro:opBotones");
						la_ajax.update(is_messageIdGrowl);

						setMensajeTerminarProceso("Ha finalizado su solicitud bajo el NIR: " + ls_nir);
						lp_primeFaces.executeScript("PF('idDialogNir').show();");
						setNirGenerado(ls_nir);
						la_ajax.update("fDialog2:otMensaje");

						if(lb_validacionCorr)
						{
							String ls_mensaje;
							ls_mensaje = "Se ha modificado el medio a notificar y medio a comunicar del interesado del NIR: "
								+ ls_nir
								+ " por ser una entidad Origen que requiere ser notificado por DIRECCIÓN CORRESPONDENCIA.";

							addMessage("I", ls_mensaje);
							PrimeFaces.current().ajax().update(is_messageIdGrowl);
						}
					}
				}
			}
		}
		catch(B2BException lb2be_e)
		{
			clh_LOGGER.error(lb2be_e);
			addMessage(lb2be_e);
			PrimeFaces.current().ajax().update(is_messageIdGrowl);
		}
	}

	/**
	 * Terminar proceso recepcion.
	 *
	 * @param event correspondiente al valor del tipo de objeto ActionEvent
	 */
	public void terminarProcesoRecepcion(ActionEvent event)
	{
		try
		{
			boolean                              lb_booleanEntregado;
			Registro                             lr_registro;
			Collection<AccCompletitudDocumental> lacd_completitudDocumental;

			lacd_completitudDocumental     = getCompletitudDocumentalSuspension();
			lb_booleanEntregado            = false;

			if(isEsSuspensionEntregaDocumentacion() || isEsCreacionMatriculasOficio())
			{
				if(CollectionUtils.isValidCollection(lacd_completitudDocumental))
				{
					for(AccCompletitudDocumental lacd_tmp : lacd_completitudDocumental)
					{
						if(lacd_tmp != null)
						{
							boolean lb_obligatorio;
							String  ls_entregado;
							String  ls_idSolicitudVinculada;

							lb_obligatorio              = lacd_tmp.isSeleccionado();
							ls_entregado                = lacd_tmp.getEntregado();
							ls_idSolicitudVinculada     = lacd_tmp.getIdSolicitudVinculada();

							if(ls_entregado != null)
							{
								if(
								    ls_entregado.equalsIgnoreCase(EstadoCommon.S)
									    && !StringUtils.isValidString(ls_idSolicitudVinculada)
								)
									lb_booleanEntregado = true;
							}

							if(lb_obligatorio)
							{
								String ls_observacionesRecepcion;

								ls_observacionesRecepcion = lacd_tmp.getObservacionesRecepcion();

								lacd_tmp.setCampoRojoObservacionRecepcion(
								    !StringUtils.isValidString(ls_observacionesRecepcion)
								);

								if(!StringUtils.isValidString(ls_observacionesRecepcion))
								{
									String ls_idTipoDoc;
									ls_idTipoDoc = lacd_tmp.getIdTipoDocumental();

									com.bachue.snr.prosnr01.model.sdb.pgn.TipoDocumental ltd_tmp;
									ltd_tmp = new com.bachue.snr.prosnr01.model.sdb.pgn.TipoDocumental();
									ltd_tmp.setIdTipoDocumental(ls_idTipoDoc);

									ltd_tmp = irr_referenceRemote.findByIdTipoDocumental(
										    ltd_tmp, getUserId(), getLocalIpAddress(), getRemoteIpAddress()
										);

									if(ltd_tmp != null)
									{
										Object[] loa_messageArgs;

										loa_messageArgs        = new String[1];
										loa_messageArgs[0]     = ltd_tmp.getNombre();

										throw new B2BException(
										    ErrorKeys.ERROR_OBSERVACIONES_DOCUMENTO_SELECCIONADO_OBLIGATORIAS,
										    loa_messageArgs
										);
									}
								}
							}
						}
					}

					if(!lb_booleanEntregado)
						throw new B2BException(ErrorKeys.DEBE_SELECCIONAR_POR_LO_MENOS_UN_DOC_EN_ENTREGA);
				}
				else
					throw new B2BException(ErrorKeys.DEBE_AGREGAR_UN_TIPO_DOCUMENTAL);
			}
			else if(isEsImpuestoDeRegistro())
			{
				Collection<Turno> lct_turnosImpuesto;

				lct_turnosImpuesto = getInfoTurnosImpuestosGobernacion();

				if(CollectionUtils.isValidCollection(lct_turnosImpuesto))
				{
					for(Turno lt_tmp : lct_turnosImpuesto)
					{
						if(lt_tmp != null)
						{
							Collection<TipoDocumental> lctd_tiposDoc;

							lctd_tiposDoc = lt_tmp.getActosui();

							if(CollectionUtils.isValidCollection(lctd_tiposDoc))
							{
								for(TipoDocumental ltd_tipoDoc : lctd_tiposDoc)
								{
									if(ltd_tipoDoc != null)
									{
										String  ls_medioRecepcion;
										boolean lb_seleccionado;
										String  ls_idTipoDoc;
										Date    ld_fechaPago;
										Date    ld_fechaPagoExtemporaneo;

										lb_seleccionado              = ltd_tipoDoc.isSeleccionado();
										ls_medioRecepcion            = ltd_tipoDoc.getMedioRecepcion();
										ls_idTipoDoc                 = ltd_tipoDoc.getIdTipoDocumental();
										ld_fechaPago                 = ltd_tipoDoc.getFechaPagoImpuesto();
										ld_fechaPagoExtemporaneo     = ltd_tipoDoc.getFechaPagoImpuestoExtemporaneo();

										if(lb_seleccionado && !StringUtils.isValidString(ls_medioRecepcion))
											throw new B2BException(
											    ErrorKeys.DEBE_VALIDAR_SECCION_DETALLE_EN_BOTON_ROJO
											);

										if(
										    StringUtils.isValidString(ls_idTipoDoc)
											    && ls_idTipoDoc.equalsIgnoreCase(TipoDocumentalCommon.BOLETA_FISCAL)
										)
										{
											Solicitud ls_tmp;
											Documento ld_documento;

											ls_tmp           = new Solicitud();
											ld_documento     = irr_registroRemote.findDocumento(
												    getIdSolicitudGobernaciones()
												);
											ls_tmp.setIdSolicitud(getIdSolicitudGobernaciones());
											ls_tmp = irr_registroRemote.recibosImpuesto(
												    ls_tmp, getUserId(), getLocalIpAddress(), getRemoteIpAddress()
												);

											if((ls_tmp != null) && (ld_documento != null))
											{
												Date ld_fechaDoc;

												ld_fechaDoc = ld_documento.getFechaDocumento();

												try
												{
													validarFechaPagoImpuesto(ld_fechaPago, ld_fechaDoc);

													if(ls_tmp.isReciboImpuestos())
														validarFechaPagoImpuestoExtemporaneo(
														    ld_fechaPagoExtemporaneo, ld_fechaDoc
														);
												}
												catch(B2BException lb2be_e)
												{
													throw new B2BException(
													    ErrorKeys.DEBE_VALIDAR_SECCION_DETALLE_EN_BOTON_ROJO
													);
												}
											}
										}
									}
								}
							}
							else
								throw new B2BException(ErrorKeys.DEBE_VALIDAR_SECCION_DETALLE_EN_BOTON_ROJO);
						}
					}
				}
			}
			else if(!CollectionUtils.isValidCollection(getTiposCompletitudDocumental()))
				throw new B2BException(ErrorKeys.DEBE_AGREGAR_UN_TIPO_DOCUMENTAL);

			{
				Solicitud lso_solicitud;

				lso_solicitud = getSolicitud();

				lso_solicitud.setTiposDocumentalesRestitucion(getTiposDocumentalesRestitucion());
				lso_solicitud.setCompletitudDocumental(lacd_completitudDocumental);

				if(isEsImpuestoDeRegistro())
				{
					lso_solicitud.setNir(getNirImpuestoRegistro());
					lso_solicitud.setInfoTurnosImpuestosGobernacion(getInfoTurnosImpuestosGobernacion());
				}

				lr_registro = irr_registroRemote.terminarProcesoRecepcion(
					    getTiposCompletitudDocumental(), lso_solicitud, getLocalIpAddress(), getRemoteIpAddress(),
					    getUserId()
					);
			}

			if(lr_registro != null)
			{
				Ajax       la_ajax;
				PrimeFaces lp_primeFaces;
				String     ls_nir;

				ls_nir = lr_registro.getNirProceso();

				if(StringUtils.isValidString(ls_nir))
				{
					byte[] lba_pdf;

					lba_pdf = lr_registro.getPdf();

					if(lba_pdf == null)
						throw new B2BException(ErrorKeys.NO_GENERO_PDF);

					{
						InputStream lis_stream;

						lis_stream = new ByteArrayInputStream(lba_pdf);

						setArchivoPdf(
						    new DefaultStreamedContent(
						        lis_stream, TipoContenidoCommon.PDF,
						        ConstanteCommon.NOMBRE_ARCHIVO_GENERADO + ExtensionCommon.PDF_PUNTO
						    )
						);
					}

					if(isEsProrrogaMayorValor())
					{
						byte[] lba_pdfProrrogaMayorValor;

						lba_pdfProrrogaMayorValor = lr_registro.getPdfProrrogaMayorValor();

						if(lba_pdfProrrogaMayorValor == null)
							throw new B2BException(ErrorKeys.NO_GENERO_PDF);

						{
							InputStream lis_stream;

							lis_stream = new ByteArrayInputStream(lba_pdfProrrogaMayorValor);

							setArchivoPdfProrrogaMayorValor(
							    new DefaultStreamedContent(
							        lis_stream, TipoContenidoCommon.PDF,
							        ConstanteCommon.NOMBRE_ARCHIVO_GENERADO + ExtensionCommon.PDF_PUNTO
							    )
							);
						}
					}

					lp_primeFaces     = PrimeFaces.current();
					la_ajax           = lp_primeFaces.ajax();

					if(la_ajax != null)
					{
						la_ajax.update("fRegistro:opPanelTerminarProcesoRecepcion");
						la_ajax.update(is_messageIdGrowl);

						setMensajeTerminarProceso("Ha finalizado su solicitud bajo el NIR: " + ls_nir);
						lp_primeFaces.executeScript("PF('idDialogNir').show();");
						la_ajax.update("fDialog2:otMensaje");

						setProcesoTerminado(true);
						setNirGenerado(ls_nir);

						if(
						    isEsImpuestoDeRegistro() || isEsRecepcionRecursos() || isEsSuspensionEntregaDocumentacion()
							    || isEsProrrogaEntregaDocumentacion() || isEsSegundaInstancia()
							    || isEsCreacionMatriculasOficio()
						)
						{
							String ls_urlCapture;

							ls_urlCapture = lr_registro.getUrlCapture();

							if(StringUtils.isValidString(ls_urlCapture))
								PrimeFaces.current().executeScript("window.open(href ='" + ls_urlCapture + "')");
						}
					}
				}
			}
		}
		catch(B2BException lb2be_e)
		{
			clh_LOGGER.error(lb2be_e);
			addMessage(lb2be_e);

			PrimeFaces.current().ajax().update(is_messageIdGrowl);
		}
	}

	/**
	 * Tipo documento validar.
	 *
	 * @param addp_datosPredio correspondiente al valor del tipo de objeto DatosDelPredio
	 */
	public void tipoDocumentoValidar(DatosDelPredio addp_datosPredio)
	{
		try
		{
			boolean lb_esRecepcionRecursos;

			lb_esRecepcionRecursos = isEsRecepcionRecursos();

			validarExistenciaDocumento(addp_datosPredio, true);
			validarExistenciaDocumentoEjecutoria();
			findTipoOficina(addp_datosPredio);
			validarActoEjecutoria(addp_datosPredio);

			if(
			    isEsGrabacionMatriculas() || isEsProrrogaEntregaDocumentacion() || isEsProrrogaMayorValor()
				    || isEsProcesoDesistimiento() || isEsSuspensionArticulo() || lb_esRecepcionRecursos
				    || isEsSegundaInstancia() || isEsCreacionMatriculasOficio()
			)
			{
				Documento ld_documento;
				boolean   lb_solicitudOrip;

				lb_solicitudOrip     = false;
				ld_documento         = getBgnDocumento();

				if(isEsCreacionMatriculasOficio())
				{
					Solicitud ls_solicitud;
					ls_solicitud = getSolicitud();

					if(ls_solicitud != null)
					{
						String ls_usuarioOrip;
						ls_usuarioOrip = StringUtils.getStringNotNull(ls_solicitud.getUsuarioOrip());

						if(ls_usuarioOrip.equalsIgnoreCase(IdentificadoresCommon.S))
							lb_solicitudOrip = true;
					}
				}

				if(ld_documento != null)
				{
					String ls_idTipoDocumento;
					ls_idTipoDocumento = ld_documento.getIdTipoDocumento();

					if(StringUtils.isValidString(ls_idTipoDocumento))
					{
						if(
						    ls_idTipoDocumento.equalsIgnoreCase(TipoDocumentoPublicoCommon.CARTA)
							    || ls_idTipoDocumento.equalsIgnoreCase(TipoDocumentoPublicoCommon.OFICIO)
						)
						{
							if(
							    isEsGrabacionMatriculas() || isEsProrrogaMayorValor() || isEsProcesoDesistimiento()
								    || lb_esRecepcionRecursos || isEsSegundaInstancia() || isEsSuspensionArticulo()
							)
								if(
								    !(isEsSuspensionArticulo()
									    && ls_idTipoDocumento.equalsIgnoreCase(TipoDocumentoPublicoCommon.OFICIO))
								)
									ld_documento.setNumero("SN");

							if(
							    isEsProrrogaEntregaDocumentacion() || isEsProrrogaMayorValor()
								    || isEsProcesoDesistimiento() || isEsSuspensionArticulo() || lb_esRecepcionRecursos
								    || isEsSegundaInstancia()
							)
								setIdTipoOficina(TipoOficinaCommon.PARTICULAR);

							if(
							    isEsProrrogaMayorValor() || isEsProcesoDesistimiento() || lb_esRecepcionRecursos
								    || isEsSegundaInstancia()
							)
								ld_documento.setFechaDocumento(new Date());
						}
					}
					else
					{
						if(lb_solicitudOrip)
						{
							ld_documento.setIdTipoDocumento(TipoDocumentoPublicoCommon.OFICIO);
							setIdTipoOficina(TipoOficinaCommon.OFICINA_REGISTRO);
							ld_documento.setNumero("SN");
							ld_documento.setFechaDocumento(new Date());
						}
					}
				}
			}

			if(isEsProrrogaEntregaDocumentacion())
			{
				setMensajeProrrogaDocumento(false);

				Documento ld_documento;
				ld_documento = getBgnDocumento();

				if(ld_documento != null)
				{
					String ls_idTipoDocumento;
					ls_idTipoDocumento = ld_documento.getIdTipoDocumento();

					if(StringUtils.isValidString(ls_idTipoDocumento))
					{
						if(
						    ls_idTipoDocumento.equalsIgnoreCase(TipoDocumentoPublicoCommon.CARTA)
							    || ls_idTipoDocumento.equalsIgnoreCase(TipoDocumentoPublicoCommon.OFICIO)
						)
							setMensajeProrrogaDocumento(true);
					}
				}
			}

			tipoOficina(null);
		}
		catch(B2BException lb2be_e)
		{
			clh_LOGGER.error(lb2be_e);
			addMessage(lb2be_e);
			PrimeFaces.current().ajax().update(is_messageIdGrowl);
		}
	}

