	/**
	 * Valida si un acto es de ejecutoria.
	 *
	 * @param addp_datosPredio Objeto contenedor de la información del acto
	 */
	public void validarActoEjecutoria(DatosDelPredio addp_datosPredio)
	{
		String    ls_idTipoDoc;
		boolean   lb_isActoEjecutoria;
		boolean   lb_antSis;
		Documento ld_docAntSis;

		lb_isActoEjecutoria     = false;
		lb_antSis               = false;
		ld_docAntSis            = null;

		if(addp_datosPredio != null)
		{
			ld_docAntSis = addp_datosPredio.getBgnDocumento();

			if(ld_docAntSis != null)
				lb_antSis = true;
		}

		ls_idTipoDoc = lb_antSis ? ld_docAntSis.getIdTipoDocumento() : getBgnDocumento().getIdTipoDocumento();

		try
		{
			if(StringUtils.isValidString(ls_idTipoDoc))
				lb_isActoEjecutoria = irr_registroRemote.validarActoEjecutoria(ls_idTipoDoc);

			if(lb_antSis)
				addp_datosPredio.setEsActoConEjecutoria(lb_isActoEjecutoria);
			else
			{
				if(!lb_isActoEjecutoria)
				{
					Documento ld_documento;
					ld_documento = getBgnDocumento();

					if(ld_documento != null)
						ld_documento.setFechaEjecutoria(null);
				}

				setEsActoConEjecutoria(lb_isActoEjecutoria);
				setEsActoConEjecutoriaDocumento(lb_isActoEjecutoria);
				PrimeFaces.current().ajax().update("fRegistro:idCalFechaEjecutoria");
			}
		}
		catch(B2BException lb2be_e)
		{
			clh_LOGGER.error(lb2be_e);
			addMessage(lb2be_e);
		}
	}

	/**
	 * Validar area.
	 *
	 * @param apaiu_acto correspondiente al valor del tipo de objeto PredioActoIU
	 * @return verdadero, si se cumple la condicion, de lo contario retorna falso
	 * @throws B2BException Señala que se ha producido una excepción
	 */
	public boolean validarArea(PredioActoIU apaiu_acto)
	    throws B2BException
	{
		boolean lb_return;

		lb_return = false;

		try
		{
			if(apaiu_acto != null)
			{
				boolean                        lb_validarArea;
				LinkedHashMap<String, Boolean> llhm_map;
				String                         ls_matriculaCompleta;

				lb_validarArea           = apaiu_acto.isValidarArea();
				llhm_map                 = getMatriculasValidarArea();
				ls_matriculaCompleta     = apaiu_acto.getMatricula();

				if(lb_validarArea)
				{
					if(StringUtils.isValidString(ls_matriculaCompleta))
					{
						AccAreaPredio laap_accAreaPredio;
						AreaPredio    lap_areaPredio;
						Boolean       lB_areaValida;
						Long          ll_idMatricula;
						String[]      lsa_matricula;
						String        ls_idCirculo;

						laap_accAreaPredio     = new AccAreaPredio();
						lap_areaPredio         = new AreaPredio();
						lsa_matricula          = ls_matriculaCompleta.split("-");
						ls_idCirculo           = lsa_matricula[0];
						ll_idMatricula         = NumericUtils.getLongWrapper(lsa_matricula[1]);

						if(StringUtils.isValidString(ls_idCirculo))
						{
							laap_accAreaPredio.setIdCirculo(ls_idCirculo);
							lap_areaPredio.setIdCirculo(ls_idCirculo);
						}

						if(NumericUtils.isValidLong(ll_idMatricula))
						{
							laap_accAreaPredio.setIdMatricula(ll_idMatricula);
							lap_areaPredio.setIdMatricula(NumericUtils.getLong(ll_idMatricula));
						}

						lap_areaPredio = irr_registroRemote.findAreaPredio(lap_areaPredio);

						if(lap_areaPredio == null)
						{
							laap_accAreaPredio = irr_registroRemote.findAccAreaPredio(laap_accAreaPredio);

							if(laap_accAreaPredio != null)
								lb_return = true;
						}
						else
							lb_return = true;

						lB_areaValida = new Boolean(lb_return);

						if(llhm_map.containsKey(ls_matriculaCompleta))
							llhm_map.replace(ls_matriculaCompleta, lB_areaValida);
						else
							llhm_map.put(ls_matriculaCompleta, lB_areaValida);

						if(lap_areaPredio == null)
						{
							if(laap_accAreaPredio == null)
							{
								Object[] loa_messageArgs = new String[1];
								loa_messageArgs[0] = ls_matriculaCompleta;
								throw new B2BException(ErrorKeys.ERROR_DESCRIPCION_AREA, loa_messageArgs);
							}
						}
					}
				}
				else
				{
					if(llhm_map.containsKey(ls_matriculaCompleta))
						llhm_map.remove(ls_matriculaCompleta);
				}
			}
		}
		catch(B2BException lb2be_e)
		{
			clh_LOGGER.error(lb2be_e);
			throw lb2be_e;
		}
		finally
		{
			comprobarAreas();
			PrimeFaces.current().ajax().update(is_messageIdGrowl);
		}

		return lb_return;
	}

