	/**
	 * Metodo encargado de validar los campos de la pantalla para pintar mensajes de error
	 * y campos en color rojo.
	 * @param as_form Argumento de tipo String que contiene el id del formulario de
	 * donde proviene la petición.
	 */
	public void validarCamposActo(String as_form)
	{
		String                                      ls_datoParaValidar;
		FacesContext                                lfc_context;
		BigDecimal                                  lbd_datoParaValidar;
		com.bachue.snr.prosnr01.model.registro.Acto la_acto;
		boolean                                     lb_focus;

		la_acto                = getActo();
		ls_datoParaValidar     = "";
		lb_focus               = true;

		if(la_acto == null)
			la_acto = new com.bachue.snr.prosnr01.model.registro.Acto();

		lfc_context     = FacesContext.getCurrentInstance();

		ls_datoParaValidar     = la_acto.getIdCirculo();
		lb_focus               = validateStyles(
			    as_form + ":circuloRegistralDatosActo", lfc_context, ls_datoParaValidar, lb_focus
			);

		{
			String ls_codigo;

			ls_codigo = la_acto.getCodigo();

			if(!StringUtils.isValidString(ls_codigo) || ls_codigo.equals("-1"))
				ls_codigo = new String();

			lb_focus = validateStyles(as_form + ":idSOMCodigoActo", lfc_context, ls_codigo, lb_focus);
		}

		ls_datoParaValidar     = la_acto.getEspecificacion();
		lb_focus               = validateStyles(
			    as_form + ":idSOMespecificacion", lfc_context, ls_datoParaValidar, lb_focus
			);

		if(
		    StringUtils.getStringNotNull(la_acto.getActoConCuantia()).equalsIgnoreCase(EstadoCommon.N)
			    || StringUtils.getStringNotNull(la_acto.getActoConCuantia())
			                      .equalsIgnoreCase(IdentificadoresCommon.CON_CUANTIA)
		)
		{
			if(!isEsCambioTipoCuantia())
			{
				lbd_datoParaValidar     = la_acto.getCuantiaActo();
				lb_focus                = validateStyles(
					    as_form + ":idItCuantiaActo", lfc_context, lbd_datoParaValidar, lb_focus
					);
			}
			else if(!isNoRequiereCuantiaActo())
			{
				lbd_datoParaValidar     = la_acto.getCuantiaActo();
				lb_focus                = validateStyles(
					    as_form + ":idItCuantiaActo", lfc_context, lbd_datoParaValidar, lb_focus
					);
			}
		}

		if(StringUtils.getStringNotNull(la_acto.getAvaluo()).equalsIgnoreCase(EstadoCommon.S))
		{
			if(!isEsCambioTipoCuantia())
			{
				lbd_datoParaValidar     = la_acto.getValorAvaluo();
				lb_focus                = validateStyles(
					    as_form + ":idItValorAvaluo", lfc_context, lbd_datoParaValidar, lb_focus
					);
			}
			else if(!isNoRequiereCuantiaActo())
			{
				lbd_datoParaValidar     = la_acto.getValorAvaluo();
				lb_focus                = validateStyles(
					    as_form + ":idItValorAvaluo", lfc_context, lbd_datoParaValidar, lb_focus
					);
			}
		}

		if(!isMostrarCantidadActos())
		{
			if(NumericUtils.isValidInteger(la_acto.getCantidadActos()))
				ls_datoParaValidar = la_acto.getCantidadActos().toString();
			else
				ls_datoParaValidar = new String();

			lb_focus = validateStyles(as_form + ":idItCantidadActos", lfc_context, ls_datoParaValidar, lb_focus);
		}

		if(la_acto.getRequiereTipoAdquisicion().equalsIgnoreCase(EstadoCommon.S))
		{
			ls_datoParaValidar     = la_acto.getTipoAdquisicion();
			lb_focus               = validateStyles(
				    as_form + ":idSOMTipoAdquisicion", lfc_context, ls_datoParaValidar, lb_focus
				);
		}

		if(la_acto.isValidCantidadMatriculas())
		{
			if(NumericUtils.isValidInteger(la_acto.getCantidadMatriculas()))
				ls_datoParaValidar = la_acto.getCantidadMatriculas().toString();
			else
				ls_datoParaValidar = new String();

			lb_focus = validateStyles(as_form + ":idItCantidadMatriculas", lfc_context, ls_datoParaValidar, lb_focus);
		}

		if(la_acto.isValidMatriculasIncrl())
		{
			if(NumericUtils.isValidInteger(la_acto.getCantidadMatriculasInclr()))
				ls_datoParaValidar = la_acto.getCantidadMatriculasInclr().toString();
			else
				ls_datoParaValidar = new String();

			lb_focus = validateStyles(
				    as_form + ":idItCantidadMatriculasInclr", lfc_context, ls_datoParaValidar, lb_focus
				);
		}
	}

