	/**
	 * Metodo encargado de validar intervinientes.
	 *
	 * @param as_idForm Argumento de tipo <code>String</code> que contiene el id del
	 * formulario desde donde se realiza la petición.
	 * @param ab_validarMedios Argumento de tipo <code>boolean</code> que determina si se debe validar medios a comunicar y notificar.
	 * @throws B2BException Señala que se ha producido una excepción
	 */
	public void validarCamposInterviniente(String as_idForm, boolean ab_validarMedios)
	    throws B2BException
	{
		BeanDireccion lbd_beanDireccion;
		boolean       lb_focus;
		FacesContext  lfc_context;

		lbd_beanDireccion     = getBeanDireccion();
		lfc_context           = FacesContext.getCurrentInstance();
		lb_focus              = true;

		if(!isDeshabilitarDatosBasicosInter())
		{
			Persona lp_persona;
			lp_persona = getPersonaInter();

			if(!isDeshabilitarCamposPorNitInter())
			{
				is_datoParaValidar     = lp_persona.getPrimerNombre();
				lb_focus               = validateStyles(
					    IdentificadoresCommon.DOS_PUNTOS + as_idForm + ":idOlPNombreInter", lfc_context,
					    is_datoParaValidar, lb_focus
					);

				is_datoParaValidar     = lp_persona.getPrimerApellido();
				lb_focus               = validateStyles(
					    IdentificadoresCommon.DOS_PUNTOS + as_idForm + ":idOlPApellidoInter", lfc_context,
					    is_datoParaValidar, lb_focus
					);

				is_datoParaValidar     = lp_persona.getIdNaturalGenero();
				lb_focus               = validateStyles(
					    IdentificadoresCommon.DOS_PUNTOS + as_idForm + ":idSOMGeneroInter", lfc_context,
					    is_datoParaValidar, lb_focus
					);
			}
			else
			{
				is_datoParaValidar     = lp_persona.getRazonSocial();
				lb_focus               = validateStyles(
					    IdentificadoresCommon.DOS_PUNTOS + as_idForm + ":idOlRazonSocialInter", lfc_context,
					    is_datoParaValidar, lb_focus
					);
			}

			is_datoParaValidar     = lp_persona.getIdTipoPersona();
			lb_focus               = validateStyles(
				    IdentificadoresCommon.DOS_PUNTOS + as_idForm + ":idSOMTipoPersonaInter", lfc_context,
				    is_datoParaValidar, lb_focus
				);

			is_datoParaValidar     = lp_persona.getIdDocumentoTipo();
			lb_focus               = validateStyles(
				    IdentificadoresCommon.DOS_PUNTOS + as_idForm + ":idSOMTipoDocInter", lfc_context, is_datoParaValidar,
				    lb_focus
				);

			is_datoParaValidar     = lp_persona.getNumeroDocumento();
			lb_focus               = validateStyles(
				    IdentificadoresCommon.DOS_PUNTOS + as_idForm + ":idOlDocumentoInter", lfc_context,
				    is_datoParaValidar, lb_focus
				);

			is_datoParaValidar     = lp_persona.getIdPais();
			lb_focus               = validateStyles(
				    IdentificadoresCommon.DOS_PUNTOS + as_idForm + ":idSOMNacionalidadInter", lfc_context,
				    is_datoParaValidar, lb_focus
				);
		}

		SolicitudInterviniente ls_solicitud;
		ls_solicitud     = getSolicitudInter();

		is_datoParaValidar     = ls_solicitud.getRolPersona();
		lb_focus               = validateStyles(
			    IdentificadoresCommon.DOS_PUNTOS + as_idForm + ":idOlRolInter", lfc_context, is_datoParaValidar,
			    lb_focus
			);

		if(ab_validarMedios)
		{
			is_datoParaValidar     = ls_solicitud.getIdAutorizacionNotificacion();
			lb_focus               = validateStyles(
				    IdentificadoresCommon.DOS_PUNTOS + as_idForm + ":idsomMedioANotificarInter", lfc_context,
				    is_datoParaValidar, lb_focus
				);

			is_datoParaValidar     = ls_solicitud.getIdAutorizacionComunicacion();
			lb_focus               = validateStyles(
				    IdentificadoresCommon.DOS_PUNTOS + as_idForm + ":idsomMedioAComInter", lfc_context,
				    is_datoParaValidar, lb_focus
				);
		}

		{
			String ls_medioAComunicar;
			String ls_medioANotificar;

			ls_medioANotificar     = ls_solicitud.getIdAutorizacionNotificacion();
			ls_medioAComunicar     = ls_solicitud.getIdAutorizacionComunicacion();

			if(StringUtils.isValidString(ls_medioANotificar) && StringUtils.isValidString(ls_medioAComunicar))
			{
				// Validacion de campos en direccion de residencia
				if(
				    (ls_medioANotificar.equalsIgnoreCase(MedioNotificarCommon.DIRECCION_RESIDENCIA)
					    || ((ls_medioAComunicar.equalsIgnoreCase(MedioNotificarCommon.DIRECCION_RESIDENCIA))
					    && !isDeshabilitarResidenciaInter()))
				)
					lbd_beanDireccion.validarCamposDireccionResidenciaInter();

				// Validacion campos direccion de correspondencia
				if(
				    (ls_medioANotificar.equalsIgnoreCase(MedioNotificarCommon.DIRECCION_CORRESPONDENCIA)
					    || ls_medioAComunicar.equalsIgnoreCase(MedioNotificarCommon.DIRECCION_CORRESPONDENCIA))
					    && !isDeshabilitarCorrespondenciaInter()
				)
					lbd_beanDireccion.validarCamposDireccionCorrespondenciaInter(true);
			}
		}

		// Validacion de datos de contacto
		if(!isDeshabilitarTelFijoInter())
		{
			PersonaTelefono lpt_telefonoFijoInter;
			String          ls_paisTelFijo;
			String          ls_numeroTelefono;

			lpt_telefonoFijoInter     = getTelefonoFijoInter();
			ls_paisTelFijo            = "";
			ls_numeroTelefono         = "";

			if(lpt_telefonoFijoInter != null)
			{
				ls_paisTelFijo     = StringUtils.getStringNotNull(lpt_telefonoFijoInter.getIdPais());
				lb_focus           = validateStyles(
					    IdentificadoresCommon.DOS_PUNTOS + as_idForm + ":idSOMPaisTelInter", lfc_context, ls_paisTelFijo,
					    lb_focus
					);

				is_datoParaValidar     = lpt_telefonoFijoInter.getIdDepartamento();
				lb_focus               = validateStyles(
					    IdentificadoresCommon.DOS_PUNTOS + as_idForm + ":idSOMDepTelInter", lfc_context,
					    is_datoParaValidar, lb_focus
					);

				ls_numeroTelefono = StringUtils.getStringNotNull(lpt_telefonoFijoInter.getTelefono());

				if(!StringUtils.isValidString(ls_numeroTelefono))
					lb_focus = validateStyles(
						    IdentificadoresCommon.DOS_PUNTOS + as_idForm + ":idItTelefonoFijoInter", lfc_context,
						    ls_numeroTelefono, lb_focus
						);
				else
				{
					String     ls_idConstante;
					Constantes lc_digitosFijo;

					ls_idConstante     = ConstanteCommon.DIGITOS_TEL_FIJO_COL;
					lc_digitosFijo     = irr_referenceRemote.findConstantesById(ls_idConstante);

					if(lc_digitosFijo == null)
					{
						Object[] loa_messageArgs;

						loa_messageArgs        = new String[1];
						loa_messageArgs[0]     = ls_idConstante;

						throw new B2BException(ErrorKeys.ERROR_SIN_CONSTANTE, loa_messageArgs);
					}

					BigInteger lbi_temp;
					int        li_digitos;

					lbi_temp       = lc_digitosFijo.getEntero();
					li_digitos     = 0;

					if(NumericUtils.isValidBigInteger(lbi_temp))
						li_digitos = lbi_temp.intValue();

					if(
					    ls_paisTelFijo.equals(IdentificadoresCommon.INDICATIVO_PAIS_DEFAULT)
						    && (ls_numeroTelefono.length() != li_digitos)
					)
						lb_focus = validateStyles(
							    IdentificadoresCommon.DOS_PUNTOS + as_idForm + ":idItTelefonoFijoInter", lfc_context, "",
							    lb_focus
							);
					else
						lb_focus = validateStyles(
							    IdentificadoresCommon.DOS_PUNTOS + as_idForm + ":idItTelefonoFijoInter", lfc_context,
							    ls_numeroTelefono, lb_focus
							);
				}
			}
		}

		if(!isDeshabilitarTelMovilInter())
		{
			PersonaTelefono lpt_telefonoMovil;
			String          ls_telefono;
			String          ls_paisMovil;

			lpt_telefonoMovil     = getTelefonoMovilInter();
			ls_telefono           = "";
			ls_paisMovil          = "";

			if(lpt_telefonoMovil != null)
			{
				ls_paisMovil     = StringUtils.getStringNotNull(lpt_telefonoMovil.getIdPais());
				lb_focus         = validateStyles(
					    IdentificadoresCommon.DOS_PUNTOS + as_idForm + ":idSOMPaisTelMovInter", lfc_context,
					    ls_paisMovil, lb_focus
					);

				ls_telefono = StringUtils.getStringNotNull(lpt_telefonoMovil.getTelefono());

				if(!StringUtils.isValidString(ls_telefono))
					lb_focus = validateStyles(
						    IdentificadoresCommon.DOS_PUNTOS + as_idForm + ":idItTelefonoMovilInter", lfc_context,
						    ls_telefono, lb_focus
						);
				else
				{
					String     ls_idConstante;
					Constantes lc_digitosFijo;

					ls_idConstante     = ConstanteCommon.DIGITOS_TEL_MOVIL_COL;
					lc_digitosFijo     = irr_referenceRemote.findConstantesById(ls_idConstante);

					if(lc_digitosFijo == null)
					{
						Object[] loa_messageArgs;

						loa_messageArgs        = new String[1];
						loa_messageArgs[0]     = ls_idConstante;

						throw new B2BException(ErrorKeys.ERROR_SIN_CONSTANTE, loa_messageArgs);
					}

					BigInteger lbi_temp;
					int        li_digitos;

					lbi_temp       = lc_digitosFijo.getEntero();
					li_digitos     = 0;

					if(NumericUtils.isValidBigInteger(lbi_temp))
						li_digitos = lbi_temp.intValue();

					if(
					    ls_paisMovil.equals(IdentificadoresCommon.INDICATIVO_PAIS_DEFAULT)
						    && (ls_telefono.length() != li_digitos)
					)
						lb_focus = validateStyles(
							    IdentificadoresCommon.DOS_PUNTOS + as_idForm + ":idItTelefonoMovilInter", lfc_context,
							    "", lb_focus
							);
					else
						lb_focus = validateStyles(
							    IdentificadoresCommon.DOS_PUNTOS + as_idForm + ":idItTelefonoMovilInter", lfc_context,
							    ls_telefono, lb_focus
							);
				}
			}
		}

		if(!isDeshabilitarCorreoInter())
		{
			is_datoParaValidar     = getCorreoElectronicoInter().getCorreoElectronico();
			lb_focus               = validateStyles(
				    IdentificadoresCommon.DOS_PUNTOS + as_idForm + ":idItEmailInter", lfc_context, is_datoParaValidar,
				    lb_focus
				);
		}
	}

