	/**
	 * Método encargado de validar el circulo origen y destino para el traslado.
	 *
	 * @param apaiu_data Contiene la información de la matrícula a trasladar.
	 * @throws B2BException Objeto de tipo B2BException, se produce cuando se encuentra algun error controlado.
	 */
	public void validarCirculoDestinoTraslado(PredioActoIU apaiu_data)
	    throws B2BException
	{
		try
		{
			if(apaiu_data != null)
			{
				Map<String, String> lmss_circulosDestino;
				String              as_idCirculoOrigen;
				String              as_idCirculoDestino;

				as_idCirculoOrigen      = apaiu_data.getIdCirculo();
				as_idCirculoDestino     = apaiu_data.getIdCirculoDestino();

				if(!StringUtils.isValidString(as_idCirculoOrigen))
					throw new B2BException(ErrorKeys.ERROR_CIRCULO_ORIGEN);

				if(!StringUtils.isValidString(as_idCirculoDestino))
					throw new B2BException(ErrorKeys.ERROR_CIRCULO_DESTINO);

				if(as_idCirculoOrigen.equalsIgnoreCase(as_idCirculoDestino))
				{
					apaiu_data.setIdCirculoDestino(null);
					throw new B2BException(ErrorKeys.ERROR_CIRCULOS_IGUALES_2);
				}

				lmss_circulosDestino = ipr_parameterRemote.getCirculosDestinoPorOrigen(as_idCirculoOrigen);

				if(
				    CollectionUtils.isValidCollection(lmss_circulosDestino)
					    && !lmss_circulosDestino.containsKey(as_idCirculoDestino)
				)
				{
					Object[] loa_arg;

					loa_arg        = new String[1];
					loa_arg[0]     = as_idCirculoOrigen;

					apaiu_data.setIdCirculoDestino(null);
					throw new B2BException(ErrorKeys.ERROR_CIRCULO_DESTINO_ORIGEN, loa_arg);
				}
			}
		}
		catch(B2BException lb2be_e)
		{
			clh_LOGGER.error(lb2be_e);
			addMessage(lb2be_e);
			PrimeFaces.current().ajax().update(is_messageIdGrowl);
		}
	}

