	/**
	 * Validar fecha mayor 60 dias.
	 */
	public void validarFechaMayor60Dias()
	{
		boolean lb_ingreso = true;

		try
		{
			validarFechaMayor60Dias(lb_ingreso);
		}
		catch(B2BException lb2be_e)
		{
			clh_LOGGER.error(lb2be_e);
			addMessage(lb2be_e);
		}
	}

	/**
	 * Validar fecha mayor 60 dias.
	 *
	 * @param ab_ingreso correspondiente al valor del tipo de objeto boolean
	 * @throws B2BException Señala que se ha producido una excepción
	 */
	public void validarFechaMayor60Dias(boolean ab_ingreso)
	    throws B2BException
	{
		boolean lb_habilitaFechaAudiencia;
		lb_habilitaFechaAudiencia = isHabilitarFechaAudiencia();

		try
		{
			Documento ld_documento;

			ld_documento = getBgnDocumento();

			if(ld_documento != null)
			{
				com.bachue.snr.prosnr01.model.registro.Acto la_acto;

				Date                                        ld_fechaEjecutoriaDatoDocumento;
				Date                                        ld_fechaEjecutoriaDatoActo;
				Date                                        ld_fechaEjecutoria;
				Date                                        ld_fechaDocumentoEnDatosDocumento;
				Date                                        ld_fechaActual;

				la_acto     = getActo();

				ld_fechaEjecutoriaDatoDocumento       = ld_documento.getFechaEjecutoria();
				ld_fechaEjecutoriaDatoActo            = getFechaEjecutoria();
				ld_fechaEjecutoria                    = lb_habilitaFechaAudiencia ? ld_fechaEjecutoriaDatoActo
					                                                              : ld_fechaEjecutoriaDatoDocumento;
				ld_fechaDocumentoEnDatosDocumento     = ld_documento.getFechaDocumento();
				ld_fechaActual                        = new Date();

				if((ld_fechaEjecutoriaDatoActo == null) && !ab_ingreso)
				{
					Object[] loa_messageArgs = new String[1];
					loa_messageArgs[0] = " audiencia/ejecutoria ";
					throw new B2BException(ErrorKeys.ERROR_CAMPO_FECHA_OBLIGATORIO, loa_messageArgs);
				}

				if((ld_fechaEjecutoriaDatoActo != null) && ld_fechaEjecutoriaDatoActo.after(new Date()))
				{
					{
						Object[] loa_messageArgs = new String[1];
						loa_messageArgs[0] = " audiencia/ejecutoria ";
						throw new B2BException(ErrorKeys.FECHA_SUPERIOR_ACTUAL, loa_messageArgs);
					}
				}

				if(ld_fechaEjecutoria != null)
				{
					Date                 ld_fechaVencimientoDosMeses;
					Date                 ld_fechaVencimientoTresMeses;
					FechaVenceTerminosUI lfvtui_fecha;

					lfvtui_fecha = new FechaVenceTerminosUI();

					lfvtui_fecha.setFechaInicial(ld_fechaEjecutoria);
					lfvtui_fecha.setTipoCalendario("C");
					lfvtui_fecha.setIdCirculo(lb_habilitaFechaAudiencia ? la_acto.getIdCirculo() : null);
					lfvtui_fecha.setDiasCalcularFecha(NumericUtils.getInteger(60));

					ld_fechaVencimientoDosMeses = irr_referenceRemote.calcularFechaVencimiento(lfvtui_fecha);

					lfvtui_fecha.setDiasCalcularFecha(NumericUtils.getInteger(90));

					ld_fechaVencimientoTresMeses = irr_referenceRemote.calcularFechaVencimiento(lfvtui_fecha);

					if(ld_fechaDocumentoEnDatosDocumento == null)
						throw new B2BException(ErrorKeys.DEBE_DIGITAR_FECHA_DOC);

					if((!lb_habilitaFechaAudiencia && ab_ingreso) || (ab_ingreso))
					{
						if(ld_fechaVencimientoDosMeses != null)
						{
							if(ld_fechaActual.after(ld_fechaVencimientoDosMeses))
								addMessage(MessagesKeys.DOCUMENTO_HA_SUPERADO_DOS_MESES);

							if(ld_fechaDocumentoEnDatosDocumento.after(ld_fechaEjecutoria))
							{
								Object[] loa_messageArgs = new String[1];
								loa_messageArgs[0] = " de documento ";
								throw new B2BException(ErrorKeys.FECHA_SUPERIOR_EJECUTORIA, loa_messageArgs);
							}
						}
					}
					else if(!ab_ingreso && lb_habilitaFechaAudiencia)
					{
						if(ld_fechaVencimientoDosMeses != null)
						{
							if(
							    ld_fechaActual.after(ld_fechaVencimientoDosMeses)
								    && ld_fechaActual.before(ld_fechaVencimientoTresMeses)
							)
								addMessage(MessagesKeys.DOCUMENTO_HA_SUPERADO_DOS_MESES);

							if(ld_fechaDocumentoEnDatosDocumento.after(ld_fechaEjecutoriaDatoActo))
								throw new B2BException(ErrorKeys.FECHA_AUDIENCIA_MENOR);
						}
					}

					if(!ab_ingreso && !lb_habilitaFechaAudiencia)
						setEsActoConEjecutoria(false);

					if(ld_fechaEjecutoria.after(ld_fechaActual))
					{
						String ls_mensaje;

						ls_mensaje = getMessages().getString(MessagesKeys.FECHA_EJECUTORIA_MAYOR_A_FECHA_ACTUAL);

						addMessage("W", ls_mensaje);
					}

					if(ld_fechaEjecutoria.before(ld_fechaDocumentoEnDatosDocumento))
					{
						String ls_mensaje;

						ls_mensaje = getMessages().getString(ErrorKeys.FECHA_AUDIENCIA_MENOR);

						addMessage("W", ls_mensaje);
					}
				}
			}
		}
		catch(B2BException lb2be_e)
		{
			if((!lb_habilitaFechaAudiencia && ab_ingreso) || ab_ingreso)
			{
				clh_LOGGER.error("validarFechaMayor60Dias", lb2be_e);
				addMessage(lb2be_e);
			}
			else if(!ab_ingreso && lb_habilitaFechaAudiencia)
				throw lb2be_e;
		}
		finally
		{
			actualizarComponente(is_messageIdGrowl);
		}
	}

	/**
	 * Validar fecha impuesto.
	 *
	 * @param ad_fechaPago Fecha a validar
	 * @param ad_fechaDocumento de ad fecha documento
	 * @throws B2BException Objeto de tipo B2BException, se produce cuando se encuentra algun error controlado.
	 */
	public void validarFechaPagoImpuesto(Date ad_fechaPago, Date ad_fechaDocumento)
	    throws B2BException
	{
		if(ad_fechaDocumento != null)
		{
			if(ad_fechaPago != null)
			{
				String ls_preguntaImpuesto;

				ls_preguntaImpuesto = StringUtils.getStringNotNull(getPreguntaPagoImpuestoRegistroGobernaciones());

				if(ls_preguntaImpuesto.equalsIgnoreCase(EstadoCommon.S) || isEsImpuestoDeRegistro())
				{
					FacesContext lfc_context;
					lfc_context = FacesContext.getCurrentInstance();

					if(ad_fechaPago.after(new Date()))
					{
						validateStyles(":fRegistro:idCalFechaPagoImpuesto", lfc_context, "", false);

						Object[] aoa_messageArgs = new String[1];
						aoa_messageArgs[0] = " pago ";
						throw new B2BException(ErrorKeys.FECHA_SUPERIOR_ACTUAL, aoa_messageArgs);
					}

					if(ad_fechaPago.before(ad_fechaDocumento))
					{
						validateStyles(":fRegistro:idCalFechaPagoImpuesto", lfc_context, "", false);
						throw new B2BException(ErrorKeys.FECHA_PAGO_DEBE_SER_SUPERIOR_DOC);
					}
				}
			}
			else
				throw new B2BException(ErrorKeys.DEBE_DIGITAR_FECHA_PAGO);
		}
	}

	/**
	 * Validar fecha impuesto extemporaneo.
	 *
	 * @param ad_fechaPago Fecha a validar
	 * @param ad_fechaDocumento de ad fecha documento
	 * @throws B2BException Objeto de tipo B2BException, se produce cuando se encuentra algun error controlado.
	 */
	public void validarFechaPagoImpuestoExtemporaneo(Date ad_fechaPago, Date ad_fechaDocumento)
	    throws B2BException
	{
		Calendar lc_calendar;
		Date     ld_fechaDoc;
		int      li_meses;
		String   ls_idPais;

		lc_calendar     = Calendar.getInstance();
		li_meses        = 2;
		ls_idPais       = getIdPais();

		if(ad_fechaDocumento != null)
		{
			if(ad_fechaPago != null)
			{
				String ls_preguntaImpuesto;

				ls_preguntaImpuesto = StringUtils.getStringNotNull(getPreguntaPagoImpuestoRegistroGobernaciones());

				if(
				    (ls_preguntaImpuesto.equalsIgnoreCase(EstadoCommon.S) && isReciboPagoExtemporaneo())
					    || isEsImpuestoDeRegistro()
				)
				{
					FacesContext lfc_context;
					lfc_context = FacesContext.getCurrentInstance();

					if(ad_fechaPago.after(new Date()))
					{
						validateStyles(":fRegistro:idCalFechaPagoImpuestoExtemporaneo", lfc_context, "", false);

						Object[] aoa_messageArgs = new String[1];
						aoa_messageArgs[0] = " pago impuesto extemporáneo ";
						throw new B2BException(ErrorKeys.FECHA_SUPERIOR_ACTUAL, aoa_messageArgs);
					}

					if(
					    StringUtils.isValidString(ls_idPais)
						    && !ls_idPais.equalsIgnoreCase(IdentificadoresCommon.INDICATIVO_PAIS_DEFAULT)
					)
						li_meses = 3;

					lc_calendar.setTime(ad_fechaDocumento);
					lc_calendar.add(Calendar.MONTH, li_meses);
					ld_fechaDoc = lc_calendar.getTime();

					if(ad_fechaPago.before(ld_fechaDoc))
					{
						validateStyles(":fRegistro:idCalFechaPagoImpuestoExtemporaneo", lfc_context, "", false);

						if(
						    StringUtils.isValidString(ls_idPais)
							    && !ls_idPais.equalsIgnoreCase(IdentificadoresCommon.INDICATIVO_PAIS_DEFAULT)
						)
							throw new B2BException(ErrorKeys.FECHA_PAGO_EXTEMPORANEA_DEBE_SER_MAYOR_DOC_3_MESES);
						else
							throw new B2BException(ErrorKeys.FECHA_PAGO_EXTEMPORANEA_DEBE_SER_MAYOR_DOC_2_MESES);
					}
				}
			}
			else
				throw new B2BException(ErrorKeys.DEBE_DIGITAR_FECHA_PAGO_EXTEMPORANEA);
		}
	}

	/**
	 * Validar fecha impuesto.
	 *
	 * @param ad_fechaPago Fecha a validar
	 * @param ab_pagoExtemporaneo de ab pago extemporaneo
	 */
	public void validarFechaPagoImpuestosGob(Date ad_fechaPago, boolean ab_pagoExtemporaneo)
	{
		try
		{
			Date      ld_fechaDoc;
			Documento ld_documento;
			ld_documento     = null;
			ld_fechaDoc      = null;

			if(isEsImpuestoDeRegistro())
				ld_documento = irr_registroRemote.findDocumento(getIdSolicitudGobernaciones());
			else
				ld_documento = getBgnDocumento();

			if(ld_documento != null)
				ld_fechaDoc = ld_documento.getFechaDocumento();

			if(ab_pagoExtemporaneo)
				validarFechaPagoImpuestoExtemporaneo(ad_fechaPago, ld_fechaDoc);
			else
				validarFechaPagoImpuesto(ad_fechaPago, ld_fechaDoc);
		}
		catch(B2BException lb2be_e)
		{
			clh_LOGGER.error(lb2be_e);
			addMessage(lb2be_e);
		}
	}

