	/**
	 * Validar nueva entrada.
	 *
	 * @throws B2BException Señala que se ha producido una excepción
	 */
	public void validarNuevaEntrada()
	    throws B2BException
	{
		NuevaEntrada lne_nuevaEntrada;
		Solicitud    ls_solicitud;

		lne_nuevaEntrada     = new NuevaEntrada();
		ls_solicitud         = getSolicitud();

		ls_solicitud.setNirAsociado(null);
		lne_nuevaEntrada.setSolicitud(ls_solicitud);

		try
		{
			lne_nuevaEntrada = irr_registroRemote.validarNuevaEntrada(lne_nuevaEntrada);

			if(lne_nuevaEntrada != null)
			{
				Collection<Turno> lct_turnoRecurrencia;
				Solicitud         ls_solicitudTemp;

				lct_turnoRecurrencia     = lne_nuevaEntrada.getTurnosRecurrencia();
				ls_solicitudTemp         = lne_nuevaEntrada.getSolicitud();

				if(ls_solicitudTemp != null)
				{
					ls_solicitud = ls_solicitudTemp;
					setSolicitud(ls_solicitud);
				}

				if(lne_nuevaEntrada.isNoEtapa501o502())
					addMessage(MessagesKeys.ETAPA_INVALIDA_501_502);

				if(CollectionUtils.isValidCollection(lct_turnoRecurrencia))
				{
					setTurnoRecurrencia(lct_turnoRecurrencia);
					setMostrarTurnoRecurrencia(true);
				}
				else
					setMostrarTurnoRecurrencia(false);
			}

			setSolicitud(ls_solicitud);
		}
		catch(B2BException lb2be_e)
		{
			ls_solicitud.setNirAsociado(null);
			setSolicitudAsociada(null);
			setMostrarTurnoRecurrencia(false);

			{
				String ls_messageKey;

				ls_messageKey = lb2be_e.getMessageKey();

				if(
				    StringUtils.isValidString(ls_messageKey)
					    && ls_messageKey.equalsIgnoreCase(ErrorKeys.ERROR_LIQUIDACIONES_TURNOS_MIGRADOS)
				)
					ls_solicitud.setIdTurnoAnt(null);
			}

			clh_LOGGER.error(lb2be_e);
			addMessage(lb2be_e);
		}
		finally
		{
			Ajax la_ajax;
			la_ajax = PrimeFaces.current().ajax();

			la_ajax.update(is_messageIdGrowl);
			la_ajax.update("fRegistro:idOlNirRelacionado");
			la_ajax.update("fRegistro:idOpTurnoRecurrencia");
		}
	}

