	/**
	 * Validar segunda recepcion documentos.
	 *
	 * @throws B2BException Objeto de tipo B2BException, se produce cuando se encuentra algun error controlado.
	 */
	public void validarSegundaRecepcionDocumentos()
	    throws B2BException
	{
		String ls_result = null;

		try
		{
			Solicitud lso_solicitud;

			lso_solicitud = getSolicitud();

			if(lso_solicitud != null)
			{
				Collection<Turno> lct_turnos;
				String            ls_idProceso;

				lct_turnos       = getInfoTurnos();
				ls_idProceso     = lso_solicitud.getIdProceso();

				if(StringUtils.isValidString(ls_idProceso))
				{
					switch(ls_idProceso)
					{
						case ProcesoCommon.ID_PROCESO_39:
							ls_result = irr_registroRemote.validarSegundaRecepcionDocumentos(
								    lct_turnos, ls_idProceso, lso_solicitud, getUserId(), getLocalIpAddress(),
								    getRemoteIpAddress()
								);
							handledErrorSegundaRecepcionDocumentos(
							    ls_result, MessagesKeys.MENSAJE_ERROR_DESISTIMIENTO_YA_EXISTE,
							    ErrorKeys.ERROR_DESISTIMIENTO_YA_EXISTE_TRAMITE
							);

							break;

						case ProcesoCommon.ID_PROCESO_41:
							ls_result = irr_registroRemote.validarSegundaRecepcionDocumentos(
								    lct_turnos, ls_idProceso, lso_solicitud, getUserId(), getLocalIpAddress(),
								    getRemoteIpAddress()
								);
							handledErrorSegundaRecepcionDocumentos(
							    ls_result, MessagesKeys.MENSAJE_ERROR_PRORROGA_ENTREGA_DOCUMENTACION_YA_EXISTE,
							    ErrorKeys.ERROR_PRORROGA_ENTREGA_DOCUMENTACION_YA_EXISTE_TRAMITE
							);

							break;

						case ProcesoCommon.ID_PROCESO_42:
							ls_result = irr_registroRemote.validarSegundaRecepcionDocumentos(
								    lct_turnos, ls_idProceso, lso_solicitud, getUserId(), getLocalIpAddress(),
								    getRemoteIpAddress()
								);
							handledErrorSegundaRecepcionDocumentos(
							    ls_result, MessagesKeys.MENSAJE_ERROR_PRORROGA_MAYOR_VALOR_YA_EXISTE,
							    ErrorKeys.ERROR_PRORROGA_MAYOR_VALOR_YA_EXISTE_TRAMITE
							);

							break;

						case ProcesoCommon.ID_PROCESO_43:
							ls_result = irr_registroRemote.validarSegundaRecepcionDocumentos(
								    lct_turnos, ls_idProceso, lso_solicitud, getUserId(), getLocalIpAddress(),
								    getRemoteIpAddress()
								);
							handledErrorSegundaRecepcionDocumentos(
							    ls_result, MessagesKeys.MENSAJE_ERROR_RESTITUCION_YA_EXISTE,
							    ErrorKeys.ERROR_RESTITUCION_YA_EXISTE_TRAMITE
							);

							break;

						case ProcesoCommon.ID_PROCESO_40:
							ls_result = irr_registroRemote.validarSegundaRecepcionDocumentos(
								    lct_turnos, ls_idProceso, lso_solicitud, getUserId(), getLocalIpAddress(),
								    getRemoteIpAddress()
								);

							if(ls_result == null)
							{
								setComentario(
								    getMessages()
									        .getString(MessagesKeys.MENSAJE_ERROR_ENTREGA_DE_DOCUMENTACION_YA_EXISTE)
								);
								setEsSegundaRecepcionDocumento(true);
								throw new B2BException(ErrorKeys.ERROR_ENTREGA_DE_DOCUMENTACION_YA_EXISTE_TRAMITE);
							}
							else
								setComentario(null);

							break;

						default:
							break;
					}
				}
			}
		}
		catch(B2BException lb2be_e)
		{
			clh_LOGGER.error(lb2be_e);
			throw new B2BException(lb2be_e.getMessage());
		}
	}

	/**
	 * Validar tipo documental correcciones.
	 *
	 * @param aacd_iterador correspondiente al valor del tipo de objeto TipoDocumental
	 * @param ab_accion correspondiente al valor del tipo de objeto boolean
	 * @throws B2BException Señala que se ha producido una excepción
	 */
	public void validarTipoDocumentalCorrecciones(TipoDocumental aacd_iterador, boolean ab_accion)
	    throws B2BException
	{
		try
		{
			if(aacd_iterador != null)
			{
				boolean   lb_agregarTurno;
				String    ls_idTipoDocumentalTemp;
				String    ls_observaciones;
				String    ls_idTurno;
				String    ls_idSolicitud;
				Solicitud ls_solicitud;

				lb_agregarTurno             = aacd_iterador.isAgregarTurno();
				ls_idTipoDocumentalTemp     = aacd_iterador.getIdTipoDocumental();
				ls_observaciones            = aacd_iterador.getObservaciones();
				ls_idTurno                  = aacd_iterador.getIdTurnoCertificadoCorrecciones();
				ls_idSolicitud              = null;
				ls_solicitud                = getSolicitud();

				if(ls_solicitud != null)
					ls_idSolicitud = ls_solicitud.getIdSolicitud();

				if(StringUtils.isValidString(ls_idTipoDocumentalTemp))
				{
					Object[] aoa_messageArgs = new String[1];
					aoa_messageArgs[0] = findNombreDocumental(ls_idTipoDocumentalTemp);

					if(StringUtils.isValidString(ls_observaciones))
					{
						if(ls_observaciones.length() > 200)
							throw new B2BException(ErrorKeys.ERROR_OBSERVACIONES_TAM);
					}
					else
					{
						if(!aacd_iterador.isSeleccionado())
							throw new B2BException(ErrorKeys.ERROR_VALIDAR_TIPOS_DOC_CORRECCIONES_CHECK);
					}

					if(lb_agregarTurno)
					{
						if(StringUtils.isValidString(ls_idTurno))
						{
							if(!irr_registroRemote.validarTurnoCertificado(ls_idTurno, ls_idSolicitud, false))
								throw new B2BException(ErrorKeys.ERROR_TURNO_CERTIFICADO);
						}
						else
							throw new B2BException(
							    ErrorKeys.ERROR_TURNO_INVALIDO_CERTIFICADO_CORRECCIONES, aoa_messageArgs
							);
					}
				}
				else
					throw new B2BException(ErrorKeys.TIPO_DOCUMENTAL_INVALIDO);
			}
		}
		catch(B2BException lb2be_e)
		{
			if(!ab_accion)
				throw lb2be_e;
			else
			{
				clh_LOGGER.error(lb2be_e);
				addMessage(lb2be_e);
				PrimeFaces.current().ajax().update(is_messageIdGrowl);
			}
		}
	}

