	/**
	 * Carga los tipos requiere matrícula y corrige la ortografía de los textos.
	 *
	 * @param ab_mixto indica si debe traer la opción mixta
	 * @param ab_antSistema indica si debe traer la opción antiguo sistema
	 * @param ab_matricula indica si debe traer la opción matricula
	 * @return Colección resultante de la busqueda
	 * @throws B2BException Señala que se ha producido una excepción
	 *
	 */
	protected Collection<TipoRequiereMatricula> cargarTextosDatosPredio(
	    boolean ab_mixto, boolean ab_antSistema, boolean ab_matricula
	)
	    throws B2BException
	{
		Collection<TipoRequiereMatricula> lctrm_tipos;
		Collection<TipoRequiereMatricula> lctrm_return;

		lctrm_tipos      = irr_referenceRemote.findTipoRequiereMatriculaActivos(
			    getUserId(), getLocalIpAddress(), getRemoteIpAddress()
			);
		lctrm_return     = new LinkedList<TipoRequiereMatricula>();

		if(!CollectionUtils.isValidCollection(lctrm_tipos))
			throw new B2BException(ErrorKeys.ERROR_INTERNO_SISTEMA);

		for(TipoRequiereMatricula ltrm_data : lctrm_tipos)
		{
			if(ltrm_data != null)
			{
				boolean lb_cargarTipo;
				String  ls_idTipoRequiereMatricula;

				lb_cargarTipo                  = true;
				ls_idTipoRequiereMatricula     = StringUtils.getStringNotNull(ltrm_data.getIdTipoRequiereMatricula());

				if(
				    !ab_mixto
					    && ls_idTipoRequiereMatricula.equals(
					        TipoRequiereMatriculaCommon.DATOS_CON_MATRICULA_Y_SIN_MATRICULA
					    )
				)
					lb_cargarTipo = false;
				else if(
				    !ab_antSistema
					    && ls_idTipoRequiereMatricula.equals(TipoRequiereMatriculaCommon.DATOS_ANTIGUO_SISTEMA)
				)
					lb_cargarTipo = false;
				else if(!ab_matricula && ls_idTipoRequiereMatricula.equals(TipoRequiereMatriculaCommon.CON_MATRICULA))
					lb_cargarTipo = false;

				if(lb_cargarTipo)
				{
					String ls_descripcion;

					ls_descripcion     = StringUtils.getStringNotNull(ltrm_data.getDescripcion());

					ls_descripcion     = ls_descripcion.substring(0, 1) + ls_descripcion.substring(1).toLowerCase();
					ls_descripcion     = ls_descripcion.replace("matricula", "matrícula");

					ltrm_data.setDescripcion(ls_descripcion);

					lctrm_return.add(ltrm_data);
				}
			}
		}

		return lctrm_return;
	}

