	/**
	 * Actualizar sub proceso solicitud.
	 *
	 * @throws B2BException Señala que se ha producido una excepción
	 */
	private void actualizarSubProcesoSolicitud()
	    throws B2BException
	{
		try
		{
			Collection<com.bachue.snr.prosnr01.model.registro.Acto> lca_actos;
			Collection<TipoActo>                                    lta_tiposActo;
			String                                                  ls_idSubprocesoAnterior;

			lca_actos                   = getDatosActo();
			lta_tiposActo               = findTiposActos();
			ls_idSubprocesoAnterior     = getIdSubProcesoAnterior();

			if(!StringUtils.isValidString(ls_idSubprocesoAnterior))
				ls_idSubprocesoAnterior = getSolicitud().getIdSubproceso();

			if(CollectionUtils.isValidCollection(lca_actos) && CollectionUtils.isValidCollection(lta_tiposActo))
			{
				for(com.bachue.snr.prosnr01.model.registro.Acto la_iterador : lca_actos)
				{
					if(la_iterador != null)
					{
						String ls_codigoActo;

						ls_codigoActo = la_iterador.getCodigo();

						if(StringUtils.isValidString(ls_codigoActo))
						{
							for(TipoActo lta_iterador : lta_tiposActo)
							{
								if(lta_iterador != null)
								{
									String ls_idActo;
									String ls_requiereMatricula;

									ls_idActo                = lta_iterador.getIdTipoActo();
									ls_requiereMatricula     = lta_iterador.getRequiereMatricula();

									if(
									    StringUtils.isValidString(ls_idActo)
										    && ls_idActo.equalsIgnoreCase(ls_codigoActo)
									)
									{
										if(
										    StringUtils.isValidString(ls_requiereMatricula)
											    && ls_requiereMatricula.equalsIgnoreCase(EstadoCommon.N)
										)
										{
											//TODO seccion de codigo sin terminar
										}
									}
								}
							}
						}
					}
				}
			}

			getSolicitud().setIdSubproceso(ls_idSubprocesoAnterior);
			setIdSubProcesoAnterior(ls_idSubprocesoAnterior);

			{
				boolean lb_mostrar                            = true;
				boolean lb_mostrarRepConstancia               = false;
				boolean lb_RenderedDatosPredioYIntervinientes = true;
				String  ls_solicitudConTramite                = null;
				String  ls_idSubprocesoSeleccion              = getSolicitud().getIdSubproceso();

				if(ls_idSubprocesoSeleccion != null)
				{
					if(ls_idSubprocesoSeleccion.equals("2") || ls_idSubprocesoSeleccion.equals("6"))
					{
						lb_mostrar                 = false;
						ls_solicitudConTramite     = "false";
						setSolicitudConTramite(ls_solicitudConTramite);
					}
					else
					{
						if(ls_idSubprocesoSeleccion.equals("1"))
						{
							ls_solicitudConTramite = "true";
							setSolicitudConTramite(ls_solicitudConTramite);
						}
						else if(ls_idSubprocesoSeleccion.equals("4"))
						{
							lb_mostrarRepConstancia                   = true;
							lb_RenderedDatosPredioYIntervinientes     = false;
						}
						else
						{
							lb_mostrar                 = true;
							ls_solicitudConTramite     = "";
							setSolicitudConTramite(ls_solicitudConTramite);
						}
					}
				}

				setRenderedRepConstancia(lb_mostrarRepConstancia);
				setDeshabilitarMenuPredio(lb_mostrar);
				setRenderedDatosPredioYIntervinientes(lb_RenderedDatosPredioYIntervinientes);

				// PrimeFaces.current().ajax().update(is_idForm);
			}

			Solicitud ls_solicitud;
			ls_solicitud = getSolicitud();

			ls_solicitud.setIdUsuarioModificacion(getUserId());
			ls_solicitud.setIpModificacion(getRemoteIpAddress());

			irr_registroRemote.actualizarSubProcesoSolicitud(getSolicitud(), getUserId());
		}
		catch(B2BException lb2be_e)
		{
			clh_LOGGER.error(lb2be_e);
			throw new B2BException(lb2be_e.getMessage());
		}
	}

	/**
	 * Cargar actos nueva entrada.
	 */
	private void cargarActosNuevaEntrada()
	{
		try
		{
			if(!isHabilitarTurnoYnir())
			{
				SolicitudAsociada lsa_solicitudAsociada;
				Solicitud         ls_solicitud;

				ls_solicitud              = getSolicitud();
				lsa_solicitudAsociada     = irr_registroRemote.findSolicitudAsociada(ls_solicitud);

				setSolicitudAsociada(lsa_solicitudAsociada);

				if((lsa_solicitudAsociada != null) && (ls_solicitud != null))
				{
					String ls_idSolicitud;
					String ls_idSolicitudActual;

					ls_idSolicitud           = lsa_solicitudAsociada.getIdSolicitud1();
					ls_idSolicitudActual     = ls_solicitud.getIdSolicitud();

					if(StringUtils.isValidString(ls_idSolicitud))
					{
						Collection<com.bachue.snr.prosnr01.model.registro.Acto> lca_actos;
						Collection<com.bachue.snr.prosnr01.model.registro.Acto> lca_actosTemp;

						lca_actos         = irr_registroRemote.findActosBySolicitudCirculoTurno(
							    ls_idSolicitud, ls_solicitud.getIdTurnoAnt()
							);
						lca_actosTemp     = irr_registroRemote.findActosBySolicitud(ls_idSolicitudActual);

						if(CollectionUtils.isValidCollection(lca_actos))
						{
							if(!CollectionUtils.isValidCollection(lca_actosTemp))
							{
								Map<String, String> lmss_actos;

								lmss_actos = new LinkedHashMap<String, String>();

								for(com.bachue.snr.prosnr01.model.registro.Acto la_acto : lca_actos)
								{
									if(la_acto != null)
									{
										String ls_idActo;
										String ls_idActoRelacionado;

										la_acto.setIdActoPrincipal(la_acto.getIdActoDb());
										la_acto.setIdSolicitudAsociada(ls_idSolicitud);
										la_acto.setIdSolicitud(getSolicitud().getIdSolicitud());
										la_acto.setUserId(getUserId());
										la_acto.setNuevaEntrada(true);

										setActo(la_acto);

										{
											ActoNuevaEntrada lane_actoNuevaEntrada;

											lane_actoNuevaEntrada = saveInfoAll();

											if(lane_actoNuevaEntrada != null)
												la_acto = lane_actoNuevaEntrada.getActo();
										}

										ls_idActo                = la_acto.getIdActoDb();
										ls_idActoRelacionado     = la_acto.getIdActoDerivado();

										lmss_actos.put(ls_idActoRelacionado, ls_idActo);
									}
								}

								setDatosActo(lca_actos);
								setDataActosParciales(lmss_actos);
							}
							else
								setDatosActo(lca_actosTemp);
						}

						{
							com.bachue.snr.prosnr01.model.registro.Acto la_acto;
							String                                      ls_idProcesoNuevo;
							String                                      ls_idSubProcesoNuevo;

							la_acto                  = null;
							ls_idProcesoNuevo        = ls_solicitud.getIdProceso();
							ls_idSubProcesoNuevo     = ls_solicitud.getIdSubproceso();

							if(
							    (StringUtils.isValidString(ls_idProcesoNuevo)
								    && StringUtils.isValidString(ls_idSubProcesoNuevo)
								    && ls_idProcesoNuevo.equalsIgnoreCase(ProcesoCommon.ID_PROCESO_6)
								    && ls_idSubProcesoNuevo.equalsIgnoreCase(ProcesoCommon.ID_SUBPROCESO_3))
								    || getSolicitud().isNuevaSolicitud()
							)
							{
								la_acto = new com.bachue.snr.prosnr01.model.registro.Acto();
								la_acto.setIdCirculo(getIdCirculoPadreTurnoDerivado());
								setProceso6Sub3(true);
								setDeshabilitarCirculo(true);
							}

							setActo(la_acto);
						}
					}
				}
			}
		}
		catch(B2BException lb2be_e)
		{
			clh_LOGGER.error(lb2be_e);
			addMessage(lb2be_e);
			PrimeFaces.current().ajax().update(is_messageIdGrowl);
		}
	}

	/**
	 * Construye los objetos necesarios para la vinculación de matrículas y predios a los actos.
	 *
	 * @throws B2BException Señala que se ha producido una excepción
	 */
	private void cargarDatosPredioActo()
	    throws B2BException
	{
		Solicitud ls_solicitud;

		ls_solicitud = getSolicitud();

		if(ls_solicitud != null)
		{
			String ls_idSolicitud;

			ls_idSolicitud = ls_solicitud.getIdSolicitud();

			if(StringUtils.isValidString(ls_idSolicitud))
			{
				Map<String, String> lhmss_englobes;
				Map<String, String> lhmss_desenglobes;
				Map<String, String> lhmss_ventaParcial;
				Map<String, String> lhmss_reloteo;

				lhmss_englobes         = new HashMap<String, String>();
				lhmss_desenglobes      = new HashMap<String, String>();
				lhmss_ventaParcial     = new HashMap<String, String>();
				lhmss_reloteo          = new HashMap<String, String>();

				{
					Collection<com.bachue.snr.prosnr01.model.registro.Acto> lca_actos;

					lca_actos = irr_registroRemote.findActosBySolicitud(ls_idSolicitud);

					if(CollectionUtils.isValidCollection(lca_actos))
					{
						Iterator<com.bachue.snr.prosnr01.model.registro.Acto> lia_iterator;

						lia_iterator = lca_actos.iterator();

						while(lia_iterator.hasNext())
						{
							com.bachue.snr.prosnr01.model.registro.Acto la_acto;

							la_acto = lia_iterator.next();

							if(la_acto != null)
							{
								String ls_tipoActo;
								String ls_idCirculo;

								ls_tipoActo      = la_acto.getCodigo();
								ls_idCirculo     = la_acto.getIdCirculo();

								if(StringUtils.isValidString(ls_tipoActo) && StringUtils.isValidString(ls_idCirculo))
								{
									lhmss_englobes         = validarProcesos(
										    ls_tipoActo, ls_idCirculo, ConstanteCommon.CODIGOS_ACTOS_ENGLOBES,
										    lhmss_englobes
										);
									lhmss_desenglobes      = validarProcesos(
										    ls_tipoActo, ls_idCirculo, ConstanteCommon.CODIGOS_ACTOS_DESENGLOBES,
										    lhmss_desenglobes
										);
									lhmss_ventaParcial     = validarProcesos(
										    ls_tipoActo, ls_idCirculo, ConstanteCommon.CODIGOS_ACTOS_VENTA_PARCIAL,
										    lhmss_ventaParcial
										);
									lhmss_reloteo          = validarProcesos(
										    ls_tipoActo, ls_idCirculo, ConstanteCommon.CODIGOS_ACTOS_RELOTEO,
										    lhmss_reloteo
										);
								}
							}
						}
					}
				}

				Collection<String> lcs_datosDelPredio;
				SolicitudMatricula lsm_sm;
				boolean            lb_b;

				if(!getSolicitud().isNuevaSolicitud())
					irr_registroRemote.limpiarDatosDelPredio(ls_solicitud);

				lsm_sm = null;

				if(getSolicitud().isNuevaSolicitud())
					lsm_sm = irr_registroRemote.consulaMatriculasAsociadas(getSolicitud());

				lb_b = lsm_sm != null;

				if(lb_b)
					setNirAsociado(StringUtils.getStringNotNull(lsm_sm.getNirAsociado()));

				setGravamenes(null);
				setProhibicionesVPM(null);
				setSiActosSeleccionadosConGravamen(false);
				setRenderedProhibiciones(false);

				lcs_datosDelPredio = irr_registroRemote.cargarDatosPredioActo(ls_solicitud);

				if(CollectionUtils.isValidCollection(lcs_datosDelPredio))
				{
					Collection<DatosDelPredio> lcddp_datosDelPredio;

					lcddp_datosDelPredio = new ArrayList<DatosDelPredio>();

					for(String ls_iterador : lcs_datosDelPredio)
					{
						if(StringUtils.isValidString(ls_iterador))
						{
							DatosDelPredio lddp_datosDelPredio;

							lddp_datosDelPredio = new DatosDelPredio();

							lddp_datosDelPredio.setIdCirculo(ls_iterador);

							{
								CirculoRegistral lcr_circuloRegistral;

								lcr_circuloRegistral = new CirculoRegistral();

								lcr_circuloRegistral.setIdCirculo(ls_iterador);

								lcr_circuloRegistral = irr_registroRemote.findCirculoRegistralById(
									    lcr_circuloRegistral, getUserId()
									);

								if(lcr_circuloRegistral != null)
								{
									String ls_nombre;
									String ls_nombreCirculo;

									ls_nombre = lcr_circuloRegistral.getNombre();

									if(StringUtils.isValidString(ls_nombre))
										ls_nombreCirculo = ls_nombre;
									else
										ls_nombreCirculo = "sin información";

									lddp_datosDelPredio.setNombreCirculo(ls_nombreCirculo);
								}
							}

							List<ColumnModel> llcm_columns;

							llcm_columns = getColumnsActos(lddp_datosDelPredio);

							if(CollectionUtils.isValidCollection(llcm_columns))
							{
								Collection<String> lcs_idActos;
								boolean            lb_eleccionMatricula;

								lcs_idActos              = new LinkedList<String>();
								lb_eleccionMatricula     = false;

								for(ColumnModel lcm_data : llcm_columns)
								{
									if(lcm_data != null)
										lcs_idActos.add(lcm_data.getIdActo());
								}

								lb_eleccionMatricula = irr_registroRemote.verificarSiActoNoValidoParaAntSistema(
									    lcs_idActos, getUserId(), getLocalIpAddress(), getRemoteIpAddress()
									);

								if(isEsTipoActoBaldio())
								{
									lddp_datosDelPredio.setEleccionRequiereMatricula(
									    TipoRequiereMatriculaCommon.DATOS_ANTIGUO_SISTEMA
									);

									lddp_datosDelPredio.setAntiguoSistema1932(EstadoCommon.O);
								}
								else if(lb_eleccionMatricula)
									lddp_datosDelPredio.setEleccionRequiereMatricula(
									    TipoRequiereMatriculaCommon.CON_MATRICULA
									);

								lddp_datosDelPredio.setActosNoValidosParaAntiguoSistema(lb_eleccionMatricula);
							}

							lddp_datosDelPredio.setColumns(llcm_columns);

							Collection<PredioActoIU> lcpaiu_iu;
							lcpaiu_iu = new ArrayList<PredioActoIU>();

							if(lb_b)
							{
								PredioActoIU lpaiu_pa;
								lpaiu_pa = new PredioActoIU();

								lpaiu_pa.setIdCirculo(lsm_sm.getIdCirculo());
								lpaiu_pa.setIdMatricula(NumericUtils.getLongWrapper(lsm_sm.getIdMatricula()));
								lpaiu_pa.setDireccion(lsm_sm.getDireccionCompleta());

								BigDecimal lbd_bd;
								lbd_bd = lsm_sm.getCantidadCertificados();

								if(NumericUtils.isValidBigDecimal(lbd_bd))
								{
									lpaiu_pa.setCertificadoAsociado(true);
									lpaiu_pa.setCantidad(NumericUtils.getLongWrapper(lbd_bd));
								}

								lcpaiu_iu.add(lpaiu_pa);
							}

							lddp_datosDelPredio.setActosAsociadosGeneral(lcpaiu_iu);
							lddp_datosDelPredio.setEnglobes(lhmss_englobes.containsKey(ls_iterador));
							lddp_datosDelPredio.setDesenglobes(lhmss_desenglobes.containsKey(ls_iterador));
							lddp_datosDelPredio.setVentaParcial(lhmss_ventaParcial.containsKey(ls_iterador));
							lddp_datosDelPredio.setReloteo(lhmss_reloteo.containsKey(ls_iterador));

							lcddp_datosDelPredio.add(lddp_datosDelPredio);
						}
					}

					setDatosDelPredio(lcddp_datosDelPredio);

					if(isEsTipoActoBaldio())
						validacionesAntiguoSistema();
				}
			}

			setMensajePredioInconsistente(null);
		}
	}

	/**
	 * Cargar documento nueva entrada.
	 */
	private void cargarDocumentoNuevaEntrada()
	{
		if(!isHabilitarTurnoYnir())
		{
			try
			{
				SolicitudAsociada lsa_solicitudAsociada;

				lsa_solicitudAsociada = irr_registroRemote.findSolicitudAsociada(getSolicitud());
				setSolicitudAsociada(lsa_solicitudAsociada);

				if(lsa_solicitudAsociada != null)
				{
					String ls_idSolicitud;

					ls_idSolicitud = lsa_solicitudAsociada.getIdSolicitud1();

					if(StringUtils.isValidString(ls_idSolicitud))
					{
						Documento ld_documento;
						ld_documento     = new Documento();
						ld_documento     = irr_registroRemote.findDocumento(ls_idSolicitud);

						if(ld_documento != null)
						{
							OficinaOrigen loo_oficinaOrigen;
							String        ls_idTipoOficina;
							String        ls_idTipoEntidad;

							loo_oficinaOrigen     = new OficinaOrigen();
							ls_idTipoOficina      = ld_documento.getIdTipoOficina();
							ls_idTipoEntidad      = ld_documento.getTipoEntidad();

							setBgnDocumento(ld_documento);
							findTipoOficina(null);
							tipoOficina(null);
							setIdTipoOficina(ls_idTipoOficina);

							{
								if(StringUtils.isValidString(ls_idTipoOficina))
								{
									TipoOficina lto_to;

									lto_to = new TipoOficina();

									lto_to.setIdTipoOficina(ls_idTipoOficina);

									lto_to = irr_referenceRemote.findTipoOficinaById(lto_to);

									if(lto_to != null)
									{
										TipoEntidad lte_te;

										lte_te = new TipoEntidad();

										lte_te.setIdTipoEntidad(lto_to.getIdTipoEntidad());

										lte_te = irr_referenceRemote.findTipoEntidadById(lte_te);

										if(lte_te != null)
											ls_idTipoEntidad = lte_te.getIdTipoEntidad();
									}
								}
							}

							setIdTipoEntidad(ls_idTipoEntidad);
							setIdOficinaOrigen(ld_documento.getIdOficinaOrigen());

							loo_oficinaOrigen.setIdOficinaOrigen(ld_documento.getIdOficinaOrigen());
							loo_oficinaOrigen.setVersion(ld_documento.getVersion());

							loo_oficinaOrigen = irr_registroRemote.findOficinaOrigen(loo_oficinaOrigen);

							if(loo_oficinaOrigen != null)
							{
								setIdPais(loo_oficinaOrigen.getIdPais());
								setIdDepartamento(loo_oficinaOrigen.getIdDepartamento());
								setIdMunicipio(loo_oficinaOrigen.getIdMunicipio());
							}
						}
					}
				}
			}
			catch(B2BException lb2be_e)
			{
				clh_LOGGER.error(lb2be_e);
				addMessage(lb2be_e);
				PrimeFaces.current().ajax().update(is_messageIdGrowl);
			}
		}
	}

	/**
	 * Método para cargar mensaje si el predio es inconsistente.
	 */
	private void cargarMensajePredioInconsistente()
	{
		String ls_matriculas;
		ls_matriculas = null;

		if(isProcesoCorrecciones())
		{
			Collection<PredioActoIU> lcpaiu_prediosActos;
			lcpaiu_prediosActos     = getActosAsociadosGeneral();

			ls_matriculas = cargarMensajePredioInconsistentePredio(lcpaiu_prediosActos, ls_matriculas, false);
		}
		else if(isProcesoCertificados())
		{
			DatosDelPredio lddp_datosDelPredio;
			lddp_datosDelPredio = getDatosMatricula();

			if(lddp_datosDelPredio != null)
			{
				Collection<PredioActoIU> lcpaiu_prediosActos;
				lcpaiu_prediosActos     = lddp_datosDelPredio.getActosAsociadosGeneral();

				ls_matriculas = cargarMensajePredioInconsistentePredio(lcpaiu_prediosActos, ls_matriculas, false);
			}
		}
		else
		{
			Collection<DatosDelPredio> lcddp_datosDelPredio;

			lcddp_datosDelPredio = getDatosDelPredio();

			if(CollectionUtils.isValidCollection(lcddp_datosDelPredio))
			{
				for(DatosDelPredio lddp_tmp : lcddp_datosDelPredio)
				{
					if(lddp_tmp != null)
					{
						Collection<PredioActoIU> lcpaiu_prediosActos;
						lcpaiu_prediosActos     = lddp_tmp.getActosAsociadosGeneral();

						ls_matriculas = cargarMensajePredioInconsistentePredio(
							    lcpaiu_prediosActos, ls_matriculas, false
							);
					}
				}
			}
		}

		if(StringUtils.isValidString(ls_matriculas))
		{
			Object[] aoa_messageArgs;

			aoa_messageArgs     = new String[1];

			aoa_messageArgs[0] = ls_matriculas;

			setMensajePredioInconsistente(
			    getMessages().getString(
			        MessagesKeys.SOLICITUD_TIENE_MATRICULAS_EN_ESTADO_INCONSISTENTE, aoa_messageArgs
			    )
			);
		}
		else
			setMensajePredioInconsistente(null);

		actualizarComponente(is_idForm);
	}

	/**
	 * Cargar predio nueva entrada.
	 */
	private void cargarPredioNuevaEntrada()
	{
		if(!isHabilitarTurnoYnir())
		{
			try
			{
				Solicitud         ls_solicitud;
				SolicitudAsociada lsa_solicitudAsociada;

				ls_solicitud              = getSolicitud();
				lsa_solicitudAsociada     = irr_registroRemote.findSolicitudAsociada(ls_solicitud);

				setSolicitudAsociada(lsa_solicitudAsociada);

				if((lsa_solicitudAsociada != null) && (ls_solicitud != null))
				{
					String ls_idSolicitud;

					ls_idSolicitud = lsa_solicitudAsociada.getIdSolicitud1();

					if(StringUtils.isValidString(ls_idSolicitud))
					{
						Collection<DatosDelPredio>     lcddp_datosDelPredio;
						Collection<PredioActoIU>       lcpaiu_paui;
						Collection<SolicitudMatricula> lcsm_sm;
						int                            li_consecutivo;
						SolicitudMatriculaActo         lsma_sma;
						SolicitudMatricula             ltsm_sm;
						DatosDelPredio                 lddp_datosDelPredio;

						lcddp_datosDelPredio     = new ArrayList<DatosDelPredio>();
						lcpaiu_paui              = new ArrayList<PredioActoIU>();
						li_consecutivo           = 1;
						ltsm_sm                  = new SolicitudMatricula();
						lddp_datosDelPredio      = null;

						ltsm_sm.setIdTurnoCertificado(ls_solicitud.getIdTurnoAnt());
						ltsm_sm.setIdSolicitud(ls_idSolicitud);

						lcsm_sm = irr_calificacionRemote.findSolicitudMatriculaOrderCirculo(ltsm_sm);

						if(CollectionUtils.isValidCollection(lcsm_sm))
						{
							Collection<PredioActoIU> lcpaiu_actosAsociadosGeneral;
							Map<String, String>      lhmss_englobes;
							Map<String, String>      lhmss_desenglobes;
							Map<String, String>      lhmss_ventaParcial;
							Map<String, String>      lhmss_reloteo;
							String                   ls_idCirculoActual;

							lcpaiu_actosAsociadosGeneral     = new ArrayList<PredioActoIU>();
							lhmss_englobes                   = new HashMap<String, String>();
							lhmss_desenglobes                = new HashMap<String, String>();
							lhmss_ventaParcial               = new HashMap<String, String>();
							lhmss_reloteo                    = new HashMap<String, String>();
							ls_idCirculoActual               = IdentificadoresCommon.DATO_INVALIDO;

							{
								Collection<com.bachue.snr.prosnr01.model.registro.Acto> lca_actos;

								lca_actos = irr_registroRemote.findActosBySolicitud(
									    lsa_solicitudAsociada.getIdSolicitud()
									);

								if(CollectionUtils.isValidCollection(lca_actos))
								{
									Iterator<com.bachue.snr.prosnr01.model.registro.Acto> lia_iterator;

									lia_iterator = lca_actos.iterator();

									while(lia_iterator.hasNext())
									{
										com.bachue.snr.prosnr01.model.registro.Acto la_acto;

										la_acto = lia_iterator.next();

										if(la_acto != null)
										{
											String ls_tipoActo;
											String ls_idCirculo;

											ls_tipoActo      = la_acto.getCodigo();
											ls_idCirculo     = la_acto.getIdCirculo();

											if(
											    StringUtils.isValidString(ls_tipoActo)
												    && StringUtils.isValidString(ls_idCirculo)
											)
											{
												lhmss_englobes         = validarProcesos(
													    ls_tipoActo, ls_idCirculo,
													    ConstanteCommon.CODIGOS_ACTOS_ENGLOBES, lhmss_englobes
													);
												lhmss_desenglobes      = validarProcesos(
													    ls_tipoActo, ls_idCirculo,
													    ConstanteCommon.CODIGOS_ACTOS_DESENGLOBES, lhmss_desenglobes
													);
												lhmss_ventaParcial     = validarProcesos(
													    ls_tipoActo, ls_idCirculo,
													    ConstanteCommon.CODIGOS_ACTOS_VENTA_PARCIAL, lhmss_ventaParcial
													);
												lhmss_reloteo          = validarProcesos(
													    ls_tipoActo, ls_idCirculo, ConstanteCommon.CODIGOS_ACTOS_RELOTEO,
													    lhmss_reloteo
													);
											}
										}
									}
								}
							}

							for(SolicitudMatricula lsm_actual : lcsm_sm)
							{
								if(lsm_actual != null)
								{
									{
										PredioActoIU lpaiu_paiu;
										String       ls_matriculaConcatenada;
										String       ls_idCirculoIterador;

										lpaiu_paiu               = new PredioActoIU(getColumns());
										lsma_sma                 = new SolicitudMatriculaActo();
										ls_idCirculoIterador     = lsm_actual.getIdCirculo();

										if(!ls_idCirculoIterador.equalsIgnoreCase(ls_idCirculoActual))
										{
											if(lddp_datosDelPredio != null)
												lcddp_datosDelPredio.add(lddp_datosDelPredio);

											lcpaiu_actosAsociadosGeneral     = new ArrayList<PredioActoIU>();
											lddp_datosDelPredio              = new DatosDelPredio();
											ls_idCirculoActual               = ls_idCirculoIterador;

											lddp_datosDelPredio.setIdCirculo(ls_idCirculoActual);

											{
												CirculoRegistral lcr_circuloRegistral;

												lcr_circuloRegistral = new CirculoRegistral();

												lcr_circuloRegistral.setIdCirculo(ls_idCirculoActual);

												lcr_circuloRegistral = irr_registroRemote.findCirculoRegistralById(
													    lcr_circuloRegistral, getUserId()
													);

												if(lcr_circuloRegistral != null)
												{
													String ls_nombre;
													String ls_nombreCirculo;

													ls_nombre = lcr_circuloRegistral.getNombre();

													if(StringUtils.isValidString(ls_nombre))
														ls_nombreCirculo = ls_nombre;
													else
														ls_nombreCirculo = "sin información";

													lddp_datosDelPredio.setNombreCirculo(ls_nombreCirculo);
												}
											}
										}

										lsma_sma.setIdSolicitud(lsm_actual.getIdSolicitud());
										lsma_sma.setIdCirculo(ls_idCirculoIterador);
										lsma_sma.setIdMatricula(lsm_actual.getIdMatricula());

										{
											ls_matriculaConcatenada = lsm_actual.getIdCirculo() + "-"
												+ lsm_actual.getIdMatricula();

											lpaiu_paiu.setMatricula(ls_matriculaConcatenada);
											lpaiu_paiu.setIdMatricula(
											    NumericUtils.getLongWrapper(lsm_actual.getIdMatricula())
											);
											lpaiu_paiu.setIdCirculo(lsm_actual.getIdCirculo());

											if(lsm_actual.getExpedirCertificado().equals(EstadoCommon.S))
											{
												lpaiu_paiu.setCertificadoAsociado(true);
												lpaiu_paiu.setCantidad(
												    NumericUtils.getLongWrapper(lsm_actual.getCantidadCertificados())
												);
											}

											{
												DireccionPredio ld_direccion;

												ld_direccion = new DireccionPredio();

												ld_direccion.setIdCirculo(lsm_actual.getIdCirculo());
												ld_direccion.setIdMatricula(
												    NumericUtils.getLongWrapper(lsm_actual.getIdMatricula())
												);

												ld_direccion = irr_registroRemote.findDireccionPredioById(
													    ld_direccion, getUserId()
													);

												if(ld_direccion != null)
												{
													String ls_address;

													ls_address = ld_direccion.getDireccion();

													if(StringUtils.isValidString(ls_address))
													{
														lpaiu_paiu.setDireccion(ls_address);
														lpaiu_paiu.setConsecutivo(li_consecutivo);
														li_consecutivo = li_consecutivo + 1;
														lddp_datosDelPredio.setFilePredialRendered(true);
													}
												}
											}
										}

										Collection<SolicitudMatriculaActo> lcsma_sma;

										lcsma_sma = irr_calificacionRemote.findSolicitudMatriculaActo(lsma_sma);

										if(CollectionUtils.isValidCollection(lcsma_sma))
										{
											for(SolicitudMatriculaActo lmpa_actual : lcsma_sma)
											{
												if(lmpa_actual != null)
													lpaiu_paiu.changeActoIU(lmpa_actual);
											}
										}

										lcpaiu_paui.add(lpaiu_paiu);
										lcpaiu_actosAsociadosGeneral.add(lpaiu_paiu);

										lddp_datosDelPredio.setActosAsociadosGeneral(lcpaiu_actosAsociadosGeneral);
										lddp_datosDelPredio.setColumns(getColumnsActos(lddp_datosDelPredio));
									}
								}
							}

							if(lcddp_datosDelPredio != null)
							{
								lddp_datosDelPredio.setEnglobes(lhmss_englobes.containsKey(ls_idCirculoActual));
								lddp_datosDelPredio.setDesenglobes(lhmss_desenglobes.containsKey(ls_idCirculoActual));
								lddp_datosDelPredio.setVentaParcial(lhmss_ventaParcial.containsKey(ls_idCirculoActual));
								lddp_datosDelPredio.setReloteo(lhmss_reloteo.containsKey(ls_idCirculoActual));

								lcddp_datosDelPredio.add(lddp_datosDelPredio);
							}
						}

						{
							Collection<MatriculaSegregacionUi> lcms_dataInfoPredial;
							lcms_dataInfoPredial = new ArrayList<MatriculaSegregacionUi>();

							Collection<MatriculaSegregacion> lcms_tmp;
							lcms_tmp = irr_registroRemote.findMatriculaSegregacionByIdSolicitud(ls_idSolicitud, null);

							if(CollectionUtils.isValidCollection(lcms_tmp))
							{
								long li_cont;
								li_cont = 1;

								for(MatriculaSegregacion lcms_actual : lcms_tmp)
								{
									if(lcms_actual != null)
									{
										MatriculaSegregacionUi lmsu_tmp;
										lmsu_tmp = new MatriculaSegregacionUi();

										lmsu_tmp.setUnidad(NumericUtils.getLongWrapper(li_cont));
										lmsu_tmp.setNombrePredio(lcms_actual.getNombrePredio());
										lmsu_tmp.setDireccion(lcms_actual.getDireccion());
										lmsu_tmp.setCertificadoAsociado(lcms_actual.isCertificadoAsociado());
										lmsu_tmp.setCantidad((lcms_actual.getCantidadCertificados()));
										lmsu_tmp.setAreaTerreno(lcms_actual.getAreaTerreno());
										lmsu_tmp.setAreaPrivada(lcms_actual.getAreaPrivada());
										lmsu_tmp.setAreaConstruida(lcms_actual.getAreaConstruida());
										lmsu_tmp.setCoeficiente(lcms_actual.getCoeficiente());
										lmsu_tmp.setIdSolicitud(lcms_actual.getIdSolicitud());
										lmsu_tmp.setIdCirculoMatriz(lcms_actual.getIdCirculoMatriz());
										lmsu_tmp.setMatriculaMatriz(lcms_actual.getMatriculaMatriz());
										lmsu_tmp.setCertificadoAsociado(true);
										lmsu_tmp.setCantidad(NumericUtils.getLongWrapper(1L));

										lcms_dataInfoPredial.add(lmsu_tmp);
										li_cont = li_cont + 1;
									}
								}

								if(CollectionUtils.isValidCollection(lcms_dataInfoPredial))
									lddp_datosDelPredio.setDataInfoPredial(lcms_dataInfoPredial);
							}
						}

						if(CollectionUtils.isValidCollection(lcpaiu_paui))
						{
							setActosAsociadosGeneral(lcpaiu_paui);
							setDatosDelPredio(lcddp_datosDelPredio);
							setSolicitudConTramite("true");
							setSeccionTipoMatricula(EstadoCommon.S);

							if((lddp_datosDelPredio != null) && (lcddp_datosDelPredio != null))
							{
								lcddp_datosDelPredio.remove(lddp_datosDelPredio);

								lddp_datosDelPredio.setSeccionTipoMatricula(EstadoCommon.S);

								lcddp_datosDelPredio.add(lddp_datosDelPredio);
							}
						}
					}
				}
			}
			catch(B2BException lb2be_e)
			{
				clh_LOGGER.error(lb2be_e);
				addMessage(lb2be_e);
				PrimeFaces.current().ajax().update(is_messageIdGrowl);
			}
		}
	}

	/**
	 * Devolver datos interesado solicitud asociada.
	 *
	 * @throws B2BException Objeto de tipo B2BException, se produce cuando se encuentra algun error controlado.
	 */
	private void devolverDatosInteresadoSolicitudAsociada()
	    throws B2BException
	{
		Persona  lp_persona;
		Registro lr_registroDatosConsultados;

		lp_persona                      = getPersona();
		lr_registroDatosConsultados     = getRegistroDatosConsultados();

		if((lp_persona != null) && (lr_registroDatosConsultados != null))
		{
			Registro            lr_registro;
			Registro            lr_registroReturn;
			Collection<Persona> lc_persona;

			lr_registro     = new Registro();
			lc_persona      = new ArrayList<Persona>(0);

			lp_persona.setTipoDocIdentidad(lp_persona.getIdDocumentoTipo());
			lr_registro.setPersona(lp_persona);

			lr_registroReturn = irr_registroRemote.findPersonByDocument(lr_registro, getUserId());

			if(lr_registroReturn != null)
			{
				lr_registroDatosConsultados.setListadoCorreoElectronico(
				    lr_registroReturn.getListadoCorreoElectronico()
				);
				lr_registroDatosConsultados.setListadoDireccionCorrespondencia(
				    lr_registroReturn.getListadoDireccionCorrespondencia()
				);
				lr_registroDatosConsultados.setListadoDireccionResidencia(
				    lr_registroReturn.getListadoDireccionResidencia()
				);
				lr_registroDatosConsultados.setListadoTelefonoMovil(lr_registroReturn.getListadoTelefonoMovil());
				lr_registroDatosConsultados.setListadoTelefonoFijo(lr_registroReturn.getListadoTelefonoFijo());

				Solicitud solicitud = getSolicitud();

				if(
				    StringUtils.isValidString(solicitud.getIdAutorizacionNotificacion())
					    && solicitud.getIdAutorizacionNotificacion()
					                    .equalsIgnoreCase(MedioNotificarCommon.DIRECCION_CORRESPONDENCIA)
				)
				{
					setMostrarDireccionesCorrespondencia(true);
					setHabilitarDireccionCoNo(true);
				}

				if(
				    StringUtils.isValidString(solicitud.getIdAutorizacionComunicacion())
					    && solicitud.getIdAutorizacionComunicacion().equalsIgnoreCase(MedioNotificarCommon.ORIP)
				)
				{
					setMostrarTelefonoFijo(true);
					setHabilitarTelFijoNo(true);
					setMostrarTelefonoMovil(true);
					setHabilitarTelMovilNo(true);
				}
			}

			lc_persona.add(lp_persona);
			lr_registroDatosConsultados.setListadoPersona(lc_persona);
		}
	}

	/**
	 * Retorna el valor del objeto de String.
	 *
	 * @param as_idTipoDocumental correspondiente al valor del tipo de objeto String
	 * @return devuelve el valor de String
	 * @throws B2BException Señala que se ha producido una excepción
	 *
	 */
	private String findNombreDocumental(String as_idTipoDocumental)
	    throws B2BException
	{
		Collection<TipoDocumental> lctd_tipoDocumentales;
		String                     ls_return;

		lctd_tipoDocumentales     = getTiposDocumentalesCorrecciones();
		ls_return                 = null;

		if(CollectionUtils.isValidCollection(lctd_tipoDocumentales))
		{
			for(TipoDocumental ltd_tipoDocumental : lctd_tipoDocumentales)
			{
				if(ltd_tipoDocumental != null)
				{
					String ls_idTipoDocumental;
					String ls_nombreTipoDocumental;

					ls_idTipoDocumental         = ltd_tipoDocumental.getIdTipoDocumental();
					ls_nombreTipoDocumental     = ltd_tipoDocumental.getTipoDocumental();

					if(
					    StringUtils.isValidString(ls_idTipoDocumental)
						    && StringUtils.isValidString(ls_nombreTipoDocumental)
						    && ls_idTipoDocumental.equalsIgnoreCase(as_idTipoDocumental)
					)
						ls_return = ls_nombreTipoDocumental;
				}
			}
		}

		return ls_return;
	}

	/**
	 * Retorna el valor del objeto de Map.
	 *
	 * @param as_idConstante correspondiente al valor del tipo de objeto String
	 * @return devuelve el valor de Map
	 * @see Map
	 */
	private Map<String, String> generarCodigosActos(String as_idConstante)
	{
		Map<String, String> lmss_return;

		lmss_return = new HashMap<String, String>();

		if(StringUtils.isValidString(as_idConstante))
		{
			Constantes lc_constanteLoteo;

			lc_constanteLoteo = new Constantes();

			lc_constanteLoteo.setIdConstante(as_idConstante);

			try
			{
				lc_constanteLoteo = ipr_parameterRemote.findConstantById(lc_constanteLoteo);
			}
			catch(B2BException lb2be_e)
			{
				clh_LOGGER.error(lb2be_e);
				addMessage(lb2be_e);
				PrimeFaces.current().ajax().update(is_messageIdGrowl);
			}

			if(lc_constanteLoteo != null)
			{
				String ls_caracter;

				ls_caracter = lc_constanteLoteo.getCaracter();

				if(StringUtils.isValidString(ls_caracter))
				{
					String[] lsa_codigos;

					lsa_codigos = ls_caracter.split(",");

					if(CollectionUtils.isValidCollection(lsa_codigos))
					{
						Map<String, String> lmss_codigos;

						lmss_codigos = new HashMap<String, String>();

						for(String ls_iterador : lsa_codigos)
						{
							if(StringUtils.isValidString(ls_iterador))
								lmss_codigos.put(ls_iterador, ls_iterador);
						}

						lmss_return = lmss_codigos;
					}
				}
			}
		}

		return lmss_return;
	}

	/**
	 * Guarda de datos de documento retornando siguiente pagina.
	 *
	 * @param addp_datosPredio correspondiente al valor del tipo de objeto DatosDelPredio
	 * @return String pag siguiente
	 * @throws B2BException Señala que se ha producido una excepción
	 * @see DatosDelPredio
	 */
	private DatosDelPredio guardaDocumento(DatosDelPredio addp_datosPredio)
	    throws B2BException
	{
		DatosDelPredio lddp_return;
		lddp_return = null;

		try
		{
			String                     ls_mensaje;
			Documento                  ld_documento;
			Documento                  ld_docAntSis;
			boolean                    lb_antSis;
			Collection<DatosDelPredio> lcddp_datosPredio;
			Ajax                       la_ajax;

			ls_mensaje            = null;
			ld_docAntSis          = null;
			lb_antSis             = false;
			lcddp_datosPredio     = getDatosDelPredio();
			la_ajax               = PrimeFaces.current().ajax();

			if(addp_datosPredio != null)
			{
				ld_docAntSis = addp_datosPredio.getBgnDocumento();

				if(ld_docAntSis != null)
					lb_antSis = true;
			}

			ld_documento = lb_antSis ? ld_docAntSis : getBgnDocumento();

			if(ld_documento == null)
				throw new B2BException(ErrorKeys.DOCUMENTO_INVALIDO);

			if(validaDatosDocumento(addp_datosPredio))
			{
				if(!lb_antSis)
				{
					ld_documento.setIdOficinaOrigen(getIdOficinaOrigen());
					ld_documento.setIdTipoOficina(getIdTipoOficina());
				}

				{
					Solicitud ls_solicitud;
					String    ls_idProceso;

					ls_solicitud     = getSolicitud();
					ls_idProceso     = ls_solicitud.getIdProceso();

					if(ls_solicitud != null)
					{
						String ls_entidadExterna;
						ls_entidadExterna = getEntidadExenta();

						if(StringUtils.isValidString(ls_entidadExterna))
						{
							if(ls_entidadExterna.equals("true"))
								ls_solicitud.setEntidadExenta(EstadoCommon.S);
							else
								ls_solicitud.setEntidadExenta(EstadoCommon.N);
						}
					}

					if(
					    StringUtils.isValidString(ls_idProceso)
						    && ls_idProceso.equalsIgnoreCase(ProcesoCommon.ID_PROCESO_47)
					)
					{
					}

					ld_documento = irr_registroRemote.salvarDocumento(
						    ld_documento, ls_solicitud, getUserId(), getLocalIpAddress(), getRemoteIpAddress()
						);
				}

				if(ld_documento != null)
				{
					if(lb_antSis)
					{
						String ls_idCirArg;

						ls_idCirArg = StringUtils.getStringNotNull(addp_datosPredio.getIdCirculo());

						if(lcddp_datosPredio == null)
							throw new B2BException(ErrorKeys.ERROR_INTERNO_SISTEMA);

						for(DatosDelPredio lddp_predio : lcddp_datosPredio)
						{
							if(lddp_predio != null)
							{
								String ls_idCirculo;

								ls_idCirculo = StringUtils.getStringNotNull(lddp_predio.getIdCirculo());

								if(ls_idCirculo.equalsIgnoreCase(ls_idCirArg))
								{
									lddp_predio.setBgnDocumento(ld_documento);

									lddp_return = lddp_predio;

									break;
								}
							}
						}

						setDatosDelPredio(lcddp_datosPredio);

						PrimeFaces.current().executeScript("PF('idWVPanelDocAntSis').collapse();");
						addMessage(MessagesKeys.DOCUMENTO_ANT_SISTEMA_GUARDADO);
						la_ajax.update(is_messageIdGrowl);
					}
					else
					{
						setIdOficinaOrigen(ld_documento.getIdOficinaOrigen());
						setIdTipoOficina(ld_documento.getIdTipoOficina());
						ld_documento.setFechaEjecutoria(getFechaEjecutoria());
						setFechaEjecutoriaTemporal(getFechaEjecutoria());
						setBgnDocumento(ld_documento);

						if(isEsCreacionMatriculasOficio())
						{
							Collection<DatosDelPredio> lcddp_datosDelPredio;
							DatosDelPredio             lddp_tmp;

							lcddp_datosDelPredio     = new ArrayList<DatosDelPredio>();
							lddp_tmp                 = new DatosDelPredio();

							lddp_tmp.setBgnDocumento(ld_documento);
							lddp_tmp.setTiposMatricula(cargarTextosDatosPredio());
							lddp_tmp.setEleccionRequiereMatricula(TipoRequiereMatriculaCommon.DATOS_ANTIGUO_SISTEMA);

							lcddp_datosDelPredio.add(lddp_tmp);

							setDatosDelPredio(lcddp_datosDelPredio);
						}
					}
				}

				if(StringUtils.isValidString(ls_mensaje))
				{
					addMessage("I", ls_mensaje);
					la_ajax.update(is_messageIdGrowl);
				}
			}

			la_ajax.update(is_messageIdGrowl);
		}
		catch(B2BException lb2be_e)
		{
			clh_LOGGER.error("guardaDocumento", lb2be_e);
			throw lb2be_e;
		}

		return lddp_return;
	}

	/**
	 * Handled error segunda recepcion documentos.
	 *
	 * @param as_fecha de as fecha
	 * @param as_messageKeys de as message keys
	 * @param as_errorKeys de as error keys
	 * @throws B2BException Objeto de tipo B2BException, se produce cuando se encuentra algun error controlado.
	 */
	private void handledErrorSegundaRecepcionDocumentos(String as_fecha, String as_messageKeys, String as_errorKeys)
	    throws B2BException
	{
		try
		{
			if(StringUtils.isValidString(as_fecha))
			{
				Object[] loa_arg;

				loa_arg        = new String[1];
				loa_arg[0]     = as_fecha;

				setComentario(getMessages().getString(as_messageKeys, loa_arg).toUpperCase());
				setEsSegundaRecepcionDocumento(true);
				throw new B2BException(as_errorKeys);
			}
			else
				setComentario(null);
		}
		catch(B2BException lb2be_e)
		{
			clh_LOGGER.error(lb2be_e);
			throw new B2BException(lb2be_e.getMessage());
		}
	}

