	/**
	 * Proc liquidacion.
	 *
	 * @param as_procesoInvoncacion correspondiente al valor del tipo de objeto String
	 * @throws B2BException Señala que se ha producido una excepción
	 */
	private void procLiquidacion(String as_procesoInvoncacion)
	    throws B2BException
	{
		try
		{
			Registro lor_registro;

			lor_registro = null;

			if(StringUtils.isValidString(as_procesoInvoncacion))
			{
				boolean   lb_simularLiquidacion;
				Solicitud los_tmp;

				lb_simularLiquidacion     = isSimuladorLiquidacion();
				los_tmp                   = isCorreccionesCalificacion() ? getSolicitudCorreccionCalificacion()
					                                                     : getSolicitud();

				if(los_tmp == null)
					throw new B2BException(ErrorKeys.ERROR_SIN_ID_SOLICITUD);

				setPreliquidacion(true);

				los_tmp.setInfoLiquidacion(getLiquidacionReprodruccionConstancia());
				los_tmp.setIdUsuarioCreacion(getUserId());
				los_tmp.setIpCreacion(getRemoteIpAddress());

				{
					Liquidacion ll_liquidacion;
					String      ls_idTurno;

					ll_liquidacion     = new Liquidacion();
					ls_idTurno         = getIdTurno();

					ll_liquidacion.setSolicitud(los_tmp);
					ll_liquidacion.setIdTurno(ls_idTurno);
					ll_liquidacion.setIdTipoMayorValor(
					    (StringUtils.isValidString(ls_idTurno) && isProcesoCertificados()) ? IdentificadoresCommon.N
					                                                                       : null
					);
					ll_liquidacion.setIdCondicion(as_procesoInvoncacion);
					ll_liquidacion.setProcesoCertificados(isProcesoCertificados());
					ll_liquidacion.setLiquidacionItemCondicion(getTabsCirculos());
					ll_liquidacion.setSimularLiquidacion(lb_simularLiquidacion);

					lor_registro = ilr_liquidacionRemote.procLiquidacion(
						    ll_liquidacion, getUserId(), getLocalIpAddress(), getRemoteIpAddress()
						);
				}

				if(lor_registro != null)
				{
					if(!as_procesoInvoncacion.equals(IdentificadoresCommon.CONDICIONES))
					{
						{
							byte[] lba_pdfPreliquidacion;

							lba_pdfPreliquidacion = lor_registro.getPdf();

							if(lba_pdfPreliquidacion != null)
								setPdfLiquidacion(lba_pdfPreliquidacion);
						}

						{
							Collection<Liquidacion> lcl_tmp;

							lcl_tmp = lor_registro.getInfoLiquidacionRepConstancia();

							if(CollectionUtils.isValidCollection(lcl_tmp))
								setLiquidacionReprodruccionConstancia(lcl_tmp);
						}
					}

					if(!isProcesoCertificados())
						setNuevaSolicitud(lor_registro.isNuevaSolicitud());

					{
						String ls_texto;

						ls_texto = getMessages()
								           .getString(
								    isNuevaSolicitud() ? MessagesKeys.MENSAJE_ADJUDICACION_REMATE
								                           : MessagesKeys.TERMINAR_PROCESO
								);

						setTextoTerminarProceso(ls_texto);
					}

					PrimeFaces.current().ajax().update("fDialog");
				}

				if(lb_simularLiquidacion)
					PrimeFaces.current()
						          .executeScript(
						    "mostrarElementos('" + "fRegistro:fRegistroSubmit:botonFinalizar" + "')"
						);
			}
		}
		catch(B2BException lb2be_e)
		{
			setPreliquidacion(false);

			clh_LOGGER.error(lb2be_e);

			addMessage(lb2be_e);

			PrimeFaces.current().ajax().update(is_messageIdGrowl);

			throw lb2be_e;
		}
	}

	/**
	 * Hace un reset a la información que pudiera estar contenida y relacionada al predio eliminado.
	 *
	 * @param addp_datosPredio Objeto contenedor de la información del círculo al cual pertenece el predio eliminado
	 * @param acdas_allDatosAnt Datos de los predios restantes despues de la eliminación
	 * @param adas_datoAnt Dato el cual fue eliminado
	 * @param ab_procesoCertificados indica se el proceso se invoca desde certificados
	 */
	private void procesoEliminarDatosPredio(
	    DatosDelPredio addp_datosPredio, Collection<DatosAntSistema> acdas_allDatosAnt, DatosAntSistema adas_datoAnt,
	    boolean ab_procesoCertificados
	)
	{
		if((addp_datosPredio != null) && (adas_datoAnt != null))
		{
			String ls_idDatosAnt;

			ls_idDatosAnt = StringUtils.getStringNotNull(adas_datoAnt.getIdDatosAntSistema());

			Collection<DetalleAntSistema> lcdas_detallesAnt;
			DetalleAntSistema             ldas_detalleAnt;

			lcdas_detallesAnt     = addp_datosPredio.getDetallesAntSisAgregados();
			ldas_detalleAnt       = addp_datosPredio.getDetalleAntSistema();

			Collection<DetalleAntSistema> lcdas_detalleTemp;

			lcdas_detalleTemp     = new LinkedList<DetalleAntSistema>(lcdas_detallesAnt);

			for(DetalleAntSistema ldas_temp : lcdas_detalleTemp)
			{
				if(ldas_temp != null)
				{
					String ls_idDatosTemp;

					ls_idDatosTemp = StringUtils.getStringNotNull(ldas_temp.getIdDatosAntSistema());

					if(ls_idDatosTemp.equals(ls_idDatosAnt))
						lcdas_detallesAnt.remove(ldas_temp);
					else if(CollectionUtils.isValidCollection(acdas_allDatosAnt))
					{
						Iterator<DatosAntSistema> lidas_iterador;

						lidas_iterador = acdas_allDatosAnt.iterator();

						while(lidas_iterador.hasNext())
						{
							DatosAntSistema ldas_data;

							ldas_data = lidas_iterador.next();

							if(ldas_data != null)
							{
								String ls_idTemp;

								ls_idTemp = StringUtils.getStringNotNull(ldas_data.getIdDatosAntSistema());

								if(ls_idDatosTemp.equals(ls_idTemp))
									ldas_temp.setConsecutivoPredioAntSistema(
									    ldas_data.getConsecutivoPredioAntSistema()
									);
							}
						}
					}
				}
			}

			adas_datoAnt.setNombrePredio(null);
			adas_datoAnt.setCantidadCertificados(null);
			adas_datoAnt.setIdTipoPredio(null);
			adas_datoAnt.setIdMunicipio(null);

			if(ab_procesoCertificados)
			{
				adas_datoAnt.setIdCirculo(null);
				adas_datoAnt.setIdDepartamento(null);
			}

			if(ldas_detalleAnt != null)
			{
				ldas_detalleAnt.setIdLibroAntSistema(null);
				ldas_detalleAnt.setTomo(null);
				ldas_detalleAnt.setFolio(null);
				ldas_detalleAnt.setNumeroPartida(null);
				ldas_detalleAnt.setPartida(null);
				ldas_detalleAnt.setAnio(null);
				ldas_detalleAnt.setIdMatricula(null);
			}

			if(!CollectionUtils.isValidCollection(acdas_allDatosAnt))
				addp_datosPredio.setDatosAntSistemaGuardados(false);

			addp_datosPredio.setDatosAntSisAgregados(acdas_allDatosAnt);
			addp_datosPredio.setDetallesAntSisAgregados(lcdas_detallesAnt);

			addp_datosPredio.setModificarDatosAntSis(false);
		}
	}

	/**
	 * Retorna el valor del objeto de String.
	 *
	 * @param al_numeroMatricula correspondiente al valor del tipo de objeto Long
	 * @param as_nupre correspondiente al valor del tipo de objeto String
	 * @param as_circuloRegistral correspondiente al valor del tipo de objeto String
	 * @param as_circuloRegistralDestino correspondiente al valor del tipo de objeto String
	 * @param as_userId correspondiente al valor del tipo de objeto String
	 * @param am_circulosValidos correspondiente al valor del tipo de objeto Map<String,Boolean>
	 * @return devuelve el valor de String
	 * @throws B2BException Señala que se ha producido una excepción
	 *
	 */
	private String processCell(
	    Long al_numeroMatricula, String as_nupre, String as_circuloRegistral, String as_circuloRegistralDestino,
	    String as_userId, Map<String, Boolean> am_circulosValidos
	)
	    throws B2BException
	{
		boolean       lb_validNupre;
		StringBuilder lsb_msj;

		lb_validNupre     = StringUtils.isValidString(as_nupre);
		lsb_msj           = new StringBuilder();

		try
		{
			boolean lb_traslado;

			lb_traslado = StringUtils.isValidString(as_circuloRegistralDestino);

			{
				Long ll_tmp;

				ll_tmp = al_numeroMatricula;

				if(!NumericUtils.isValidLong(ll_tmp))
					lsb_msj.append(getMessages().getString(MessagesKeys.NUMERO_METRICULA_INVALIDO));
			}

			if(lb_validNupre && ExpresionRegular.getExpresionRegular().contieneCaracteresEspeciales(as_nupre))
				lsb_msj.append(getMessages().getString(MessagesKeys.NUPRE_CONTIENE_CARACTERES_ESPECIALES));

			{
				String ls_tmp;

				ls_tmp = as_circuloRegistral;

				if(!StringUtils.isValidString(ls_tmp))
					lsb_msj.append(getMessages().getString(MessagesKeys.EL_CIRCULO_REGISTRAL_ES_INVALIDO));
			}

			if(lb_traslado && StringUtils.isValidString(as_circuloRegistral))
			{
				Map<String, String> lmss_circulosDestino;

				lmss_circulosDestino = ipr_parameterRemote.getCirculosDestinoPorOrigen(as_circuloRegistral);

				if(as_circuloRegistralDestino.equalsIgnoreCase(as_circuloRegistral))
					lsb_msj.append(getMessages().getString(MessagesKeys.EL_CIRCULO_REGISTRAL_ORIGEN_DESTINO));

				if(
				    CollectionUtils.isValidCollection(lmss_circulosDestino)
					    && !lmss_circulosDestino.containsKey(as_circuloRegistralDestino)
				)
					lsb_msj.append(getMessages().getString(MessagesKeys.EL_CIRCULO_REGISTRAL_DESTINO_ORIGEN));
			}

			if(!StringUtils.isValidString(lsb_msj.toString()))
			{
				CirculoRegistral lcr_circulo;

				lcr_circulo = new CirculoRegistral();

				lcr_circulo.setIdCirculo(as_circuloRegistral);

				lcr_circulo = irr_registroRemote.findCirculoRegistralById(lcr_circulo, getUserId());

				if(lcr_circulo != null)
				{
					boolean lb_continuar;

					lb_continuar = true;

					if(lb_traslado)
					{
						CirculoRegistral lcr_circuloTemp;

						lcr_circuloTemp = new CirculoRegistral();

						lcr_circuloTemp.setIdCirculo(as_circuloRegistralDestino);

						lcr_circuloTemp     = irr_registroRemote.findCirculoRegistralById(lcr_circuloTemp, getUserId());
						lb_continuar        = lcr_circuloTemp != null;
					}

					if(lb_continuar)
					{
						boolean lb_circuloValido;
						boolean lb_validarCirculo;

						lb_circuloValido      = true;
						lb_validarCirculo     = false;

						if(CollectionUtils.isValidCollection(am_circulosValidos))
						{
							if(!am_circulosValidos.containsKey(as_circuloRegistral))
								lb_circuloValido = false;
							else
								lb_validarCirculo = true;
						}

						if(lb_circuloValido)
						{
							PredioRegistro lpr_predio;

							lpr_predio = new PredioRegistro();

							lpr_predio.setIdCirculo(lcr_circulo.getIdCirculo());
							lpr_predio.setIdMatricula(NumericUtils.getLong(al_numeroMatricula));
							lpr_predio.setNupre(as_nupre);
							lpr_predio.setValidNupre(lb_validNupre);
							lpr_predio.setValidMatricula(true);

							lpr_predio = irr_registroRemote.findPredioRegistroById(lpr_predio, getUserId());

							if(lpr_predio != null)
							{
								Collection<DatosDelPredio> lcddp_datosDelPredio;
								Collection<PredioActoIU>   lcpaui_tmp;
								int                        li_contarMatriculasIguales;
								int                        li_size;
								String                     ls_matriculaConcatenada;
								PredioActoIU               lpaui_nuevo;
								boolean                    lb_agregarMatricula;
								String                     ls_predioInconsistente;

								lcddp_datosDelPredio       = getDatosDelPredio();
								lcpaui_tmp                 = null;
								lb_agregarMatricula        = true;
								ls_predioInconsistente     = StringUtils.getStringNotNull(
									    lpr_predio.getPredioInconsistente()
									);

								if(lb_validarCirculo)
								{
									if(CollectionUtils.isValidCollection(lcddp_datosDelPredio))
									{
										for(DatosDelPredio lddp_iterador : lcddp_datosDelPredio)
										{
											if(lddp_iterador != null)
											{
												String ls_idCirculoIterador;

												ls_idCirculoIterador = lddp_iterador.getIdCirculo();

												if(
												    StringUtils.isValidString(ls_idCirculoIterador)
													    && ls_idCirculoIterador.equalsIgnoreCase(as_circuloRegistral)
												)
													lcpaui_tmp = lddp_iterador.getActosAsociadosGeneral();
											}
										}
									}
								}
								else
									lcpaui_tmp = getActosAsociadosGeneral();

								if(!CollectionUtils.isValidCollection(lcpaui_tmp))
									lcpaui_tmp = new ArrayList<PredioActoIU>();

								li_contarMatriculasIguales     = 0;
								li_size                        = lcpaui_tmp.size();
								lpaui_nuevo                    = new PredioActoIU(getColumns());
								ls_matriculaConcatenada        = as_circuloRegistral + "-" + al_numeroMatricula;

								lpaui_nuevo.setMatricula(ls_matriculaConcatenada);
								lpaui_nuevo.setIdMatricula(al_numeroMatricula);
								lpaui_nuevo.setIdCirculo(as_circuloRegistral);
								lpaui_nuevo.setIdCirculoDestino(as_circuloRegistralDestino);
								lpaui_nuevo.setEsPredioInconsistente(
								    ls_predioInconsistente.equalsIgnoreCase(EstadoCommon.S)
								);

								if(isProcesoCertificados())
									lpaui_nuevo.setCantidad(NumericUtils.getLongWrapper(1L));

								{
									DireccionPredio ld_direccion;

									ld_direccion = new DireccionPredio();

									ld_direccion.setIdCirculo(lpr_predio.getIdCirculo());
									ld_direccion.setIdMatricula(
									    NumericUtils.getLongWrapper(lpr_predio.getIdMatricula())
									);

									ld_direccion = irr_registroRemote.findDireccionPredioById(
										    ld_direccion, getUserId()
										);

									if(ld_direccion != null)
									{
										String ls_address;

										ls_address = ld_direccion.getDireccion();

										if(StringUtils.isValidString(ls_address))
											lpaui_nuevo.setDireccion(ls_address);
									}
									else
										lsb_msj.append(
										    "La Matrícula Inmobiliaria " + ls_matriculaConcatenada
										    + " No tiene Relacionada una dirección. "
										);

									lpaui_nuevo.setConsecutivo(li_size + 1);
								}

								if(CollectionUtils.isValidCollection(lcpaui_tmp))
								{
									for(PredioActoIU lpaui_actual : lcpaui_tmp)
									{
										if(lpaui_actual != null)
										{
											String ls_matriculaCargada;

											ls_matriculaCargada = lpaui_actual.getMatricula();

											if(ls_matriculaConcatenada.equalsIgnoreCase(ls_matriculaCargada))
												li_contarMatriculasIguales++;
										}
									}
								}

								ls_predioInconsistente = StringUtils.getStringNotNull(
									    lpr_predio.getPredioInconsistente()
									);

								{
									String ls_estadoPredio;

									ls_estadoPredio = lpr_predio.getIdEstadoPredio();

									if(StringUtils.isValidString(ls_estadoPredio))
									{
										EstadoPredio lep_estado;

										lep_estado = new EstadoPredio();

										lep_estado.setIdEstadoPredio(ls_estadoPredio);

										lep_estado = irr_registroRemote.findEstadoPredioById(lep_estado, getUserId());

										if(lep_estado != null)
										{
											String ls_estado;

											ls_estado = StringUtils.getStringNotNull(lep_estado.getIdEstadoPredio());

											if(ls_estado.equalsIgnoreCase(EstadoCommon.C))
												lsb_msj.append(
												    "La Matrícula Inmobiliaria " + ls_matriculaConcatenada
												    + " a incluir esta en estado 'CERRADO'. "
												);
											else if(ls_estado.equalsIgnoreCase(EstadoCommon.A))
											{
												lsb_msj.append(
												    "La Matrícula Inmobiliaria " + ls_matriculaConcatenada
												    + " a incluir esta en estado 'ANULADO'. "
												);

												lb_agregarMatricula = false;
											}
											else if(ls_estado.equalsIgnoreCase(EstadoCommon.T))
											{
												lsb_msj.append(
												    "La Matrícula Inmobiliaria " + ls_matriculaConcatenada
												    + " a incluir esta en estado 'TRASLADADO'. "
												);

												lb_agregarMatricula = false;
											}
											else if(ls_predioInconsistente.equals(EstadoCommon.S))
											{
												lsb_msj.append(
												    "La Matrícula Inmobiliaria " + ls_matriculaConcatenada
												    + " a incluir esta en estado 'PREDIO INCONSISTENTE'. "
												);

												lb_agregarMatricula = false;
											}
										}
									}
								}

								if(lb_agregarMatricula)
								{
									if((li_contarMatriculasIguales < 1))
									{
										lcpaui_tmp.add(lpaui_nuevo);

										if(ls_predioInconsistente.equals(EstadoCommon.S))
										{
											lsb_msj.append(
											    "La Matrícula Inmobiliaria " + ls_matriculaConcatenada
											    + " a incluir esta en estado 'PREDIO INCONSISTENTE'. "
											);

											lb_agregarMatricula = false;
										}
										else
											lsb_msj.append(
											    "La Matrícula Inmobiliaria " + ls_matriculaConcatenada
											    + " Insertada correctamente. "
											);

										if(lb_validarCirculo)
										{
											if(CollectionUtils.isValidCollection(lcddp_datosDelPredio))
											{
												for(DatosDelPredio lddp_iterador : lcddp_datosDelPredio)
												{
													if(lddp_iterador != null)
													{
														String ls_idCirculoIterador;

														ls_idCirculoIterador = lddp_iterador.getIdCirculo();

														if(
														    StringUtils.isValidString(ls_idCirculoIterador)
															    && ls_idCirculoIterador.equalsIgnoreCase(
															        as_circuloRegistral
															    )
														)
															lddp_iterador.setActosAsociadosGeneral(lcpaui_tmp);
													}
												}
											}
										}
										else
											setActosAsociadosGeneral(lcpaui_tmp);

										{
											RegistroAnotacionProhibicion lrap_rap;

											lrap_rap = irr_registroRemote.findRegistroAnotacionProhibicionByCirMat(
												    getSolicitud(), as_circuloRegistral,
												    NumericUtils.getLong(al_numeroMatricula), getUserId(),
												    getLocalIpAddress(), getRemoteIpAddress()
												);

											if(lrap_rap != null)
											{
												if(lrap_rap.isAlerta())
												{
													String ls_errorKey;

													ls_errorKey = lrap_rap.getErrorKey();

													if(StringUtils.isValidString(ls_errorKey))
														lsb_msj.append(
														    getMessages()
															        .getString(ls_errorKey, lrap_rap.getMessageArgs())
														);
												}
											}
										}

										{
											Collection<String> lcs_turnosBloqueo;

											lcs_turnosBloqueo = irr_registroRemote.findTurnosBloqueoPredio(lpr_predio);

											if(CollectionUtils.isValidCollection(lcs_turnosBloqueo))
											{
												Iterator<String> lis_turnosBloqueo;
												String           ls_turnosBloqueo;

												lis_turnosBloqueo     = lcs_turnosBloqueo.iterator();
												ls_turnosBloqueo      = "";

												while(lis_turnosBloqueo.hasNext())
												{
													String ls_turnoTemp;
													String ls_espacio;

													ls_turnoTemp     = lis_turnosBloqueo.next();
													ls_espacio       = lis_turnosBloqueo.hasNext() ? ",\n" : "\n";

													if(StringUtils.isValidString(ls_turnoTemp))
														ls_turnosBloqueo = ls_turnosBloqueo + ls_espacio + ls_turnoTemp;
												}

												lsb_msj.append(
												    "El folio de matrícula " + ls_matriculaConcatenada
												    + " se encuentra bloqueado con los turnos: " + ls_turnosBloqueo
												);
											}
										}
									}
									else
										lsb_msj.append(
										    "La Matrícula Inmobiliaria " + ls_matriculaConcatenada
										    + " Ya se encuentra insertada en la tabla. "
										);
								}
								else
									setContadorMatriculasErroneas(getContadorMatriculasErroneas() + 1);
							}
							else
							{
								String ls_msg;

								if(lb_validNupre)
									ls_msg = "La Matrícula Inmobiliaria " + as_circuloRegistral + "-"
										+ al_numeroMatricula + " y Nupre:" + as_nupre + " No Encontrado o no Existe.";
								else
									ls_msg = "La Matrícula Inmobiliaria " + as_circuloRegistral + "-"
										+ al_numeroMatricula + " No Encontrado o no Existe.";

								lsb_msj.append(ls_msg);

								setContadorMatriculasErroneas(getContadorMatriculasErroneas() + 1);
							}
						}
						else
						{
							setContadorMatriculasErroneas(getContadorMatriculasErroneas() + 1);

							lsb_msj.append(
							    "La matrícula: " + as_circuloRegistral + "-" + al_numeroMatricula
							    + " con círculo registral: " + as_circuloRegistral
							    + " no corresponde a ninguno de los círculos registrales ingresados en la sección datos del acto."
							);
						}
					}
					else
					{
						setContadorMatriculasErroneas(getContadorMatriculasErroneas() + 1);

						lsb_msj.append(
						    "El Circulo Registral" + as_circuloRegistralDestino + " No Encontrado o no Existe."
						);
					}
				}
				else
				{
					setContadorMatriculasErroneas(getContadorMatriculasErroneas() + 1);

					lsb_msj.append("El Circulo Registral" + as_circuloRegistral + " No Encontrado o no Existe.");
				}
			}
			else
				setContadorMatriculasErroneas(getContadorMatriculasErroneas() + 1);
		}
		catch(B2BException lb2be_e)
		{
			lsb_msj.append(lb2be_e.getMessage());
		}

		return lsb_msj.toString();
	}

	/**
	 * Retorna el valor del objeto de String.
	 *
	 * @param al_numeroMatricula correspondiente al valor del tipo de objeto Long
	 * @param aoms_oms correspondiente al valor del tipo de objeto MatriculaSegregacionUi
	 * @param as_userId correspondiente al valor del tipo de objeto String
	 * @param as_solicitud correspondiente al valor del tipo de objeto String
	 * @param ab_obligatorio correspondiente al valor del tipo de objeto boolean
	 * @param addp_ddp correspondiente al valor del tipo de objeto DatosDelPredio
	 * @return devuelve el valor de String
	 * @throws B2BException Señala que se ha producido una excepción
	 *
	 */

	/* MODIFCAR PREDIAL */
	private String processCellPredial(
	    Long al_numeroMatricula, MatriculaSegregacionUi aoms_oms, String as_userId, String as_solicitud,
	    boolean ab_obligatorio, DatosDelPredio addp_ddp
	)
	    throws B2BException
	{
		StringBuilder                      lsb_msj;
		Collection<PredioActoIU>           lcpaiu_tmp;
		Collection<MatriculaSegregacionUi> lcms_mstp;
		int                                li_matricula;
		PredioActoIU                       lopaiu_tmp;
		Long                               ll_matricula;
		String                             ls_matricula;
		String                             ls_circuloRegistral;

		lsb_msj                 = new StringBuilder();
		lcpaiu_tmp              = (addp_ddp != null) ? addp_ddp.getActosAsociadosGeneral() : null;
		lcms_mstp               = (addp_ddp != null) ? addp_ddp.getDataInfoPredial() : null;
		lopaiu_tmp              = new PredioActoIU();
		ls_circuloRegistral     = null;
		ll_matricula            = null;

		if(aoms_oms != null)
		{
			if(CollectionUtils.isValidCollection(lcpaiu_tmp))
			{
				li_matricula = lcpaiu_tmp.size();

				for(PredioActoIU lopa_tmp : lcpaiu_tmp)
				{
					if(lopa_tmp.getConsecutivo() == li_matricula)
						lopaiu_tmp = lopa_tmp;
				}
			}
			else
			{
				Collection<DatosDelPredio> lcddp_datosDelPredio;

				lcddp_datosDelPredio     = getDatosDelPredio();
				lcpaiu_tmp               = new ArrayList<PredioActoIU>();

				if(CollectionUtils.isValidCollection(lcddp_datosDelPredio))
				{
					for(DatosDelPredio lddp_iterador : lcddp_datosDelPredio)
					{
						if(lddp_iterador != null)
						{
							Collection<PredioActoIU> lcpaiu_data;

							lcpaiu_data = lddp_iterador.getActosAsociadosGeneral();

							if(CollectionUtils.isValidCollection(lcpaiu_data))
							{
								for(PredioActoIU lpaiu_iterador : lcpaiu_data)
								{
									if(lpaiu_iterador != null)
										lcpaiu_tmp.add(lpaiu_iterador);
								}
							}
						}
					}
				}

				if(CollectionUtils.isValidCollection(lcpaiu_tmp))
				{
					li_matricula = lcpaiu_tmp.size();

					for(PredioActoIU lopa_tmp : lcpaiu_tmp)
					{
						if(lopa_tmp.getConsecutivo() == li_matricula)
							lopaiu_tmp = lopa_tmp;
					}
				}
			}

			if(lopaiu_tmp != null)
			{
				if(!NumericUtils.isValidLong(aoms_oms.getUnidad()))
					lsb_msj.append("El Número Unidad es inválido. ");

				if(!StringUtils.isValidString(aoms_oms.getNombrePredio()))
					lsb_msj.append("El Campo Nombre predio es inválido.");

				if(!NumericUtils.isValidDouble(aoms_oms.getAreaTerreno()))
					lsb_msj.append("El Campo Nombre predio es inválido.");

				if(!NumericUtils.isValidDouble(aoms_oms.getAreaPrivada()) && ab_obligatorio)
					lsb_msj.append("El Número de Área  privada es inválido.");

				if(!NumericUtils.isValidDouble(aoms_oms.getAreaConstruida()) && ab_obligatorio)
					lsb_msj.append("El Número de Área  construida es inválido.");

				if(!NumericUtils.isValidDouble(aoms_oms.getCoeficiente()) && ab_obligatorio)
					lsb_msj.append("El campo  de coeficiente de propiedad es inválido.");

				if(!NumericUtils.isValidLong(aoms_oms.getCantidadCertificados()))
					lsb_msj.append("La cantidad de certificados es inválida. ");

				if(!StringUtils.isValidString(lsb_msj.toString()))
				{
					ls_matricula = lopaiu_tmp.getMatricula();

					if(!StringUtils.isValidString(ls_matricula))
						ls_matricula = lopaiu_tmp.getIdCirculo() + "-" + lopaiu_tmp.getIdMatricula();

					if(StringUtils.isValidString(ls_matricula))
					{
						int li_inicio;

						if(ls_matricula.contains("-"))
						{
							li_inicio               = ls_matricula.lastIndexOf("-");
							ls_circuloRegistral     = ls_matricula.substring(0, li_inicio);
							ls_matricula            = ls_matricula.substring(li_inicio + 1, ls_matricula.length());

							if(StringUtils.isValidString(ls_matricula))
							{
								try
								{
									ll_matricula = NumericUtils.getLongWrapper(ls_matricula);
								}
								catch(NumberFormatException lnfe_fe)
								{
									ll_matricula = null;
								}
							}
						}
					}

					if(StringUtils.isValidString(lopaiu_tmp.getDireccion()))
						aoms_oms.setDireccion(lopaiu_tmp.getDireccion());

					if(StringUtils.isValidString(ls_circuloRegistral) && NumericUtils.isValidLong(ll_matricula))
					{
						aoms_oms.setIdCirculoMatriz(ls_circuloRegistral);
						aoms_oms.setMatriculaMatriz(ll_matricula);
						aoms_oms.setCertificadoAsociado(true);
						aoms_oms.setCantidad(NumericUtils.getLongWrapper(1L));
						aoms_oms.setIdSolicitud((as_solicitud));
					}

					if(!CollectionUtils.isValidCollection(lcms_mstp))
						lcms_mstp = new ArrayList<MatriculaSegregacionUi>();

					lcms_mstp.add(aoms_oms);

					if(addp_ddp != null)
						addp_ddp.setDataInfoPredial(lcms_mstp);

					lsb_msj.append("Predio:" + aoms_oms.getNombrePredio() + ",Insertado correctamente.");
				}
			}
		}

		return lsb_msj.toString();
	}

	/**
	 * Carga la información de los datos del turno anterior para nueva entrada.
	 *
	 * @throws B2BException Señala que se ha producido una excepción
	 */
	private void realizarValidacionesDatosPredioNuevaEntrada()
	    throws B2BException
	{
		Collection<DatosDelPredio> lcddp_datosPredios;

		lcddp_datosPredios = getDatosDelPredio();

		if(CollectionUtils.isValidCollection(lcddp_datosPredios))
		{
			for(DatosDelPredio lddp_data : lcddp_datosPredios)
			{
				if(lddp_data != null)
				{
					Collection<PredioActoIU> lcpaiu_predioActos;

					lcpaiu_predioActos = lddp_data.getActosAsociadosGeneral();

					if(CollectionUtils.isValidCollection(lcpaiu_predioActos))
					{
						for(PredioActoIU lpaiu_temp : lcpaiu_predioActos)
						{
							if(lpaiu_temp != null)
							{
								List<ColumnModel> llcm_columns;

								llcm_columns = lddp_data.getColumns();

								if(CollectionUtils.isValidCollection(llcm_columns))
								{
									Iterator<ColumnModel> licm_iterador;
									boolean               lb_valido;

									licm_iterador     = llcm_columns.iterator();
									lb_valido         = false;

									while(licm_iterador.hasNext() && !lb_valido)
									{
										ColumnModel lcm_column;

										lcm_column = licm_iterador.next();

										if(lcm_column != null)
										{
											mostrarDescripcionArea(lpaiu_temp, lddp_data, lcm_column);

											lb_valido = true;
										}
									}
								}
							}
						}
					}

					SolicitudAsociada                lsa_solicitud;
					Collection<MatriculaSegregacion> lcms_matrSegregacion;

					lsa_solicitud = getSolicitudAsociada();

					if(lsa_solicitud != null)
					{
						lcms_matrSegregacion = irr_registroRemote.findMatriculaSegregacionByIdSolicitud(
							    lsa_solicitud.getIdSolicitud1(), null
							);

						if(CollectionUtils.isValidCollection(lcms_matrSegregacion))
						{
							Iterator<MatriculaSegregacion> lims_iterador;
							boolean                        lb_encontro;

							lims_iterador     = lcms_matrSegregacion.iterator();
							lb_encontro       = false;

							while(lims_iterador.hasNext() && !lb_encontro)
							{
								MatriculaSegregacion lms_matriculaSeg;

								lms_matriculaSeg = lims_iterador.next();

								if(lms_matriculaSeg != null)
								{
									lms_matriculaSeg.setAreaConstruidaLectura(
									    StringUtils.getString(lms_matriculaSeg.getAreaConstruida())
									);
									lms_matriculaSeg.setAreaPrivadaLectura(
									    StringUtils.getString(lms_matriculaSeg.getAreaPrivada())
									);
									lms_matriculaSeg.setAreaTerrenoLectura(
									    StringUtils.getString(lms_matriculaSeg.getAreaTerreno())
									);

									lddp_data.setMatriculaSegregacion(lms_matriculaSeg);

									lb_encontro = true;
								}
							}
						}
					}
				}
			}
		}
	}

	/**
	 * Salvar solicitud matricula.
	 *
	 * @throws B2BException Señala que se ha producido una excepción
	 */
	private void salvarSolicitudMatricula()
	    throws B2BException
	{
		Collection<PredioActoIU> lcpaiu_datos;
		Solicitud                ls_solicitud;

		lcpaiu_datos     = getActosAsociadosGeneral();
		ls_solicitud     = getSolicitud();

		if(CollectionUtils.isValidCollection(lcpaiu_datos) && (ls_solicitud != null))
		{
			String ls_idSolicitud;

			ls_idSolicitud = ls_solicitud.getIdSolicitud();

			if(StringUtils.isValidString(ls_idSolicitud))
			{
				for(PredioActoIU lpaiu_iterador : lcpaiu_datos)
				{
					if(lpaiu_iterador != null)
					{
						String             ls_matricula;
						SolicitudMatricula lsm_insert;

						ls_matricula     = lpaiu_iterador.getMatricula();
						lsm_insert       = new SolicitudMatricula();

						if(StringUtils.isValidString(ls_matricula))
						{
							long     ll_idMatricula;
							String[] lsa_matricula;
							String   ls_idCirculo;

							lsa_matricula = ls_matricula.split("-");

							if(lsa_matricula.length > 1)
							{
								ls_idCirculo       = lsa_matricula[0];
								ll_idMatricula     = NumericUtils.getLong(lsa_matricula[1]);

								lsm_insert.setIdCirculo(ls_idCirculo);
								lsm_insert.setIdMatricula(ll_idMatricula);
								lsm_insert.setIdSolicitud(ls_idSolicitud);

								if(lpaiu_iterador.isCertificadoAsociado())
								{
									lsm_insert.setExpedirCertificado(EstadoCommon.S);
									lsm_insert.setCantidadCertificados(
									    NumericUtils.getBigDecimal(NumericUtils.getLong(lpaiu_iterador.getCantidad()))
									);
								}
								else
									lsm_insert.setExpedirCertificado(EstadoCommon.N);

								lsm_insert.setCantidadAperturar(lpaiu_iterador.getCantidadAperturar());

								irr_registroRemote.salvarSolicitudMatricula(
								    lsm_insert, getUserId(), getLocalIpAddress(), getRemoteIpAddress()
								);
							}
						}
						else
							throw new B2BException(ErrorKeys.MATRICULAS_FORMATO);
					}
				}
			}
		}
	}

	/**
	 * Save property acts.
	 *
	 * @throws B2BException Señala que se ha producido una excepción
	 */
	private void savePropertyActs()
	    throws B2BException
	{
		try
		{
			Collection<MatriculaSegregacion> lcms_ms;
			MatriculaSegregacion             lms_ms;
			Collection<DatosDelPredio>       lcddp_datosPredio;
			Collection<DatosPredioRegistro>  lcdpr_predioRegistro;

			lcms_ms                  = new ArrayList<MatriculaSegregacion>();
			lcddp_datosPredio        = getDatosDelPredio();
			lcdpr_predioRegistro     = new LinkedList<DatosPredioRegistro>();

			if(!CollectionUtils.isValidCollection(lcddp_datosPredio))
				throw new B2BException(ErrorKeys.ERROR_INTERNO_SISTEMA);

			for(DatosDelPredio lddp_iterador : lcddp_datosPredio)
			{
				if(lddp_iterador != null)
				{
					String              ls_tipoRequiereMatricula;
					String              ls_idCirculo;
					DatosPredioRegistro ldpr_datosPredio;

					ls_tipoRequiereMatricula     = lddp_iterador.getEleccionRequiereMatricula();
					ls_idCirculo                 = lddp_iterador.getIdCirculo();
					ldpr_datosPredio             = new DatosPredioRegistro();

					if(!StringUtils.isValidString(ls_tipoRequiereMatricula))
					{
						Object[] loa_messageArgs;
						loa_messageArgs     = new String[1];

						loa_messageArgs[0] = ls_idCirculo + " - " + lddp_iterador.getNombreCirculo();

						throw new B2BException(ErrorKeys.ERROR_SIN_TIPO_REQUIERE_MATRICULA, loa_messageArgs);
					}

					ldpr_datosPredio.setTipoRequiereMatricula(ls_tipoRequiereMatricula);

					List<ColumnModel> llcm_colums;

					llcm_colums = lddp_iterador.getColumns();

					if(CollectionUtils.isValidCollection(llcm_colums))
					{
						for(ColumnModel lcm_data : llcm_colums)
						{
							if(lcm_data != null)
								ldpr_datosPredio.getIdActos().add(lcm_data.getIdActo());
						}
					}

					if(
					    ls_tipoRequiereMatricula.equals(TipoRequiereMatriculaCommon.CON_MATRICULA)
						    || ls_tipoRequiereMatricula.equals(
						        TipoRequiereMatriculaCommon.DATOS_CON_MATRICULA_Y_SIN_MATRICULA
						    )
					)
					{
						Collection<SolicitudMatriculaActo> lcsma_datosBandejaActos;
						Collection<SolicitudMatricula>     lcsm_datosBandejaPredios;
						Solicitud                          ls_solicitud;

						lcsma_datosBandejaActos      = new ArrayList<SolicitudMatriculaActo>();
						lcsm_datosBandejaPredios     = new ArrayList<SolicitudMatricula>();
						ls_solicitud                 = getSolicitud();

						if(ls_solicitud == null)
							throw new B2BException(ErrorKeys.NO_SE_ENCONTRO_SOLICITUD);

						String ls_idProceso;

						ls_idProceso = ls_solicitud.getIdProceso();

						if(!StringUtils.isValidString(ls_idProceso))
							throw new B2BException(ErrorKeys.ERROR_SIN_ID_PROCESO);

						boolean                  lb_procesoEnglobes;
						boolean                  lb_procesoDesenglobes;
						boolean                  lb_procesoVentaParcial;
						boolean                  lb_procesoReloteo;
						Collection<PredioActoIU> lcpaui_bandeja;
						MatriculaSegregacion     lsm_matriculaSegregacion;

						lb_procesoEnglobes           = lddp_iterador.isEnglobes();
						lb_procesoDesenglobes        = lddp_iterador.isDesenglobes();
						lb_procesoVentaParcial       = lddp_iterador.isVentaParcial();
						lb_procesoReloteo            = lddp_iterador.isReloteo();
						lcpaui_bandeja               = lddp_iterador.getActosAsociadosGeneral();
						lsm_matriculaSegregacion     = null;

						if(lb_procesoEnglobes || lb_procesoVentaParcial || lb_procesoDesenglobes)
						{
							lsm_matriculaSegregacion = lddp_iterador.getMatriculaSegregacion();

							lsm_matriculaSegregacion.setIdCirculoMatriz(ls_idCirculo);
							lsm_matriculaSegregacion.setCementerio(!isNoCementerio());
						}

						if(!CollectionUtils.isValidCollection(lcpaui_bandeja))
						{
							Object[] loa_messageArgs;
							loa_messageArgs     = new String[1];

							loa_messageArgs[0] = ls_idCirculo + " - " + lddp_iterador.getNombreCirculo();

							throw new B2BException(ErrorKeys.ERROR_MATRICULA_PREDIO_CIRCULO, loa_messageArgs);
						}

						boolean              lb_matriculaProceso;
						long                 ll_cantidadCertificadosSolicitud;
						Map<String, Boolean> lmsb_actosVerificacion;

						lb_matriculaProceso                  = false;
						ll_cantidadCertificadosSolicitud     = 0L;
						lmsb_actosVerificacion               = new HashMap<String, Boolean>();

						if(lb_procesoEnglobes || lb_procesoReloteo)
						{
							if(lcpaui_bandeja.size() < 2)
							{
								Object[] loa_messageArgs = new String[1];
								loa_messageArgs[0] = ls_idCirculo + " - " + lddp_iterador.getNombreCirculo();

								throw new B2BException(
								    lb_procesoReloteo ? ErrorKeys.ERROR_RELOTEO_MATRICULAS
								                      : ErrorKeys.ERROR_ENGLOBES_MATRICULAS, loa_messageArgs
								);
							}
						}

						if(lb_procesoVentaParcial || lb_procesoDesenglobes)
						{
							if(lcpaui_bandeja.size() != 1)
							{
								Object[] loa_messageArgs = new String[1];
								loa_messageArgs[0] = ls_idCirculo + " - " + lddp_iterador.getNombreCirculo();

								if(lb_procesoVentaParcial)
									throw new B2BException(ErrorKeys.ERROR_VENTA_PARCIAL_ACTOS, loa_messageArgs);
								else
									throw new B2BException(ErrorKeys.ERROR_DESENGLOBE_ACTOS, loa_messageArgs);
							}
						}

						long ll_cantidadTotal;
						ll_cantidadTotal = 0;

						for(PredioActoIU lpaui_actual : lcpaui_bandeja)
						{
							if(lpaui_actual != null)
							{
								SolicitudMatricula lsm_matricula;
								String             ls_matricula;

								lsm_matricula     = new SolicitudMatricula();
								ls_matricula      = lpaui_actual.getMatricula();

								if(
								    (lb_procesoEnglobes || lb_procesoDesenglobes || lb_procesoVentaParcial
									    || lb_procesoReloteo) && !lb_matriculaProceso
								)
								{
									Long ll_idMatriculaPredio;

									ll_idMatriculaPredio = lpaui_actual.getIdMatricula();

									if(
									    NumericUtils.isValidLong(ll_idMatriculaPredio)
										    && (lsm_matriculaSegregacion != null)
									)
									{
										lsm_matriculaSegregacion.setMatriculaMatriz(ll_idMatriculaPredio);

										lb_matriculaProceso = true;
									}

									if(lb_procesoReloteo)
									{
										Constantes lc_constanteLoteo;

										lc_constanteLoteo = new Constantes();

										lc_constanteLoteo.setIdConstante(ConstanteCommon.CODIGOS_ACTOS_LOTEO);

										lc_constanteLoteo = ipr_parameterRemote.findConstantById(lc_constanteLoteo);

										if(lc_constanteLoteo != null)
										{
											String ls_codigoLoteo;

											ls_codigoLoteo = lc_constanteLoteo.getCaracter();

											if(StringUtils.isValidString(ls_codigoLoteo))
											{
												AnotacionPredio lap_anotacionPredio;
												Long            ll_idMatriculaTemp;

												lap_anotacionPredio     = new AnotacionPredio();
												ll_idMatriculaTemp      = null;

												lap_anotacionPredio.setIdCirculo(ls_idCirculo);

												if(ls_matricula.contains("-"))
												{
													int li_inicio;

													li_inicio              = ls_matricula.lastIndexOf("-");
													ll_idMatriculaTemp     = NumericUtils.getLongWrapper(
														    ls_matricula.substring(
														        li_inicio + 1, ls_matricula.length()
														    )
														);
												}
												else
													ll_idMatriculaTemp = NumericUtils.getLongWrapper(ls_matricula);

												lap_anotacionPredio.setIdMatricula(ll_idMatriculaTemp);
												lap_anotacionPredio.setIdNaturalezaJuridica(ls_codigoLoteo);

												if(!irr_registroRemote.validarAnotacionLoteo(lap_anotacionPredio))
												{
													Object[] loa_messageArgs;

													loa_messageArgs        = new String[2];
													loa_messageArgs[0]     = ls_idCirculo;
													loa_messageArgs[1]     = ls_matricula;

													throw new B2BException(
													    ErrorKeys.ERROR_ANOTACION_LOTEO, loa_messageArgs
													);
												}
											}
										}
									}
								}

								if(StringUtils.isValidString(ls_matricula))
								{
									String ls_circuloRegistral;
									long   ll_matricula;

									if(!ls_matricula.contains("-"))
									{
										Object[] loa_messageArgs = new String[1];
										loa_messageArgs[0] = ls_matricula;
										throw new B2BException(
										    ErrorKeys.MATRICULA_INMOBILIARIA_INVALIDA, loa_messageArgs
										);
									}

									int li_inicio = 0;

									li_inicio     = ls_matricula.lastIndexOf("-");

									ll_matricula     = NumericUtils.getLong(
										    ls_matricula.substring(li_inicio + 1, ls_matricula.length())
										);

									ls_circuloRegistral = ls_matricula.substring(0, li_inicio);

									{
										boolean lb_certificadoAsociado;

										lb_certificadoAsociado = false;

										CirculoRegistral lcr_circulo;

										lcr_circulo = new CirculoRegistral();

										lcr_circulo.setIdCirculo(ls_circuloRegistral);

										lcr_circulo = irr_registroRemote.findCirculoRegistralById(
											    lcr_circulo, getUserId()
											);

										if(lcr_circulo != null)
										{
											boolean        lb_nupreValido;
											PredioRegistro lpr_predio;
											String         ls_nupre;

											ls_nupre           = lpaui_actual.getNupre();
											lb_nupreValido     = StringUtils.isValidString(ls_nupre);
											lpr_predio         = new PredioRegistro();

											lpr_predio.setIdCirculo(ls_circuloRegistral);
											lpr_predio.setIdMatricula(ll_matricula);
											lpr_predio.setNupre(ls_nupre);
											lpr_predio.setValidNupre(lb_nupreValido);

											lpr_predio = irr_registroRemote.findPredioRegistroById(
												    lpr_predio, getUserId()
												);

											if(lpr_predio != null)
											{
												long   ll_cantidadAperturar;
												String ls_cementerio;

												ll_cantidadAperturar     = NumericUtils.getLong(
													    lpaui_actual.getCantidadAperturar()
													);
												ls_cementerio            = null;

												if(lb_procesoVentaParcial)
													ls_cementerio = isNoCementerio() ? "N" : "S";

												lsm_matricula.setIdMatricula(ll_matricula);
												lsm_matricula.setIdCirculo(ls_circuloRegistral);
												lsm_matricula.setIdSolicitud(getSolicitud().getIdSolicitud());
												lb_certificadoAsociado = lpaui_actual.isCertificadoAsociado();
												lsm_matricula.setCantidadAperturar(
												    NumericUtils.getLongWrapper(ll_cantidadAperturar)
												);

												ll_cantidadTotal = ll_cantidadTotal + ll_cantidadAperturar;

												lsm_matricula.setExpedirCertificado(lb_certificadoAsociado ? "S" : "N");
												lsm_matricula.setCementerio(ls_cementerio);

												if(lb_certificadoAsociado)
												{
													long ll_cantidadCertificados;

													ll_cantidadCertificados     = NumericUtils.getLong(
														    lpaui_actual.getCantidad()
														);

													ll_cantidadCertificadosSolicitud = ll_cantidadCertificadosSolicitud
														+ ll_cantidadCertificados;

													if(
													    NumericUtils.isValidLong(
														        NumericUtils.getLongWrapper(ll_cantidadCertificados), 1
														    )
													)
														lsm_matricula.setCantidadCertificados(
														    NumericUtils.getBigDecimal(ll_cantidadCertificados)
														);
													else
													{
														Object[] loa_messageArgs;
														loa_messageArgs     = new String[1];

														loa_messageArgs[0] = ls_matricula;

														throw new B2BException(
														    ErrorKeys.ERROR_CANTIDAD_CERTIFICADOS_NO_VALIDA_MATRICULA,
														    loa_messageArgs
														);
													}
												}
												else
													lsm_matricula.setCantidadCertificados(new BigDecimal(0));

												lsm_matricula.setIdUsuarioCreacion(getUserId());
											}
											else
											{
												Object[] loa_messageArgs;
												loa_messageArgs     = new String[1];

												loa_messageArgs[0] = ls_circuloRegistral + " - " + ll_matricula;

												throw new B2BException(
												    ErrorKeys.MATRICULA_INMOBILIARIA_NO_ENCONTRADA, loa_messageArgs
												);
											}
										}
										else
										{
											Object[] loa_messageArgs;
											loa_messageArgs     = new String[1];

											loa_messageArgs[0] = ls_circuloRegistral;

											throw new B2BException(
											    ErrorKeys.CIRCULO_REGISTRAL_NO_ENCONTRADO, loa_messageArgs
											);
										}
									}

									{
										List<ColumnModel> llcm_lcm;

										llcm_lcm = getListadoColumns();

										if(CollectionUtils.isValidCollection(llcm_lcm))
										{
											Map<String, Boolean> lmsb_actos;
											boolean              lb_ActoAsocido;

											lb_ActoAsocido     = false;

											lmsb_actos = lpaui_actual.getActos();

											for(ColumnModel lcm_tmp : llcm_lcm)
											{
												if(lcm_tmp != null)
												{
													boolean lb_actoAsociado;
													String  ls_idActo;

													lb_actoAsociado     = false;
													ls_idActo           = lcm_tmp.getIdActo();

													if(StringUtils.isValidString(ls_idActo))
														lb_actoAsociado = BooleanUtils.getBooleanValue(
															    lmsb_actos.get(ls_idActo)
															);

													if(lb_actoAsociado)
													{
														SolicitudMatriculaActo lsma_matriculaActo;

														lsma_matriculaActo = new SolicitudMatriculaActo();

														lsma_matriculaActo.setIdSolicitud(
														    getSolicitud().getIdSolicitud()
														);
														lsma_matriculaActo.setIdCirculo(ls_circuloRegistral);
														lsma_matriculaActo.setIdMatricula(ll_matricula);
														lsma_matriculaActo.setIdActo(lcm_tmp.getIdActo());
														lsma_matriculaActo.setUsuario(getUserId());

														if(lpaui_actual.isRegistroParcial())
															lsma_matriculaActo.setMotivoTramite("REGISTRO PARCIAL");

														lcsma_datosBandejaActos.add(lsma_matriculaActo);

														lb_ActoAsocido = true;

														lmsb_actosVerificacion.put(
														    ls_idActo, new Boolean(lb_actoAsociado)
														);
													}
													else
													{
														if(!lmsb_actosVerificacion.containsKey(ls_idActo))
															lmsb_actosVerificacion.put(
															    ls_idActo, new Boolean(lb_actoAsociado)
															);
													}
												}
											}

											ldpr_datosPredio.setDatosBandejaActos(lcsma_datosBandejaActos);

											if(!lb_ActoAsocido)
											{
												Object[] loa_messageArgs;
												loa_messageArgs     = new String[1];

												loa_messageArgs[0] = ls_circuloRegistral + " - " + ll_matricula;

												throw new B2BException(
												    ErrorKeys.DEBE_DIGITAR_ACTOS_ASOCIADOS_MATRICULA, loa_messageArgs
												);
											}
										}
									}
								}
								else
								{
									Object[] loa_messageArgs;
									loa_messageArgs     = new String[1];

									loa_messageArgs[0] = lddp_iterador.getIdCirculo() + " - "
										+ lddp_iterador.getNombreCirculo();

									throw new B2BException(ErrorKeys.MATRICULAS_FORMATO_CIRCULO, loa_messageArgs);
								}

								if(
								    (lsm_matricula != null)
									    && CollectionUtils.isValidCollection(lcsma_datosBandejaActos)
								)
									lcsm_datosBandejaPredios.add(lsm_matricula);
							}

							ldpr_datosPredio.setDatosBandejaPredios(lcsm_datosBandejaPredios);
						}

						if(ll_cantidadTotal > 0)
						{
							long ll_cantidadActos;
							ll_cantidadActos = 0;

							if(ls_solicitud != null)
							{
								String ls_idSolicitud;

								ls_idSolicitud = ls_solicitud.getIdSolicitud();

								if(StringUtils.isValidString(ls_idSolicitud))
								{
									Collection<com.bachue.snr.prosnr01.model.registro.Acto> lc_actos;

									lc_actos = irr_registroRemote.findActosBySolicitud(ls_idSolicitud);

									if(CollectionUtils.isValidCollection(lc_actos))
									{
										for(com.bachue.snr.prosnr01.model.registro.Acto la_acto : lc_actos)
										{
											String ls_idActo;

											ls_idActo = la_acto.getCodigo();

											if(StringUtils.isValidString(ls_idActo))
											{
												if(ls_idActo.equalsIgnoreCase("99") || ls_idActo.equalsIgnoreCase("19"))
													ll_cantidadActos = NumericUtils.getLong(la_acto.getCantidadActos());
											}
										}
									}
								}

								if(ll_cantidadActos != ll_cantidadTotal)
									throw new B2BException(ErrorKeys.CANTIDAD_MATRICULAS_APERTURAR);
							}
						}

						ldpr_datosPredio.setMatriculaSegregacion(lsm_matriculaSegregacion);

						boolean lb_validacionRegistroParcial;
						lb_validacionRegistroParcial = false;

						if(ls_solicitud != null)
						{
							String ls_idSubproceso;
							ls_idSubproceso = ls_solicitud.getIdSubproceso();

							if(StringUtils.isValidString(ls_idSubproceso) && ls_idSubproceso.equalsIgnoreCase("7"))
								lb_validacionRegistroParcial = true;
						}

						if(!lb_validacionRegistroParcial)
						{
							Set<String> lss_mapKeys = lmsb_actosVerificacion.keySet();

							for(String ls_idActo : lss_mapKeys)
							{
								Acto    la_acto;
								boolean lb_value;

								la_acto      = new Acto();
								lb_value     = BooleanUtils.getBooleanValue(lmsb_actosVerificacion.get(ls_idActo));

								la_acto.setIdActo(ls_idActo);

								la_acto = irr_registroRemote.findActoBy(la_acto);

								if(ls_idActo != null)
								{
									String ls_idCirculoActo;

									ls_idCirculoActo = la_acto.getIdCirculo();

									if(
									    StringUtils.isValidString(ls_idCirculoActo)
										    && ls_idCirculoActo.equalsIgnoreCase(lddp_iterador.getIdCirculo())
									)
									{
										if(!lb_value)
											throw new B2BException(ErrorKeys.DEBE_ASOCIAR_MATRICULA_ACTO);
									}
								}
							}
						}

						Collection<MatriculaSegregacionUi> lcmsui_matriculas;

						lcmsui_matriculas = lddp_iterador.getDataInfoPredial();

						if(CollectionUtils.isValidCollection(lcmsui_matriculas))
						{
							for(MatriculaSegregacionUi lmsui_msui : lcmsui_matriculas)
							{
								if(!lmsui_msui.isOmitirMatricula())
								{
									lms_ms = new MatriculaSegregacion();

									lms_ms.setUnidad(lmsui_msui.getUnidad());
									lms_ms.setNombrePredio(lmsui_msui.getNombrePredio());
									lms_ms.setDireccion(lmsui_msui.getDireccion());
									lms_ms.setCertificadoAsociado(lmsui_msui.isCertificadoAsociado());
									lms_ms.setCantidadCertificados(lmsui_msui.getCantidadCertificados());
									lms_ms.setAreaTerreno(lmsui_msui.getAreaTerreno());
									lms_ms.setAreaPrivada(lmsui_msui.getAreaPrivada());
									lms_ms.setAreaConstruida(lmsui_msui.getAreaConstruida());
									lms_ms.setCoeficiente(lmsui_msui.getCoeficiente());
									lms_ms.setIdSolicitud(lmsui_msui.getIdSolicitud());
									lms_ms.setIdCirculoMatriz(lmsui_msui.getIdCirculoMatriz());
									lms_ms.setMatriculaMatriz(lmsui_msui.getMatriculaMatriz());

									lcms_ms.add(lms_ms);
								}
							}

							ldpr_datosPredio.setMatriculasSegregacion(lcms_ms);
						}
					}

					if(
					    ls_tipoRequiereMatricula.equals(TipoRequiereMatriculaCommon.DATOS_ANTIGUO_SISTEMA)
						    || ls_tipoRequiereMatricula.equals(
						        TipoRequiereMatriculaCommon.DATOS_CON_MATRICULA_Y_SIN_MATRICULA
						    )
					)
					{
						if(!lddp_iterador.isDatosAntSistemaGuardados())
						{
							Object[] loa_messageArgs;
							loa_messageArgs     = new String[1];

							loa_messageArgs[0] = lddp_iterador.getIdCirculo() + " - "
								+ lddp_iterador.getNombreCirculo();

							throw new B2BException(ErrorKeys.ERROR_SIN_DATOS_ANT_SISTEMA, loa_messageArgs);
						}

						Collection<DatosAntSistema> lcdas_datos;

						lcdas_datos = lddp_iterador.getDatosAntSisAgregados();

						if(lcdas_datos == null)
							throw new B2BException(ErrorKeys.ERROR_INTERNO_SISTEMA);

						for(DatosAntSistema ldas_iterador : lcdas_datos)
						{
							if(ldas_iterador != null)
							{
								Collection<DetalleAntSistema> lcdas_detalles;

								lcdas_detalles = irr_registroRemote.findDetallesAntSistema(
									    ldas_iterador.getIdDatosAntSistema(), getUserId(), getLocalIpAddress(),
									    getRemoteIpAddress()
									);

								String ls_antiguoSistema;
								ls_antiguoSistema = StringUtils.getStringNotNull(ldas_iterador.getAdquisicionPredio());

								if(
								    !CollectionUtils.isValidCollection(lcdas_detalles)
									    && ls_antiguoSistema.equals(IdentificadoresCommon.ADQUISICION_ANT_SISTEMA)
								)
								{
									Object[] loa_messageArgs;

									loa_messageArgs     = new String[2];

									loa_messageArgs[0]     = ldas_iterador.getNombrePredio();
									loa_messageArgs[1]     = lddp_iterador.getIdCirculo() + " - "
										+ lddp_iterador.getNombreCirculo();

									throw new B2BException(ErrorKeys.ERROR_SIN_DETALLES_ANT_SISTEMA, loa_messageArgs);
								}

								MatriculaSegregacion lms_tmp;
								lms_tmp = lddp_iterador.getMatriculaSegregacion();

								if(lms_tmp != null)
								{
									FacesContext lfc_context;
									String       ls_areaTerreno;

									ls_areaTerreno     = lms_tmp.getAreaTerrenoLectura();
									lfc_context        = FacesContext.getCurrentInstance();

									validateStyles(
									    "fRegistro:idRepeatActosMatriculas:0:idTVDatosPredio:idITareaTerrenoSegregacionBaldio",
									    lfc_context, ls_areaTerreno, true
									);
								}
							}
						}

						ldpr_datosPredio.setDatosAntSistemaAgregados(lddp_iterador.getDatosAntSisAgregados());
					}

					boolean lb_esTipoActoBaldio;
					lb_esTipoActoBaldio = isEsTipoActoBaldio();

					if(lb_esTipoActoBaldio)
						ldpr_datosPredio.setEsTipoActoBaldio(lb_esTipoActoBaldio);

					lcdpr_predioRegistro.add(ldpr_datosPredio);
				}
			}

			irr_registroRemote.salvarPrediosConTramite(
			    lcdpr_predioRegistro,
			    isSiActosSeleccionadosConGravamen() ? true : (isRenderedProhibiciones() ? true : false), getGravamenes(),
			    getProhibicionesVPM(), getUserId(), getSolicitud(), getDataActosParciales(), getLocalIpAddress(),
			    getRemoteIpAddress()
			);
		}
		catch(B2BException lb2be_e)
		{
			clh_LOGGER.error("savePropertyActs", lb2be_e);
			throw lb2be_e;
		}
	}

	/**
	 * Turno anterior relacionado.
	 *
	 * @throws B2BException Señala que se ha producido una excepción
	 */
	private void turnoAnteriorRelacionado()
	    throws B2BException
	{
		Collection<Turno> lct_turnoRecurrencia;
		Solicitud         ls_solicitud;

		lct_turnoRecurrencia     = getTurnoRecurrencia();
		ls_solicitud             = getSolicitud();

		if(CollectionUtils.isValidCollection(lct_turnoRecurrencia))
		{
			if(ls_solicitud != null)
			{
				int    li_count;
				String ls_idTurnoAnt;

				li_count          = 0;
				ls_idTurnoAnt     = ls_solicitud.getIdTurnoAnt();

				for(Turno lt_turnoRecurrencia : lct_turnoRecurrencia)
				{
					if(lt_turnoRecurrencia != null)
					{
						if(lt_turnoRecurrencia.isTurnoSeleccionado())
						{
							String ls_idTurno;

							ls_idTurno = lt_turnoRecurrencia.getIdTurno();

							if(!StringUtils.isValidString(ls_idTurno))
							{
								String ls_turnoMigrado;

								ls_turnoMigrado = lt_turnoRecurrencia.getMigrado();

								if(
								    StringUtils.isValidString(ls_turnoMigrado)
									    && ls_turnoMigrado.equalsIgnoreCase(EstadoCommon.S)
								)
									ls_idTurno = lt_turnoRecurrencia.getIdTurnoAnt();
							}

							if(StringUtils.isValidString(ls_idTurno))
							{
								ls_solicitud.setIdTurnoAnt(ls_idTurno);
								li_count++;
							}
						}
					}
				}

				if(li_count != 1)
				{
					ls_solicitud.setIdTurnoAnt(ls_idTurnoAnt);
					setSolicitud(ls_solicitud);
					throw new B2BException(ErrorKeys.ERROR_TURNO_ANT_SELECCION);
				}

				setSolicitud(ls_solicitud);
			}
		}
	}

	/**
	 * Valida datos documento.
	 *
	 * @param addp_datosPredio correspondiente al valor del tipo de objeto DatosDelPredio
	 * @return verdadero, si se cumple la condicion, de lo contario retorna falso
	 * @throws B2BException Señala que se ha producido una excepción
	 */
	private boolean validaDatosDocumento(DatosDelPredio addp_datosPredio)
	    throws B2BException
	{
		boolean      lb_return;
		boolean      lb_antSis;
		Documento    ld_documento;
		Documento    ld_docAntSis;
		FacesContext lfc_context;

		lb_return        = true;
		lb_antSis        = false;
		ld_docAntSis     = null;
		lfc_context      = FacesContext.getCurrentInstance();

		if(addp_datosPredio != null)
		{
			ld_docAntSis = addp_datosPredio.getBgnDocumento();

			if(ld_docAntSis != null)
				lb_antSis = true;
		}

		ld_documento = lb_antSis ? ld_docAntSis : getBgnDocumento();

		if(ld_documento != null)
		{
			if(ld_documento.getIdTipoDocumento() == null)
				throw new B2BException(ErrorKeys.DEBE_SELECCIONAR_TIPO);

			if(!StringUtils.isValidString(ld_documento.getNumero()))
				throw new B2BException(ErrorKeys.DOCUMENTO_INVALIDO);

			if(ld_documento.getFechaDocumento() == null)
			{
				Object[] loa_messageArgs = new String[1];
				loa_messageArgs[0] = " Documento ";
				throw new B2BException(ErrorKeys.ERROR_CAMPO_FECHA_OBLIGATORIO, loa_messageArgs);
			}

			if(ld_documento.getFechaDocumento().after(new Date()))
			{
				Object[] loa_messageArgs = new String[1];
				loa_messageArgs[0] = " del documento ";
				throw new B2BException(ErrorKeys.FECHA_SUPERIOR_ACTUAL, loa_messageArgs);
			}

			if(lb_antSis ? addp_datosPredio.isEsActoConEjecutoria() : isEsActoConEjecutoria())
			{
				boolean lb_fechaEjecutoria;
				lb_fechaEjecutoria = (ld_documento.getFechaEjecutoria() == null) ? true : false;

				if(!lb_fechaEjecutoria)
				{
					if(ld_documento.getFechaDocumento().after(ld_documento.getFechaEjecutoria()))
					{
						if(!lb_antSis)
						{
							boolean lb_focus;
							Date    ls_fechaValidar;

							lb_focus            = true;
							ls_fechaValidar     = null;
							lb_focus            = validateStyles(
								    ":fRegistro:idCalFechaEjecutoria", lfc_context, ls_fechaValidar, lb_focus
								);
						}

						Object[] loa_messageArgs = new String[1];
						loa_messageArgs[0] = " de documento ";
						throw new B2BException(ErrorKeys.FECHA_SUPERIOR_EJECUTORIA, loa_messageArgs);
					}

					if(ld_documento.getFechaEjecutoria().after(new Date()))
					{
						Object[] loa_messageArgs = new String[1];
						loa_messageArgs[0] = " de audiencia/ejecutoria ";
						throw new B2BException(ErrorKeys.FECHA_SUPERIOR_ACTUAL, loa_messageArgs);
					}

					if(!lb_antSis)
						setFechaEjecutoria(ld_documento.getFechaEjecutoria());
				}
			}

			if(
			    lb_antSis ? (!StringUtils.isValidString(ld_documento.getIdTipoOficina()))
				              : (!StringUtils.isValidString(getIdTipoOficina()))
			)
			{
				Object[] loa_messageArgs = new String[1];
				loa_messageArgs[0] = " el tipo oficina ";
				throw new B2BException(ErrorKeys.ERROR_SIN_SELECCION_COMBOS, loa_messageArgs);
			}

			if(
			    lb_antSis ? (!StringUtils.isValidString(ld_documento.getIdPais()))
				              : (!StringUtils.isValidString(getIdPais()))
			)
				throw new B2BException(ErrorKeys.DEBE_SELECCIONAR_PAIS);

			if(
			    lb_antSis ? (!StringUtils.isValidString(ld_documento.getIdDepartamento()))
				              : (!StringUtils.isValidString(getIdDepartamento()))
			)
			{
				Object[] loa_messageArgs = new String[1];
				loa_messageArgs[0] = " un Departamento ";
				throw new B2BException(ErrorKeys.ERROR_SIN_SELECCION_COMBOS, loa_messageArgs);
			}

			if(
			    lb_antSis ? (!StringUtils.isValidString(ld_documento.getIdMunicipio()))
				              : (!StringUtils.isValidString(getIdMunicipio()))
			)
			{
				Object[] loa_messageArgs = new String[1];
				loa_messageArgs[0] = " un municipio ";
				throw new B2BException(ErrorKeys.ERROR_SIN_SELECCION_COMBOS, loa_messageArgs);
			}

			if(
			    lb_antSis ? (!StringUtils.isValidString(ld_documento.getIdOficinaOrigen()))
				              : (!StringUtils.isValidString(getIdOficinaOrigen()))
			)
			{
				Object[] loa_messageArgs = new String[1];
				loa_messageArgs[0] = " la oficina origen ";
				throw new B2BException(ErrorKeys.ERROR_SIN_SELECCION_COMBOS, loa_messageArgs);
			}
		}

		return lb_return;
	}

	/**
	 * Valida tramite.
	 *
	 * @return verdadero, si se cumple la condicion, de lo contario retorna falso
	 * @throws B2BException Señala que se ha producido una excepción
	 */
	private boolean validaTramite()
	    throws B2BException
	{
		boolean  lb_result;
		Object[] aoa_messageArgs;

		lb_result              = true;
		aoa_messageArgs        = new String[1];
		aoa_messageArgs[0]     = " de radicado ";

		if(
		    StringUtils.isValidString(getSolicitud().getIdTipoRecepcion())
			    && getSolicitud().getIdTipoRecepcion().equals("6")
		)
		{
			if(!StringUtils.isValidString(getSolicitud().getRadicadoPQRS()))
				throw new B2BException(ErrorKeys.DEBE_DIGITAR_RADICADO_PQRS);

			if(StringUtils.isValidString(getSolicitud().getRadicadoPQRS()))
			{
				double ld_radicado;
				ld_radicado = NumericUtils.getDouble(getSolicitud().getRadicadoPQRS());

				if(ld_radicado == 0)
					throw new B2BException(ErrorKeys.DEBE_DIGITAR_NUMERO_PQRS);
				else if(ld_radicado < 0)
					throw new B2BException(ErrorKeys.ERROR_PQRS);
			}

			if(getSolicitud().getFechaRadicadoPQRS() == null)
				throw new B2BException(ErrorKeys.NO_SE_ENCONTRO_FECHA_RADICADO);

			if(getSolicitud().getFechaRadicadoPQRS().after(new Date()))
				throw new B2BException(ErrorKeys.FECHA_SUPERIOR_ACTUAL, aoa_messageArgs);

			if(!StringUtils.isValidString(getSolicitud().getIdSubproceso()))
			{
				aoa_messageArgs[0] = " el Tipo Tramite ";
				throw new B2BException(ErrorKeys.ERROR_SIN_SELECCION_COMBOS, aoa_messageArgs);
			}
		}

		return lb_result;
	}

	/**
	 * Validaciones antiguo sistema.
	 *
	 * @throws B2BException Señala que se ha producido una excepción
	 */
	private void validacionesAntiguoSistema()
	    throws B2BException
	{
		Collection<DatosDelPredio> lcddp_datosPredio;
		lcddp_datosPredio = getDatosDelPredio();

		if(CollectionUtils.isValidCollection(lcddp_datosPredio))
		{
			for(DatosDelPredio lddp_data : lcddp_datosPredio)
			{
				if(lddp_data != null)
				{
					ZonaRegistral lzr_zonaRegistral;

					lzr_zonaRegistral = irr_registroRemote.findCirculoRegistralActoAntiguoSistema(getSolicitud());

					if((lzr_zonaRegistral != null) && (lcddp_datosPredio != null))
					{
						DatosAntSistema ldas_datosAntSistema;

						ldas_datosAntSistema = lddp_data.getDatosAntiguoSistema();

						if(ldas_datosAntSistema != null)
						{
							ldas_datosAntSistema.setIdCirculo(lzr_zonaRegistral.getIdCirculo());
							ldas_datosAntSistema.setIdDepartamento(lzr_zonaRegistral.getIdDepartamento());

							lddp_data.setDatosAntiguoSistema(ldas_datosAntSistema);
						}
					}
				}
			}

			setDatosDelPredio(lcddp_datosPredio);
		}
	}

	/**
	 * Validar acto nueva entrada.
	 *
	 * @param as_codigoActo correspondiente al valor del tipo de objeto String
	 * @throws B2BException Señala que se ha producido una excepción
	 */
	private void validarActoNuevaEntrada(String as_codigoActo)
	    throws B2BException
	{
		if(!isHabilitarTurnoYnir())
		{
			try
			{
				if(StringUtils.isValidString(as_codigoActo))
				{
					boolean   lb_accion;
					Solicitud ls_solicitud;

					lb_accion        = false;
					ls_solicitud     = getSolicitud();

					if(ls_solicitud != null)
					{
						String ls_idSolicitudActual;

						ls_idSolicitudActual = ls_solicitud.getIdSolicitud();

						if(StringUtils.isValidString(ls_idSolicitudActual))
						{
							Collection<com.bachue.snr.prosnr01.model.registro.Acto> lca_actos;

							lca_actos = irr_registroRemote.findActosBySolicitud(ls_idSolicitudActual);

							if(CollectionUtils.isValidCollection(lca_actos))
							{
								for(com.bachue.snr.prosnr01.model.registro.Acto la_acto : lca_actos)
								{
									if(la_acto != null)
									{
										String ls_codigoActo;

										ls_codigoActo = la_acto.getCodigo();

										if(
										    StringUtils.isValidString(as_codigoActo)
											    && ls_codigoActo.equalsIgnoreCase(as_codigoActo)
										)
											lb_accion = true;
									}
								}
							}
						}
					}

					if(lb_accion)
					{
						Object[] aoa_messageArgs;
						aoa_messageArgs     = new String[1];

						aoa_messageArgs[0] = as_codigoActo;

						throw new B2BException(ErrorKeys.ERROR_ACTO_INGRESADO_YA_EXISTE, aoa_messageArgs);
					}
				}
			}
			catch(B2BException lb2be_e)
			{
				throw lb2be_e;
			}
		}
	}

