	/**
	 * Validar campos datos ant sistema.
	 *
	 * @param addp_datosPredio correspondiente al valor del tipo de objeto DatosDelPredio
	 * @param acddp_datos correspondiente al valor del tipo de objeto Collection<DatosDelPredio>
	 * @param apf_primefaces correspondiente al valor del tipo de objeto PrimeFaces
	 * @throws B2BException Señala que se ha producido una excepción
	 */
	private void validarCamposDatosAntSistema(
	    DatosDelPredio addp_datosPredio, Collection<DatosDelPredio> acddp_datos, PrimeFaces apf_primefaces
	)
	    throws B2BException
	{
		try
		{
			if((addp_datosPredio == null))
				throw new B2BException(ErrorKeys.ERROR_INTERNO_SISTEMA);

			FacesContext    lfc_context;
			boolean         lb_focus;
			int             li_posicion;
			String          ls_idCirculo;
			String          ls_tipoAntSis;
			DatosAntSistema ldas_datosAnt;
			String          ls_datoValidar;
			String          ls_idTipoPredio;
			String          ls_idNombrePredio;
			String          ls_idMunicipio;
			String          ls_idCampoTipoPredio;
			String          ls_idCampoNombrePredio;
			String          ls_idCampoMunicipioPredio;

			lfc_context                   = FacesContext.getCurrentInstance();
			lb_focus                      = true;
			li_posicion                   = 0;
			ls_idCirculo                  = StringUtils.getStringNotNull(addp_datosPredio.getIdCirculo());
			ls_tipoAntSis                 = StringUtils.getStringNotNull(addp_datosPredio.getAntiguoSistema1932());
			ldas_datosAnt                 = addp_datosPredio.getDatosAntiguoSistema();
			ls_datoValidar                = null;
			ls_idCampoTipoPredio          = "idSOMTipoPredioAntSistema";
			ls_idCampoNombrePredio        = "idItNomAntSistema";
			ls_idCampoMunicipioPredio     = "idSOMMunAntSistema";

			if(ldas_datosAnt == null)
				throw new B2BException(ErrorKeys.ERROR_INTERNO_SISTEMA);

			if(CollectionUtils.isValidCollection(acddp_datos))
			{
				for(DatosDelPredio lddp_data : acddp_datos)
				{
					if(lddp_data != null)
					{
						String ls_idCirTemp;
						ls_idCirTemp = StringUtils.getStringNotNull(lddp_data.getIdCirculo());

						if(ls_idCirculo.equals(ls_idCirTemp))
							break;
					}

					li_posicion++;
				}
			}

			ls_idTipoPredio       = is_repeatDatosPredio + li_posicion + is_complementoRepeat + ls_idCampoTipoPredio;
			ls_idNombrePredio     = is_repeatDatosPredio + li_posicion + is_complementoRepeat + ls_idCampoNombrePredio;
			ls_idMunicipio        = is_repeatDatosPredio + li_posicion + is_complementoRepeat
				+ ls_idCampoMunicipioPredio;

			ls_datoValidar     = ldas_datosAnt.getIdTipoPredio();

			lb_focus = validateStylesRepeatTab(
				    is_repeatDatosPredio, ls_idCampoTipoPredio, lfc_context, is_idTabViewDatosPredio, ls_datoValidar,
				    lb_focus
				);

			if(ls_tipoAntSis.equals(EstadoCommon.O))
			{
				ls_datoValidar     = ldas_datosAnt.getNombrePredio();

				lb_focus = validateStylesRepeatTab(
					    is_repeatDatosPredio, ls_idCampoNombrePredio, lfc_context, is_idTabViewDatosPredio,
					    ls_datoValidar, lb_focus
					);
			}
			else
				lb_focus = validateStylesRepeatTab(
					    is_repeatDatosPredio, ls_idCampoNombrePredio, lfc_context, is_idTabViewDatosPredio,
					    IdentificadoresCommon.NOMBRE, lb_focus
					);

			ls_datoValidar     = ldas_datosAnt.getIdMunicipio();

			lb_focus = validateStylesRepeatTab(
				    is_repeatDatosPredio, ls_idCampoMunicipioPredio, lfc_context, is_idTabViewDatosPredio,
				    ls_datoValidar, lb_focus
				);

			apf_primefaces.ajax().update(ls_idTipoPredio);
			apf_primefaces.ajax().update(ls_idNombrePredio);
			apf_primefaces.ajax().update(ls_idMunicipio);
		}
		catch(B2BException lb2be_e)
		{
			clh_LOGGER.error("validarCamposDatosAntSistema", lb2be_e);
			addMessage(lb2be_e);
			throw lb2be_e;
		}
	}

