			lfc_context                 = FacesContext.getCurrentInstance();
			lb_focus                    = true;
			li_posicion                 = 0;
			ls_idCirculo                = StringUtils.getStringNotNull(addp_datosPredio.getIdCirculo());
			ld_documento                = addp_datosPredio.getBgnDocumento();
			ls_datoValidar              = null;
			ls_idCampoIdTipoDoc         = "idSOMEscrituraAntSis";
			ls_idCampoNumeroDoc         = "idItDocuActoAntSis";
			ls_idCampoFechaDoc          = "idCalFechaDocAntSis";
			ls_idCampoIdTipoOficina     = "idSOMTipoOficinaAntSis";
			ls_idCampoPais              = "idPaisDocumentoAntSis";
			ls_idCampoDepartamento      = "idSOMDepartamentoAntSis";
			ls_idCampoMunicipio         = "idSOMMunicipioAntSis";
